INSERT INTO `post_jobs` (`id`, `job_id`, `created_by`, `job_for`, `job_descripton`, `country_id`, `job_requirements`, `num_of_candidates`, `phone`, `prefered_gender`, `max_salary`, `currency_id`, `min_salary`, `visa_statues`, `living_arrangments`, `educational_level`, `religion`, `experience`, `martial_status`, `request_status`, `nationality`, `seen`, `availability`, `industry_id`, `link`, `created_at`, `updated_at`) VALUES
(8500, 329, 583, 'maidcv.com', '\r\n                            I am looking for Urdu or Hindi Speaking Muslim live-in housemaid. Lady should be between 20 to 40 years old. Must know basic English. Must be energetic and fast.\r\nSalary 1500 dhs per month.\r\nVisa and insurance provided. Please call or send whatsapp with photo and passport copy to 00971507021452.\r\n                        ', 602, NULL, NULL, NULL, NULL, '1.800', 6, '1.5000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:20', '2018-07-03 04:56:20'),
(8501, 330, 584, 'maidcv.com', '\r\n                            Proffered Indonesian/Srilankan/Filipino lady for an American family based in Dubai- Please whatsapp me on +966 5387 82659\r\n                        ', 603, NULL, NULL, NULL, NULL, '1.800', 6, '1.5000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:21', '2018-07-03 04:56:21'),
(8502, 331, 585, 'maidcv.com', '\r\n                            Looking for a Filipina Lady ONLY!!  located currently in DUBAI, Age 25 to 35. READY TO MOVE IN AND START IMMEDIATELY. Must Have experience with Children and house chores.  MUST SPEAK & UNDERSTAND VERY GOOD ENGLISH!! We provide a private bedroom with bathroom inside and kitchen access, with all the daily needs and food,  a weekly day off and In addition to the salary, we provide a yearly 1 month paid vacation with free airline Ticket to home country. We will also provide the Visa and health Insurance. Must be active, loving person, Smily, clean and trustworthy. \r\nIf interested please contact me now on 0501590940 (call or WhatsApp)\r\n                        ', 604, NULL, NULL, NULL, NULL, '2.100', 6, '1.9000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:21', '2018-07-03 04:56:21'),
(8503, 332, 586, 'maidcv.com', '\r\n                            Seeking a professional and caring individual who can communicate effectively, is detail oriented, is punctual, and supportive in her role as a nanny and maid. Needs to be willing and enthusiastic about travel to the USA and Europe, when we visit family.\r\nPlease contact me on my WhatsApp. provide name, age, background experience.\r\n                        ', 595, NULL, NULL, NULL, NULL, '2.100', 6, '1.9000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:21', '2018-07-03 04:56:21'),
(8505, 334, 588, 'maidcv.com', '\r\n                            hello\r\nwe are a lebanese canadian family with 2 kids ( 1 and 5) looking for LIVE IN housemaid /nanny to do all the housechores. we live in a 2 bedroom apt with maids room.  Job duties is to do all the house chores and care for kids.\r\nsAlary 2300-2500 + visa+ insurance + food + toileteries. day off friday ( till 8pm)\r\n\r\nnationality : SRILANKa, INDONESIA, PHILIppines\r\n\r\ncall or whatsapp on 050316 5826.  Serious candidates that fit the criteria only please!\r\n                        ', 606, NULL, NULL, NULL, NULL, '2.400', 6, '2.2000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:21', '2018-07-03 04:56:21'),
(8506, 335, 589, 'maidcv.com', '\r\n                            Urgent requirement for LIVE IN Filipinas (ONLY FILIPINAS WILL BE CONSIDERED): one  caregiver and one housemaid.\r\n\r\nCandidates should be honest, hardworking, compassionate, adaptable, and fast learners.\r\n\r\nKnowledge of cleaning, cooking & laundry required.\r\n\r\nYou will be working for a small friendly family with no children.\r\n\r\nMust be able to join immediately. You will have one day off per week. Visa will be provided.\r\n\r\nPlease whatsapp on 050-5580245 or call 056-5022825\r\n                        ', 595, NULL, NULL, NULL, NULL, '2.100', 6, '1.9000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:21', '2018-07-03 04:56:21'),
