(8509, 337, 592, 'maidcv.com', '\r\n                            We are looking for a House Maid that can\r\n- Do laundry\r\n- Knowledge with cleaning materials.\r\n- Mopping, vacuuming and steaming rooms.\r\n- Not afraid of Pets ( Cats, Dogs, Parrots).\r\n- Tidy beds professionally.\r\n- Always aware of her surroundings.\r\n\r\nWe are only 3 ladies at home but have small dogs, a cat and a parrot.\r\n\r\nWe like to live in a clean environment at all times. \r\nWe are looking for a maid who is kind and honest. Someone that will care for our home like their own. We also want someone who is able to cook meals even if its light meals like salads, sandwiches ,etc and willing to learn how to cook.\r\nWe are looking for someone who can work fast, always smiles and if confused will not be shy to ask.\r\n\r\nWe dont give days off, but we do go on outings together. We can also arrange a 1 day off per month. \r\n\r\nWe want someone who will help us care for our pets from feeding to cleaning.\r\n\r\nWe will also help around at home and teach you what you need to learn about our lifestyle its quite simple.\r\n\r\nThank you,\r\nAfra Al Dhaheri\r\n                        ', 609, NULL, NULL, NULL, NULL, '1.400', 6, '1.0000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:21', '2018-07-03 04:56:21'),
