(8534, 361, 581, 'maidcv.com', '\r\n                            To whom it may concern, I am not looking for a maid here, am here for charity purpose.\r\n\r\nPlease however strange or surprising this contact may seem to you as we have not met personally or had any dealings in the past, I humbly ask that you take due consideration of it\'s importance and immense benefit, However, this is not mandatory nor will it in any manner compel you to honor against your will, I don\'t want you to feel sorry for me because I believe everyone will die someday, My name is Mrs. Lana Henriquez and I have been diagnosed with cancer & congested heart failure of which the doctors have confirmed that I don\'t have much time left after several tests carried out on me, I am about to undergo a surgery which I don’t stand a chance to survive it, I want God to be merciful to me and accept my soul so I have decided to give alms to charity organizations, as I want this to be one of the Last good deeds I do on earth, So far I have distributed money to some charity organizations here and nearby countries. Now that my health has deteriorated so badly I cannot do this myself anymore, I once asked members of my family to close my personal accounts and distribute the money which I have there to charity organizations in  some other places of their choice but they refused and kept the money to themselves, Hence I do not trust them anymore, as they seem not to be contended with what I have left for them, The last of my money which no one knows of it  a huge cash of ($3.500.000.00 USD) that my late husband deposited in a Finance Security Company in Ivory Coast before he died, I want to donate this money to someone who can use it and help me dispatch it to charity organizations and help the less privileges in his/her country, if only the person will be sincere to me then I will trust him/her and give the person more details on how to receive the money so Kindly contact me back with my private Email address below if you are interested to help me', 628, NULL, NULL, NULL, NULL, '5000.000', 6, '0.0000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:21', '2018-07-03 04:56:21'),
