(8573, 399, 650, 'maidcv.com', '\r\n                            We are a family of 5 looking for a live-in Filipino nanny/maid already located in Dubai. The family lives between Spain & Dubai and the older son (18 years old) is living full time in Dubai for his studies.\r\n\r\nWe are looking for somebody with proven experience in all types of household chores (cleaning, laundry, ironing, cooking), with a good level of english, who is able to work with minimum supervision and who is flexible, honest, reliable & perfectionist.\r\n\r\nWe live in a flat on the Palm and offer the following benefits:\r\n-salary AED3000/month\r\n-medical insurance\r\n-1.5 days off per week\r\n-one month leave with plane ticket\r\n-independent room with bathroom & wifi\r\nPlease contact us if interested with your details and CV\r\n                        ', 595, NULL, NULL, NULL, NULL, '3.000', 6, '2.8000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:21', '2018-07-03 04:56:21'),
(8574, 400, 651, 'maidcv.com', '\r\n                            - flexible with our schedule as cabin crew.\r\n-with our schedule will not required to work every single day. Will definitely have a lot of days off.\r\n- live out but have to sleep over when we both flying\r\n- No cooking required.\r\n- cleaning. Ironing. Organizing.\r\n- taking care of well being of 4 year old boy.(he goes to school) And 1 year 6 months baby girl.\r\n-to help cover us when we have errands to run or just need extra hands.\r\n\r\n\r\nLooking for \r\n-A trustworthy lady to join our family.\r\n-Well mannered and friendly\r\n-Understanding and can take instruction well.\r\n-Works well with children \r\n\r\n- PREFERABLY LIVE CLOSE BY TO MIRDIF OR RASHIDIYAH AREA.\r\n                        ', 608, NULL, NULL, NULL, NULL, '2.700', 6, '2.5000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:21', '2018-07-03 04:56:21'),
(8575, 401, 652, 'maidcv.com', '\r\n                            I am looking for a live-out or Live in candidate who has a UAE Driver\'s License with good experience of Dubai area. \r\n\r\nVisa, one yearly airline ticket to the home country with one month paid vacation and accommodation allowance will be provided.\r\n\r\nWe would consider as well couples application.\r\n\r\nContact me preferably via email natacha@fk-group.net,  as I travel a lot. or send a text message or whatsap.\r\n\r\nBest regards. \r\nMrs Natacha.\r\n                        ', 650, NULL, NULL, NULL, NULL, '3.000', 6, '2.8000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:21', '2018-07-03 04:56:21'),
(8577, 403, 654, 'maidcv.com', '\r\n                            hi, we are a Moroccan French Family with 3 kids (twins age 2,5 and 6th month old baby) and their loving nanny. Were are looking for a second filipino line in helper to join our family. Duties will mainly involve housekeeping with some childcare (preparing kids meal, bath, taking the kids to the parc and activities). As busy working parents we are looking for someone energetic, with a positive and can do attitude, able to work with very limited supervision. \r\ncompetitive salary depending on experience and fit, 1 day off per week (alternatively Friday and another day with the current nanny). We offer q respectful and caring environment.\r\nThe nanny must be IN DUBAI for interviews and provide at least 1 or 2 references .\r\nIf you first this criteria pls send me your contact, CV, visa status and references . Thank you\r\n                        ', 651, NULL, NULL, NULL, NULL, '2.700', 6, '2.5000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:21', '2018-07-03 04:56:21'),
(8578, 404, 655, 'maidcv.com', '\r\n                            We are a local couple looking for a housemaid that can take care of all housekeeping work starting immediately for a period of 1 or 2 months only .. we have 3 daughters  13,11 and 7 yrs old .. we live in a small villa ..\r\nYou will be required to work everyday until 8 - 9 pm   \r\nYour responsibilities will include:\r\n-general cleaning and ironing\r\n-Preparing meals for the family \r\n-preparing the kids cloths for school \r\n-waking the kids early morning at 4:45am for school ( if live in )\r\n-helping the younger girl with her hair and other needs\r\n-cleaning a small rabbits house \r\n(for live in only )You will sleep in a separate room and you will have your privacy, you will be well treated and you will have a full access to the kitchen and food..\r\n                        ', 652, NULL, NULL, NULL, NULL, '2.700', 6, '2.5000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:21', '2018-07-03 04:56:21'),
