(8580, 406, 658, 'maidcv.com', '\r\n                            We are a young Saudi family of 4, we live in Riyadh, Saudi in a four bedroom home and we have a lovely 4 year old girl and a handsome 1 year old boy.\r\n\r\nWe are looking for an experienced Filipino housekeeper who knows how to cook, can speak good english and is responsible, hardworker, friendly, and trustworthy. We prefere ex-Gcc\r\n\r\nWe already have a skilled filipino nanny with a sweet personality who helpes us with kids related matters, and one of the important things I\'m looking for is a kind, positive, polite and team-worker person who will be sharing the room with our nanny.\r\n\r\nExpected duties:\r\n- Cooking\r\n- House cleaning\r\n- Laundry\r\n- Grocery shopping.\r\n\r\nWe offer:\r\n- Salary is discussable depending on experiance and skills\r\n- Days off \r\n- medical insurance\r\n- Bonuses on holidays depending on preformance.\r\n\r\nContact on\r\nShamsibra@hotmail.com\r\n                        ', 655, NULL, NULL, NULL, NULL, '1.800', 6, '1.5000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:21', '2018-07-03 04:56:21'),
