(8711, 536, 801, 'maidcv.com', '\r\n                            I am due to start work in RAK on Sunday 30th October on Marjan Island.  My husband and 4 month old daughter will be coming out in November.  I am German, my husband is English.\r\n \r\nWe would be looking for a Nanny to start end of November/beginning of December.\r\n\r\nThe role is mainly to look after our 4 month daughter with the usual duties.  We will live on Marjan Island etc.\r\n \r\nSalary, accomdation etc negotiable.\r\n\r\nThanks\r\n \r\nDaniela\r\n\r\n**I have listed my UK number here but please whatsapp or email.  I will update with UAE number on Sunday 30/10/16\r\n                        ', 626, NULL, NULL, NULL, NULL, '2.100', 6, '1.9000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:22', '2018-07-03 04:56:22'),
(8712, 537, 803, 'maidcv.com', '\r\n                            We have moved from South Africa with 2 grown children no pets. We are Looking for a live-In Maid with +3 years housekeeping experience who can also cook western/Asian food. We would like her to be from the Philippines. We want her to be mature and friendly personality. To start 1st December 2016.\r\n                        ', 642, NULL, NULL, NULL, NULL, '2.700', 6, '2.5000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:22', '2018-07-03 04:56:22'),
(8713, 538, 804, 'maidcv.com', '\r\n                            We are a Canadian Egyptian family of 4, with 2 energetic boys, ages 3 and 4 looking for a new nanny/housemaid. Responsibilities  include looking after the boys (while they are not at school/nursery), house cleaning and some cooking. We provide a salary of 2200-2500 based on experience, 3 days off per month (2 Fridays + 1 Saturday), private room, food & toilettries provided. All candidates must love children! Please call me on 971502682412\r\n                        ', 722, NULL, NULL, NULL, NULL, '2.400', 6, '2.2000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:22', '2018-07-03 04:56:22'),
(8714, 539, 805, 'maidcv.com', '\r\n                            We are currently seeking for a friendly, hard work, with loyalty and sincerity and dynamic customer focused Housekeeping professionals who pride themselves on their ability to deliver extraordinary levels of customer service and provide creative solutions to our customers.\r\n\r\nCLEANERS(MALE & FEMALE)\r\n\r\n\r\nJOINING IMMEDITLY \r\n\r\nNOTE : \r\n\r\n• MUST HAVE EXPERIENCE OF MIN 1 YEAR \r\n• WILL BE HAVE TRIAL WORK FOR 1 OR 2 DAYS \r\n• WE PREFER FILIPINO/INDIAN PEOPLE \r\n• STYLISH & CLEAN BODY IN AND OUT SIDE \r\n• NO AFRICAN PEOPLES REQUIRED \r\n• WE OFFER FEMALE CLEANER SALARY from 1200 AED To 1500 AED\r\n• WE OFFER MALE SALARY from 900 AED To 1100 AED\r\n• WE PROVIDE ACCOMMODATION & TRANSPORTATION\r\n• WE PROVIDE SOME FOOD ALLOWANCE \r\n\r\n\r\n\r\n• ATTRACTIVE OFFERS \r\n\r\nBE NOW OUR PRIDE STUFF AND JOIN IMMEDIATELY\r\n                        ', 723, NULL, NULL, NULL, NULL, '1.800', 6, '1.5000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:22', '2018-07-03 04:56:22'),
