(8729, 554, 758, 'maidcv.com', '\r\n                            Hello! We are a Canadian family of 4. We have 2 kids- a daughter who is 4 and a son who is 8 months old. We have a wonderful nanny/maid but she is leaving us to go back home to Phillippines to get married. We need someone who can look after our children, clean and cook. Experience with an Arabic family is valued.  We offer a salary of 2000 AED, 3 days off per month (2 Fridays/ 1 Saturday), food and toiletries provided and a private room with bathroom. Get in touch with me on 052 906 2024.\r\n                        ', 732, NULL, NULL, NULL, NULL, '2.100', 6, '1.9000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 04:56:22', '2018-07-03 04:56:22'),
