(8866, 746, 447, 'Jobs in UAE', 'MAID JOBS IN DUBAI\nAt CleaningCompany.AE we are used to having monthly hiring for the cleaning jobs, candidates who are really experienced and qualified for this job. We always have housemaid jobs or nanny jobs available in Dubai as we are hiring at regular time intervals. Our customers are classified into commercial and residential sectors.\nWe do residential cleaning where we assign our maid to do the cleaning job. Our maids do\nwashing the dishes\nWashout the floor\nLaundry, Folding and Ironing the clothes\nCleaning the windows\n\nWe are looking for a friendly maid and nanny as our customer are high-level business and busy people located at Palm Jumeirah, Al Barsha, Dubai Marina etc., and they have lovely kids. So our housemaid will be assigned to clean for part-time and take care of the kids.\nIn some other locations, our cleaner would have commercial cleaning such as\n1.office cleaning where our cleaner has to be organized, on-time, understanding the client requirement. We will drop the cleaner to the location where sometimes they need to carry the cleaning materials according to customer requirements.\n2.Exhibition cleaning where our cleaner has to clean the stands at the exhibition, like dusting, cleaning the mirror, wiping the floor. We used to have monthly exhibition cleaning. The safety jackets and shoes are provided to the cleaner to make them safe during the work.\nWe are also looking expert cleaners who are experienced to do sofa, mattress and carpet cleaning. There is a special machine to clean the carpet and mattress by shampooing and we do this for both residential and commercial places. We need people who are well responding to the customer demands and take care of the material and the cleaner job is to maintain it in good condition.\nSo if you are looking for a cleaner job or maid vacancy you can apply. Some of the responsibilities or description of the housekeeping job are:\nHaving the knowledge to use cleaning chemicals and the storing and disposing of after ', 502, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=e95e8643583f0273&from=serp&vjs=3', '2018-07-03 04:56:24', '2018-07-03 04:56:24'),
