(8872, 785, 533, 'Jobs in UAE', 'Urgently requires a Restaurant cleaner with minimum 1 year experience in the same field. With minimum 1 year experience in the same field Main responsibility is to maintain the cleanliness of the entire store. Keep working environment clean and tidy at all times. Excellent organizational and time management skills Keep a constant eye on the table to gauge needs and fulfill them immediately Clear table and clean table tops Carry dishes and flatware to the kitchen Ensure that all tables replenished with eating dishes Ensure the cleanliness of all the kitchen utensils equipment machines.\n\n. Shami Gourmet is a traditional Arabic restaurant and the first Arabic fast food service in United Arab Emirates. Shami Gourmet opened its first branch at the beginning of 2015 which is in Dubai Marina one of the most touristic and exciting place of Dubai and ideally located next to Jumeirah Lakes Towers Internet City and Jumeirah Beach Residence and opened its second branch at the beginning of 2017 which is in Business Bay and the third will soon to open the Al Rigga branch in the second half of 2017. Shami Gourmet also have branch now in the oldest city in the world which is Damascus Syria.\n\nWe supply the food from our centralized kitchen in Alquoz Dubai which can serve more than 10 restaurants. All of our foods are made fresh with an open kitchen system. Our slogan is Fresh Fast Homemade', 546, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=65c77e6a8d3ae44e&from=serp&vjs=3', '2018-07-03 04:56:24', '2018-07-03 04:56:24'),
(8873, 750, 452, 'Jobs in Qatar', 'Join a team recognized for leadership, innovation and diversity\nDesign and initiate processes for the manufacturing of chemicals and related products. You will run experiments and tests to aid in the development of improved manufacturing procedures and processes. Use your chemical engineering experience to enhance Honeywell\'s products and services.\nResponsibilities\nManage the UOP service relationship within Qatar\nBuild strong relationships with each customer’s personnel across several levels of the organization\nBecome knowledgeable of each customers’refinery/plant configuration, processing goals and strategies\nDetermine how UOP products and services might be applied to meet customers\' processing goals\nSupport LBS business and meet service financial targets.\nOversee all customer service interactions with UOP and ensure necessary agreements are in place.\nVisit customers’ sites regularly for in-depth discussions and consultation on current operations, process performance, and any other issues relating to UOP technology transfer. Proactively engage customers to obtain and/or review operating data to enable value added technical support\nManage the troubleshooting efforts for the assigned customer base with the help of UOP’s Technical Service Department personnel as necessary to ensure that timely, accurate and effective support is provided to maintain overall customer satisfaction\nWe invite you to discover for yourself why a career with Honeywell is the opportunity you\'ve been looking for\nLead a team of some of the world\'s most talented engineers\nHelp create innovative technologies that make the world cleaner and more sustainable, more secure, connected, energy efficient, and productive\n25 Project Management\n25 Design & development\n25 Research\n25 Run experiments\nYOU MUST HAVEBachelors Degree in Chemical Engineering\nExtensive experience within a similar role within the Middle EastWE VALUEAbility to design experimen