(8882, 825, 1021, 'Jobs in USA', 'Job DescriptionATC is an FAA approved 145 Repair Station in need of those motivated persons that will serve as support to our technicians. You will be responsible for cleaning/degreasing various aircraft parts as well as removing paint and other coatings to facilitate our technicians in performing detailed inspections. Also, you will be asked to sand and prep various large structural aircraft components so that they can be repainted. Various equipment is supplied including all sanders, plastic bead blasters, oxide blasters, degreasing stations, and sanding booths. Hours of operation General shop are M- F 0700-1730. There are five employees in the department with staggered start and stop times working 8 hours a day Mon- Fri. You may be asked to work overtime in order to meet deadlines, so the applicant should keep that in mind.Responsibilities and DutiesKeeping up with a daily “run” of jobs for which you are responsibleMaintain good housekeeping and cleaning standards in the shopEnsure all maintenance documentation is complete and correctMust display exceptional attention to detail as well as solid organizational skillsAbility to work independently and unsupervised once you have received proper trainingQUALIFICATIONSHigh School diploma or equivalentAble to lift 30lbs unassisted. Assistance is available for heavier componentsPrior experience in a mechanical field or shop environment is a plusAble to read, write, and speak English*BenefitsWe offer an employer-matched 401K savings plan as well as a paid HMO health insurance plan for the employee only along with optional dental and vision plans. ATC is a drug-free employer, and you must be able to pass a pre-employment drug screen as well as random drug screens during your employment.Medical, dental and vision coverage, matching retirement 401k savings plans, supplemental life, short/long term disabilityJob Type: Full-timeSalary: $14.00 to $15.00 /hour', 843, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Air-Transport-Components/jobs/Part-Cleaner-Worker-e84a8c9117784dc8?vjs=3', '2018-07-03 10:04:17', '2018-07-03 10:04:17'),
(8883, 2, 984, 'Jobs in USA', 'Holden Farms strives to be the most progressive, innovative, and collaborative pork producer in the nation. At Holden Farms we pride ourselves on teamwork, personal growth, and opportunity. If you are seeking a challenging and rewarding career and enjoy working with animals check out Holden Farms today!Title: Truck DriverDescription: Truck Drivers report to Trucking Manager and are responsible for transporting pigs from various farm locations in SE MN and NE IA.Location: Waukon, IAHours: Monday-Friday 5:30am-3:00pm; times may vary based on business needs; opportunities for overtimeCompensation: Hourly, competitive based on experience, plus we offer an excellent benefits packageEssential Job Functions: Proper pre and post trip truck and trailer inspectionsSafely drive loaded and unloaded semi-truck/trailerProperly load and unload animals from livestock trailerWash out trailer dailyCommit to Holden Farms goal of achieving a zero injury cultureFollow Holden Farm’s Biosecurity ProtocolsDependable and able to work with minimal supervisionSelf-motivated team player with a positive attitudeStrong written and verbal communication skillsRequired Qualifications: Valid Class A CDL with good driving recordCurrent DOT medical cardPhysical Requirements: Candidate must be able stand and sit for prolonged periods of timeAbility to frequently bend, reach, squat and kneelAbility to lift up to 55lbsAbility to work in a variety of conditions (heat, cold, dust, etc.)Ability to bend over, scrap, and pressure wash to clean trailerBenefits: $3,000 Hiring Bonus!!Medical/Dental/Vision InsuranceLife Insurance401(k) + Company ContributionProfit SharingPTO (Paid Time Off)Paid HolidaysMuch More!No previous experience working with pigs required. Ready to start your career with Holden Farms? APPLY TODAY!Contact Jeny at 507-301-0679 or https://workforcenow.adp.com/mascsr/default/mdf/recruitment/recruitment.html?cid=6cecd5cd-e0bf-4c18-b90b-8a010b2c5606&jobId=192232&lang=en_US&source=CC2&ccId=1900010', 817, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Holden-Farms-Inc/jobs/Truck-Driver-40760125a60ce371?sjdu=QwrRXKrqZ3CNX5W-O9jEvV_1-3a1LOO3UUMrMHHi9RKkzbqeYZfzNX3YCspTR0ZrZi', '2018-07-03 13:42:02', '2018-07-03 13:42:02'),
(8884, 800, 986, 'Jobs in USA', 'Date: Apr 26, 2018\nLocation:Phoenix, AZ, US, 85034\nCompany: Envision\nRoutine Driver Personal Vehicle\nPersonal Vehicle\nJob Description\n$300 bonus!!! Hiring ASAP!!\nComTrans, Inc. is proud to be an affirmative action / equal opportunity employer. All qualified applicants will receive consideration without regard to race, creed, gender, marital status, sexual orientation, citizenship status, color, religion, national origin, age, disability, veteran status, or any other status protected under local, state or federal laws.\nVISION:\nThe Routine Driver contributes to the profitable growth of ComTrans by ensuring a high level of customer service, client safety, responsiveness, and timeliness.\nBASIC FUNCTION:\nThis position provides transportation service for clients of behavioral health services and centers, routine medical appointments from their home, hospital, facility or other location and safely transport to the destination. The driver is responsible for maintaining accurate and complete transport documentation. Hours of work may vary and are dependent upon organizational needs. This position requires the use of the employee’s personal vehicle and such vehicle must meet vehicle requirements as listed as well as pass initial and on-going safety inspections.\nComTrans is a safety sensitive company.\nJob description(s) are subject to change based on business necessity\nEMPLOYEE STATUS:\nRegular: Part Time; hourly / non-exempt position.\nCondition of employment is subject to personal vehicle passing initial and continued inspections.\nPeak Volume Drivers- 3 hour shifts\nMonday-Friday 7:00 am to 9:00 am or 2:00 pm to 5:00 pm +/- 30 minutes\nNo guarantee of shift\nRate $20.00 per hour\nREQUIREMENTS:\nDedicated to ComTrans for their 3 hour shift-may request early release or late start but time/pay will be adjusted and it must be approved\nWear company provided shirt\nEmployee Badge\nUse of Company phone (for provider application)\nClean, well maintained vehicle - must be approved prior to hir', 819, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=6248274f2d597393&from=serp&vjs=3', '2018-07-03 13:42:02', '2018-07-03 13:42:02');
