(8885, 700, 1025, 'Jobs in USA', 'Schedule: Tuesday Through Friday 10:30am - 7:30pm\nSaturday 8:00am - 4:00pm\nSome schedule rotation expected.\nFirst 3 weeks of training schedule will vary. Going through Route Optimization, hours might change slightly. Schedule flexibility required. Very demanding route, specimen handling experience preferred, good knowledge of the city and able to lift 40 pound boxes for shipping. Good driving record with good driving habits. Computer knowledge and team oriented individual.\nSummary:\nThe Route Service Representative (RSR) is the face of Quest Diagnostics to the public, our customers and acts as an Ambassador for the company in everything he/she does. Everyday Excellence is a critical component in fulfilling this position requirement. This position performs day to day route operations by serving client needs with regard to properly tracking, sorting, storing and transporting patient specimens and other materials including but not limited to supplies and patient results.\nBasic Purpose:\nThe RSR is assigned up to a maximum of two (2) routes which may include:, Routine Route, STAT Route, Weekend Routes or Shuttle/Relay Route; Safely operates company vehicle to pick up, properly store and deliver specimens and other materials; and provides service to internal and external customers in an organized, efficient, and professional manner.\nDuties and Responsibilities:\n1. Responsible for compliance with all processes including and not limited to: timekeeping, attendance and punctuality, vehicle safety and cleanliness, safety and OSHA requirements, handheld /scanning device and usage, proper handling and storage of all samples from the client office to the drop off point, proper packing of specimens for shipment, end of day vehicle checks, dress code, code of conduct and all Company / Regional / Logistics policies and procedures.\n2. Responsible for the safe and timely transportation of specimens, supplies, reports, equipment and materials to the appropriate destination.\n3. Responsi', 845, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=e8986aca7080ab37&from=serp&vjs=3', '2018-07-03 13:42:02', '2018-07-03 13:42:02'),
(8886, 703, 1026, 'Jobs in USA', 'Job DescriptionJob DescriptionPassionate about helping Senior Citizens get around in a safe and comfortable fashion? This may be for you! The most flexible and rewarding job you will ever find. Set your own schedule and work only when it\'s convenient for you. Make up to $18/hour driving your own car. Help seniors and patients in your community.We have an opening for several part-time Driver Companion positions.Location: Phoenix, Glendale, Mesa, Scottsdale, Goodyear, Suprise and the surrounding citiesSchedule: Set your own schedule and work only when it’s convenient for youRequirements: Care-giving experience2012 or newer vehicleHave or be willing to obtain First Aid/CPR certificationClean background and driving recordReliable, senior friendly vehicleValid driver’s license, vehicle registration and insuranceSummary: Envoy America, a companion and transportation company oriented to Senior Citizens, is in need of responsible driver companions in Phoenix and the surrounding areas who have a good record and are enthusiastic about providing needed services to our Seniors. Our clients need to shop, visit doctors, go to worship services, or stay socially active, and they need a safe, reliable, and affordable way to get there. Driver Companions accompany Seniors to go to their medical appointments, run errands, buy groceries and attend to other daily needs outside the home, just like a son or daughter would.https://envoyamerica.com/careers/Job Type: Part-timeSalary: $18.00 /hourExperience:caregiving: 1 yearLocation:Phoenix, AZLicense:CPR/First AidDriver\'s LicenseVehicle 2012 or newerRequired travel:50', 846, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Envoy-America/jobs/Driver-Companion-87b6653f4deb0289?vjs=3', '2018-07-03 13:42:02', '2018-07-03 13:42:02'),
