nHigh school diploma OR\nSix months to one year prio', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Na', '2018-07-03 13:42:02', '2018-07-03 13:42:02'),
(8889, 769, 368, 'Jobs in USA', 'Now hiring Driver - Shuttle Bus! Our senior living community, Maravilla Scottsdale located in Scottsdale is a great setting if you enjoy working with seniors.\nWe offer competitive pay, great benefits, bonus opportunities, and flexible schedules. You will work in our senior living community that sets\nthe standard for quality, hospitality, and professionalism.\nFor over 30 years, Senior Resource Group (SRG) has been an innovator in the development and operation of senior living communities across the USA. Learn more about our experience and passion at www.SRGseniorliving.com.Part-time position available: 3-4 days a week, may include Saturday & Sunday. Usual shift is 8:00 am - 5:00 pm. May change occasionally due to activities planned.\nDrive a bus, minibus, or van to transport residents to and from scheduled group activities and individual resident appointments. This is a perfect job for a semi-retired individual. Helping our seniors with everyday tasks and errands is sincerely appreciated by our residents.\nEssential Duties:\n\nDrive vehicle to designated locations.\nAssist passengers into and out of vehicle.\nSecure passengers\' wheelchairs, walkers and other equipment to restraining devices to stabilize equipment during trip.\nClean and service vehicle with fuel, lubricants, and accessories.\nQualifications:\nMust have current Commercial Drivers License (CDL)\nMust hold a valid and applicable state drivers’ license and have a clean driving record. Must submit current copy of Department of Motor Vehicles Driving Record Report.\nHigh School Diploma or General Education Degree (GED); or one to three months’ related experience and/or training.\nFirst aid and CPR certification.\nBenefits for Full-time employees include: Medical/Vision/Dental/Life Insurance plus a 401k program with generous company match!Maravilla Scottsdale\n7325 E. Princess Blvd., Scottsdale, AZ 85255 USASenior Resource Group - SRG is an equal opportunity employer.\nKeywords: Driver, Bus Driver, CDL, Commercial Driver,', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Holden-Farms-Inc/jobs/Truck-Driver-40760125a60ce371?sjdu=QwrRXKrqZ3CNX5W-O9jEvV_1-3a1LOO3UUMrMHHi9RKkzbqeYZfzNX3YCspTR0ZrZi', '2018-07-03 13:42:02', '2018-07-03 13:42:02'),
(8890, 827, 362, 'Jobs in USA', 'Medical & Other Transportation Drivers (Part-time & Full-time) - $200 Sign-on Bonus\nLocations: Phoenix, Arizona (Greater Phoenix Metropolitan Area) - Drive Valleywide. You get to choose!Do you want to make a difference in the lives of others?If so, join us in the fast-growing field of non-emergency medical transportation!\nYou may know us as Discount Cab - the Glendale-based company with the bright green and clean taxi cabs. But today, we are so much more! Along with our parent company Total Transit, we provide transportation for East and West Valley Dial-a-Ride and we facilitate transportation for the major medical providers of the valley. In short, we’re in the business of taking care of people.\nTo help us support those who rely on our transportation services, we’re looking for full-time and part-time caring drivers with excellent customer service skills and a passion for helping others.\n\n In return, we offer the freedom to create your own schedule, energy efficient high-quality vehicles, and training is only 2 days to get started.\nWe also offer a wide range of professional development classes to help you thrive. We will help you cultivate your career in non-emergency medical transportation through wheel chair training, Americans with Disabilities Act (ADA) training and much more.\nOur services are constantly in demand - meaning our customers count on us, and our drivers profit. In fact, we boast one of the the highest call center volume in Phoenix.\nRequirements:\nMust be 23 years or older & a legal U.S. residentMust have a valid driver\'s license for at least 39 monthsMust possess outstanding customer service skillsMust have a good driving recordMust pass a background test and drug test\nDrive Valleywide!\n\nApply Online or just walk in to: 4610 W. Camelback Rd., Glendale, AZ. Hours of walk-ins are 10am to 2pm. Phone: 602-266-8724. Email: recruitingteam@totalride.com', 461, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=4ee26d01d8695d7f&from=serp&vjs=3', '2018-07-03 13:42:02', '2018-07-03 13:42:02'),
