(8893, 220, 372, 'Jobs in Oman', 'At Air Products, we\'ve been helping our customers to become more productive, energy efficient and sustainable for more than 75 years. With approximately 16,000 employees and operations in 50 countries, we serve customers across a wide range of industries from food and beverage to medical, energy and transportation. We supply a unique portfolio of atmospheric and process gases, equipment and services.\nBased in Sohar, as a Delivery Van Driver you will be driving a Large Goods Vehicle delivering industrial gas cylinders to our customers. You will also maintain a profitable and satisfied customer base by working with the commercial team supporting their retention and new business activities.As a delivery Van Driver, you will: Manage the customer and vehicle activity safely Adhere to all Road Traffic Legislation in the operation of cylinder delivery vehicle including Speed Limits, Tachograph requirements, Vehicle Load Restrictions Adhere to operating Licence Requirements including Planned Maintenance, Safety Inspections, Defect Reporting System, Record Keeping and Loading of Vehicle Liaise directly with customer representatives to take orders, answer account queries, advise on product selection Coordinate cylinder stock holdings / replenishment to ensure a timely and efficient supply to customers and Manage Site Inventory Grow local business by signing new accounts Build on existing relationships as the “face of Air Products” Locally support understanding of and reporting all competitor activity Generate leads for local sales person to act upon through local knowledge, observations and intelligence gatheringAs a delivery Van Driver, you will have: Heavy duty driver licence Commercial Acumen Fork Lift Truck Licence Knowledge of local areas\nIn return, we offer a competitive salary & benefits package, a culture of respect, challenge and innovation – with excellent opportunities for growth and development.\nIf that sounds interesting, then come and discover, care and accompli', 464, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=d242a8391faad4f1&from=serp&vjs=3', '2018-07-03 13:42:02', '2018-07-03 13:42:02'),
