w.orbitstaffinginnovision.com/\nWe invite you to review t', 469, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=697f248292c1eee4&from=serp&vjs=3', '2018-07-03 13:42:02', '2018-07-03 13:42:02'),
(8895, 770, 498, 'Jobs in Oman', 'No two days are the same at Al-Futtaim, no matter what role you have. Our work is driven by the desire to make a difference and to have a meaningful impact with the goal of enriching everyday lives. Take our engaging and supportive work environment and couple it with a company culture that recognises and rewards quality performance, and what do you get? The chance to push the limits every single day.\nAs a humble family business that started on the banks of the Dubai Creek in the 1930s, Al-Futtaim has expanded to a presence in 31 countries, a portfolio of over 200 companies, and 42,000 employees. You’ll find us in industries ranging from automotive and retail, to finance and real estate, and connecting people with international names like Lexus, Ikea, Robinsons, and Adidas. Our team is proudly multicultural and multinational because that kind of diverse representation gives us the global mindset to grow and impact the people, markets, and trends around us.\nCome join us to live well, work better, and be the best.\nJOB PURPOSE:\nTo support the company in achieving the monthly and annual objectives through logistics support. This role is responsible in making sure that all required logistics assignments are done efficiently.\nKEY RESPONSIBILITIES: Specify the output required from the job. Identify not more than 7 Key Responsibilities & their performance indicators. NB-Focus on outcomes not tasks.\n1- To assist SA in coordinating the delivery of vehicles, moving the vehicles to and from showroom / Workshop and if required to customers place.\n2- Check if all incoming cars from Yard / Workshop are in good condition and to report the same to line manager if any damage is found.\n3-To assist in the registration of vehicles, including taking the vehicles for Passing. To carry out business related activities as instructed by line manager.\n4-To inspect and ensure all demo cars are maintained in good condition and ready for use at all times. To immediately bring to the notice of line', 520, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=487218b2def9013d&from=serp&vjs=3', '2018-07-03 13:42:02', '2018-07-03 13:42:02'),
(8896, 226, 970, 'Jobs in Oman', 'General\nEnsure that designated responsibilities are executed in accordance with applicable regulations and standards of Oman Air;\nShall comply with laws, regulations and procedures of the State of work location.\nBe familiar with the laws, regulations and procedures pertinent to the performance of the duties.\nResponsible to execute quality responsibilities in accordance with Quality Assurance Operations Manual\nResponsible to execute safety responsibilities in accordance with Safety Management Systems Manual.\n\nJob Related\n\nEnsure all passengers are handled in correct manner and provide personalized service to high yield passenger as well as for any special service required for economy class passengers\nIn coordination with ASDM implement action plan for delayed flight and accomplish all the necessary steps in accordance with the laid-down procedure and ensure maximum attention and care provided to all passengers.\nLiaise with Catering/Engineering in all areas affecting Passenger Services.\nSafeguard Oman Air’s marketing interests at all times.\nEnsure timely delivery of arrival baggage in the baggage reclaim area. Report any shortcomings to GHA management.\nEnsure a high standard of safety and security for staff, passengers, baggage, cargo, mail, aircraft and company property.\nReport all discrepancies and deviations in the Flight Handling Report (FHR) and make ASM aware of corrective action taken along with recommendation to prevent recurrence.\nEnsure that company regulations are followed with regard to lost/found/damage baggage and that the time factor in this connection is not exceeded\nEnsure all laid down procedures/regulations/standards affecting passenger, ramp, baggage, cargo weight and balance are maintained.\nCarryout Boarding gate activities on time.\nCheck the details in the boarding card ,flight no ,date, destination\n.Liaise with flight information section for periodic announcement to process passengers\nCoordinate with Ramp to ensure retrieved handbags are dispatc', 807, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=02ae41d00967cc59&from=serp&vjs=3', '2018-07-03 13:42:02', '2018-07-03 13:42:02'),
