(8899, 711, 384, 'Jobs in KSA', 'Raytheon Saudi Arabia is seeking a Driver to support operations. As the driver, you will perform a wide variety of tasks related to transporting materials, supplies, and people safely in support of the office and business. You will operate an assigned vehicle safely to transport passengers, material, and/or merchandise. In addition, the driver will perform a wide variety of planning, scheduling, coordinating, and communicating tasks in support of maintaining timely pick-up and deliveries. In addition, the driver will assist with translation duties in Arabic and English both verbally and written as needed. You will be required to prioritize activities to ensure efficiencies in the workflow and day-to-day tasks by taking initiative and implementing resolution. The driver will also prepare reports, maintain records, and reply to inquiries in both Arabic and English as needed.\nLocation:\nThis position will be based in Riyadh, Saudi ArabiaResponsibilities Include:Plan, schedule, and coordinate pick-up and delivery of passengers, materials, and/or merchandise in support of the business and program\nEnsure vehicles and other company tools are clean, safe and in working order before use\nMaintain records, receipts, and documents on behalf of the office according to company guidelines\nMaintain a customer mind-set when interacting with all internal/external requests and transportation services; Remain professional at all times\nPrepare vehicle, conduct operator maintenance, ensure cleanliness and safe operating condition\nEstimate travel time, arrange for short/long term parking, determine occupancy and luggage requirements\nDeliver items to approved destinations, unloads/loads merchandise, maintains schedule and protects all company property and information\nMaintains travel logs, maintenance records, and submits invoices/receipts as appropriate\nKnowledge of navigation in Riyadh, local laws and regulations as it relates to transportation services\nProvide a safe route to include ass', 476, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=4fdef11baa03a3d3&from=serp&vjs=3', '2018-07-03 13:42:02', '2018-07-03 13:42:02'),
