edures (SAP), sealed bidding,\nnegotiated, and commercial acquisi', 847, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=4fdef11baa03a3d3&from=serp&vjs=3', '2018-07-03 13:42:02', '2018-07-03 13:42:02'),
