(8902, 830, 1030, 'Jobs in KSA', 'Auto req ID: 148051BR\nJob Description\nPepsiCo Canada employs nearly 10,000 Canadians and is organized into two business units - PepsiCo Beverages Canada, which includes brands such as Pepsi, Gatorade and Tropicana; and PepsiCo Foods Canada, which includes Frito Lay Canada and Quaker foods & snacks. PepsiCo Canada, in turn, belongs to the global PepsiCo, Inc., family.\nAt PepsiCo Canada, we\'re committed to achieving business and financial success while leaving a positive imprint on society - delivering what we call Performance with Purpose. Performance with Purpose is at the heart of every aspect of our business.\n\nAt PepsiCo Beverages Canada, we believe our people are the core of our business. As a Seasonal AZ Delivery Driver, you will have the opportunity to work for a company that truly believes it’s only as great as its people. Success is fostered through passionate teams and dedicated people combined with work life flexibility and a supportive environment.\nSeasonal AZ Delivery Driver Job Summary:\n\nThe Seasonal AZ Delivery Driver contributes to the success of PepsiCo Beverages Canada by delivering large quantities of previously ordered products to high volume stores using a tractor/trailer truck.\nDuration: April – September\nDUTIES AND RESPONSIBILITIES INCLUDE BUT ARE NOT LIMITED TO\nOperating a class AZ or DZ vehicle in a safe and responsible manner\nDeliver product using a Bulk, Side bay, or PTG truck\nPerforming a proper pre and post trip inspection on all vehicles\nUsing a Dolly and/or power jack to deliver product to customers\nLift up to 100lbs in a safe manner\nMaintain vehicle cleanliness\nObey all HTA/MTO laws and regulations\nWork overtime as needed\nProvide outstanding customer service\nAbility to complete assigned work in the allotted time\nAny and all other duties as requested by delivery Supervisor\nQualifications/Requirements\nQUALIFICATIONS:\nA valid AZ Ontario License - driver abstract requested\nHigh School Diploma\nEmployment contingent upon successful road test ', 848, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=801fa364230be715&from=serp&vjs=3', '2018-07-03 13:42:02', '2018-07-03 13:42:02'),
(8903, 129, 502, 'Jobs in KSA', 'This technically competent engineer position involves the installation, maintenance; repair and support of stabilized (Seatel) and fixed TX-RX satellite systems in the offshore oil market.\nPRIMARY DUTIES & RESPONSIBILITIES:\nResponsible for performing customer support activities, which involve the service, installation, and trouble-shooting/repair of stabilized satellite communications systems, Cisco VoIP telephony systems, Internet services, networking applications and two-way radio systems on land rigs, offshore rigs, offshore production platforms, and remote locations.\nMust be well-organized person with the ability to work with minimal supervision\nMust be available 24x7 when on call\nMust be willing to travel overseas and have valid passport.\nUp to 100% of time spent traveling or offshore when on call\nMust be able to take Job ownership throughout completion which includes: Site Folders, Inventory Documentation, and Field TicketsQUALIFICATIONS:\nEducation, Knowledge, Skills & Abilities:\nOIL & GAS FIELD EXPERIENCE REQUIRED!!\nSeatel 9797 certification\nMust have experience working with Seatel 4003/4006, 4996/6006, and 9797 TX-RX series antennas\nExperience with and interest in commercial-grade satellite communications systems and Cisco networking equipment\nMinimum Associate Degree in related field or equivalent education in field work\nMust be able to create and manipulate Microsoft Excel and Word Documents\nComputer and IP networking skills\nCCNA and MCP is a Plus\nMust be customer focused and an effective communicator\nPossess ability to climb towers up to one hundred fifty feet as required on land and offshore locations, and lift 75 lbs\nComply with all safety requirements implemented by employer, customers, facility owners or vendors involved in the employee’s daily task, including but not limited to, PEC, H2S, Water Egress, Lock Out/Tag Out, First Aid/CPR, Lifting, Fall Protection, Climbing Techniques and etc.\nValid state driver license required; good driving recordThe ab', 524, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=96ff25b44a143a91&from=serp&vjs=3', '2018-07-03 13:42:02', '2018-07-03 13:42:02'),
(8904, 772, 504, 'Jobs in UAE', 'We are looking for a responsible Driver to distribute medical products promptly to our customers. You will represent our company in a professional and cost-effective manner to increase our profitability and customer satisfaction.\n\nResponsibilitiesDeliver a wide variety medical consumables to different addresses and through different routesFollow routes and time scheduleLoad, unload, prepare, inspect and operate a delivery vehicleAsk for feedback on provided services and resolve clients’ complaintsCollect paymentsInform customers about new products and servicesComplete logs and reportsFollow driving regulations and safety standardsCandidate Requirements\nProven working experience as a Delivery DriverValid professional driver’s license and motorcycle licenseExcellent organizational and time management skillsGood driving record with no traffic violations', 526, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 13:42:05', '2018-07-03 13:42:05'),
