(8907, 773, 510, 'Jobs in UAE', 'Job Purpose\nUnder the general supervision of the Vehicle Technician and Technical Supervisor is responsible for the driving of customer vehicles, within the premises and parking them safely, only within the site (in accordance with the laid down procedures) and sometimes conduct basic vehicle tests, as directed by the Vehicle Technician.\nDetailed Description\nPrincipal Accountabilities Carries out vehicle driving and assists the vehicle technician in basic tests. Parks the vehicle in the designated parking lot after testing is completed. Maintains test lanes and testing equipment on a regular basis, as decided by the supervisor.\n\nMinimum Requirements Good general education ( high school level ),\n Valid UAE driving license. – Light or Heavy Technical background is an advantage. Good communication skills. Basic computer skills.', 532, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/Light-Vehicle-Driver-jobs', '2018-07-03 13:42:05', '2018-07-03 13:42:05'),
(8908, 833, 497, 'Jobs in UAE', 'As a humble family business that started on the banks of the Dubai Creek in the 1930s, Al-Futtaim has expanded to a presence in 31 countries, a portfolio of over 200 companies, and 42,000 employees. You’ll find us in industries ranging from automotive and retail, to finance and real estate, and connecting people with international names like Lexus, Ikea, Robinsons, and Adidas. Our team is proudly multicultural and multinational because that kind of diverse representation gives us the global mindset to grow and impact the people, markets, and trends around us.\nCome join us to live well, work better, and be the best.\nAbout the Position:\n\nWe are currently looking for an experienced Driver to join our Hertz branch in Dubai. The main purpose of this role is to improve the overall customer satisfaction by ensuring that the customer is dealt with in a pleasant and professional manner by adhering to agreed Hertz standards concerning to all vehicle transactions.\n\nYour responsibilities will include the following:\n\nTransactions: Check in and Check outEnsures that the vehicle checks are done & filled out properly on Check reports (COR/VCR/VCI/TDS etc.) recording any existing or additional damages.Ensures that the Drivers Log Sheet is updated with each check out/check in transaction with all details filled in\nVehicle DeliveriesEnsures that the vehicle is properly checked before deliveryMaintains proper record of the delivery, collection & non-revenue transfers on the Drivers Log sheet.\nVehicle CollectionEnsures that all damages along with the check in KM are properly recorded on the Collection report.Maintains proper record of the collection on the Drivers Log Sheet\nCustomer EscalationsEnsure all policies and procedures are strictly adhered to ensure customer satisfaction.Where required customer challenges are escalated to the coordinator/CSR as per process agreed.\nAbout You:\n\nThe ideal candidate for this role should have High School qualification with a valid UAE Driving Licens', 519, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/Light-Vehicle-Driver-jobs', '2018-07-03 13:42:05', '2018-07-03 13:42:05'),
