(8911, 776, 514, 'Jobs in Qatar', 'One of the global leader in high speed trains, ALSTOM Transport (Turnover = €5,2 Billions) supplies one in four metros and one out of three trains in the world, with 24,700 people in over 60 countries.\nAlstom, as part of a consortium, has been awarded a 500M€ contract by QRAIL to supply a turnkey tramway system for a 4-line tram network in Lusail, Qatar.\nThe tram network will cross the city covering a distance of 33 km, including 7km underground and 37 stations. The system is expected to enter commercial service from 2018.\n\nPurpose of the Job\nA system Testing & Commissioning driver is in charge of driving the tramway in a testing configuration following the rulebook procedures of the project set up by Temporary Operations.\nOrganisational Reporting\nReports hierarchically to the Manager of the Temporary Operations of the Project.\nMissions\nAccountabilities\nSafely drive trams during Testing and Commissioning as per the temporary operations rule book. He also makes sure that testing objectives are met within his scope. He keep himself informed of incoming week Rail Road Vehicle and Tram movements within the test zone.\nResponsibilities\nSafely drive the trains following the rulebook,\nMaintain and develop his own level of expertise,\nSupport the entire Turnkey T&C team in delivering testing objectives,\nImplement the processes, methods and tools corresponding to his activities,\nReport to the Manager of Temporary Operations any safety concerns observed in the course of his duty\nJob Specifications\nKnowledge / Experience :\nCar Driving license,\nHas previous knowledge in train driving,\nGood knowledge of a railway system (Train, power supply, signaling…),\nAt least 3 years of experience in the T&C drivingEducational Requirements\nMust be able to read, write and communicate verbally in English.\nBehavioral and Technical Skills / Competencies\nApply ALSTOM corporate Discipline and Processes,\nBe invested in the role; display a collaborative behavior as well as a the rigour in applying the', 536, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=18079fd4c005191e&from=serp&vjs=3', '2018-07-03 13:42:05', '2018-07-03 13:42:05'),
