(8914, 834, 1035, 'Jobs in Qatar', 'QR17339 - Cargo & Baggage Transport Driver (Pakistan Event) | Qatar Aviation Services | Doha\nOrganisation: Qatar Aviation Services\nJob Function: Ground Transportation\nDivision: Airside Operations - QAS (Division)\nEmployment Type: Full Time - Permanent\nCity: Middle East | Qatar | Doha\nLast date of application: 31-Jul-2018\nQatar Aviation Services\nQatar Aviation Services (QAS) is an award winning, premier ground handling organisation whose global headquarter is at Hamad International Airport (HIA), the hub airport of Qatar Airways. Since its establishment in 2000, QAS has developed a reputation as a premium provider of world-class ground services to: international airlines; Heads of State and VVIPs; private fleets and customers; executive charter flights and cargo operators.\nThe QAS team comprising of over 8,000 strong multicultural employees, is dedicated to fulfilling the total passenger and cargo requirements of the airport, the airlines and customers it serves. This team of highly trained and diversely skilled staff is the reason for QAS outstanding success and their Customer’s satisfaction.\nAbout Your Job:\nAs a Cargo and Baggage Transport Driver, your responsibilities will be to drive light equipment and Light Vehicles at airside premises in order to assist with the day to day transportation activity that will ensure efficient cargo and baggage movement through the HUB. You will need to ensure that all transported units are handled and transported in line with Company procedures and guidelines. You will move cargo and baggage units from various locations at airside premises within the HUB in line with Operational procedures, Health, Safety and Security to ensure that QAS Airside Baggage and Transport provides the highest possible customer service experience.\nYou are required to learn and be confident in your specific role, observe and recognize best practices, follow the correct SOPs and always ask questions if in doubt. You must enhance your expertise and take op', 853, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=02455fc9347f55be&from=serp&vjs=3', '2018-07-03 13:42:05', '2018-07-03 13:42:05'),
