oubt. You must enhance your expertise and take o', 853, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=43998ed5a0ed182f&from=serp&vjs=3', '2018-07-03 13:42:05', '2018-07-03 13:42:05'),
(8916, 778, 512, 'Jobs in Qatar', 'Jaidah Group is looking for 3 Heavy Equipment Drivers in our Supply Chain Management department. Main responsibility is to drives flat bed or low bed trailer trucks and car carrier trucks carrying cars and loads and unloads such vehicles as needed\nDIVISION/DEPT\nSUPPLY CHAIN MANAGEMENT\nESSENTIAL DUTIES & RESPONSIBILITIES\nDrive Car Carrier Truck / Trailer truck and keep up to date with the loading schedule.\nLoad and unload automotive vehicles from the car carrier, and heavy equipment from trailer truck.\nFollow city and highway driving codes, regulations and speed limits.\nCheck engine oil, brakes, tires, fuel level, water level, warning lights, horn and all necessary functioning items of the truck.\nConsistently follow safety precautions.\nQUALIFICATIONS\nValid Qatari heavy duty driving license\n35 years of age and below\nEXPERIENCE\nAt least 3 years experience in operating and driving at least a 20 meter long flat bed or low bed trailer truck or car carrier truck.\nSKILLS & ABILITIES\nGood oral and written communication skills in English – Arabic a plus.\nHardworking, responsible, trustworthy and willing to work overtime.\nSkilled driver of heavy goods trucks and trailers and ability to operate such vehicles and equipment.\nCOMPETENCIES\nManage Relationships & Diversity\nCustomer Orientation\nAnalysis & Problem Solving\nLearning and Self-Development\nCommunicate with Others\nTime Management\nPlanning & OrganizingApply Now', 534, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=bf0d3462b7969bab&from=serp&vjs=3', '2018-07-03 13:42:05', '2018-07-03 13:42:05'),
(8917, 836, 1036, 'Jobs in USA', 'ANNOUNCEMENT OF POSITION VACANCY\nJob Title: Allied Health Program Director\nDepartment: WCCC Health Sciences\nPosition No. AF0208\nEmployment Type: Administrative\nSalary: Commensurate with education and experience. Excellent health and retirement benefits package.\nApplication: Submit a cover letter, resume or CV, . (Official transcripts will be required upon hire. Unofficial transcripts may be requested for top candidates.)\nApplication Deadline: Open until filled. To ensure consideration, complete applications must be received by 7/13/2018\nDirect Inquiries Contact: Debbie Balmer, dbalmer@coloradomesa.edu\nSUMMARY:\nReporting to the Director of Instruction, the Program Director directs and coordinates the activities of the Medical Office Assistant, CNA and Tech Scholar Medical Preparatory programs at Western Colorado Community College (WCCC). The Program Director is responsible for coordinating and maintaining accreditation of the above programs. The Program Director is responsible for budget planning, coordination, scheduling and recruitment, and supervision of faculty in the programs, both at the Grand Junction and Montrose campuses, as well as teaching, advising, and evaluating. The Director must maintain a positive working relationship with college administration and staff, faculty, students, and health care agency personnel to support the role and mission of the programs. The position requires the application of sound managements skills, interpersonal skills, decision making, and judgment.\nESSENTIAL DUTIES AND RESPONSIBILITIES include the following. Other related duties may be assigned.\nTeaching, advising and evaluating in department instructional programs\nDevelop curriculum proposals for WCCC medical programs\nIdentify resources (personnel, space and physical) for implementation of programs\nDevelop and manage budget of programs; contribute to departmental budget planning and budget decisions\nCoordinate the development, evaluation and revision for student admission, p', 854, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=ac7a60ce388cb3cc&from=serp&vjs=3', '2018-07-03 17:10:52', '2018-07-03 17:10:52'),
(8918, 837, 1037, 'Jobs in USA', 'Global Empire, LLC (GHG) is a Healthcare Staffing Company specialized in providing reliable and qualified healthcare professionals for Government contracts nationwide.\nAvailable Position: Outpatient Medical Coder - Registered Health Information Technologist (RHIT), Registered Health Information Administrator (RHIA), Certified Professional Coder (CPC) CCS-P (Certified Coder Specialist – Physician (CCS-P).\nPlace of Performance: is 75 TH Medical Group, 7321 Balmer St, Bldg 570, Hill AFB, UT 84056.\nWork Schedule: full-time, Monday – Friday; 0730-1630, Weekly hours shall not exceed a forty (40) hour work week except when the performance location is shut down for planned or unplanned closures as applicable.\nPeriod of Performance: July 23, 2018 18 to January 22, 2021\nScope of Work: The personnel under this task order will perform coding services for all medical, surgical and ancillary services s in accordance with AFMS policy and procedures.These individuals will be assigned to the TRICARE Operations and Patient Administration Flight. Coding professionals performing in an Air Force facility shall complete requirements for ICD-10-CM as required by national certification agencies before employment start date. The Government requires certificates or other documentation proving completion.\nWork Duties:\nResponsible for assignment of accurate E&M, ICD-9, CPT and HCPCS codes and modifiers from medical record documentation.\n\nIdentifies and abstracts information from medical records (paper or electronic) for special studies and audits, internal and external.\n\nInteracts with MTF staff to ensure documentation is clear and supports coding assignments. Educates MTF staff through individual or group in-services and training sessions.\n\nMaintains a delinquency report of missing records in order to facilitate completion of work within the required Air Force thresholds.\nPosition Requirements/Qualifications:\nMandatory knowledge and skills.\n\nPosition requires excellent computer/communication ', 855, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=7dc7c94572f306a4&from=serp&vjs=3', '2018-07-03 17:10:52', '2018-07-03 17:10:52'),
