(8920, 839, 1039, 'Jobs in USA', 'The University of Miami Miller School of Medicine-UHealth is home to some of the brightest minds in the world. At the U, we are committed to attracting and retaining a talented workforce to support our common purpose of transforming lives through teaching, research, and service. Our Faculty teach students who represent the future of medicine. Our researchers are discovering breakthrough patient treatments. As an academic medical center, we are proud to serve South Florida, Latin America and the Caribbean. Our physicians represent more than 100 specialties and subspecialties, and have more than one million patient encounters each year.\nThe Administrative Assistant completes assignments requiring the collection, and organization of data; may provide analysis. Serves as a primary information resource regarding service and program policies, procedures, and operational functions. Maintains calendar, types, provides routine and general clerical support or medical-related support which may include patient care, student service, reports, and statistics. Answers telephones, takes messages, answers routine questions, and transfers calls to appropriate individuals. Greets visitors and callers, handles their inquiries, and directs them to the appropriate persons according to their needs. Orders office supplies. Composes correspondence or selects standardized formats. Prepares financial forms (IDRs, BEFs, Pos, work orders, check requisitions, etc for department). May provide ancillary support to physicians. Assist in preparation of documentation and billing for different funding. Assist with the documentation of various patient assistant program for special medications. Assist in updating medicine inventory. Liaison for physician on schedule changes, template changes, clinical staffing and day-to-day clinical functions. Oversee/approve any overbooking of physician’s clinical schedule, bumped clinics and arrange all appointments. Other duties as assigned.The minimum qualification', 267, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=51ac98a08543a460&from=serp&vjs=3', '2018-07-03 17:11:36', '2018-07-03 17:11:36'),
(8921, 840, 1040, 'Jobs in USA', 'The University of Miami is considered among the top tier institutions of higher education in the U.S. for its academic excellence, superior medical care, and cutting-edge research. At the U, we are committed to attracting a talented workforce to support our common purpose of transforming lives through teaching, research, and service. Through our values of Diversity, Integrity, Responsibility, Excellence, Compassion, Creativity and Teamwork (DIRECCT) we strive to create an environment where everyone contributes in making UM a great place to work. We are one of the largest private employers in Miami-Dade County; home to more than 13,400 faculty and staff from all over the world.\nJob Description\nGeneral Description (Purpose and Function):\nExecute all assigned physician and ancillary scheduling requests to ensure daily efficient operations.\nPrimary Duties and Responsibilities (For Non-exempt Employees Include Percent of Effort):Efficiently maintains daily schedule changes in a timely manner.Monitors cancellation of physician clinic schedules, dates and follow up requests for the assigned scheduling provider.Efficiently maintains and reschedules from the IDX online bump list according to policy and procedure.Coordinates the written communication for all bumped patients which are unable to be contacted via telephone.Enhances relationship with assigned physicians and staff by providing resolution to problems and follow up as needed in a courteous and professional manner.Perform quality assurance checks on assigned facility schedules.Monitor overbooking and under-booking of provider schedules. Report findings to Master Scheduling Analyst.Prepares runner log for assigned clinic day from IDX report.Serves as a patient clinic coordinator for the assigned clinic day by keeping track of patients during clinic visit.Monitors the progress of patients undergoing diagnostic testing and/or consultations in other areas/departments within the facility.Monitors and motivates ancillary d', 856, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=094554c58de8e429&from=serp&vjs=3', '2018-07-03 17:11:36', '2018-07-03 17:11:36'),
(8922, 841, 1042, 'Jobs in USA', 'Are you looking for a rewarding career caring for pigs? We’re currently hiring for a full-time Animal Caregiver at a sow farm near Palmer, NE.\n\nIn this position, you would carry out daily care of the animals, ensuring adequate access to feed and water, monitoring the barn environment and making sure pigs are comfortable. As an Animal Caregiver, you’d be trained to specialize in a certain function, whether that’s breeding, assisting during piglet birth or caring for young piglets.\n\nA career with The Maschhoffs empowers you to set your own path. Additionally, you’d have the opportunity to take advantage of competitive wages, health and dental insurance, a 401K match program and a production bonus program.\n\nInterested yet?\n\nHere are the basic requirements:\nA high school diploma or GED is preferred\nAnimal husbandry skills, or the desire to learn how to effectively care for pigs\nAvailability to work every other weekend\nAbility to lift, push or pull a minimum of 50 pounds\nThink you’ve got all those covered? Here’s how you seal the deal with the extras:\nOne year farm and/or livestock experience\nBasic understanding of Microsoft Office and computers\nJoin our team and experience all that a family-first culture has to offer! We are an equal opportunity employer.', 858, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://helpwanted.indeed.com/jobs/viewjob/cc244fe12531ba92?jk=781c9a2f72407068&vjs=3', '2018-07-03 17:11:36', '2018-07-03 17:11:36'),
(8923, 842, 1043, 'Jobs in USA', 'JOB TITLE: Cellar Master\nOVERVIEW: Create and maintain an efficient working environment in the cellar to facilitate the Winemakers goals and vision of Iris wine styles. This position is responsible for Safety program oversight for winery and tasting room. The Cellar Master reports directly to the Winemaker.\nESSENTIAL FUNCTIONS: Protect the wine as the first priority. Be aware of any losses to fruit or wine and advise the Winemaker of any such loss immediately. Maintain a high standard of cleanliness in the cellar for all equipment - surfaces, tanks, fittings, pumps, hoses, etc. should be ready for use at all times. Maintain barrels: top full barrels on a regular schedule, clean empty barrels and then gas with SO2 on a regular schedule. Maintain winery protocols for sanitizing and keep tanks, fittings and other equipment sanitized. Perform racking, filtering and blending operations per instructions. Forklift operation is an essential function of the Cellar Master who must be certified to do so - training provided if needed. Operate equipment responsibly and in a manner that preserves functionality. With Winemakers help, manage contractors for building maintenance and construction. Perform lab analysis as required, following instructions provided by Winemaker. Maintain written records in lab journal of all labs performed; ensure that information is being entered completely and accurately. Maintain a clean and neat laboratory environment; all equipment cleaned and put away, counters and floors wiped down, etc. Keep written record of all wine additions, labs and movements in IVIS software. Create workorders in IVIS for cellar and lab workers as needed. Ensure cellar and lab workers complete and sign workorders as assigned. Review workorders and mark as done in IVIS. Develop a working knowledge of all physical plant equipment as well as cellar equipment. Assure that work areas are clean and all fittings and equipment are returned to their proper places upon completion of', 859, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Na', '2018-07-03 17:11:37', '2018-07-03 17:11:37'),
(8924, 843, 1044, 'Jobs in USA', 'The Chicopee Register and The Register weekly community newspapers are seeking a full-time staff writer to report local news in Chicopee and Ludlow. Applicants must be dependable, have a passion for community journalism, feature reporting and social media, be able to cover evening meetings (as needed), and meet deadlines. The successful candidate will maintain cultural, political, educational and municipal relationships within their respective territory. Photography skills and own camera are a plus. A journalism (or equivalent) degree is preferred, but we will consider less experienced applicants. This position is based out of our Palmer, MA, office. Candidates must reside within 25 miles of the coverage territory.Job Type: Full-timeExperience:Writing: 2 yearsEducation:Bachelor\'s', 859, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=72f50306a1fd4432&from=serp&vjs=3', '2018-07-03 17:11:37', '2018-07-03 17:11:37'),
(8925, 844, 1045, 'Jobs in USA', 'POSTING DATE: Wednesday, June 20, 2018, 1:00 p.m.\n\nCLOSING DATE: Open Until Filled\n\nSALARY: $73,849 to $91,465, DOE\n\nHOURS OF WORK: 8:00 a.m. to 5:00 p.m.\n\nWORK LOCATION: Palmer\n\nREQUISITION NO.: 610-191b\n\nUNION REPRESENTATION: None\n\nDEPARTMENT: Human Resources\n\nFLSA CLASSIFICATION: Exempt\n\nPURPOSE\n\nThis position is responsible for the development and implementation of a variety of human resource programs, with primary focus on strategic talent management and employee development. This is a hands-on, mid-management position with functional oversight of recruitment practices, training and development, division budget, employee recognition, job analysis/compensation, and administering MEA’s Employee Assistance Program. This position is expected to accomplish these responsibilities through the application of a strong knowledge of Human Resource practices, programs, and philosophies, and by utilizing initiative, innovation, and creativity.\n\nESSENTIAL FUNCTIONS OF THE POSITION\n\n1. Provide professional expertise and support in the design, development, and implementation of the Association’s talent management process to support and align to the Association’s strategic goals and create an internal bench of top talent.\n\n2. Work with Division Directors to ensure that organization-wide talent management and initiatives are focused and aligned on improving operational and program efficiencies and effectiveness.\n\n3. Participate as a member of MEA’s interview team for positions being recruited. Assist with crafting interview questions to evaluate a match of technical and interpersonal skills required for the position.\n\n4. Responsible for proposing, coordinating, developing and monitoring all training and development activities. Work with Executive Staff, managers, and supervisors to determine training needs of employees. Work may include engaging contractors to design and present training or preparing and delivering training internally. Responsible for monitoring spending within ', 860, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=cd74552f692ed130&from=serp&vjs=3', '2018-07-03 17:11:37', '2018-07-03 17:11:37'),
(8926, 845, 1046, 'Jobs in USA', 'ATTENTION ALASKA RESIDENTS!**This individual position is EXEMPT from the hiring restriction. Qualified applicants are encouraged to apply.**Effective July 1, 2018, the standard SU workweek is changing from 37.5 hours to 40 hours. In accordance with this change, the salary listed in this job posting reflects this workweek change.The Alaska Department of Fish and Game, Division of Wildlife Conservation is recruiting for a full time Wildlife Biologist IV (PCN 11-2229). This position serves as the Region IV Research Coordinator, and is stationed in Palmer.\nThe key responsibilities of this position include, but are not limited to:\n1) Directly supervise and evaluate professional research biologists and subordinate staff.Review progress on assignments and seasonal workloads, and coordinate with other supervisors to make staff assignments.\nReview and approve leave schedules, prepare annual personnel evaluations, and identify exceptional accomplishments for formal recognition for outstanding performance.\nIdentify areas for improvement and establish steps for remedial action and assign training as needed.\nPrepare, edit, and/or periodically review formal position descriptions. Recruit and hire for vacant positions.\nAssist project leaders with field activities to gain familiarity with individual projects and to provide mentoring, supervision, and a better understanding between research and management.\n2) Provide support to Regional Supervisor.Serve as a member of the regional leadership team to assist the regional supervisor in planning and implementing both policy and operational-level decisions\nObtain and consolidate information relevant to research or other wildlife or administrative issues such as facilities improvement and maintenance, public relations, staff morale, continuing education programs for staff, evaluation of regional personnel structure and staffing levels, coordination of procurement and use of capital equipment.\nPrepare briefings or reports on findings, and ', 861, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Turley-Publications/jobs/Staff-Writer-c0ff167a9945eaef?vjs=3', '2018-07-03 17:11:37', '2018-07-03 17:11:37'),
