(8928, 847, 1048, 'Jobs in UAE', 'Palace Manager and Family PA (Female Palace/Facilities Manager (Hards/Softs).\nNeeded for UAE Royal family – Properties: Dubai – Kuwait – Abu Dhabi – Bahrain;\nExperience of Palace Management, ideal;\nSuit female GM — International Hotel – “ideal candidate”\nRoyal Appointment;\n84K Tax Free;\nExecutive Search starts August 2014 for August 2015 start;\nFiled: Jamaica, Port Robin, Caribbean.\n\nPackage:Generous TAX FREE salary £7,000 per monthPrivate separate apartment accommodation within the grounds of the family palace.All expenses covered including meals, medical, visa, use of family driver, annual flights home for holidays.Excellent working conditions and lifestyle perks working for a VIP family.\n\nPosition:\nThe Palace Manager is responsible for planning, organising, and developing of the overall operation of the housekeeping at the palace assuring the highest degree of quality guest care is maintained at all times. Responsible for staffing, scheduling, training and developing staff. Events management responsibilities are also involved.\n\nTasks and Responsibilities: involved but not limited to:Planning, organizing and directing team members to ensure the highest degree of family and guest care.Running one of three UAE palaces.Daily supervision of the housekeeping staff, including the day and night. (Flexibility required).Purchase, re-order and maintain housekeeping supplies and inventory.Conduct pre-event inspections of all areas. .Recruit, schedule and train all new housekeeping staff members.Maintain the housekeeping budget, providing billing summaries and expenses for all pre and post events.Uphold the highest standards of cleanliness, safety, and conduct.Ensures the proper maintenance of all equipment; makes arrangements for repair\nand/or replacement of used and damaged equipment.\n\nWe are seeking to find:We are looking for somebody who has the following qualities:Dynamic, proactive and extremely well organised.Leadership personality with fantastic management skills.Crea', 863, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-03 17:11:39', '2018-07-03 17:11:39'),
(8929, 848, 1049, 'Jobs in USA', 'Family with main residence in Bucktown of Chicago and another residence in Malibu, California with 4 year old boy and baby girl due in September is seeking an educated, experienced, professional and organized Full-Time Nanny. The schedule is 40+ hours per week on five days (flexible to work varying combinations of days including weekends). Nanny will receive two consecutive days off per week and monthly schedule will be made at least one month in advance. Nanny is required to travel internationally approximately 4-6+ weeks per year and domestically approximately 4-8+ weeks per year, which excludes travel and time spent at residences in Chicago and Malibu, California. Overnights are required approximately 2-4+ weeks annually when parents are traveling without children. Extreme flexibility is required for the position. Older child is enrolled in private Montessori school for full days (pick up at 3:00pm), which is driving distance from the family\'s residence. Family has staff vehicle, so safe vehicle for transportation is not required. Candidates must be comfortable with cat. Candidates bilingual in English and Spanish is desirable, but not required. Nanny must be collaborative to work with domestic staff and directly with Principals on a daily basis (Stay-at-home mom and Mr. works from home often), discreet, assertive, proactive, resourceful, self starter, organized, detail oriented, hard working, service focused, kind, professional, ability to multi-task and wear many hats, respectful and capable of maintaining discretion (confidentiality agreement is required). Candidates must have previous experience in similar position(s) that include nanny experience with extreme travel and highly flexible schedule. This is a newly created position. Principals are open to local candidates in Chicago or candidates relocating domestically. Start date is August, but flexible for the right candidate.RESPONSIBILITIES: Newborn experience and knowledgeable about routines, sleep trainin', 864, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Strollers-and-Stilettos/jobs/Full-Time-Nanny-Heavy-Travel-Bucktown-Malibu-c8bb66eeefa9636b?vjs=3', '2018-07-03 17:15:20', '2018-07-03 17:15:20'),
(8930, 292, 267, 'Jobs in USA', 'Nanny Position Description: Wonderful family seeks an amazing nanny for newborn. This position is full time, live in. Ideal candidate is warm but professional, energetic, fun, responsible, reliable respectful, organized, and has an interest in child development. Candidate must have childcare experience reflected in their resume.Job Position:  Full-Time, Live-in or super flexible Live-out. Meaning if you want to live-out you must be able to work later some nights.Location: Greenwich, VillageNanny Childcare Experience: Very important*Start date: Late july/ Early augustSchedule:  Mon-Fri: 8-7pm, with some nights and weekendsHourly Pay: 80K+Care of: 1newbornPets:  Black Lab, 45-50 lbsNanny Qualities:  Flexibility is key -- both with schedules and with responsibilities. Ideally someone positive, respectful, and collaborative.Duties: Looking for a nanny who can also do some housekeeping (family laundry, vacuuming, dishes) -- cooking would also be great, Does laundry for children]. Who can do laundry for family, someone who can for children and for familyBenefits: Private Bedroom, Private Bathroom, Paid Vacation, Sick/Personal days, Major Holidays Off, Bonus, MetrocardJob Type: Full-timeSalary: $75,000.00 to $90,000.00 /yearExperience:Infant care: 4 yearsLocation:Manhattan, NYRequired work authorization:United States', 865, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Tiny-Treasures-NYC/jobs/Live-Nanny-or-Very-Flexible-Nanny-c7bb9f3f0f723879?vjs=3', '2018-07-03 17:15:20', '2018-07-03 17:15:20'),
(8931, 721, 402, 'Jobs in USA', 'Live-Out Family Assistant / Nanny needed – Austin, TX – Up to $60kOur client is seeking a responsible Live-Out Family Assistant / Nanny for their home In Austin, TX.Hours: Monday-Friday, 10-7 must be flexibleProfessional, dependable Family Assistant / Nanny needed for busy household with school aged children (8 & 12 girls) in the Westlake/Barton Creek area of Austin.Must have strong organizational skills, attention to detail and be able to prioritize and manage their time well.Previous experience working in a large, busy home discreetly and efficiently while maintaining family’s peace and privacy. Must be friendly, able to work with little supervision, willing to help where needed, and work well with other household staff.Assisting with P.A. situations during the day, and picking up the children from school and delivering them to Piano lessons, Soccer, or any additional after school activities.Must have great communication skills both written and verbalPaid VacationPaid Sick Days*MUST Have at least 5 years experience doing this type of work in high end homes*Are legal to work in the U.S.*Are hard working and efficient*Can drive and have valid drivers license*Have great references and clean background checks*Speak English – ALL communication must be in English*Background Checks will be conductedPLEASE EMAIL US YOUR RESUME IN MS WORD FORMATJob Type: Full-timeSalary: $60,000.00 /yearExperience:Family Assistant / Nanny: 5 yearsLocation:Austin, TX', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/The-Domestic-Group,-Inc./jobs/Family-Assistant-9019d4cd91c866d6?vjs=3', '2018-07-03 17:15:20', '2018-07-03 17:15:20'),
(8932, 849, 1050, 'Jobs in USA', 'Busy family with multiple school-going kids needs a top nanny with fabulous references to help with the organization of the home and daily activities. Duties include some personal assistance to the family. You must have experience with multiples and busy busy afternoons and meals etc etc .Fabulous opportunity for a great team player. Call us directly at 212-641-0002 and attach your resume with your application for immediate response.This is a position for a professional nanny with ooodles of in-home nanny experience.Job Type: Full-timeSalary: $80,000.00 to $100,000.00 /yearExperience:childcare: 6 yearsLocation:New York, NYLicense:Driver\'s LicenseRequired work authorization:United States', 384, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/NannyCity/jobs/Lead-Nanny-a62581e23e6ead5e?vjs=3', '2018-07-03 17:15:20', '2018-07-03 17:15:20'),
(8933, 296, 272, 'Jobs in USA', 'We are hiring EXPERIENCED, well-qualified nannies all over Phoenix and surrounding cities. We are hiring for both full and part time positions with very competitive pay.Your application MUST show at least 2 years of childcare experience or it will be dismissed. You must pass a background check, have a valid drivers license, and provide 3 professional references to be considered.We hire the BEST! And, we have the BEST families!!!www.butterflybabyconcierge.comJob Types: Full-time, Part-timeSalary: $14.00 to $20.00 /hourJob Types: Full-time, Part-timeSalary: $12.00 to $20.00 /hourExperience:childcare: 4 yearsEducation:High schoolLocation:Phoenix, AZLicense:Driver\'s LicenseRequired work authorization:United States', 434, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Butterfly-Baby-Concierge/jobs/Nanny-07411ba3443801fd?vjs=3', '2018-07-03 17:15:20', '2018-07-03 17:15:20'),
(8934, 723, 404, 'Jobs in USA', 'We are looking for the perfect person to fill this position! We have a beautiful, loving, high spirited little 4 year old boy named Mason, who needs someone to help care for him.This is a live in position.Along with helping with Mason, we want someone who wants to be a part of the start up of a self sustaining small scale organic farm. We live in Murphys on 9 acres and we are in the beginning stages of putting in vegetable gardens, orchards, flower gardens, bees, chickens, goats and more to come.Duties would include:Tending to the gardens dailyWateringHelp around the houseHelp with animalsHelp with MasonHouseworkCooking and meal prepPossibly helping with a booth at local farmers markets, when the time comesBasically we are looking for someone to be a part of the family, share in responsibilities and eventually profits!We will all pitch in together to get all the work done.You would be expected to work a full 40 hour week, preferably tues through Saturday.The ideal qualities in the ideal candidate are:kind and fun lovingLoves kids and animalsIs extroverted and community orientedLoves gardening and being outdoorsCreativeHealth consciousHard working and can lift 50+ pounds(a must)Must have own transportationSalary includes:Room and boardAll utilitiesFood and drinkGeneral household items$200 weeklyA portion of the proceeds from all produce sold at marketsWe own Murphys Nursery and are starting a year round produce stand and farmers market this year where we will sell our goods!If you are interested in this position, please contact us via indeed or drop your resume off at 88 W Hwy 4, Murphys CA 95247Job Type: Full-time', 339, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Murphys-Nursery/jobs/Live-Nanny-d139028aa03d3119?vjs=3', '2018-07-03 17:15:20', '2018-07-03 17:15:20'),
(8935, 850, 1051, 'Jobs in USA', 'Detail-oriented, organized Family Assistant with a high energy level and strong work ethic for busy household in the Barton Creek/Westlake area.Position will be a combination of childcare, personal assistant and household management responsibilities.Schedule will be full-time with a flex schedule that will be determined weekly.Must have the flexibility to travel with family and be open to work evenings and/or weekends as needed. Passport will be required for international travel. Travel bonus of $200/day will be paid when traveling with family. Good driving record is essential.During the morning hours when girls are in school, Family Assistant will perform household management duties including running errands, plant/pet-care, car maintenance, planning special events, vendor/contractor management, calendar management, basic meal preparation (as needed) and general household organization. Will be working with contractors, household staff and managing special projects as well. This position requires a high level of organization and attention to detail, great communication skills (both written and verbal) and ability to work well with household staff and contractors. Must be fluent in Apple/Mac products and programs like iCal and Microsoft Office.Looking to hire an educated, creative individual who is fit, active and engaging. Ideal Family Assistant will be relatable to girls and make things fun. There are dogs in the home.Must have calm demeanorWork well with little supervisionTake initiativeHave great time management skillsExcellent written and verbal communication skillsBe very organized and able to effectively maintain detailed paper and online filesTo qualify you MUST:have a good amount of Nanny AND Personal Assistant experience that can be called and verified with a reference. References must be non-family/friend-related. We will need to be able to obtain a reference and/or recommendation letter from each childcare employer you have been employed with the past 10 ', 372, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Mom\'s-Best-Friend--Austin/jobs/Personal-Assistant-Nanny-481aa490a79c2eff?vjs=3', '2018-07-03 17:15:21', '2018-07-03 17:15:21'),
(8936, 725, 276, 'Jobs in USA', 'Manhattan family is seeking an articulate and verbally-focused live-in nanny to care for their two young boys. Must be a true career nanny - energetic, with strong long-term experience.. Responsibilities are all child-centered along with routine straightening up. The nanny will be required to prepare all meals for the kids. There is a full time housekeeper to take care of laundry and all deep cleaning. Although the daily routine finishes in the early evening, the family requires considerable flexibility for babysitting in the evenings if mom and dad go out. Nanny is required to travel internationally about six weeks per year. The nanny must have a place to stay in on their days off. Immediate start.\nRequirementsLegal to work in the US\nFlexible Schedule 50-60 hours per week\nAble to live in and live out on days off\nProfessional nanny experience and references\nMultilingual preferred\nAvailable ASAP\nBenefits\nFull compensation package with benefits', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=8876e61866c86f0a&from=serp&vjs=3', '2018-07-03 17:15:21', '2018-07-03 17:15:21'),
(8937, 851, 406, 'Jobs in USA', 'Loving, Live In Nanny 24/5 OR 24/7 Needed in Weston, CT (southern CT). Nanny can go home on the weekends or stay at the family\'s residence (not have to pay rent).Job starts August 1st!DAYS/HOURS:Monday – Friday 7:00am to 9:30am (Nanny is OFF approx. 9:30am-1/2:00pm ) and then ON again 1/2pm to 8pm.Two children, boy in early elementary with special needs (experience with Autism a plus) and toddler (2yrs old).MUSTS:Have a great attitude, be enthusiastic and engage easily with children.Be able to plan activities and take the children to them as well as to lessons, appts, etc.Be patient, understanding, adaptable, and intuitive.Be super energetic, athletic, warm, cheerful, fun and positive.Be flexible. Mother works a lot, pitching in and remaining open to schedule changes.Be punctual and dependable.Be organized. Likes to keep things neat and tidy in children’s rooms and common areas of home.Always has children’s safety as top priority.Be able to swim; pool at the home.Be a good communicator and team player; open and honest with parents and other staff.Be 100% comfortable and capable administering medicine, keep record for the family.Be 100% comfortable driving the children, have a valid driver’s license and clear record.Be comfortable preparing healthy, creative meals with the specified dietary restrictions.Have a valid passport and be able to travel with family.Be respectful of family’s home.PREFERENCES:College Education.Someone who enjoys cooking, assist the family’s PA in preparing meals.Experience in special needs specifically Autism a plus.TRAVEL:Family will need the nanny to travel internationally and domestically.JOB REQUIREMENTS/DUTIES:Get both children up for school starting in the Fall / help get them ready in the morning. Take children and pick up from school. Children attend different schools. Nanny will be responsible for drop offs and pick ups from school.Take boy to all his appts in the afternoon, daughter will be in tow.After drop off in the morning, clea', 488, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/NY-Nanny/jobs/Live-Nanny-9cc20fb587c22803?vjs=3', '2018-07-03 17:15:21', '2018-07-03 17:15:21'),
(8938, 297, 1052, 'Jobs in USA', 'Seeking a full-time live-in nanny for two boys (12yo and 10yo). The skills and responsibilities listed below are required and non-negotiable. The position pays $1,200 per week. A car is provided for driving the boys and running work-related errands.- Live-in is required Monday through Thursday (private bedroom/full bath with private entrance)- Must currently live in the Los Angeles area- Must have valid drivers license and clean driving record- Must be able to travel with the family on domestic and international flights- Must be CPR certified and able to administer medication- Cook/prepare HEALTHY breakfasts, lunches, snacks, and dinners- Drop-off/pick-up boys to and from schools and extracurricular activities- Feed the family dog and manage groomer/dog-walker schedules- Pack the boys backpacks/sports bags- Grocery shop- Liase with boys tutors, teachers, and other nannies for lessons, playdates etc.Job Type: Full-timeSalary: $1,200.00 /weekLanguage:EnglishRequired work authorization:United States', 339, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Girodet-Family/jobs/Full-Time-Live-Nanny-27e4f44474c4b891?sjdu=QwrRXKrqZ3CNX5W-O9jEvV_1-3a1LOO3UUMrMHHi9RKV-VrM_iAMZRRJXgLn', '2018-07-03 17:15:21', '2018-07-03 17:15:21'),
(8939, 729, 411, 'Jobs in Oman', 'Maternity Nurse Needed in Muscat, Oman | ASAP Start\nJob ref: MN/Oman\nA family based in Muscat, Oman would like an experienced and preferably qualified maternity nurse to join them in Oman for a period of 3 months starting asap.\n\nThe family have an 8 week old baby girl and have only hired local help, they would now like assistance from a professional maternity nurse to help with the feeding and sleep routine.\n\nThe position will be working 24 hours 6 days per week. During the booking the maternity nurse will share a bedroom with the baby and a private bedroom with en-suite will be provided for her day off.\n\nThe family will require the maternity nurse to be responsible for all baby duties such as sterilizing bottles and helping with the feeding and baby’s routine. The family would like the maternity nurse to be supportive, calm and easy going. Minimal travel with the family would be expected, but the family are planning a trip to Thailand in the coming months.\n\nIdeal candidates will be experienced in maternity placements and having worked overseas would be a bonus. The family are looking for an experienced, capable and discreet maternity nurse who will fit in well with the family.\n\nThe salary is negotiable with an ASAPstart date.\nRequirements\nLocation\nOman\nStart date\nASAP\nDuration\n3 months\nSalary\n£200 - £220 per 24 hours +\nHours\n24/6\nLanguages\nEnglish\nPermanence\nTemporary\nChildrenExperience\nEssential\nDriving licence\nNot Essential\nNon smoker\nNot Essential\nShared care\nYes\nSole charge\nNo\nAccommodation Details\nBasisAccommodationFamily residenceOther Details\nNursery duties only\nYes\nExpecting a baby\nNo\nAny special needs?\nNo', 492, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=eab2c002f584c20b&from=serp&vjs=3', '2018-07-03 17:15:21', '2018-07-03 17:15:21'),
(8940, 728, 410, 'Jobs in Oman', 'Oman, Muscat: An energetic Maternity Nanny is required to care for a 1st baby, 5 months old. Starting ASAP for 12 weeks with a view to extend, working 6 days, 24 hours. £160 – £200 per 24 hours gross.\n\nA family based in Oman are looking for a Maternity Nanny who can join them ASAP. The family would like the Maternity Nanny to continue with the routine that has already been established and support their baby with the next stage of their development. An active and energetic Maternity Nurse would suit this booking. Accommodation provided is a room shared with the baby.\n\nASAP Maternity Nanny\n12 week booking\n1st baby, 5 months old\nEnergetic Maternity Nanny\nApplying for this position: Please email your interest in this position to maternity@eden-nannies.co.uk. Please ensure you include the reference number for the position you are applying for (found at the top of the advert). For candidates who are not currently registered with Eden Nannies, please include an up-to-date CV when applying. Applicants for this position should have excellent checkable references, a valid DBS [CRB] and First Aid Certificate.', 491, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=119c4ec8cf79f001&from=serp&vjs=3', '2018-07-03 17:15:21', '2018-07-03 17:15:21'),
(8941, 731, 412, 'Jobs in KSA', 'Driver: Non-DriverAccommodation: Own Bedroom and Own Bathroom\n\nBaby Nanny for 1 year old little girl. A qualified and experienced baby/toddler nanny is needed who is developmentally focused with excellent knowledge of potty training and all those early childhood milestones. Life is super exciting for a one-year-old as they start saying their first words and taking those first steps and nanny can help them achieve those!\n\nExciting international travel is involved, so a super organized jet setter nanny is needed. Excellent English is essential, also ideally bi-lingual in French as would be of benefit, as the parents would love their child growing up speaking English and have French language skills.\n\nThe ideal candidate will be an:\nExperienced Baby Nanny• Qualified Nanny• Have French language skills\n\nEden Private Staff follows a safer recruitment practice. We are committed to child safeguarding and all candidates must have an enhanced DBS check and reference checks prior to appointment.', 493, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=92cca2bedcdbc48b&from=serp&vjs=3', '2018-07-03 17:15:21', '2018-07-03 17:15:21');
