(8942, 730, 412, 'Jobs in KSA', 'Driver: Non-DriverAccommodation: Within the palace grounds – own separate room and bathroom\n\nA Saudi Arabian family is looking for a nanny/governess to care for their 2-year-old twins (girl and boy).\n\nThe family wants an educationally focused nanny who is well-versed in the care of toddlers and pre-schoolers. Twin experience would be of benefit. Working hours are Sunday to Friday, 12 hours a day, with flexibility needed when travelling. Travelling hours will be 24/6. The household is fully staffed, so you will be expected to carry out childcare duties only. A bi-lingual nanny in either French or Spanish would be advantageous.\nRiyadh, Saudi Arabia• Nanny/Governess• International travel• French or Spanish speaker\n\nEden Private Staff follows a safer recruitment practice. We are committed to child safeguarding and all candidates must have an enhanced DBS check and reference checks prior to appointment.', 493, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=ee0c4a18b2093c72&from=serp&vjs=3', '2018-07-03 17:15:21', '2018-07-03 17:15:21'),
