(8946, 853, 411, 'Jobs in KSA', 'Professional Family in Khobar, Saudi Arabia Looking for an English Speaking Nanny for their 12 year old and 14 year old | ASAP Start Date\nJob ref: Nanny/T/SauA\nA VIP family in Khobar, Saudi Arabia are looking for a Nanny/Governess to care for and educate their 12 year old and 14 year old daughters.\n\nBoth girls are in full-time school, but their parents would like someone who can help with a pre-school and after-school routine, help with manners, English language refinement, accent, attitude and behaviour. As well as assisting the girls with their homework and ensuring they have everything they need for school.\n\nThe nanny will be working 12 hours a day 6 days a week, although there may be some down time whilst the girls are in school, with one day off a week. The family are happy to pay the successful candidate up to £1200 pw. The nanny will be living in the family home.\n\nThis is a lovely position for a nanny experienced with older children happy to assist with their education.\nRequirements\nLocation\nSaudi Arabia\nStart date\nASAP\nDuration\nPermanent\nSalary\nup to £1200 pw\nHours\n12/6\nLanguages\nEnglish\nPermanence\nPermanent\nChildren\nFemale/14 years old, Female/12 years old,\nExperience\nEssential\nDriving licence\nNot Essential\nNon smoker\nEssential\nShared care\nYes\nSole charge\nYes\nAccommodation Details\nBasis\nLive-in\nAccommodation\nThe nanny will be living in the family home.\nFamily residence\nHouse\nOther Details\nNursery duties only\nNo\nExpecting a baby\nNo\nAny special needs?\nNo\nBoth parents work\nYes', 492, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=15b07e733ca666cc&from=serp&vjs=3', '2018-07-03 17:15:21', '2018-07-03 17:15:21'),
