(8950, 854, 1053, 'Jobs in KSA', 'A family is looking for a Full Time Live in Nanny in Riyadh, Saudi Arabia. The family is looking for someone who has experiences with babies, the working hours for this position will be 6 days per week, full time, with some flexibility.\n\nThe Live In Nanny will be responsible with nanny and nursery duties such as,\nchanging nappies,\norganising child’s daily schedule,\ncleaning and sterilising bottles,\nplaying with the child,\npreparing health baby foods,\nmaking sure the child is always happy and safe,\nand maintaining a clean and tidy environment for the child.\n\nThe family is looking for someone who has experienced working abroad. Someone who speaks French is advantageous but not required. The family is happy to wait for the right person to join them.\n\nTo learn more about this position, please complete the form below and a consultant will contact you with more information.\nPosition ID: 2023454', 866, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=c3919d797f0ff568&from=serp&vjs=3', '2018-07-03 17:15:21', '2018-07-03 17:15:21'),
