(8955, 859, 411, 'Jobs in UAE', 'English-Speaking Nanny Role in Dubai for Knowledgeable Nanny | ASAP Start\nJob ref: N/Dubai/3C\nA member of the Abu Dhabi royal family are seeking an English-speaking, experienced nanny to care for their 3 children aged 6, 5 and 2.5 years old.\n\nThe role will be working 12/6 and on a shared care basis, as each child has the support of a local nanny providing 24 hour cover.\n\nThe main duty of this role is to be the head nanny, responsible for the local nannies, as well as educating the children.\n\nFurther duties include planning the children’s day-to-day, reporting back to the mother with the day’s activities. The nanny will be in charge of the children’s wardrobes, keeping them organised and shopping for necessary items.\n\nThe children attend a British School in Dubai so the nanny will be performing the school runs, liaising with school teachers and attending school activities. The school follows the British National Curriculum, but also leans on different approaches to teaching such as the Montessori method. A nanny who has experience with the Montessori method and teaching children literacy through phonics will be highly regarded.\n\nThe family travel throughout Europe and have a family home in London so the nanny will be expected to travel with the family. The family also spend their weekends with family in Abu Dhabi or Umm Al-Quwain.\n\nThe family are looking for a nanny who will be an educational asset to the children and a nanny that is reliable and organised as well as caring and creative.\n\nThe family will provide the nanny with a separate apartment within the family compound, the nanny will also be provided with a car once passing the 2-month probationary period.\n\nThe salary is £900 -£1100 per week with an ASAP start date.\nRequirements\nLocation\nDubai\nStart date\nASAP\nDuration\nPermanent\nSalary\n£900 - £1100\nHours\n12/6\nLanguages\nEnglish\nPermanence\nPermanent\nChildrenExperience\nEssential\nDriving licence\nPreferred\nNon smoker\nEssential\nShared care\nYes\nSole charge\nYes\nAccommod', 492, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=c287c650ace3cf94&from=serp&vjs=3', '2018-07-03 17:15:23', '2018-07-03 17:15:23'),
(8956, 860, 411, 'Jobs in UAE', 'Baby Nanny Needed in Dubai | September Start | Separate Flat Provided\nJob ref: Nanny/Dubai\nA VIP Royal Family in Dubai are looking for an English speaking nanny to care for their 6 month old daughter.\n\nThe family are looking for a nanny who is experienced with babies and the milestones associated with such a young child.\n\nThis is a fully staffed household so no nursery duties are required. The family also employ an English speaking Nanny who cares for the family’s eldest child.\n\nThe family would like their nanny to work 24/6, whilst working the nanny will be sharing a bedroom and bathroom with their daughter. On her day off the nanny will stay in a separate flat which will also be used by the other nanny on a different day.\n\nThe family would expect their nanny to travel with them, in the near future they have trips planned to Italy and London.\n\nThe family are interested in finding the right match – someone flexible, caring, helpful, open & willing to work as a team.\n\nThe current nanny is placed by Nannies Incorporated and is friendly and professional and describes the family as “lovely”. This role would suit a confident nanny who can lead confidently as she will be working alongside two Filipino qualified baby nurses who have been with the family since the baby was born.\n\nThe family are offering a salary of £1000- £1200 per week. September Start Date.\nRequirements\nLocation\nDubai\nStart date\n21/06/2018\nDuration\nPermanent\nSalary\n£1000 - £1200 per week\nHours\n24/6\nLanguages\nEnglish\nPermanence\nPermanent\nChildren\nFemale/6 month old, Male/3,\nExperience\nEssential\nDriving licence\nNot Essential\nNon smoker\nEssential\nShared care\nYes\nSole charge\nNo\nAccommodation Details\nBasis\nLive-in\nAccommodation\nSeparate Flat Provided\nFamily residence\nHouse\nOther Details\nNursery duties only\nYes\nExpecting a baby\nNo\nAny special needs?\nNo\nPets\nNo\nBoth parents work\nNo\nAny babysitting\nYes\nBabysitting nights per week\n6', 492, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=50437088d4a221a7&from=serp&vjs=3', '2018-07-03 17:15:23', '2018-07-03 17:15:23'),
