in a separate flat which will also be used by the English speaking nanny on a dif', 492, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=2ea6174476455dd5&from=serp&vjs=3', '2018-07-03 17:15:23', '2018-07-03 17:15:23'),
