chool or equivalentLocation:Scotts', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Advanced-Cleanroom-Microclean/jobs/F-T-or-P-T-Cleanroom-Cleaner-6e82ba95dd039987?sjdu=Zzi_VW2ygsY1fzh3Ma9ZsE4zIT1NTXCwgFBhd', '2018-07-04 13:09:07', '2018-07-04 13:09:07'),
(8964, 787, 550, 'Jobs in USA', 'We do commercial janitorial cleaning. So most of our cleaning happens after 5pm when commercial buildings are closed. Usually you will be working alone or with one other cleaner. Most work will be in airconditioned buildings. Physical work needed as common tasks are vacuuming, dusting, wiping down surfaces, mopping etc. Most work is part-time and in the evening. Perfect for college students or those looking for a second job.A ServiceMaster T-Shirt must be worn at all times while on the customer\'s property (this is provided). Neutral colored pants and work shorts are allowed (i.e. black, khaki, brown, navy blue, tan). Shorts should reach to at least 2 inches above the knee or lower. Tennis shoes are acceptable.Most positions require that you find your own transportation to and from the job site. On occasion, there are openings in our \"route\" division where you drive to multiple locations each night. These positions pay $.54 per mile for travel with your own vehicle. You must have your own insurance.We are 100% female owned and operated. We are an equal employment opportunity employer. We adhere to a policy of making employment decisions without regard to race, color, religion, gender, sexual orientation, national origin, citizenship, age, height, weight, or disability. We assure you that your opportunity for employment with us depends solely on your qualifications.All new hires will take online training teaching them about on the job safety and procedures. They will also receive at least 3 days of on the job training before being set out on their own. Managers are available at all times via text message if any concerns come up. Further training is available if interest is expressed. This training includes becoming a certified carpet cleaner, hard surface floor training as well as management training.Each position is unique. Some work weeks are less than 10 hours a week. Other positions are as much as 20 hours a week. Most are part-time. No vacation is offered for par', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/ServiceMaster-Facilities-Maintenance-by-AP-Property-Solutions/jobs/Cleaning-Technician-682a1f2a4d1f3679?vjs=3', '2018-07-04 13:09:07', '2018-07-04 13:09:07'),
