(8969, 283, 322, 'Jobs in UAE', 'Pool Cleaner\nPrimary Location\n: United Arab Emirates-Fujairah-Fairmont Fujairah Beach Resort\nEmployee Status\n: Regular\nPool Cleaner\n\nFostering the health and wellbeing of our guests, visitors and Colleagues is an integral part of our Fairmont Hotels & Resorts culture. While our guests are swimming, the water cleanliness and high hygiene standard you provide as a Pool Cleaner will make them feel valued.\nHotel Overview: Located on the east coast of the United Arab Emirates with sweeping views of the Gulf known for its natural beauty set against the backdrop of the historic Hajar Mountains. The hotel consists of 180 rooms and residences, along with a marina and beach club.\nSummary of Responsibilities:\n\nReporting to the Pool Technician, responsibilities and essential job functions include but are not limited to the following:\nConsistently offer professional, friendly and engaging services\nWelcome guests to the pool facility and ensure they have a safe and enjoyable experience\nDiagnoses and maintains public swimming pools hygiene , whirlpools and other water features at the hotel premises.\nMaintain the proper chemical balance for the pool .\nMaintain the pool area including cleaning of the deck and other tasks.\nRespond to swimming pool related cleaning orders in a timely, friendly and efficient manner..\nCarrying out scheduled water cleaning, using chemicals like chlorine.\nRegularly testing swimming pool water quality and pH balance .\nMaintains manual or automated records of all cleaning and maintenance activities and prepares daily / weekly / monthly reports .\nOperates and inspects tools and equipment and makes minor adjustments and repairs.\nFixing lights above and below water level.\nUse swimming pool vacuum cleaners to clean the pool floor.\nChecking and repairing corrosion, cracks and leaks in the pool walls or floors.\nUse a telescopic pole with net to clean and remove any leafs or derbies .\nMaking sure equipment