(8971, 690, 1061, 'Jobs in USA', 'The work of the Aircraft Cleaner classification, depending on assignment, includes any or all of the following; performing aircraft interior cleaning, including equipping the aircraft cabin for flight according to specifications, with equipment and cabin services supplies; cleaning interior of aircraft by hand or powered equipment using cleaners; completion of the aircraft cleaning bill of work as required; stocking and cleaning of vehicles used in the cleaning functions; stocking and cleaning of the cabin services make-up rooms area; stocking and maintaining cabin services kits; disposing of trash, rubbish and waste that is incidental and related to the applicable job functions.\n\nAs may apply to work assignments, using cleaning fluids and materials, such as washing solutions, scrapers, squeegees, wringer pails and vacuum cleaners. Completes forms connected with work assignments according to established procedures.\n\nAs may apply to any particular work assignment, will complete additional jobs as directed by managements, and will work according to Company policy and/or regulations.\n\nIt is understood and agreed that the Company will determine the need and use of the Aircraft Cleaner classification, pursuant to customer contract needs. In those situations where it is determined that the Aircraft Cleaner classification is not needed, the above work will continue to be performed by the Ramp Service Clerk classification. This position is covered by a collective bargaining agreement.\n\nComply with WFS site security procedures for assigned warehouse and other operations. Remain cognizant of WFS staff, security contractors, and visitors’ activities and report security breaches, suspicious occurrences, or non-compliance with the site security plan to managers or via the WFS whistleblower program.\n\nRequired Skills\nEquip airplane cabin, by reading check list specifications, with equipment and supplies such as rugs, linens, blankets, etc., as well as carrying supplies weighing up', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=3522139c87af0f08&from=serp&vjs=3', '2018-07-09 07:58:32', '2018-07-09 07:58:32'),
