(8976, 88, 1077, 'Jobs in UAE', 'Join Nalco Champion, an Ecolab Company Supply Chain team as a Customer Service Representative in Dubai, UAE and help make the world cleaner, safer and healthier. We’re growing and need talented people like you to help us continue to protect the world’s most vital resources.\n\nIn this role, you will be a vital partner in delivering satisfaction to Ecolab Energy Services customers in a sustainable and profitable manner.\nWhat’s in it For You:\nThe opportunity to take on some of the world’s most meaningful challenges, helping customers achieve clean water, safe food, abundant energy and healthy environments\nThe ability to make an impact and shape your career with a company that is passionate about growth\nThe support of an organization that believes it is vital to include and engage diverse people, perspectives and ideas to achieve our best\nWhat You Will Do:\nFollow safety policies to provide a safe workplace for all employees and support the guiding principles of Goal Zero to continually improve the plant’s safety, health and environmental performance, security, and efforts to respond to public concerns relating to design, development, manufacture, storage, marketing, distribution, use and ultimate safe disposal of chemical products.\n\nDrive culture of safety; report safety observations and incidents\n\nSupport and is committed to the Quality Improvement Process. Plans strategies to ensure error-free work by “doing it right the first time” and conveys this attitude in the daily performance of various duties, in our drive continuous improvement.\n\nEnter Customer Orders and provide confirmation to the customer and sales team.\n\nEnsure that product price is aligned with the Nalco Champion price list.\n\nCoordinate with the credit team for clearing credit/ delivery holds.\n\nProvide Sales and Customer of the Shipping Updates.\n\nCoordination with the planners to ensure that requested delivery dates are met.\n\nReview Letter of Credit to confirm that all criteria are aligned with Nalco Cham', 629, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=8bf351ec4d96d648&from=serp&vjs=3', '2018-07-09 07:58:34', '2018-07-09 07:58:34'),
(8977, 874, 1078, 'Jobs in Qatar', 'The Laundry Attendant must maintain and control a high level of guest service achieved by ensuring consistent and thoughtful service.\nFour Seasons Hotel Doha:-\nGazing over the Arabian Gulf, with a private beach and marina curving at its feet, Four Seasons Hotel Doha is a traveler’s haven fashioned to the finest international standards. It is the centerpiece of Doha’s outstanding waterfront landmark, the West Bay business and residential complex. Four Seasons is home to 232 guest rooms overlooking land and sea, nearly a quarter of which are suites. With refreshing contemporary elegance, the accommodations are enhanced by carefully detailed comforts and 21st century conveniences.\nAbout Four Seasons:-\nFounded in 1960, Four Seasons continues to define the future of luxury hospitality with extraordinary imagination, unwavering commitment to the highest standards of quality, and the most genuine and customized service. Currently operating 106 hotels and private residences in major city centers and resort destination in 43 countries, and with more than 60 projects in development, Four Seasons consistently ranks among the world’s best hotels and most prestigious brands in reader polls, traveler reviews and industry awards.\nFour Seasons Hotels and Resorts has been recognized by FORTUNE Magazine’s 100 Best Companies to Work for, every year since the survey began in 1998.\nIn the words of Isadore Sharp, Founder and Chairman of Four Seasons Hotels and Resorts:\n“The reason for our success is no secret. It comes down to one single principle that transcends time and geography, religion and culture. It’s the Golden Rule – the simple idea that if you treat people well, the way you would like to be treated, they will do the same.” This philosophy is the cornerstone of the Four Seasons culture, truly making Four Seasons the best company to work for.\nOur Team:-\nOur team is our greatest asset and the key to our success. We demonstrate our beliefs in the way we treat each other and by the', 499, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=3ddce928dc14047c&from=serp&vjs=3', '2018-07-09 07:58:34', '2018-07-09 07:58:34'),
