(8981, 877, 1083, 'Jobs in USA', 'Boys Hope Girls Hope of Arizona helps good kids in tough situations beat the odds.By providing family-like homes in safe neighborhoods, a first-class education in top-rated schools, and comprehensive college preparation, we empower children of poverty and potential to triumph over their circumstances, become successful, and grow up to give back to their communities.As a live-in House Parent at our Residential Home, you\'ll provide the most fundamental need of all. You\'ll help build the loving and supportive family dynamic and home environment that all children need to feel secure. We are looking for team members who are eager to learn, responsible, and dependable. Ideal candidates will be comfortable working with teenagers, and will have the ability to enforce structure that encourages growth, productivity, and fun! We have an opening in our Girls Home and our Boys Home.You and other committed staff members will:Create an environment of achievement by guiding our scholars in college preparation and educational excellence;Provide for our scholars\' physical, emotional, and spiritual needs;Help provide new opportunities and activities;Build relationships with families and volunteers;Model a healthy and responsible lifestyle by providing discipline, organization, and compassion.Qualified applicants will be at least 21 years of age; hold a Bachelor\'s degree from an accredited college in social work, psychology, counseling, education, or a related field; and will have experience in serving a similar population equal to at least one-year full-time work. A valid driver\'s license is also required.This position requires living in the home with the youth, so be sure you can make that commitment before responding.Live-in staff members receive private, furnished living quarters, and meals at no cost; a competitive compensation and benefits package including group medical and dental coverage, 401(k) retirement savings plan, tuition reimbursement, life insurance, long-term disabili', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Boys-Hope-Girls-Hope-of-Arizona/jobs/House-Parent-e0e4d3232c5f46d8?vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
