be pass a background check.- Be abl', 806, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Darlaloo\'s-Pet-Services,-LLC/jobs/Dog-Walker-Pet-Sitter-3fbd8d3fb7ca88b6?vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
(8984, 880, 1086, 'Jobs in USA', 'Mission of the Anchor House:To provide a safe and supportive community where single moms and their children can receive holistic healing and restoration.Job Description: This job is a live-in positionand serves along at-risk families. There are 3 days a week this position is on-call and required to be at the home and available for any needs that arise (e.g., transporting family to doctor’s appointment, giving a tour of the home to community, conflict resolution with moms in home, organizing any donations that come in).Help create a family environment and culture for women and families to receive healingLive in community with single moms and children providing support and mentorship to healthy family dynamics, child rearing practices, life skills, and conflict resolutiong., weekly meals together, group family meetings and celebrationsAct as the contact person (providing one-one-one support, guidance, and discipleship for specific moms in the home)Meet weekly with moms to work with personalized goals progressAssume some administration duties (e.g., volunteer coordination, donation management, household operations)Facilitate the daily schedule and routine of the houseRequirements: Must be a follower of Jesus ChristBe able to pass a criminal background checkValid drivers licenseReport to: Anchor House ManagerCommit to a 1 year of serviceCompensation: This position is provided a small stipend with room and board provided as well.Job Type: Part-timeExperience:working with vulnerable families or non-profit: 1 yearLicense:Driver\'s License', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Anchor-House-Transitional-Housing-Shelter/jobs/House-Parent-7b93247e34f125f8?vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
(8985, 881, 1088, 'Jobs in USA', 'High & Rye is looking to add a few new team members to our Front of House crew. There are serving, bartending, and support staff positions available. We are looking for experienced restaurant industry employees that want to take the next step in their career. We are an independent restaurant that offers upper-scale family-style comfort food and a full bar featuring over 100 different types of whiskey. These are not entry-level positions, we expect servers and bartenders to have years of experience in high-volume full service restaurants. We are looking to start training new staff members so that by the time the busy season gets here you can hit the ground running. Get your foot in the door now with one or two shifts a week with more work opening up come September. Please reply to this email with a resume if you are interested.Job Type: Part-time', 885, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/High-&-Rye/jobs/Front-House-Staff-97fbfde5d91a67fd?vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
