inate the preparation of all listin', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/AZ-Real-Estate-Consultants/jobs/Executive-Assistant-66359715e621ff89?vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
(8987, 883, 1091, 'Jobs in USA', 'Digital Forensics Corp., a national industry leader in the exciting field of digital forensics, is currently hiring full-time Forensic Analysts for Shaker Heights, Ohio location (possibility to work remote)\nDFC works with corporations, attorneys, private investigators, and individuals to uncover digital evidence to support civil, criminal and business investigations. DFC is dynamic North American leader in an industry currently experiencing rapid growth, with offices across the United States. DFC’s offers employees the opportunity to learn and advance within the company, while learning about the leading-edge technology associated with cyber-security and digital forensics.\nDue to growth, a need has been created for additional Forensic Analysts. You will be working in a team of forensic and eDiscovery experts to maintain Advanced Discovery’s high standards in the area of eDiscovery document handling and processing.\nYou will be expected to:Work closely with the Project Management Team to acquire data for project processing, delivery and analysis.Work closely with the Forensic Team, ESI and Consultants to provide sound forensic analysis, up to, and including producing witness statements or court evidence.Maintain accurate notes relating to the acquisition, processing and delivery of data in accordance with our robust QA procedures.\nRequirements\nEssential Skills:\nKnowledge of computer systems, storage, and network infrastructure.Forensic Computing knowledge including a detailed knowledge of the ACPO Guidelines, data collection and preservation techniques.Proven record of forensic collections, investigations, precise contemporaneous notes, and report writing.Cellebrite or other mobile phone collection experience or certification.\nMastery of concepts in at least two of the following domains: NTFS file system forensics, memory forensics, Linux forensics, scripting, cloud computing technologies, networking and network security.Preferred Skills:\nMore than 2 years within the D', 886, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=3ccc3b94e101bcbd&from=serp&vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
