get\ncontrol and schedule control.\n3. Generating re', 888, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=87bff0dd75afa1b4&from=serp&vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
