present the company in meetings with Oman Officials to get a', 889, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=11de6ad776e2338a&from=serp&vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
(8991, 886, 1095, 'Jobs in Oman', 'It takes a very special kind of person to work at Shangri-La.\nSomeone with an eye for detail and the skills to perform.\nSomeone with an attitude to deliver and a passion to delight.\nJob Summary\nThe Service Manager – Concierge provides guest services as well as supervision, direction and leadership in the Concierge in accordance with the objectives, performance and quality standards established by Shangri-La Hotels and Resorts and the hotel.\nKey Responsibilities\nTo have complete knowledge of policies and procedures for the Concierge/Transportation department.\nTo have knowledge about Opera system.\nSupervises the Concierge operation and work flow to maximise guests’ satisfaction.\nIdentifies staff training requirements and service improvements areas.\nBuilds relationship with guests to delight and gain loyalty.\nMaintains and enforces all quality standards and procedures from guest’s pre-arrival, to guest’s arrival, to guest’s in-house stay to guest’s departure.\nCoordinates all luggage deliveries and collections.\nEnsures that all equipment is properly cleaned and maintained.\nManages the budget and forecast of Concierge/Transportation.\nReviews and manages monthly Concierge expense and cost.\nShangri-La Barr Al Jissah Resort & SpaMuscat, Sultanate of Oman\nNestled in between the dramatic backdrop of rugged mountains and the pristine waters of the Sea of Oman, Shangri-La’s Barr Al Jissah Resort and Spa is set on 124 acres of stunning scenery and home to three spectacular hotels: the family orientated Al Waha comprises 262 rooms, the diverse Al Bandar comprises 198 deluxe rooms and the luxurious and most exclusive Al Husn has 180 elegantly appointed guestrooms and suites. The resort also features 22 Food and Beverage outlets, 1,056 sqm ballroom with 8 breakout rooms, wide variety of recreational facilities, and a spa with 12 treatment villas.\nThe resort is only 15 minutes to Muttrah Souk, the old city of Muscat, the Ruwi business district, and within easy access to many local s', 890, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=ba1f9694a890610c&from=serp&vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
(8992, 887, 1095, 'Jobs in Oman', 'Better Ingredients. Better Pizza.\nDive into any of the range of Papa John’s delicious pizza with its tangy garlic sauce and super toppings and enter a vast world of flavours!\nCommitted to quality, only the finest ingredients are used - from fresh-sliced vegetables to fresh hand-tossed dough and superior quality tomato sauce – there’s no compromise. Vine-ripened tomatoes, grown in the rich, fertile valleys of central California and packed within an average of six hours after harvesting, give the sauce a rich and unique flavour! Because the vegetables are sliced fresh daily, never vacuum-packed or pre-cut, they are always crisp and flavourful. Unlike every other pizza chain, the pizzas are prepared with fresh, hand-tossed dough every single day!THE ROLE\nAttend to all job functions related to the preparation of menu items as well as any other duties delegated by the supervisor.KEY RESPONSIBILITIES\nFollows the methods of preparation and adheres to specific product prep and handling procedures.\n\nAdheres to all company safety and sanitation policies and procedures.\n\nMaintains cleanliness throughout the kitchen. Cleans and sanitizes throughout the shift.\n\nCompletes assigned prep work to stock and set up stations as necessary.\n\nBreaks down, and cleans station or work area at end of shift.\n\nEnsures proper rotation of all products and stocks product to par.SKILLS AND EXPERIENCE\nWith good English communication skills.\n\nWith 1 to 2 years work experience from a restaurant as a kitchen crew or kitchen steward.\n\nMust be a team player and can work under pressure with no time constraints.', 890, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=9a341722dce4e077&from=serp&vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
