(8996, 891, 1099, 'Jobs in Oman', 'Recruitment for PMP CERTIFIED PROJECT MANAGER (EPC security projects) - Oman\nFINAL INTERVIEW SHORTLY AT MUMBAI, CHENNAI & BANGALORE\nExcellent Salary Package\nCandidate Profile\nQualification - Professional Engineering Graduate in Electrical, Electronics,\nInstrumentation, Communication, IT\nExperience -\nPMP Certified Engineering Graduate with minimum 10-12 years of relevant\nexperience in managing major turnkey EPC security projects, and mandatory\n2 years of Gulf Experience as Project Manager for managing Integrated\nSecurity projects.\nMANDATORY experience of 4 years Oil & Gas Industrial security projects\nexperience, atleast in 2 major Oil & Gas (Or) Petrochemical EPC Security\nprojects as Contract/Project Manager position. Each project must be\nminimum value of 10m US$ Integrated Security package (duration not less\nthan 1 year).\nThe ELV products include Industrial & Commercial CCTV, Integrated high end\nAccess Control, Fire Alarm, Intruder Alarm, PAVA systems, Physical Control\nEquipment, PIDS, BMS, A/V systems, ISMS, SMATV, VDP, Gate Automation &\nresidential systems, etc.\nIn addition, the incumbent MUST have related in-depth knowledge on IT & Telecom systems inclusive of database management, Fiber systems, Server & Storage systems, Active & passive components, operating systems, IP domain, redundancy operations in connection with ELV systems specified above.\nThe candidate must have handled EPC security jobs inclusive of civil,\nelectrical and telecom works. Civil works such as foundation, trenching,\ngates, fencing, security building and guard house etc are mandatory.\nKey Job responsibilities and duties\n1. Manage the project operations completely from Design to financial sign-off.\n2. Contract Owner of assigned projects and responsible for cost/budget\ncontrol and schedule control.\n3. Generating revenues from project variations and improve project margin.\n4. Responsible for resolving all project constraints and resource management as\nrequired.\n5. Responsible for project deliver', 894, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=06fb7a681a31ea87&from=serp&vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
