(8998, 893, 1101, 'Jobs in KSA', 'المُساهمة في إعداد خطط الشّركة بشكل عامّ، وقسم إدارة الموارد البشريّة بشكل خاصّالإشراف على تنفيذ الخطّة التشغيليّة للشّركة، وضمان تطبيقها بالشّكل الأمثل والجودة الأعلىالمُساهمة في حصر وتحديد احتياجات الشّركة من المُوظفين والعاملين بناءً على الهيكل التنظيميّ للشّركة، ومُتابعة طلبات التّوظيف الواردة للشّركة، ومُقارنتها بالمواصفات المطلوبة لكلّ شاغرترتيب طلبات التّوظيف المُقدَّمة للشّركة، وإجراء المُقابلات مع المُتقدّمينتنظيم عقود العملترتيب وجدولة نظام الإجازات الخاصّ بكلّ مُوظّف في الشّركة بشكل مُنتظمتنظيم ومُتابعة كلّ الإجراءات المُتعلّقة بالمُوظّفين، مثل الإعارات، واستحقاقات النّقل من فرع لآخر، والانتداب، والتّرفيعات داخل الشّركة، والإقالات، والحوافز، مع توثيقها بدقّة في الملفّاتاعداد وتسليم كشوفات الرّواتبمُتابعة تقييم العمالة، واتّخاذ كافّة التّدابير والإجراءات اللّازمة بناءً عليهامُتابعة مشاكل العاملين كاملةً والسّعي لحلّهاالقيام بأيّة مَهامٍ أو أعمال أُخرى تُناط به من قِبَل المدير العام.Skills\nأن يمتلك مهارات التّنسيق والتّنظيم والتّخطيط، ويُتقن فنّ التّعامل مع الآخرينأن يكون على اطّلاع ومعرفة بجميع القوانين والأنظمة الخاصّة\nبالشّركة مع الالتزام بهاأن يكون قادراً على التّحليل والتّفكير، وفهم المشكلات وإيجاد\nالحلول السّريعة والعمليّة لهاأن يُتقن مهارات الحاسوب واللّغة الإنجليزيّة بطلاقةأن يكون قادراً على إعداد التّقارير الشهريّة والسنويّة الخاصّة\nبالعاملين، وقادراً على المُتابعة الدّائمة لهاأن يجتهد في تطوير نفسه ورفع كفاءته العمليّة\nمدير شؤون موظفينMy Little House\nJob Description\nالمُساهمة في إعداد خطط الشّركة بشكل عامّ، وقسم إدارة الموارد البشريّة بشكل خاصّالإشراف على تنفيذ الخطّة التشغيليّة للشّركة، وضمان تطبيقها بالشّكل الأمثل والجودة الأعلىالمُساهمة في حصر وتحديد احتياجات الشّركة من المُوظفين والعاملين بناءً على الهيكل التنظيميّ للشّركة، ومُتابعة طلبات التّوظيف الواردة للشّركة، ومُقارنتها بالمواصفات المطلوبة لكلّ شاغرترتيب طلبات التّوظيف المُقدَّمة للشّركة، وإجراء المُقابلات مع المُتقدّمينتنظيم عقود العملترتيب وجدولة نظام الإجازات الخاصّ بكلّ مُوظّف في الشّركة بشكل مُنتظمتنظيم ومُتابعة كلّ الإجراءات المُتعلّقة بالمُوظّفين، مثل الإعارات، واستحقاقات النّقل من', 896, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=fdf730c043eacf61&from=serp&vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
