(9001, 896, 1103, 'Jobs in KSA', 'Overview / Responsibilities\nWood is currently looking for a Document Controller to work out of our office in Al-Khobar, Saudi Arabia. This position will be part of our COTC core team and is expected to last for approximately twelve months.\nOur clients are setting up a new Joint Venture business which will take crude oil and produce a wide range of bulk chemical products. The project will be a first of a kind investment with a fully integrated 600,000 bpd refinery and chemicals complex including two parallel ethylene crackers, and with limited co-production of fuels. All the individual parts of the project will be world scale, and the integration will deliver world beating production efficiency. The TIC is likely to be of the order of $20-$25 Billion making it one of the largest ever single-phase investments in the petrochemicals industry.\nBe familiar with Wood procedures\nDevelop and maintain document control processes for the efficient management and recording of all documentations\nReceive, check, accurately record into Wood internal document control system and distribute all project drawings and documentation in an efficient and expeditious manner as requested by engineers - this must be done per agreed Project and Corporate Procedures\nMonitor progress of in-house and Client reviews of technical data. Where required, input progress information (received from discipline engineers) accurately at regular intervals as specified by the project\nProduce reports on documentation and progress as requested. Ensure that hard copy and electronic record files as required are maintained in good order to comply with QA requirements\nContribute to compilation of final project dossiers, as built portfolios and archiving. Produce exception reports on late documentation for management review\nProcess and record accurately all technical documentation in accordance with agreed procedures. Maintain effective organization and storage of documents and information\nSet up an electronic librar', 898, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=06d1c11f416ca0cd&from=serp&vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
(9002, 897, 1104, 'Jobs in KSA', 'Training Co-ordinator\nRequisition ID\n: 1803165\nDescription\nSUMMARY:\nRecord and maintain control of Training Records. Develop and maintain in-house training and assessment procedures.\nPRIMARY RESPONSIBILITIES\n Perform induction process for new employees, including initial training on HSE and facility procedures. Assess training needs of new – and existing employees Collaborate with the HOD and Supervisors to develop suitable training programs for each position. Monitor and assess training progress of employees.\n Maintain and update training records\n Compare and select training vendors/trainers Collaborate with and coach employees to develop and revise training programs. Align current training practices to ISO requirements and demonstrate this alignment during audit Comply with all NOV Company and HSE policies and procedures.\nQualifications\n KNOWLEDGE AND SKILL REQUIREMENTS\n Bachelor Degree in any discipline, preferably Manufacturing, Business Administration or Human Resource Graduate Diploma in Training & Development would be an advantage Certified Human Resource Administrator 2 year experience in similar role Able to communicate in English. Arabic speaking is added advantage.\n Team work - Should be detail-oriented and be able to influence others.\nWORKING CONDITIONS\n Work will involve around 50% Administrative Duties and 50% attendance on the manufacturing work floor to perform employee assessment and training reviews.\nJob\n: Manufacturing\nSchedule\n: Full-time\nShift\n: Rotating\nJob Posting\n:', 899, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=1546fd31ad146688&from=serp&vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
(9003, 898, 1105, 'Jobs in KSA', 'الرئيسية\nمنوعة\nالسعودية\nجدة\nlooking for a full time housekeeper to work for me in Jeddah\nlooking for a full time housekeeper to work for me in Jeddah\nYou will be staying with my family which consist of my wife, 5 year old boy and 8mth baby. Help to look after the house with cleaning, washing, cooking and looking after my kids. I am a muslim family from Singapore. We speak english and malay language. Those interested to call or watsapp me at my number.', 900, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=0e1c1540ae2b5e3a&from=serp&vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
(9004, 27, 1106, 'Jobs in KSA', 'Welcomes visitors by greeting them, in person or on the telephone; answering or referring inquiries.Directs visitors by maintaining employee and department directories; giving instructions.Maintains security by following procedures; monitoring logbook; issuing visitor badges.Maintains telecommunication system by following manufacturer\'s instructions for house phone and console operation.Skills\nMust be Saudi national.Must have at least 1 year of experience.\nReceptionistConfidential Company\nJob Description\nWelcomes visitors by greeting them, in person or on the telephone; answering or referring inquiries.Directs visitors by maintaining employee and department directories; giving instructions.Maintains security by following procedures; monitoring logbook; issuing visitor badges.Maintains telecommunication system by following manufacturer\'s instructions for house phone and console operation.Skills\nMust be Saudi national.Must have at least 1 year of experience.\nJob Details\nJob Location:\nKhobar, Saudi Arabia\nCompany Industry:\nInformation Technology\nRequirements :\nEmployer (Private Sector)\nJob Role:\nSecretarial\nEmployment Status:\nFull time\nEmployment Type:\nEmployee\nPreferred Candidate\nCareer Level:\nMid Career\nYears of Experience :\nMin: 1\nResidence Location:\nEastern Province, Saudi Arabia; Jubail, Saudi Arabia; Khobar, Saudi Arabia; Dammam, Saudi Arabia; Qatif, Saudi Arabia; Hofof, Saudi Arabia; Hafr Albaten, Saudi Arabia; Alahsa, Saudi Arabia\nNationality:\nSaudi Arabia', 901, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=4f1dbed8a4b4948e&from=serp&vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
