(9006, 900, 322, 'Jobs in KSA', 'The Company\nWillis Towers Watson is a leading global advisory, broking and solutions company that helps clients around the world turn risk into a path for growth. With roots dating to 1828, Willis Towers Watson has 40,000 employees serving more than 140 countries. We design and deliver solutions that manage risk, optimize benefits, cultivate talent, and expand the power of capital to protect and strengthen institutions and individuals. Our unique perspective allows us to see the critical intersections between talent, assets and ideas – the dynamic formula that drives business performance. Together, we unlock potential. Learn more at willistowerswatson.com.\nThe Business\nTalent & Rewards helps organizations get the right people in the right places, doing the right things, at the right cost. Through a broad set of services and products, we help clients define and deliver on their human capital strategy.\n\nUsing a foundation of data, research and analytics we provide clients insights into their employees, industry and workplace practices. We draw on those insights to help shape and implement solutions that yield measurable results.\nWe deliver a client experience unlike any competitor when we connect our consulting across issues and across practice areas. Our work is guided by a unique consulting framework.\n\nTalent & Rewards includes deep expertise in the following practice areas:\nExecutive Compensation: we help clients make sound decisions about how and how much to pay their senior executives.\nGlobal Data Services: GDS is the center of excellence for compensation, benefits and employment practices information.\nOrganisational Survey & Insights: we design and administer surveys to improve employee engagement, shape a high-performance culture and maximize the return on talent investments.\nRewards, Talent and Communication: we combine skills in change management, organizational effectiveness and communication to help ensure clients’ pay and other reward programs drive employ', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=d8a75ef29d772ab5&from=serp&vjs=3', '2018-07-10 16:56:32', '2018-07-10 16:56:32'),
(9007, 901, 1107, 'Jobs in UAE', 'Position: Social Media Manager\n\nLocation: Dubai\n\nSalary: AED 11K+ Benefits\n\nCVs to MariaATmacgroup.me\n\nResponsibilities:\n\nAs a social media manager, you’ll need to:\nDevelop a social media strategy and set goals to increase brand awareness and increase engagement\nManage all social media channels such as facebook, twitter, pinterest, google + and instagram\nPlan content and delivery and use tools like hootsuite and asana to manage multiple social media channels\nDevelop and manage competitions and campaigns that promote your organization and brand\nWrite engaging blog posts and articles\nCreate engaging multimedia content such as videos, and/or outsource this effectively\nForm key relationships with influencers across the social media platforms\nManage and facilitate social media communities by responding to social media posts and developing discussions\nMonitor and report on performance on social media platforms using tools such as google analytics\nEducate other staff on the use of social media and promote its use within your company (in-house roles)\nRegularly liaise with clients via telephone, email, conference calls or face-to-face\nAdvertisements', 902, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=0d1fd7841c1b89a9&from=serp&vjs=3', '2018-07-10 16:56:34', '2018-07-10 16:56:34'),
(9008, 902, 1108, 'Jobs in UAE', 'About the Role\nWe are looking for a strong School HR Officer to lead on and manage all aspects of Human Resources within GEMS Wellington Primary School.\nYou will need to:manage all day to day operations of the Human Resources school office. Manage and oversee Human Resources policies, procedures and systems to ensure consistency and compliance\n\n*\nAdvise and support Principal, management and staff on UAE Labour Law regulations and compliance. Be a source of expertise within school on issues relating to Employment Law, HR Policies and Human Resources best practice\n\n*\nSupport the Principal in managing Employee Relations issues - including performance issues, disciplinaries, grievances and terminations. Ensuring employee relations issues are handled effectively in accordance with UAE Labour Law and GEMS Policy\n\n*\nPrepare employment contracts and maintain all personal files of employees in coordination with the PRO and Ministry of Labour/Education requirements and in accordance with GEMS Compliance guidelines and audit criteria. Participate in HR Audits and lead on responsibility for post-Audit Action Plan to address areas of improvements in Compliance\n\n*\nSupport and communicate effectively with new employees during the pre-hire onboarding period to ensure a smooth and effective joining process\n\n*\nDesign and conduct new employee orientations to explain school and HR policies, benefit programs, code of conduct, etc.\n\n*\nAdminister and explain insurance benefits to employees, serve as liaison between employees and insurance carriers. Support employees with insurance related and medical issues.\n\n*\nMonitor attendance and absence levels and report/escalate issues to Principal. Ensure consistent and transparent approach in handling attendance, leave and absence in school.\n\n*\nResponsible for recruitment of non-Education roles in school including admin, front of house, IT, finance and operations. Manage end to end recruitment process including advertising (internal and external),', 903, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=78f633541c803f2a&from=serp&vjs=3', '2018-07-10 16:56:34', '2018-07-10 16:56:34'),
(9009, 903, 1109, 'Jobs in UAE', 'Job DescriptionScope of Position:\nProvide support to customers and distribution clerical staff to ensure efficient daily operation of all distribution accounts.\nMajor Duties and Responsibilities:Receiving cisco shipments both documents and non-documents.Updating the On hand sheet, by capturing all details that would be required to process any outbound documentationFiling all shipment documentation in an orderly manner that is easily retrievable.Notifying the respective Cisco employees of shipments that arrived for them.Maintaining the Cisco store room in an organized manner.Conducting periodic counts just to make sure of stock integrity.Receiving orders from Cisco employees.Processing the orders and preparing the necessary documentation and back up.Coordinating with forwarder or courier companies for pick up.Updating the On hand sheet, by capturing all details pertaining to the outbound shipment.Preparing the billing back up at the end of each month for billing.Submitting invoices to Cisco.Following up on Invoices to make sure they are approved and will be settled on time.Escalating to the department manager whenever there are issues of any kind.\nRemote Distribution department tasksPerform the customer\'s transactions based on the SOPCoordinate with team members to ensure proper transition of tasks and completion of the full transaction processEDMS user, responsible for capturing transaction details correct, complete and on timeParticipates in team, service provider and customer meetings, whenever necessary to communicate concerns, instructions and resultsParticipate in the operation of VAS whenever requiredResponsible to complete assigned reporting correct and on timeEnsure KPIs and capacities are metCoordinate and negotiate with suppliers (jointly with manager)Making sure that all Inbound and Outbound documentation (PODs, customs documents, etc…) are properly filed in an easily retrievable manner.Assist team members in daily op