(9013, 907, 1112, 'Jobs in UAE', 'The Role\nOur client is a relatively new medical clinic based in Dubai, and they are currently looking to recruit a Receptionist/Patient Coordinator. The role will involve basic reception duties including answering calls, greeting visitors, managing appointments and liaising with patients. The role will be five days per week with alternate Saturdays required and working hours will be based on the clinics opening hours.\n\nRequirements\nCandidates should: • Have a minimum of two years\' experience as Front of House • Preferably have experience in the healthcare industry • Be a native English speaker • Be competent in basic IT systems • Understand the concept of customer service • Arabic would be an advantage\n\nAbout the company\nWe are NOT just a recruitment agency. We are a PEOPLE\'S Company. A team of dedicated professionals who believe in the well-being of the individual. Cassia is a boutique healthcare recruitment company, offering high-value human resources to the growing demand of the Middle East medical industry. Our unique value proposition is based on placing highly qualified, experienced and well-prepared candidates from Western Nations into the rapidly expanding Middle Eastern healthcare market.', 907, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=846c7705c8657202&from=serp&vjs=3', '2018-07-10 16:56:34', '2018-07-10 16:56:34'),
