liness of the GEP office, meeting rooms and printer/p', 908, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=644677a748509e9f&from=serp&vjs=3', '2018-07-10 16:56:34', '2018-07-10 16:56:34'),
