(9036, 922, 1157, 'Jobs in KSA', 'The objective being the smooth co-ordination of the Reception, pro shop and provide assistance in membership sales when required. You will be the first impression of Arena. The role requires you to work within own initiative and as part of a team.\nEnvironment\n\nWorking in Reception and the pro shop at the Club you will represent Arena. Working in a demanding environment as part of a small team, dealing with all enquiries both in person and over the phone.\nCOMMUNICATION\nThe Customer Service Advisor must maintain constant communication with the Customer Service Manager on all aspects of club responsibilities and activities. It is paramount to the success of the club and company for the Customer Service Advisor to maintain an open line of communication on any issues relating to the club and its staff.\nOPERATIONAL & ADMINISTRATIVE RESPONSIBILITIES\nDaily interface with the Customer Service Team on the weekly schedule\nTo answer all incoming telephone calls and further their enquiry to the correct departments.\nTo perform the cashing up duties at the end of your shift and perform duties as required by your Customer Service Manager.\nTo take care of any lost property and log it in the lost properties folder.\nAccurately cash up at the end of your shift and account for all transactions during your shift.\nTo always wear your correct uniform and name badge.\nTo keep reception area free of litter as food and drinks are not allowed behind reception.\nTo coordinate all booking of treatments, personal training and orientations.\nTo be knowledgeable of all areas of the club i.e., timetables treatments, membership prices.\nTo provide a sales support to the sales team on tours or administration.\nTo support the Customer Service Manager and action reports and information required for weekly/ monthly meetings.\nHandle guest comments and complaints professional take ownership of the issues\nTo attend regular department meetings and to record minutes for the Club General Manager.\nTo always be polit', 929, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=87396322c68a7e5e&from=serp&vjs=3', '2018-07-12 18:07:29', '2018-07-12 18:07:29'),
