(9041, 927, 1169, 'Jobs in Qatar', 'الرئيسية\nمنوعة\nقطر\nالدوحة\nScrubs Cleaning Services\nScrubs Cleaning Services\nScrubs Cleaning is one of the original hourly cleaning companies in Qatar. We train our cleaners like no other company and your satisfaction is 100% guaranteed. We have grown tremendously based on our excellent service and high customer satisfaction. Our experienced and mature cleaners are ready to clean your homes, offices and businesses. Most of them are married with kids, well educated and all are fluent in English. We know how to protect your furnisher while cleaning homes, knowledgeable with regards to washing clothes, folding and ironing and all type of chores around the house work... we can even clean your fish tanks. We work on an hourly basis or monthly contract\nOur Timing is 8am..12pm morning shift and afternoon shift is 1pm..5pm. or a full day..8 hrs', 941, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=d94280fe3297c96f&from=serp&vjs=3', '2018-07-12 18:07:31', '2018-07-12 18:07:31'),
(9042, 928, 1175, 'Jobs in USA', 'I have young kids in my chiropractic office. We need you to help look after them and work at the front desk. They are wonderful kids and I\'m looking for someone who will love them, help them develop, and enjoy watching them grow for years. Newborn experience a must.You will also work the front office of our small family chiropractic practice. In-office experience preferred, but it\'s more important to have a friendly, outgoing personality. Training will be provided. In our chiropractic office you would be responsible for office duties including: using electronic health records on the computer, checking patients in and out, answering the phone, and assisting patients with exercises. You must have extreme attention to detail, be able to multi-task, be smart, have proper spelling/grammar, be proficient handling money, and be a fast learner. Math proficiency is required for daily reports and office transactions; you must pass a basic math test for hire. Personal or work experience with chiropractic is a plus. On the job you\'ll become a certified chiropractic assistant.We have a wonderful practice with a great environment, that\'s friendly and personal. A good match will be on-time, respectful, outgoing, warm, friendly, easy to work with, energetic, and love kids.Hours are Monday 8:30-4:30, Wednesday 8:30-4:30, Friday 8:30-4:30. You must be available for ALL hours, no exceptions. We are off for most school and federal holidays. Compensation is on payroll with employer tax contribution starting at $11/hr, 90 day probationary period.We are located at 66St & Sweetwater (Scottsdale, 85254) in beautiful garden setting. You must live a reasonable distance. Computer proficiency required.Must start by the end of July. Minimum one year commitment required. You will love this job. It has the best of both words- professional and childcare. Attach your resume, name, address, phone (all required.) Please write a paragraph stating why this is a perfect job for you.I will remove this pos', 947, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Kuty-Chiropractic-LLC/jobs/Nanny-Chiropractic-Assistant-5a33e790f7214d5c?vjs=3', '2018-07-13 23:37:46', '2018-07-13 23:37:46'),
(9043, 724, 1176, 'Jobs in USA', 'Who are we?\n\nWe employ and support those who like working with children and get great satisfaction from helping them grow and develop. If serving others, providing a valuable service and making kids happy, then you are in the right place!\n\nWhat we would like to see in you.\nThe ability to work 2-3 week days. Most jobs are several hours during the weekdays, 7am-6pm.Previous experience working with children.At least two non-related references.Must be at least 18 years old.Must have a clean record. We will complete a thorough background check.A love for children and lots of patience.Can live anywhere in the Phoenix area, you do not have to be in Scottsdale.\nWhat’s in it for you?\nGreat resume builder! Employers will know you can handle many different situations and multi-task well.You will meet many great families, and build your network.Build your soft skills. We help you learn to call families, help you make a good first impression.A support system. Our team here to help you! We will ensure you are in safe environments and always feel comfortable. You can contact us anytime!We are a W2 employer. We manage your taxes.\nPay: $11.50-13.00/hr.\n\nJoin our wonderful team and Apply NOW by copying and pasting the link below into your browser!!\n\nhttps://www.collegenanniesandtutors.com/northscottsdaleaz/nanny/join\n\nAbout Us:\n\nCollege Nannies + Sitters + Tutors North Scottsdale aims for professional development and personal growth in you, the family and within our company. The people we hire have a broad set of personal skills (you don\'t have to be a college student!) who are ready to tackle the most common childcare and academic problems and make an impact on everyone we meet. Our nannies and tutors are enabled to focus on their work with one student or family and bring a personalized solution to each case, making lives easier and better, one child at a time.', 430, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=ca9ab3aec0e15cc9&from=serp&vjs=3', '2018-07-13 23:37:46', '2018-07-13 23:37:46');
