(9044, 929, 1178, 'Jobs in USA', 'Family living in Lincoln Park of Chicago with 8 months, 7, 9 and 10 year old children is seeking an educated, experienced, professional, organized, meticulous and detail oriented Full-Time Nanny/Family Assistant to manage a busy family and household. The schedule is approximately 40 hours per week on five days. Flexibility is required to work varying combinations of days including weekends, but majority of shifts will be on weekdays. Nanny will always receive two consecutive days off per week and monthly schedules will be made at least two months in advance. Nanny is required to travel internationally and domestically approximately 6-8+ weeks per year. Extreme flexibility is required for the position. Older children are enrolled in private school, which is walking distance from the family\'s residence. Family has staff vehicle, so safe vehicle for transportation is not required. Nanny/Family Assistant must be collaborative to work with domestic staff and directly with Principals on a daily basis (stay-at-home mom), discreet, assertive, proactive, resourceful, self starter, organized, detail oriented, hard working, service focused, kind, professional, ability to multi-task and wear many hats, respectful and capable of maintaining discretion (confidentiality agreement is required). Candidates must have previous experience in similar position(s) that include nanny experience along with highly detailed and demanding family assistant responsibilities. Start date is ASAP, but flexible for the right candidate.RESPONSIBILITIES: Infant experience and knowledgeable about routines, sleep training, reading and communicating to baby as often as possibleExperienced with play-based learning and creating educational activities (e.g., planned engaging activities at home, developmentally appropriate games and activities, engaging projects and crafts, themed weeks, scheduled outings, etc.)Knowledgeable about child development (e.g., firm when necessary and capable of teaching children ', 864, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Strollers-and-Stilettos/jobs/Full-Time-Nanny-Family-Assistant-Lincoln-Park-6d57f401ebd5e33f?vjs=3', '2018-07-13 23:37:46', '2018-07-13 23:37:46'),
(9045, 930, 1180, 'Jobs in USA', 'Caring family looking for a right hand partner to help manage household and care for their 3 children (5, 3.5, and 2) . Family is seeking someone who walks into the house everyday with a great attitude and loving, happy disposition. Two older children in school during the day. Two year commitment ideal.Must be an experienced, mature candidate who knows how to run a home, be of help to a family and anticipate needs. Clients and are looking for someone who will care for their children like their own and handle housework duties. Must have an interest in child development and a passion for education.MUST BE PRESENT - We are not looking for someone who will be on their cell phone, laptop or watching tv. If you cannot step away from your technology, this is NOT the role for you.Schedule:Nanny M-F 2pm - 8pm, **additional hours optional Sat 2-8pm Sun 2-8pmPay: $20-22 net + additional benefits such as PTO and paid holidaysMust Haves:CPR & First Aid TrainedCollege degree or Early Childhood Education credit a huge plusClean driving record, no DUI or DWINon-Smoker7+ years of nanny experience3+ years of experience working with infantsSafe car for running errandsBe able to provide 3 - 5 supervisory referencesHealthy and activeChild development background ages and stages a plusJob Type: Full-timeSalary: $20.00 to $22.00 /hour', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Crunch-Care/jobs/Nanny-4b12ee65155eced1?sjdu=QwrRXKrqZ3CNX5W-O9jEvV_1-3a1LOO3UUMrMHHi9RIUDqScWfEQNr4o-iHt85-tF1xr9zXQsqliN9', '2018-07-13 23:37:46', '2018-07-13 23:37:46'),
(9046, 931, 1181, 'Jobs in USA', 'You should have character with a heart and a willingness to lead by example as their nanny to 2 boys (5 1/2 and 8 1/2). Help them with the morning routine - wake up, dressed, breakfast, check over their homework and help them complete if needed. Then drive them to their schools (North Ranch Elementary and Sonoran Sky Elementary). The boys are still getting used to being in two different homes during the week so you can be a calm stable influence on them and start their mornings off right!\n\nDevelop a close relationship with the boys and show them you\'re a good example to learn from and offer to help when needed so that you\'ll make the mom\'s life a little easier too!\n\n(As a bonus, there\'s also a medium sized dog who loves attention.)\n\nYou\'ll be employed by North Scottsdale College Nannies + Sitters + Tutors. We\'re a legal W2 employer so you\'re guaranteed to be paid by direct deposit every 2 weeks for the hours you work. We can also cover for the family if they need support when you are not able to work especially during school half days or school breaks.\n\nQualifications:\nHave access to safe, reliable transportation and a good driving record.\nAt least 2 non-family references related to working with children, paid or unpaid.\nAbility to pass extensive background check.\nPay: $13 – $14/hr. We are a W2 employer.\n\nLocation: Scottsdale (85255) Home is South of Thompson Peak Parkway and Bell Roads in McDowell Mountain Ranch.\n\nSchedule: Start mornings Aug 17. 6:45AM - 9:45AM.\n\nGreat if you have some availability Wednesdays and possibly Thursdays or every other Friday afternoons 3:15pm - 6:15pm.\n\nAugust 20 schedule:\n\n Monday, Thursday, Friday mornings 6:45AM - 9:45AM only.\n\n Following week: mornings Thursdays and Friday 6:45AM - 9:45AM.\n\n Schedule will be every Thursday, Friday morning and every other Monday.', 384, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=f2ce41106feff466&from=serp&vjs=3', '2018-07-13 23:37:46', '2018-07-13 23:37:46'),
(9047, 932, 1181, 'Jobs in USA', 'Motivated 7th grade girl(12) needs you to help her with Saxon Math. You should be engaging, reliable to pick her up from school on Mondays through Wednesdays at 2:30 pm from Cheyenne Elementary. She likes to get her homework done in about an hour and a half or so as soon as she gets home so she has free time in the evening!\n\nThis is girl is intent on being a success and you\'ll have a good part in making her goal a reality. You\'ll be more than just a sitter, and look out for her best interests. She\'ll probably like to get to know you and learn from your experiences as well. This looks like it has the potential to be a long term partnership!\n\nOnly if there is time, offer to pitch in to get some light household tasks done as well. No pets, no pool.\n\nHome is just north of Cactus Road just east of the 101 in Scottsdale so it\'s easy freeway access.\n\nYou\'ll be legally employed through North Scottsdale College Nannies + Sitters + Tutors. so you\'ll definitely get paid for the hours you work every 2 weeks.\n\nLocation: Scottsdale (85260) Near 101 freeway and Cactus Rd\n\nSchedule: Mondays, Tuesdays, Wednesdays 2:30 pm – 6pm. Optional once a month Wednesdays start mid-day for errands.\n\nPay: $13 - 15/hr.\n\nQualifications:\n\nAccess to safe, reliable transportation, a good driving record.\nActive mindset and strong elementary math skills.\nAt least 2 non-family references (including babysitting) related to working with children, paid or unpaid.\nAbility to pass extensive background check.', 384, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=790052a80e46939a&from=serp&vjs=3', '2018-07-13 23:37:46', '2018-07-13 23:37:46'),
(9048, 933, 1182, 'Jobs in USA', 'Family living in Lakeview of Chicago with 9 months and 16 months old boys is seeking an educated, experienced and professional full-time nanny. The schedule is on Monday - Friday at 7:15am - 6:00pm. Nanny is required to work approximately one or two later evenings per month for date nights. Nanny is required to work overnights while parents are traveling, which is approximately five to six overnights per year. Approximately two to four weeks of international and domestic travel is required for the position. Part-Time housekeeper works one day per week. Safe vehicle for transportation is not required for the position. Candidates must be comfortable with small dog (Mini Yorkie). Start date is ASAP, but flexible for the right candidate.RESPONSIBILITIES: Experienced working with similar aged children (toddlers, school aged, etc.)Comfortable and experienced with at least two+ children in domestic positionInfant experience and knowledgeable about routines, sleep training, reading and communicating to baby as often as possible, etc.Willing to work collaboratively with parents and assist them with developmental milestones, what to expect, etc.Willing to find age appropriate activities and resources in the city and register childrenWilling to transport child to and from scheduled activities, play dates, outings, etc. (when age appropriate)Experienced with play-based learning and creating educational activities, lesson planning, etc. (e.g., engaging activities at home, scheduled outings, themed weeks, scheduling play dates, etc.)Willing to assist child with homework and school projects (when age appropriate)Knowledgeable about child development (e.g., firm when necessary and capable of teaching children manners and etiquette, but also capable of being laid back and fun)Willing to prepare fresh and healthy meals that introduce children to new foodsComfortable assisting with small dog (e.g., letting outside, feeding, etc.)Excellent communication skillsFlexible scheduleProfessio', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Strollers-and-Stilettos/jobs/Full-Time-Nanny-Lakeview-f1a5b14e7554ff56?vjs=3', '2018-07-13 23:37:46', '2018-07-13 23:37:46'),
(9049, 934, 1183, 'Jobs in USA', 'Family living in Cow Hollow of San Francisco with newborn girl is seeking a professional, experienced and educated Full-Time Nanny. Schedule will be 50 hours per week on five out of seven days per week. Nanny will receive two consecutive days off per week. Family will ensure nanny has schedules approximately two months in advance, but flexibility is required with scheduling as last minute trips and events occasionally arise. In the future, schedule will likely be spilt between two full-time nannies to ensure the family has seven day per week coverage. Nannies will work three or four days per week at approximately 6:00/7:00am - 6:00/11:00pm. Nearly all months this schedule will ensure each nanny has two weekends off and travels half of the time with family. Nannies should be comfortable working many days consecutively (e.g., if traveling for two to three weeks at a time, only one nanny will travel with family and the other nanny is off work). The position requires extreme flexibility as family\'s schedule changes at various times in the year (e.g., summer, travel, etc.). Approximately four to six weeks of domestic and/or international travel per year is required (approximately four weeks of international travel to Europe annually). Applicants need to be honest, trustworthy, understand the importance of maintaining discretion (confidentiality agreement is required), comfortable with small dog, collaborative and experienced working with other domestic staff (full-time housekeeper, full-time nanny, etc.) and experienced working with Principals that are at residence often (discreet and staying out of the way is important). Family has staff vehicle for transporting children. Full-Time Housekeeper works five days per week. Start date is ASAP, but flexible for the right candidate.RESPONSIBILITIES: Newborn experience and knowledgeable about routines, sleep training, reading and communicating to baby as often as possibleExperienced with play-based learning and creating educati', 949, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Strollers-and-Stilettos/jobs/Full-Time-Nanny-Newborn-Cow-Hollow-8077b15656d55b3f?vjs=3', '2018-07-13 23:37:46', '2018-07-13 23:37:46'),
(9050, 935, 1186, 'Jobs in KSA', 'الرئيسية\nمال ومحاسبة\nالسعودية\nالاحساء\nWorkers Urgently needed in a Super Market in canada\nWorkers Urgently needed in a Super Market in canada\nWorkers Urgently needed in a Super Market in canada\nMr Kamel Mohammed is seriously in need of young dynamic self motivated Seles Man / Woman ,House Keeper, Nanny , Driver , Gardener needed as soon as possible who want to move their career forward in canada\nMinimum experience of 1 years in the catering or House Keeper , You should have a professional Driver Liences course and previous experiences in quality establishments along with good culinary skills.\nMost have the ability to speak English, In possession of a valid passport and be ready to join immediately. Interested Candidate should submit their resume to us by email for more information regarding this job offer .', 952, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=13a42918b02555d8&from=serp&vjs=3', '2018-07-13 23:37:46', '2018-07-13 23:37:46'),
(9051, 936, 1188, 'Jobs in KSA', '2827E THREE GOVERNESS English or French or Spanish or Italian + English speaking - Live inJeddah, Saudi Arabia with frequent travels to London and EuropeNumber/ages of children: 5.5 - 4.5 and 1 year old girlsDetails/Duties:\nGoverness duties.\nThe 3 girls have 3 nannies already so the focus of the governesses will be mainly on education, deportment, mannersRequirements:\nDegree in Education\nBackground/experience in schooling or education preferredEnglish or French or Spanish or Italian mother tongueFluent English\nFamily will take care of:\nVisa\nReturn ticket to home country ticket\nTransportation\nInsuranceWorking Hours: possibly 6 days per week - to be discussed with the FamilyStipend Offered: £ 1,000 - 1,200 npwk upon experience and qualificationsAccommodation: personal bedroom with bathroomStarting Date: ASAP June 2018\nResponsible consultant: valentina.arena@nannybutler.com', 954, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=21848b275b20084f&from=serp&vjs=3', '2018-07-13 23:37:46', '2018-07-13 23:37:46'),
(9052, 720, 1189, 'Jobs in KSA', 'Qualifications:\nFemale\nLess than high school\n1 year min experience\nRequirements:\nPassport\nNBI\nSchool Credentials etc.\nIndustry:\nOthers\nJob Description:\nDomestic Helpers perform a variety of tasks within an employer’s home, such as providing care for a child or elderly family member, housecleaning, running errands and cooking. They may also be referred to as a Housekeeper, Maid or Nanny. While most Domestic Helpers live separately from the family they work for, some will be provided room and board in addition to their wages.\nDomestic Helpers generally work as independent contractors and report to one or more of the family members for their duties and instructions. Some Domestic Helpers may work for a staffing agency and be paired up with families looking for assistance. The Domestic Helper may perform some or all of their duties while the family is away from the house or they may work in a home where one or more of the heads of the household work from home.\nJOB REQUIREMENTS:\n1. At least 23 years old and above\n2. Elementary Graduate that can speak and understand english\n3. Hardworking & Willing to learn\nSalary: 400 USD (Standard Contract)\nVisit us: Unit 210 Vareb Mansion Bldg. 1679 A. Mabini St. Malate Manila\nFacebook Page: Starborne Manpower\nWebsite: starbornerecruitment.com\nBEWARE OF ILLEGAL RECRUITERS\nNO FEES TO BE COLLECTED\nContact Person: Chinee, Grace, Danica\nContact Number: 09175701343\nAgency Name: Starborne International Promotions & Manpower Corp\nPrincipal/Project: Bawabat Asia Recruitment / Al Enjaz / Ejara Recruitment Bureua\nLocation: Jeddah, Dammam, & Riyadh , Saudi Arabia\nSalary: 20,876', 955, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=25967fb151f86e49&from=serp&vjs=3', '2018-07-13 23:37:46', '2018-07-13 23:37:46'),
(9053, 937, 1190, 'Jobs in KSA', 'A valued client of Little Ones based in Riyadh, Saudi Arabia, is currently hiring for a new Nanny to join a team of Nannies, in order to provide one to one support to their eldest child of early primary school age. The family already employ two other nannies who focus on the younger siblings. There will be times of sole care, as well as times where you work on shared care basis with the mother and the other nannies.\n\nThe family are looking for a professional and highly experienced Nanny who enjoys arts & crafts, dress up play and imagine play and is happy to get down to the child\'s level and involved in playing, as well as have the ability to provide structured activities to enhance the child\'s developmental stages and learning. This is a fully staffed, formal VIP household based in a western part of Riyadh and the family are looking for a polite, well presented, professional and friendly Nanny who works well in a team and is happy working in a busy environment.\n\nYou will accompany the family on frequent trips abroad (typically 2-3 months in the summer, plus 1-3 week trips throughout the year) to various European and US locations.\n\nTypical working hours whilst in Riyadh will be 6 days per week, 12 hours per day, but flexibility is required.\n\nAccommodation provided is in a separate building to the family, where you will be provided with your own bedroom & bathroom.\n\nSalary is negotiable depending on level of experience and qualifications and start date is flexible (ideally in June/July). You must be prepared to commit to a long term contract. The child speaks Arabic, English and French, and whilst fluent English is essential for this role, Arabic or French as additional language will be a bonus. Montessori training/knowledge would be a huge plus!\nYour main duties will include:Supervising other staff members to ensure all nursery duties and children\'s cooking is done to a high standard\nPlanning and structuring the child\'s activities for the day to include developmenta', 956, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=caa022514075d1d4&from=serp&vjs=3', '2018-07-13 23:37:46', '2018-07-13 23:37:46'),
(9054, 938, 1191, 'maidcv.com', '\r\n                            Hello! \r\n\r\nWe\'re a happy new family, just 2 people (plus a newborn baby soon). We just moved into a new home in Dubai (Mirdif) and we\'re looking for an excited, happy and hardworking housemaid/nanny to join us.\r\n\r\nBenefits: Salary is AED 1,500 per month; Live-in including a room and dedicated bathroom for you; One day off weekly (either Fri or Sat); Paid vacation with a ticket home; Visa coverage; Health insurance. \r\n\r\nRequirements: Female; Aged 24-45; Very good spoken English; 1+ references from previous employers that can be contacted; Ready to be a happy and hardworking housemaid/nanny; Currently in the UAE. \r\n\r\nJob task mostly includes cleaning and cooking within our house. And sometimes may include taking care of our newborn baby.\r\n\r\nIf you\'re interested and you fit the requirements, please send me your CV over whatsapp or text message on 056-990-0786\r\n                        ', 957, NULL, NULL, NULL, NULL, '1.800', 6, '1.5000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-13 23:37:46', '2018-07-13 23:37:46'),
(9055, 939, 1185, 'Jobs in UAE', 'This lovely family are looking for a wonderful and caring nanny with confidence in their ability and knowledge. The role will be based in Dubai from September however the family are spending the summer in Belgravia London. This is a fully staffed VIP household and experience in this environment would be advantageous. The child has a Sesame and Dairy allergy which the nanny will need to be very conscious of.\nThe job description is typical of a “nanny” in terms of roles and responsibilities including:\nCreating a nurturing, stimulating and fun environment\nMeeting the children’s social, emotional and physical needs\nProviding age-appropriate activities\nDressing\nBathing\nAssisting with self-care and hygiene, including diapering\nPotty training\nDisciplining when necessary and in accordance with our parenting principles\nReading\nPreparing nutritious menus for meals and snacks\nInstilling good manners and a sense of responsibility\nOrganizing on age-appropriate outings\nAccompanying parents to medical appointments\nTraveling with the family.\nJob qualifications and prerequisites may include, but are not limited to: At least 4 years of previous nanny experience\nExperience caring for toddlers\nExcellent, verifiable references\nCurrent first aid and CPR certification\nDegree in early childhood education\nValid driver’s license\nDependable, honest and trustworthy\nLanguage skills: Arabic and EnglishType of care: Shared/ Sole\nAccommodation: Own bedroom and bathroom\nPets:No\nTravel: Lots of International travel\nDriver/Non driver: Not essential', 951, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=8632e28b31f6529e&from=serp&vjs=3', '2018-07-13 23:37:48', '2018-07-13 23:37:48'),
(9056, 940, 1196, 'Jobs in UAE', 'Nanny Needed for Professional Family in Dubai, UAE | 7 and 8 years old | ASAP Start\nJob ref: Dub/2/n\nA local family in Dubai are looking for a professional nanny to help care for their children starting ASAP.\n\nThe position will focus on children’s education and general well-being. Duties and responsibilities will include: looking after the children on a shared charge basis, taking them to school, after school activities, organising fun & educational activities, helping with homework, monitoring children’s school performance and motivating children through fun games and/or sports. Additional duties include encouraging good manners and travelling with the family.\n\nThe position is to work on 6-days a week basis/12 hour a day; with occasional babysitting.\n\nIdeal candidate will have good teaching skills; will be perfectly fluent in English.\n\nPersonality-wise, the family are looking for someone warm and dynamic, well-mannered and highly organised with flexibility.\n\nThe family have three older children aged 11, 14 and 16 years old. The family are also looking for a second nanny to assist with the care of these children.\n\nThe household is fully staffed and each child has an additional local helper on hand.\n\nStart date is May 2018 and salary offered: £800-£1000 + per week.\nRequirements\nLocation\nDubai\nStart date\nASAP\nDuration\nPermanent\nSalary\n£800 - £1000 per week\nHours\n12/6\nLanguages\nEnglish\nPermanence\nPermanent\nChildren\nMale/7, Female/8,\nExperience\nEssential\nDriving licence\nNot Essential\nNon smoker\nNot Essential\nShared care\nYes\nSole charge\nNo\nAccommodation Details\nBasis\nLive-in\nAccommodation\nSeparate flat to be shared with the nanny for the older children.\nFamily residence\nHouse\nOther Details\nNursery duties only\nYes\nExpecting a baby\nNo\nAny special needs?\nNo\nBoth parents work\nNo\nAny babysitting\nNo', 962, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=d89edd319ef8de7d&from=serp&vjs=3', '2018-07-13 23:37:49', '2018-07-13 23:37:49'),
(9057, 941, 1196, 'Jobs in UAE', 'Professional Nanny Needed for Dubai | Three Children | ASAP Start\nJob ref: Dubai/3/N\nProfessional family based in Dubai, UAE are looking for an experienced and capable Nanny for their three children aged 11, 14 and 16 years.\n\nThe position will focus on children’s education and general well-being. Duties and responsibilities will include: looking after the children on a shared charge basis, taking them to school, after school activities, organising fun & educational activities, helping with homework, monitoring children’s school performance and motivating children through fun games and/or sports. Additional duties include encouraging good manners and travelling with the family.\nThe position is to work on 6-days a week basis/12 hour a day; with occasional babysitting.\n\nIdeal candidate will have good teaching skills; will be perfectly fluent in English.\n\nPersonality-wise, the family are looking for someone warm and dynamic, well-mannered and highly organised with flexibility.\n\nThe family have two younger children aged 7 and 5 years old. The family are also looking for a second nanny to assist with the care of these children.\n\nThe household is fully staffed and each child has an additional local helper on hand.\n\nStart date is ASAP and salary offered: £800-£1000 + per week net.\nRequirements\nLocation\nDubai\nStart date\nASAP\nDuration\nPermanent\nSalary\n£800 - £1000 per week\nHours\n12/6\nLanguages\nEnglish\nPermanence\nPermanent\nChildren\nMale/11, Female/14, Male/15,\nExperience\nEssential\nDriving licence\nNot Essential\nNon smoker\nEssential\nShared care\nYes\nSole charge\nNo\nAccommodation Details\nBasis\nLive-in\nAccommodation\nSeparate flat shared with a nanny.\nFamily residence\nHouse\nOther Details\nNursery duties only\nYes\nExpecting a baby\nNo\nPets\nNo\nBoth parents work\nNo\nAny babysitting\nYes', 962, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,