(9058, 942, 1185, 'Jobs in Qatar', 'Job Summary:\n\nA professional and enthusiastic PA is required to work closely with a female principal. She is looking for someone who can be her right hand and go to person, who has everything under control and knows exactly what is going on.\n\nDuties\n\nYou will be responsible for carrying out a range of tasks, including but not limited to:\n\n– Diary management\n\n– Booking hair and beauty appointments\n\n– Booking restaurants and theatre tickets\n\n– Planning and booking travel itineraries\n\n– Overseeing the principals domestic staff\n\n– Checking emails and dealing with correspondence\n\n– Planning events\n\n– Run personal errands\n\nYou will be required to travel with the principal around 4 to 6 times per year, mostly to Europe and America.\n\nCandidate requirements\n\nThe perfect PA will be someone who is energetic, smart, easy going, responsible and trustworthy. You need to be happy to live in Qatar and enjoy travelling. Good IT skills is also important.\n\nThe client is looking for someone who is a driver\n\nAccommodation (If required)\n\nYou will be provided with accommodation within the staff quarters.', 951, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=94a177cce99cc725&from=serp&vjs=3', '2018-07-13 23:37:49', '2018-07-13 23:37:49'),
