(9070, 946, 1219, 'Jobs in USA', 'Kanoo Travel Division is currently recruiting Saudi Nationals as Trainee Travel Consultants to employ within its travel agency office network throughout the Kingdom. Full training will be provided for candidates in all three provinces in Dammam, Riyadh, Jeddah.\nSelected Saudi candidates will be expected to demonstrate an interest to build a long term career within Kanoo travel division as ticketing and customer service agents. A good command of the English language is essential as is an outgoing personality and interest to exceed customer expectations. Basic computer skills is essential however no knowledge of ticketing/travel agency software is required as full training will be provided.\nHigh school education is a minimum requirement.\nAn excellent remuneration package is in place with full training provided at Kanoo training centres.\nKanoo Travel is the largest Travel Company in the Middle East, with a team of travel specialists, operating a network of over 140 offices in the region, and through a global network of world class travel partners. Kanoo Travel provides the most comprehensive and specialized services in the travel industry with unmatched quality awards and achievements that guarantees the highest levels of customer satisfaction.', 975, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=a5eb09f7e3681360&from=serp&vjs=3', '2018-07-17 11:19:03', '2018-07-17 11:19:03'),
(9071, 947, 1220, 'Jobs in USA', 'Job Description Summary\nPlease note: this position is based in Saudi Arabia**\nThe Organization & Location\nThe Babson Global Center for Entrepreneurial Leadership (BGCEL) based at the Prince Mohammad Bin Salman College of Business and Entrepreneurship (MBSC) is located in King Abdullah Economic City (KAEC). KAEC is the largest privately funded Economic City in Saudi Arabia located on the pristine beaches of the Red Sea. Its busy sea port and growing industrial valley are home to a community that takes advantage of the quiet working environment only an hour from the bustling city of Jeddah.\n\nThe BGCEL is a joint collaboration between Babson Global, Inc., (a wholly owned subsidiary of Babson College, the world’s leader in entrepreneurship education for the past two decades), Lockheed Martin, and Emaar, The Economic City. The mission of the Center is to provide students and entrepreneurs with the knowledge and skills necessary to launch and expand business ventures and to invigorate their entrepreneurial spirit with new ideas.\nThe BGCEL delivers innovative programs and provides experiential learning opportunities to students at MBSC and other educational institutions, as well as to the broader community. BGCEL is the flagship center for entrepreneurial activity in the MENA region, hosting academic conferences and speaker series, delivering entrepreneurship education programs, conducting the Babson Global Entrepreneurship Monitor (GEM) study for Saudi Arabia, and supporting MBSC in managing student co-curricular activities that create Entrepreneurs of all Kinds® in Saudi Arabia and neighboring countries.\nThe BGCEL supports academic institutions, private enterprises, and government agencies in producing entrepreneurial leaders who create sustainable value for their societies in established businesses, other organizations, and new ventures. The Center helps entrepreneurs, new ventures, and family businesses innovate, expand, and improve their management, governance, and op', 976, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=8ddc68cb66d237dc&from=serp&vjs=3', '2018-07-17 11:19:04', '2018-07-17 11:19:04'),
(9072, 948, 1221, 'Jobs in KSA', 'You will be responsible to assist with the efficient running of the department in line with Hyatt International\'s Corporate Strategies and brand standards, whilst meeting employee, guest and owner expectations.\nTo assist the Manager – Banquet Service in managing the Banquet Services Department as a successful independent profit centre, ensuring that all functions are successfully executed ensuring maximum guest satisfaction consistent with Hyatt International Standards, through planning, organizing, directing and controlling the food and beverage operation and administration.\nTo participate in the formulation of the Annual Operating Budget in determining outlet projected revenues and expenses, operating equipment and FF&E requirements in line with the compilation of the Annual Business Plan.\nTo strictly adhere to the established operating expenses and that all costs are controlled.\nTo assist in effective payroll controls through a flexible work force maximize utilization of part time employees and close cooperation with other Food & Beverage outlets.\nQualifications\nIdeally with a relevant degree, apprenticeship or diploma in Hospitality or restaurant management.\nMinimum 2 years work experience as Assistant Outlet Manager or Team Leader/Captain in a hotel or large restaurant with good standards.\nVery good command of English and local language.\nTransferrable Iqama only will be considered.\nMust be available locally for interview.\nPrimary Location\n: SA-Jeddah-Jeddah\nOrganization\n: Park Hyatt Jeddah\nJob Level\n: Entry Level Manager | Full-time\nJob\n: Catering/Event Planning\nWorldwide/Local Candidates : Local', 977, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=09bc3065d965d557&from=serp&vjs=3', '2018-07-17 11:19:04', '2018-07-17 11:19:04'),
(9073, 949, 1222, 'Jobs in KSA', 'استقبال المكالماتخدمة العملاء الشروط والمهارات:\nخبرة\nنوع الوظيفة:\nدوام كاملنطاق الراتب: 3,000 ريال سعودي بدلات ومزايا أخرى: - الراتب 2500 ريال في الثلاث اشهر الاولى ومن ثم يصبح 3000 ريال بعد تثبيت الموظف\nالمتطلبات الأساسية\nالجنس: نساء الحد الأدنى لمستوى التعليم: الثانوية العامة أو ما يعادلها الحد الأدنى لمستوى الخبرة: مستوى مبتدئ (خبرة اقل من سنة إلى 3 سنوات) فئة الجنسية: متاحة للجميع', 978, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=eaba14e66321e0a6&from=serp&vjs=3', '2018-07-17 11:19:04', '2018-07-17 11:19:04'),
(9074, 950, 1223, 'Jobs in KSA', 'Hardware & Software Issues/Requests:\nReceive Nahdi users’ software and hardware issues/requests through e-mail, system alerts…etc to solve the issue directly within the agreed Service Level Agreement (SLA) or reassign to the concerned IT team.Prepare the receiving form to Nahdi users of the new hardware received and archive all the related documents to ensure proper asset management.New Hires:\nExecute the tickets -received from the supervisor- of the new hires through the creation of e-mail user, windows installation, the approved required applications, access on the business domain….etc to ensure providing the IT services as per the job profile.Hardware & Software:\nEnsure the maintenance of Nahdi hardware though the review of the warranty (expiry date and specifications) the preparation of the receiving form –to be signed by the vendor- and the communication with the contracted vendors to ensure on-time maintenance.Maintain the IT support asset inventory through the check of the hardware per the monthly periodic maintenance plan, receiving the new hardware devices and preparation of the hardware for the usage to meet the business requirements.Maintain the users’ software and applications (such as antivirus, Microsoft Office…etc.) through ensuring the timely update per the monthly periodic maintenance plan to prevent software conflict with old versions and upgrades and to ensure compatibility with the business use.Trends & Technologies:\nKeep up-to-date with new trends and technologies in IT field\nEmployee duties are not limited only to the above-mentioned Accountabilities; he/she may perform other duties as assigned.', 979, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=3339dadfad7499b1&from=serp&vjs=3', '2018-07-17 11:19:04', '2018-07-17 11:19:04'),
(9075, 951, 1224, 'Jobs in KSA', 'As a Store Manager for one of our most recognisable brands, you will provide the Starbucks \'service experience\' consistently for all customers, and ensure that they receive the highest quality product possible. You will also ensure that all company policies, store operating standards and procedures are communicated effectively to partners and are maintained and consistently followed.\n\nYour other duties will include:\nMaintaining store appearance and equipment to the highest possible standardsFollowing safety and security guidelines to create and maintain the safest environment possible for partners and customersOrganising work throughout the store to deliver efficient, speedy customer service and profitable operation.\nQualifications & Requirements:\n\nYou will have:\nProven store management experienceFood retail management experienceExcellent English skillsGood numerical, analytical, interpersonal and networking skillsThe ability to develop and motivate a team.', 980, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=4f4a5fb7280b66f1&from=serp&vjs=3', '2018-07-17 11:19:04', '2018-07-17 11:19:04'),
(9076, 952, 1225, 'Jobs in KSA', 'Job Description\nSet up workstations with computers and necessary peripheral devices.\nProvide orientation and guidance to users on how to operate new software and computer equipment.\nIdentify computer or network equipment shortages and place orders.\nMaintaining all kind of IT documents.\nSkills\nWorking knowledge of Windows Desktop operating systems.\nHands on experience with data cabling and termination work.\nSolid diagnostics and problem solving skills.\nGood understanding of computer networks and protocols.\nEducation\nIT\n\nJob Details\nJob Location:\nJeddah , Saudi Arabia\nJob Role:\nInformation Technology\nEmployment Status:\nFull time\nEmployment Type:\nEmployee\nNumber of Vacancies:\n2\nPreferred Candidate\nCareer Level:\nEntry Level\nYears of Experience :\nMin: 0 Max: 2\nResidence Location:\nSaudi Arabia\nGender:\nFemale\nNationality:\nSaudi Arabia\nDegree:\nBachelor\'s degree\nCompany Profile\nNesma Electric provides an extensive range of services and equipment for power transmission and distribution, including power protection and control. As an electrical power, engineering and contracting company, the company specializes in the execution of electrical power transmission reinforcement projects and primary electrical power equipment supply for GIS substation extension projects on both the 110 kV and 132 kV levels.', 981, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=1a410f38bbc20e66&from=serp&vjs=3', '2018-07-17 11:19:04', '2018-07-17 11:19:04'),
(9077, 953, 1226, 'Jobs in KSA', 'Ensure that an effective framework for managing and controlling costs is in place, and is being executed through Area ManagersMonitor shops’ financial performance and action on required improvement to meet/exceed business planAssist Operations Manager in operating budgetClosely monitor budget performance through the cycle, implementing corrective action as neededConduct regular meetings with direct reporters to trade review in presence of Operations ManagerEnsure selection of productive and high-performing employees to meet staffing requirements through close liaison and co-planning with HR for Areas Managers and below and confirm the hiring approval with Operations ManagerEnsure that performance issues drive Learning and Coaching structures are fully supported and effective in reaching employeesEnsure proper motivation and coaching for managersEnsure shops teams receive necessary training and development as per job level to reflect on their capabilities and customer serviceDeploy and plan promotion of staff related to individual strengths to maximize business plan delivery in alignment with Operations ManageReview stock availability across all outlets and ensure proper rotation of stocks between locationsProvide feedback about customer feedback related to brand and stocks to brand managers and operations managerLiaise with marketing team for implementing all marketing activities setEnsure service in shops is up to high standard in order to keep the Company image in liaison with CRM teamBuild good relations with malls managementsSkills\nStrong management, communication organizational skillsStrong analytical and problem solving skillsProfessional, highly disciplined and excellent leadership skillsMust be self-motivated, multi-task oriented and be one who thrive in a fast paced entrepreneurial environmentExtensive experience in developing, review and monitor business plansStrong verbal and written communication skills with excellent managerial and organizational abilit', 982, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=34c25dcc3059a747&from=serp&vjs=3', '2018-07-17 11:19:04', '2018-07-17 11:19:04'),
(9078, 954, 1227, 'Jobs in KSA', 'We offer you a unique opportunity to join Maersk Line an established company within international shipping & logistics. You will be an essential part of the company and get a high degree of personal responsibility. You will be working in a truly international environment and cooperate closely with colleagues throughout the world.\nWe offer\nAt Maersk, you’ll be part of a global team motivated by bringing food and commodities to people in every corner of the world. We do this through close partnerships with our valued customers, who trade everything from seafood and fruits, to clothes, electronics and cars! No matter our role in the Region our end goal is to simplify the lives of our customers. This is done through seamless processes, best in class digital solutions, and great customer service!\nOur diverse team of passionate and dedicated colleagues are empowered and supported to grow by their leaders. We all have our customers in mind, in every action of our daily work life, and this is truly the key to reaching our target!\nKey responsibilities\nTake full responsibility and end-to-end ownership of customer shipments.Act as a primary point of contact for customers and communicate proactively to keep customers informed of any issues.Ensure smooth execution of the shipment lifecycle by working closely with customers and internal stakeholders.Engage in constructive issue resolution. This includes dealing with escalations and complaints.\nAddress root causes and seek continuous improvements – constantly look for ways to improve work processes by understanding and being familiar with local KPIs and act in line with set targets.Willingness of going the extra mile for the customer.Thinking out of the box and with focus on providing solutions.Build strong and lasting relationships with customers with purpose of gaining an understanding for their business, service needs and drivers of success.Actively work together with colleagues within and beyond functions and locations.Assist ', 983, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=e296c02574242938&from=serp&vjs=3', '2018-07-17 11:19:04', '2018-07-17 11:19:04');
