(9079, 955, 1228, 'Jobs in KSA', 'Jotun has been present in the Middle East since 1962 and has expanded across the region to include 15 companies across the Middle East, India and Africa region. Throughout our history, we have focused on providing our employees with learning and development opportunities and offering them meaningful and challenging work, guided by our four values of Care, Loyalty, Respect and Boldness.\n\nJotun Paints Saudi Arabia has been established for more than 31 years and has two production facilities in Jeddah and Yanbu with 5 sales offices and warehouses around the Kingdom and more than 500 employees. Jotun Saudia has ambitious growth plans and in order to support this growth,\n\nWe are looking for candidate to fill position Sales Administrator within Performance Coatings Department based in Jeddah,\nJob description\nProvide administration and sales support tasks like handling paper works, typing of daily correspondence, compiling of proposals and quotations, tenders and submittals duties.\nCompile sales proposals and tenders\nHandle documents and telephone inquiries are conveyed accordingly to the respective personnel.\nMaintain sales contracts / documents for filing as well as updating CRM.\nCoordinate with Customer Service on price variations, customer enquiries, etc. and assist in updating system price list.\nAssist in keeping the customer credit file up-to-date and posting collection entries.\nQualifications\n1-3 years of relevant experience\nBachelor’s degree\nEducation level\nCollege / University, Bachelor\'s degree\nPersonal qualities\nInitiative & Responsibility: acts on own initiative, makes things happen and accepts responsibility for the results\nExecution: adheres to company rules and procedures; executes plans with commitment and determination; achieves high quality results\nSystematic Approach: uses a methodical and systematic approach; plans ahead, defines clear priorities and allocates resources effectively\nEffective Communication: communicates in a clear, precise and structured', 984, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=8b8781410e30b334&from=serp&vjs=3', '2018-07-17 11:19:04', '2018-07-17 11:19:04'),
(9080, 956, 322, 'Jobs in KSA', 'We are currently looking for a Bilingual Secretary for our Litigation practice in Jeddah.\nActivities will include, but not be limited to:\nPerform typing and transcription duties as required.\nTake and transcribe dictation accurately.\nMaintain files and correspondence in accordance with established company procedures.\nRetrieve records and correspondence on request.\nMonitor the progress of various assignments and take necessary steps to keep projects on course.\nCo-ordinate travel arrangements and schedule appointments.\nAssess and prioritise workload effectively.\nReceive and screen telephone calls and re-route them to other personnel as required.\nAdhere to established policies and procedures.\nMaintain confidentiality at all times.\nPerform any other related duties as assigned.\nSkills and experience\nExperience in a law firm preferred / Previous legal secretarial experience\nWritten and spoken English and Arabic (mandatory)\nPerform typing and dictation duties\nPossess excellent communication skills, both written and oral\nEstablish and maintain good working relationship with colleagues\nHelp others to meet their objectives and complete assignments\nWrite, transcribe and proof red work with high degree of accuracy and minimum supervision\nType a minimum of 40 words per minute.\nGood working knowledge of MS Office, E-mail\nAbout Al Tamimi & Company\nAl Tamimi & Company is one of the leading law firms in the Middle East and the largest law firm in the region, with presence in all of the six GCC countries. Established in 1989, the firm has 57 partners, staff of over 670, and 17 offices in nine countries throughout the UAE, Bahrain, Qatar, Iraq, Saudi Arabia, Jordan, Kuwait, Oman and Egypt.\nThe firm specialises in advising major international corporations and financial institutions, Middle East banks and government organisations, businesses and families in their global operations and investments. It has particular expertise in arbitration & ADR, banking & finance, dispute resolution & l', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=cecf5009ac4339e4&from=serp&vjs=3', '2018-07-17 11:19:04', '2018-07-17 11:19:04'),
(9081, 957, 322, 'Jobs in KSA', 'يقود عملية ادخال مستحقات الموظفين, واصدار كشوفات رواتب الموظفين وارسالها للمالية لتنفيذها في وقتها, ان يقوم بعملية الادخالات اليومية وبالتالي يصدر كشوغات دقيقة مبنية على الحسابات, ويتخاطب مع المشرف الاداري, ويتحرى دقتها عن طريق السيستم, يعمل مراجعات على ادخالات مشرفي الفروع لكي يرى ان كانت دقيقة ام لا .\nSkills\nان يكون ملتزم, شخص امين, يكون لدية دقة عالية في استخدام الارقام, وان باجمالي خبرة لا يقل عن 2 سنة SAPيكون مستخدم جيد لنظام ال\nEducation\nموارد بشرية\nاخصائي رواتب - Payroll supervisorShahini Trading\nJob Description\n يقود عملية ادخال مستحقات الموظفين, واصدار كشوفات رواتب الموظفين وارسالها للمالية لتنفيذها في وقتها, ان يقوم بعملية الادخالات اليومية وبالتالي يصدر كشوغات دقيقة مبنية على الحسابات, ويتخاطب مع المشرف الاداري, ويتحرى دقتها عن طريق السيستم, يعمل مراجعات على ادخالات مشرفي الفروع لكي يرى ان كانت دقيقة ام لا .\nSkills\nان يكون ملتزم, شخص امين, يكون لدية دقة عالية في استخدام الارقام, وان باجمالي خبرة لا يقل عن 2 سنة SAPيكون مستخدم جيد لنظام ال\nEducation\nموارد بشرية\nJob Details\nJob Location:\nJeddah , Saudi Arabia\nCompany Industry:\nDistributions and Logistics\nRequirements :\nEmployer (Private Sector)\nJob Role:\nHuman Resources and Recruitment\nEmployment Status:\nFull time\nEmployment Type:\nEmployee\nPreferred Candidate\nCareer Level:\nManagement\nYears of Experience :\nMin: 3 Max: 5\nResidence Location:\nJeddah , Saudi Arabia\nGender:\nMale\nNationality:\nSaudi Arabia\nDegree:\nBachelor\'s degree\nCompany Profile\nAs a first class food distributor in the region, size and scale are crucial to our partners hence, we provide them with actual 40,000PP capacity, a fleet with over 200 vehicles and 700 dedicated professional employees. From distribution, customer service, logistics and management, we put our heart into every exchange.', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=1be0e57630919e2d&from=serp&vjs=3', '2018-07-17 11:19:04', '2018-07-17 11:19:04'),
(9082, 958, 1172, 'Jobs in UAE', 'Join the industry leader to design the next generation of breakthroughs\nThis E Band role is responsible for providing leadership, ownership and coordination for the Honeywell Aerospace business throughout the Middle East. The successful candidate will be tasked with growing the Aerospace business within the region’s Commercial and Defense & Space markets by accelerating current STRAP outlook over the next 5 years.\nThere is a large team supporting the Aerospace business within the Middle East (primarily in Dubai and Jeddah) with plans in place to increase the number of business development and customer relationship management personnel in the near future.\nThis role would have dotted line responsibility for managing 10 sales personnel across the ATR, BGA and D&S verticals as well as dotted line management responsibility for Strategic Marketing leaders and support staff for the Middle East.\nBased in any of our key Aerospace growth markets in the Middle East (e.g. UAE, KSA, Qatar) the Aerospace Middle East Regional Leader’s main responsibilities will include:\nProvide overall strategic direction for the Middle East Aerospace Team and work closely with the SBU\'s to deliver profitable growth, faster than the market with year-over-year margin expansion and related performance objectives including supporting and/or overdriving our STRAP initiatives.\nDrive Business Development activities including the identification and building of relationships with strategic partners for joint ventures and partnerships.\nLead cross SBU Middle East Growth initiatives and synergies including, commercial and technical synergies, execution offsets, ISC & localization initiatives/synergies and take active part in \"One Honeywell initiatives\" e.g. Airport projects.\nInterface with Aerospace leaders for ME-specific Aerospace growth projects.\nProvide the glue and increased focus on common agenda items for the Middle East team.\nIncrease connectivity to EMEAI Leadership Team.\nWork closely with Corporate', 944, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=fdac7aa8117a71f4&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9083, 959, 1229, 'Jobs in UAE', 'FleishmanHillard in the Middle East shares the guiding principles of the firm’s founders: mutual respect, integrity, teamwork and “client comes first” customer service. We combine an in-depth knowledge of Arabic culture with years of multidiscipline communications expertise.\nAs today’s global marketplace continues to evolve, countries in the Middle East are looking to diversify economies and further open markets to international business. To that end, there is a growing need for clear, consistent and strategic communication and reputation management. Our offices in the Middle East (Dubai, Abu Dhabi and Jeddah) offer experienced local practitioners who understand their markets and combine global expertise to deliver results.\nINTERNSHIP OPPORTUNITY\nYou’re creative. You’ve studied creative subjects. Had countless creative ideas. Created many creative things. Now, you’re ready to take on the world. You just need a good place and opportunity to shine.\nWe’re looking for a Creative Intern who can help us handle our day-to-day creative needs.\nIdeally, you’re a visual designer who is just getting started in your career and you want hands-on agency experience. While design is your greatest strength, you’re a multi-talented, multi-tasker who can support our entire team of writers, designers, and video producers.\nPlease note that the three month internship is unpaid. However, successful applicants will receive a small expenses allowance of AED 500 per week.\nDAILY ACTIVITIES\nTasks include (but aren’t limited to):\nPresentation design\nCamera work\nVideo editing and post production\nVisual mockups for presentations (e.g. social media feeds, landing pages, storyboards, event booths)\nPhoto editing (selections, cropping, color correction, basic re-touching)\nDesigning/Laying out short- and long-form documents for digital and print distribution (white papers, case studies, HTML emails, event invitations, etc.)\nSocial media content (static and animated)\nData visualization and infographics\n', 985, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=d324ba260cd410e9&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9084, 960, 1230, 'Jobs in UAE', 'Archirodon is seeking to recruit\n\na Global Stores Manager\n\n(GSM)\n\nWe currently have an opening for a Global Stores Manager. The successful candidate will be part of the Procurement Department, based in Jeddah, KSA, working under the direction of the Procurement Director. They will be globally responsible to manage the Stores Department, as well as operationally responsible for one of the Company’s three regions.\n\nKey responsibilities of the role are to:\nGlobally supervise in developing standards, proposing budgets, managing and improves processes.\nEnsure proper operational requirements at Central Yard Facilities and Project Sites.\nPropose, on a yearly basis, a strategic roadmap with Stores main objectives, initiatives, saving targets and action plan.\nEnsure proper Stores Management organization to be in place by regular visits and audits at sites.\nMaintain and improve receiving, warehousing and distribution operations by initiating, coordinating and enforcing program, policies and procedures.\nEnsures Stores management optimization.\nRecruit, select, schedule, assign and mentor Stores staff.We are seeking individuals who:\nHave strong problem-solving skills: ability to assess a problem and determine an effective course of action.\nAre pro-active, decisive and have a “can-do” attitude with minimum resources.\nDisplay very good interpersonal and communication skills (oral and written).\nAre guided by team and collaborative spirit, particularly in a multicultural environment.\nHave managed teams successfully.\nEssential prerequisites include:\nBSc degree in Logistics or Supply Chain Management.\nOverall 10 - 15 years’ experience in work related field, including 5 years as Stores/Warehouse Manager at Departmental level.\nPrevious experience in KSA / Middle East.\nProven experience to implement Stores Management Organization in multi sites projects.\nFluency in the English language (oral and written).\nSchengen passport holders only.', 986, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=c41aab71d16913ce&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9085, 961, 1231, 'Jobs in UAE', 'Are you a Superstar?\n\nBecause we are! And we need more superstars to join our growing team.\n\nDo you like to connect and meet clients to build strong relations and increase client satisfaction ?\n\nDo you strive in a multicultural environment and can be an effective team player?\n\nWe have the best product! We have the biggest customers! We need more...We need you!\nKey Responsibilities to keep Bayt #1\nAcquire companies that have no significant revenue history with Bayt.com by selling Bayt.com’s recruitment products &amp; services\nExpand the SME client database through market research and prospecting\nDetermine customers\' recruitment needs, and prepare proposals to sell services that address these needs,\nGive online demonstrations to clients in order to handle objections and convince customers to buy\nIdentify up-sell and cross-sell opportunities by building long-term relationships and providing quality customer service\nConduct a minimum of 50 calls/day\nConduct a minimum of 2 physical meetings/day\nSkills\nExcellent verbal &amp; written skills in both English and Arabic\nExceptional negotiation skills\nUAE driving license is a must\nEnergetic, people-oriented and self-motivated\nB2B experience is a plusBayt.com at a glance\nSME Relationship ManagerBayt.com\nJob Description\nAre you a Superstar?\n\nBecause we are! And we need more superstars to join our growing team.\n\nDo you like to connect and meet clients to build strong relations and increase client satisfaction ?\n\nDo you strive in a multicultural environment and can be an effective team player?\n\nWe have the best product! We have the biggest customers! We need more...We need you!\nKey Responsibilities to keep Bayt #1\nAcquire companies that have no significant revenue history with Bayt.com by selling Bayt.com’s recruitment products &amp; services\nExpand the SME client database through market research and prospecting\nDetermine customers\' recruitment needs, and prepare proposals to sell services that address these needs,\nGive online dem', 987, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=b5e3b67dd3d62525&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
