(9087, 963, 1232, 'Jobs in UAE', 'Role:\nOur Engineering, Design and Project Management businesses have recently secured several large projects in the Middle East. As we move into this significant period of growth, we are looking to expand the capabilities of our in-house recruitment team. As a Senior Recruitment Advisor based in our Dubai office, you will be given the opportunity to demonstrate your recruitment expertise whilst working on some high-profile projects throughout the region. This job requires a proactive, innovative and highly focused HR professional to support recruitment efforts across multiple sectors and provide additional support for our expanding needs. Full life-cycle recruiting is required, and experience recruiting in a professional services environment preferred.\nCore Responsibilities:\nProvide support and management of key projects and recruitment activity for our Middle East businesses ensuring delivery of requirements across geographically dispersed locations\nMonitor and report on recruitment activity and key performance indicators (KPIs) taking corrective action when required. KPIs will include the following:\nTime to source\nOffers made\nOffers accepted / rejected\nNumber of hires per business\nTime to offer\nCost of hire\nSource of hire\nDrive and influence change both within the recruitment team and the wider Atkins business\nBuild and maintain high quality effective relationships with internal and external stakeholders at all levels\nDirectly interface with project leads, directors and hiring managers to ensure suitable hiring decisions are made\nProvide guidance to supervisors and employees related to hiring policies and procedures; maintaining compliance with the required operational and regulatory requirements\nIdentify resourcing needs within the region and take appropriate action\nProvide expert resourcing and selection advice to line managers and HR colleagues\nMaintains job descriptions; assists managers in creating job descriptions for new positions\nManage the performance and', 988, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=2d6f59d23526790b&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9088, 964, 1229, 'Jobs in UAE', 'FleishmanHillard in the Middle East shares the guiding principles of the firm’s founders: mutual respect, integrity, teamwork and “client comes first” customer service. We combine an in-depth knowledge of Arabic culture with years of multidiscipline communications expertise.\nAs today’s global marketplace continues to evolve, countries in the Middle East are looking to diversify economies and further open markets to international business. To that end, there is a growing need for clear, consistent and strategic communication and reputation management. Our offices in the Middle East (Dubai, Abu Dhabi and Jeddah) offer experienced local practitioners who understand their markets and combine global expertise to deliver results.\nThis is a competitive internship programme, which provides an excellent grounding and training in the PR industry. For a three month period, you will learn from working closely with colleagues at different levels who have forged a career at the world’s largest and most complete communications firm. As well as working closely with the team of 20 employees in FleishmanHillard’s Dubai office, you will also have the opportunity to work with colleagues in FH’s international offices. If you are considering a career in PR, this is an excellent entry level opportunity for a confident, enthusiastic and talented individual or individuals to join a growing, buzzing team at an exciting transition point.\nPlease note that the three month internship is unpaid. However, successful applicants will receive a small expenses allowance of AED 500 per week.\nDaily Activities\nYou will provide wide-ranging support to the team, across a range of high profile domestic and global clients. These span a range of sectors such as energy, consumer lifestyle, investments and technology.\nThe role is not limited to but will include…\nReporting and coverage monitoring across our accounts\nMedia liaison, e.g. checking feature opportunities, distributing news releases on behalf of clien', 985, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=dfee6b5e5370eb90&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9089, 965, 322, 'Jobs in UAE', 'Printing Operator\nRequirement-\nCandidate should have an eye for detail, Good eyesight and no color recognition issues are essential for this job.\nMust be physically fit and healthy in order for the candidate to work under a manufacturing environment.\nStrong error detection and problem solving skills\nKnowledge of the use, operations, and repairs of Flexo printing machines\nExcellent artwork layout capability, able to trouble shoots and make correct ink adjustment to achieve required colour match\nHigh emphasis on maintaining quality and accuracy in work, minimizing scrap and maximizing production\nKnowledge of inks and related materials/techniques used in the printing industry\nAbility to interact and communicate with seniors and work with helper and finishing operations as required\nEducation-\nDegree/ Diploma in printing technology required\nWork Location-\nPermanent position in Dubai, United Arab Emirates/ Muscat, Oman or Jeddah, K.S.A', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=d821b53cf6f5bcae&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
