e outreach / Community Management\nResear', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=002bc4a216ec8a6c&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9091, 967, 322, 'Jobs in UAE', 'Salary 20,000 + Bonus 20% of basic + Car + Laptop/Phone + Flight + European Medical (family)\nReporting to: (Sales Director)\nMy client is globally recognised as one of the leading manufacturers of drainage systems. Products are used in the residential, commercial, civils and infrastructure sectors. Recently a new vacancy has opened for the role of specification manager based out of the Dubai MENA HQ office.\nResponsible for specifications sales of the of company products (buildings) into a variety of key construction projects in the United Arab Emirates. A senior sales position focusing on the specification and technical support of a basket of products that manage water and waste water within buildings. Responsible for leading the strategic relationships with large and influential clients, consultants and the design community as a whole helping to identify, track and convert cross-range sales opportunities for the products by developing future demand through an opportunity pipeline.\nSkills\nRecognised qualification(s) relating to industry experience (Degree or similar)Construction industry related commercial/sales experience (min 5 years essential)Experience in handling high level clients, government, consultantsHigh level of technical capability and competence relative to the building industry (preferable)Ability to work as part of a team, be motivational, as well as being self-motivatedLeadership and key account management experience (essential)Be highly numerate and able to work with commercial strategiesAbility to monitor own performance and take appropriate action to maximise outputsExcellent communication and relationship skills (essential)Computer literate, highly competent in MS Office (Outlook, Word, Excel, CAD)Time and diary management skills (essential)Flexibility relative to on-going business needsStrong business language skills\nSpecification Manager - European Drainage ManufacturerSustainable Recruitment Solutions\nJob Description\nSalary 20,000 + Bonus 20% ', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=892ca52c79b8dc00&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9092, 968, 1231, 'Jobs in Qatar', 'Pierre Hermé Paris, an international Luxury French Pastry brand, is looking for motivated Sales Assistants for its Jeddah boutique. There are 4 vacancies for this position and reserved for Saudi nationals only.\nJob Overview:\nReporting to the Boutique Manager, the Sales Assistant is the ambassador of Pierre Hermé Paris. Your everyday duties include working with the sales team as well as passing on your knowledge to ensure that high quality standards are met. You are responsible for seeing that each of our customers is satisfied while helping our company achieve its commercial policy objectives.\nJob Duties:Greet customers as specified in the house service standardsBe perfectly familiar with all the products and know how to promote their qualities and characteristics to customersExpress yourself in a way that is consistent with the luxury positioning of the houseAdvise and serve customersOffer a level of service consistent with the luxury positioning of the houseMeet customer needs, detect potential customer needs and create customer wantsEstablish a genuine relationship with customers and recommend the most adapted products to their preferencesMake sure customers are aware of house sales / marketing initiativesSecure customer loyaltyEnsure that products and packaging materials are properly stored and organizedEnsure that the boutique is well presented and maintained with special attention to product displayAssist in stock management and boutique replenishmentFollow the company dress code and have impeccable grooming at all timeFollow house rules regarding cleanliness, hygiene and safety\nSkills\nPrevious experience in Food retail, Food &amp; Beverage, Sales, or Customer ServicePrevious experience in the Luxury industry (is a plus)Languages: English (spoken &amp; written). Arabic and/or French are a plusVery sociable, pleasant, and well-groomed personExcellent team player and a self-motivated personVery good sales technique skills\nSales Assistant (Luxury Pastry Shop)Conf', 987, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=e60c383566414868&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9093, 969, 1231, 'Jobs in Qatar', 'Working with and showing leadership to site engineers and co-ordination at site on a multi-million high end mixed use and residential development.\nThe Resident Engineer (RE) should have good communication skills (written and verbal), with ability to work under pressure and drive efficiency within the team. The candidate will also lead a team of MEP/Civil engineers and inspectors.\nThe candidate is expected to have at least 12 years experience, of which a minimum of 8 years in the Gulf. The candidate will report to the Client management team on a daily basis and is expected to interact regularly with the Head Office.\nThe RE is expected to have the ability to mange well a team of MEP engineers, Civil and admin support.\nIt is expected that he leads contractors meetings, monitor progress of work, and report internally and to the client.\nHe is expected to have good analytical and problem solving skills, and ability to manage difficult situations.\nHe is expected to be pro-active and forward thinking.\nThe candidate should have an architectural qualifications, with a minimum of 15 years of practice. He should also have experience on Project Management and leading a team on large developments.\nThe candidate should have a good understanding of structural and Building Services Design. We are seeking an all rounder, keen and enthusiastic to expand the services we offer and to be a key team player. Also the candidate shall have excellent English communication and writing skillsSNC Lavalin\'s Atkins business is one of the largest multidisciplinary, multi sector engineering design consultancies in the world and is part of the SNC Lavalin Group.\nAs one of the worlds most respected design, engineering and project management consultancies with a leading track record in the defence sector, Atkins are ideally placed to respond to this market. We have a broad establishment and proud, 50 year history throughout the Middle East region.\nWe provide a full range of design, engineering and proj', 987, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=503ce756b3c82f09&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9094, 970, 1231, 'Jobs in Qatar', 'Atkins is one of the world\'s leading rail engineers. We have established a high profile presence in the Middle East through our role as Lead Designer on the Dubai Metro project and the Rail Systems designer on the Makkah Metro in the Kingdom of Saudi Arabia and also Preliminary Designer for Etihad Rail in Abu Dhabi.\nWe are seeking a senior, qualified and experienced Integration & Interfaces Manager to provide expert advice and consultancy services. The Integration & Interfaces Manager is responsible for the overall technical coordination of the project, System and Civil work, for a proper integration in all technical and operational areas.\nWhile initially assigned to a specific project, the role will support the Core Team to further support Atkins in future projects within the region.\nRole:\nReporting to the head of Systems & Assurance, responsible for leading integration & interface services on rail projects through the application of systems engineering processes. To support business development and project delivery obligations for the Transportation sector.\nResponsibilities:\nManage Atkins obligations for Systems integration and integration Management for its contracted services covering Interface, Integration & Requirements management.\nIdentify client requirements, deliverables and prepare integration and integration program schedules.\nPlan, schedule and monitor the status of the integration and integration milestones within the project to ensure deliverables are submitted on time and on quality.\nPreparation of functional analysis / specify the project integration and integration requirements\nManage and coordinate the integration of integration and integration requirements through the project lifecycle with demonstrable evidences.\nLead technical discussions/ presentations with other engineering parties, Clients, ISA or other certification bodies.\nTechnical lead of a project interface and integration teams\nKnowledge transfer to other suitable Atkins staff.\nAtkins h', 987, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=fc20c395440469a2&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9095, 971, 1231, 'Jobs in Qatar', 'Atkins is one of the world\'s leading rail engineers. We have established a high profile presence in the Middle East through our role as Lead Designer on a number of prestigious Metro, Monorail and Mainline Rail projects within the Middle East.\nWe are seeking a qualified and experienced Requirements & Configuration Manager to provide expert advice and consultancy services to an extensive internal and external client base. This role requires strong technical background in a multi-disciplinary consulting environment primarily within the rail industry. The successful applicant will be a team member also contributing to large scale urban rail projects throughout the Middle East. The person will also assisting developing business by increasing the current client base and furthering client relationships through identifying opportunities for future works and services.\nFundamental broad experiences in the rail industry are seen as essential to determine optimum scheme design options and system performance during project phases of Feasibility, Concept, Preliminary, Detailed Design stages of a projects lifecycle. Experience of independent design verification and also site supervision is also highly desirable.\nWhile initially assigned to a specific project, the role will support the Core Team to further support Atkins in future projects within the region.\nRole:\nReporting to the head of Systems & Assurance, to provide Requirements & Configuration Management expert advice and consultancy services to be considered in all design stages and also the systems engineering processes to satisfy business development and project delivery obligations for the Transportation sector.\nResponsibilities:\nUndertaking systems engineering (SE) tasks in line with good practice and relevant industry standards\nManage Atkins obligations for Requirements & Configuration Management for its contracted services.\nDevelopment & implementation of Requirements & Configuration Management plans across all discipl', 987, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=c452b2ffde3695a5&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9096, 972, 1231, 'Jobs in Qatar', 'Atkins is one of the world\'s leading rail engineers. We have established a high profile presence in the Middle East through our role as Lead Designer on the Dubai Metro project and the Rail Systems designer on the Makkah Metro in the Kingdom of Saudi Arabia and also Preliminary Designer for Etihad Rail in Abu Dhabi.\nWe are seeking a qualified and experienced RAMS Engineer to provide expert advice and consultancy services to an extensive internal and external client base with a focus on the transportation. This role requires strong technical background in a multi-disciplinary consulting environment primarily within the rail industry. The successful applicant will be a team member also contributing to large scale urban rail projects throughout the Middle East. The person will also assisting developing business by increasing the current client base and furthering client relationships through identifying opportunities for future works and services.\nWhile initially assigned to a specific project, the role will support the Core Team to further support Atkins in future projects within the region.\nRole:\nReporting to the head of Systems & Assurance, to provide Reliability, Availability, Maintenance & operational Safety Engineering services on rail projects in compliance EN50126. To support business development and project delivery obligations for the Transport sector.\nResponsibilities:\nCreating the documentation required to verify that the design is meeting the customer requirements and adhering to the processes established for the project;\nCreating, managing and assessing Hazard Logs, ALARP determination, Control Measure apportionment and traceability, assessing design safety features;\nAssisting Stakeholders, Engineering and Project Management in understanding the Safety Engineering effort so that they can better understand and forecast the scope of their projected activities;\nPreparing for and participating in Hazard Analysis workshops, Project Design Reviews, Safety Desig', 987, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=6f6d3ec9f24b4169&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9097, 973, 1231, 'Jobs in Qatar', 'Digital Asset Management Business Development Manager\nWhat we are trying to do\nDeliver diverse Digital Asset Management projects, covering anything from implementing innovative uses of new technology, formulating national guidance, providing strategic direction for asset management policy and using data and analysis tools to develop works programme\nTransform and grow the Middle East region approach to asset management across the transportation, buildings, energy, defence and power sectors\nGuide clients through solving some of their most complex challenges by providing a unique combination of management consulting, technology, and engineering expertise\nAging assets, funding shortfalls, evolving government priorities and emerging disruptive technologies; infrastructure owners and operators are facing a multitude of challenges.\nClients are increasingly leveraging multi-disciplinary experts utilizing a solutions-driven approach and a solid foundation in engineering practices to meet their organizations challengesSNC Lavalin\'s Atkins business is one of the largest multidisciplinary, multi sector engineering design consultancies in the world and is part of the SNC Lavalin Group.\nAs one of the worlds most respected design, engineering and project management consultancies with a leading track record in the defence sector, Atkins are ideally placed to respond to this market. We have a broad establishment and proud, 50 year history throughout the Middle East region.\nWe provide a full range of design, engineering and project management services for buildings, transportation and other infrastructure programmes.\nAtkins in the Middle East now employs around 2,000 staff serving Gulf clients across all market sectors from offices in Abu Dhabi, Al Ain, Doha, Dubai, Jeddah, Kuwait City, Manama, Muscat, Riyadh, and Sharjah.\nWhat we are looking forDigital Asset Management Sales Leader to drive sales in the Middle East Region for the Digital Asset Management Market. The role will work w', 987, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=3b08c214da9f00ef&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9098, 974, 1233, 'Jobs in Qatar', 'Atkins is one of the world\'s leading rail engineers. We have established a high profile presence in the Middle East through our role as Lead Designer on a number of prestigious Metro, Monorail and Mainline Rail projects within the Middle East.\nWe are seeking a qualified and experienced Systems Assurance Manager to provide expert advice and consultancy services to an extensive internal and external client base. This role requires strong technical background in a multi-disciplinary consulting environment primarily within the rail industry. The successful applicant will be a team member also contributing to large scale urban rail projects throughout the Middle East. The person will also assisting developing business by increasing the current client base and furthering client relationships through identifying opportunities for future works and services.\nWhile initially assigned to a specific project, the role will support the Core Team to further support Atkins in future projects within the region.\nRole:\nReporting to the head of Systems & Assurance, to provide Systems Assurance Management expert advice and consultancy services to be considered in all design stages and also the systems engineering processes to satisfy business development and project delivery obligations for the Transportation sector.\nResponsibilities:\nManage Atkins obligations for Systems Engineering and Assurance Management for its contracted services.\nSet up project safety program and RAM program (including FRACAS).\nCreate system assurance plan, RAM Plan & Safety Plan and lead the safety and RAM process in the project\nPlan, schedule and monitor the status of the Systems Assurance milestones within the project to ensure deliverables are submitted on time and on quality.\nPreparation of functional analysis and requirements for RAM and safety\nAnalyse / specify the project safety, reliability, availability and maintainability (RAM) requirements\nPrepare and coordinate the tasks of the safety process for the', 989, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=f9df3ddeb08a36db&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9099, 975, 1231, 'Jobs in Qatar', 'Project Controls Manager, c. $300k pa tax free, Elite Recruitment Group, Saudi Arabia.\nOur client is a leading Engineering Company part of an international consortium responsible for the Design and Construction of a Major Rail / Metro project in Saudi Arabia.\nA great opportunity has arisen for a Rail Project Controls Manager to manage the planning function (and potentially other project control functions) on this iconic and and and large scale project. As the salary indicates it, our client is looking for a highly talented and experienced Project Controls Manager (rail, metro, construction, infrastructure).\nJOB DUTIES:\nThe Project Controls Manager (Rail) will prepare and develop Master schedule for the rail project utilizing WBS system, resource and cost loaded\nManage the progress of the metro project and immediately report any major deviations, issues or delays through his hierarchy for the purpose of notifying the project Consortium\nThe Project Controls Manager (Rail) will be responsible for monitoring, reporting and trending of project cost and schedule activities through all phases of the project\nWork closely with and assist the rail Project & Deputy Project Managers in developing and implementing a project controls plan (cost, schedule, deliverables)\nThe Project Controls Manager (rail/metro) will assist in the development and review of the rail / metro project’s implementation cost loaded schedule\nMonitor potential cost and schedule problems and recommend corrective actions\nSet up and configure in-house software tools and systems to gather data and monitor progress against plan throughout the project\nPerform Risk Analysis using Pert Master (If requested)Prepare monthly or as needed Earned Value reports\nParticipate in the preparation of monthly progress report through thematic scheduling reports\nExpected to work flexibly and efficiently, to maintain the highest professional standards.\nCANDIDATE REQUIREMENTS:\nMinimum 10-15 years of project scheduling experience o', 987, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=77bb845eedb094a5&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9100, 976, 1231, 'Jobs in Qatar', 'As part of our regional growth plans, we are currently looking for a Senior Architect.This person works as part of an architectural design team. This team member plans, schedules, organizes, coordinates and executes the design work on small to medium scale projects (or distinct portions of larger projects), with periodic interaction with an Associate or Associate Director.\nAtkins has been established in the Gulf for over 40 years, having first carried out design and supervision commissions in the Gulf area in 1967. The regional head office (Dubai) was established in 1979.\nSNC Lavalin\'s Atkins business is one of the largest multidisciplinary, multi sector engineering design consultancies in the world and is part of the SNC Lavalin Group.\nAs one of the worlds most respected design, engineering and project management consultancies with a leading track record in the defence sector, Atkins are ideally placed to respond to this market. We have a broad establishment and proud, 50 year history throughout the Middle East region.\nWe provide a full range of design, engineering and project management services for buildings, transportation and other infrastructure programmes.\nAtkins in the Middle East now employs around 2,000 staff serving Gulf clients across all market sectors from offices in Abu Dhabi, Al Ain, Doha, Dubai, Jeddah, Kuwait City, Manama, Muscat, Riyadh, and Sharjah.\nResponsibilities\nAbility to fulfill all the duties and responsibilities.\nDeveloped architectural design skills and understanding of the design process and interfaces between design disciplines.\nExtensive project experience.\nDeveloped leadership skills.\nDeveloped communication skills.\nFlexibility of attitude towards company objectives.\nCordial relationships with clients and stakeholders.\nUnderstanding of Atkins commercial management of projects.\nUnderstanding of scope definition and scope interface.\nDeveloped presentation skills.\nProficiency in AutoCAD and REVIT, word processing and presentation progra', 987, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=5504b9e9cc9de963&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06');
