(9101, 977, 322, 'Jobs in Qatar', 'As part of our regional growth plans, we are currently looking for an experienced Senior Design Engineer Wet Utilities infrastructure.\n\nThe Senior Design Engineer will also be responsible for maintaining and enhancing Atkins reputation with our clients and developing effective long term client relationships thus identifying and developing new opportunities for the Group.\n\nThe Senior Design Engineer will:\nPrepare schematic and detailed civil engineering designs for property developments and road infrastructure projects.\nPrepare technical and commercial specifications, coordinate with vendors and assist in preparation of Bill of Quantities.\nAssist in preparation of technical proposals for Bids.\nCoordinate with globally remote design teams and flexible for short visits to other Atkins offices globally.\nAssist in coordinating and obtaining approvals from statutory authorities.\nLiaise with site teams and assist in addressing site queries or request for inspection (RFI).\nEnsure quality of design with considerations to value engineering and construction safety.\nCoordinate with multi-disciplinary teams and take ownership from initiation to completion of tasks.\nShare knowledge and mentor team.Atkins has been established in the Gulf for over 40 years, having first carried out design and supervision commissions in the Gulf area in 1967. The regional head office (Dubai) was established in 1979.\n\nWe provide a full range of design, engineering and project management services for buildings, transportation and other infrastructure programmes.\n\nAtkins in the Middle East now employs around 2,000 staff serving Gulf clients across all market sectors from offices in Abu Dhabi, Al Ain, Doha, Dubai, Jeddah, Kuwait City, Manama, Muscat, Riyadh, and Sharjah.\nRequirements\n\nThe Senior Design Engineer should be:\nMME Grade A Registered Civil Engineer in Qatar.\nChartered Professional with more than five years experience in Qatar is preferred.\nExperienced in design and hydraulic modelling of grav', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=568a09614fa152ec&from=serp&vjs=3', '2018-07-17 11:19:06', '2018-07-17 11:19:06'),
(9102, 978, 1235, 'Jobs in USA', 'Paramount Recovery Service is Arizona\'s fastest growing Repossession Company. Due to rapid growth we are looking to expand our team and invite a Camera Car/Scout Car Driver to join our field staff. In this position you would drive a company owned vehicle equipped with the latest License Plate Recognition Technology.This position would be centrally located in Phoenix, AZ.Qualifications: Clean MVRCurrent Drivers licenseMust be at least 23 years oldAble to pass background check to pass state licensing requirements (sorry no felonies)Able to pass pre-employment and random drug testingIntermediate computer skillsAbility to stay calm under pressure and de-escalate situationsBe self-motivated and have a strong eagerness to work.Neat and clean appearance.Must be able to work all shifts including weekends.Training: New hires will receive training with our team of highly experienced staff. Training will consist of camera car operations, computer software, general paperwork, and all applicable laws and regulations.Experience: Prior Driving Experience for a company (moving, delivery, repossession preferred).License or certification: Current Driver License/ Clean MVR (Required)Job Type: Full-timeSalary: $300.00 to $700.00 /weekExperience:Commercial Driving: 2 yearsLicense:Driver\'s LicenseRequired work authorization:United States', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Paramount-Recovery-Service/jobs/Camera-Car-Scout-Car-Driver-2d3e76acef6e272a?vjs=3', '2018-07-17 14:40:06', '2018-07-17 14:40:06'),
(9103, 979, 1237, 'Jobs in USA', 'Summary of Position: Provide individualized and quality transportation services to individuals were serve. Cortney\'s Place client drivers operate vehicles to safely transport passengers with physical, emotional or developmental disabilities utilizing a radio-equipped vehicle between residences and other designated areas. Cortney\'s Place client drivers may follow a predetermined route or obtain individual trip information shortly before a trip is needed. The Cortney\'s Place vehicle fleet is comprised of passenger vans and cutaway buses that may be equipped with wheelchair lifts and seats with safety belts and harnesses.You are hired to a position not a location. You may be relocated based on the needs of the program. Essential Functions: Assist in the maintenance of departmental operations to achieve compliance with contract requirements, accreditation, licensing and monitoring standards, agency procedures, Federal/State/Local regulations and all other licensing/regulatory agencies as directed. Adhere to current training requirements and applicable accreditation and licensing/regulatory standards and compliance with the Health Insurance Portability and Accountability Act (HIPAA) and Health Information Technology for Economic Clinical Health (HITECH) requirements.Most of a driver\'s workday is spent sitting. Drivers must also be physically fit and able to lift heavy objects as He/she assists passengers in and out of vehicles; as needed. A driver is expected to safely operate their vehicle in all kinds of weather and on all types of highways and roadsProvides necessary assistance to passengers according to the varying needs of each individual;Operates specialized equipment necessary in the safe transport of variously abled passengers, i.e., wheel chair lift, restraints;Complete pre-trip inspections (check lights, brakes, steering, tires, radiator and oil level, etc., prior to beginning each shift) and post-trip inspections.Makes required reports of passengers transporte', 947, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Cortney\'s-Place/jobs/Van-Driver-4b94f9bdd27c9fed?vjs=3', '2018-07-17 14:40:06', '2018-07-17 14:40:06'),
(9104, 980, 1239, 'Jobs in USA', 'PositionCurrently, we have full-time and part-time openings. Shifts available Monday through Sunday with the start times of 9:00AM, 2:00PM and 5:00PM. Rotating weekends required. Please message us for more details.QualificationsAs an Independent Contractor; you are responsible for providing your own vehicle, insurance and fuel.Reliable vehicle with good gas mileage (25+ MPG).Knowledge of the different areas within the Greater Phoenix Metro Area.Clean Driving RecordCustomer Service Oriented with emphasis on patience.Good Communication SkillsProfessional AppearanceCell phone with TXT message and email capabilities.Past delivery, courier, taxi, Lyft and Uber experience a plus but not required.About UsWe are a Courier Company that provides 24 hours, 7 days a week package delivery services to all cities within Arizona. Our services range from scheduled deliveries to on demand deliveries. On occasions, we have \"Long Haul\" deliveries.Job Types: Full-time, Part-time, ContractRequired work authorization:United States', 919, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Red-Letter-Delivery/jobs/Courier-Driver-Independent-Contractor-4696a6e53768a981?vjs=3', '2018-07-17 14:40:06', '2018-07-17 14:40:06'),
(9105, 981, 1241, 'Jobs in USA', 'Position Description\nPlan and execute delivery activities including preparing delivery loads, following planned delivery routes, and assisting with merchandise installations or returns. Also responsible for unloading, installing, and checking appliances and store equipment. Responsible for the\ncleanliness and standard maintenance of delivery vehicles, and observing safety procedures regarding Department of Transportation (DOT) regulations, Hazmat, and power equipment tools, including complying with reporting.\nJob Requirements\nRequires morning, afternoon, and evening availability any day of the week. Physical ability to move large, bulky and/or heavy merchandise. Physical ability to perform tasks that may require prolonged standing, sitting, and other activities necessary to perform job duties. Appropriate Driver s License Required.\nMinimum Qualifications\nValid state-issued driver\'s license.\nAbility to read, write, and perform basic arithmetic (addition, subtraction).\nMinimum 21 years of age.\nPreferred Qualifications\n3 months experience operating forklift/power equipment such as lifts, order pickers, and similar equipment.\n6 months experience performing in-home delivery OR retail customer service.', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=bb6e6aeb5847132a&from=serp&vjs=3', '2018-07-17 14:40:06', '2018-07-17 14:40:06'),
(9106, 982, 1242, 'Jobs in USA', 'Non-emergency medical transportation company looking for reliable and dependable drivers with good driving records to transport wheelchair patient to and from, home, hospital, doctor’s office, dialysis centers etc. around MESA, CASA GRANDE, PHOENIX, ELOY, CHANDLER and surrounding metro area.STARTING PAY IS $11.00 per hour to start, this is an independent contractor job. Good position for taxi drivers and retirees. For brief phone interview, please contact Diane (800) 210-9298. This is a full-time position.REQUIREMENTS: Must be 30 years or older, with a valid Arizona driver’s license.1 – Legal Status to work in the United States2 --Clean Driving records (NO DUI’s, NO SPEEDING TICKETS, NO SUSPENSIONS, NO CELL PHONE TICKETS, NO RECKLESS DRIVING TICKETS) in past 3 years3—Clean criminal record4—Able to pass drug screen and physical5—Clear a 10-year DOT background check.6—Must be able to read and speak English fluently.7—Must be punctual, reliable and honest.8—Must have knowledge of Phoenix Metro and surrounding rural areas.9—Must be Non-Smoker10—Must have working cell phone with GPS capabilities.Job Type: Full-timeSalary: $11.00 /hourExperience:driving: 10 yearsLocation:Phoenix, AZ 85022Language:EnglishRequired work authorization:United States', 323, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Med--Ride-Transportation/jobs/Non-Emergency-Medical-Driver-8921986ec7ff5a78?vjs=3', '2018-07-17 14:40:06', '2018-07-17 14:40:06'),
(9107, 983, 1248, 'Jobs in Oman', 'Operation\nAssist Transport Supervisor in planning and allocating transport drivers to ensure timely pickup and drop services to all passengers, Cabin crew and VIP / VVIP as per incoming transportation requests.\nAssist Transport Supervisor in implementing control measures and work systems to monitor and achieve the Key Performance Indicators (KPIs), satisfy the Airlines’ requirements and Service Level Agreements (SLA) as well as comply with the rules and regulations set by clients and authorities.Assist Transport Supervisor in monitoring adherence of Transport Drivers to uniforms and safety gears and ensure all management policies, procedures and guidelines are followed by all Transport staff.\nAssist Transport Supervisor in checking attendance of staff against duty roster and report all attendance discrepancies (e.g. sick leave, absenteeism) including missing from place of work.\nAssist Transport Supervisor in preparing allocation sheet based on flight schedule and ensure compliance of all transport drivers.\nAssist Transport Supervisor in carrying out supervision of Transport staffs and other duties on need basis.\nSubmit reports to Senior Officer – Transport regarding any operational issues which required attention and recommend possible solutions.\nEnsure compliance to safety and security regulations.\nUpdate knowledge of current company policy and procedures by reading, memo, circulars and manual updates.', 994, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=6ac7dc4de74cab07&from=serp&vjs=3', '2018-07-17 14:40:06', '2018-07-17 14:40:06'),
(9108, 984, 1248, 'Jobs in Oman', 'Operational\nMonitor and plan the allocation of drivers for timely pickup/ drop services to all passengers, Cabin crew and VIP / VVIP as per incoming transportation request to/from the aircraft.\nCheck staff attendance and allocate effective replacements ensuring timely completion of transportation activities.\nMonitor flight schedule and drivers duty timings and there adhere to uniforms and safety gears in order to ensure all management policies, procedures and guidelines are followed by all Transport personnel.\nCoordinate with G.E. Support Team to ensure that all ground equipment are operationally safe to use and take necessary action steps for repair.\nCoordinate with Ramp Dispatch section for VIP’s, VVIP’s and ensure to allocate and provide adequate manpower and equipment.\nMonitor and ensure that assigned buses are dispatched to their respective flights as allocated in coordination with the Coordinator – Ramp Turnaround.Other Duties\nManage and motivate the performance and productivity of the teams with in the specific area of responsibility, and collaborate with peers and different sections of Ground Operations to achieve the most productive, cost effective and responsive quality solution for all activities and issues.\nMaintain regular co-ordination and communication with the other Supervisors and Resource Allocators on the shift to ensure that all activities are synchronized, adequately covered and that cross-utilization of resources is achieved where necessary.\nProactively identify and deal with operational issues, and work with allocators to solve as required.\nEnsure that the handover process from one shift to the other is carried out in an efficient manner.\nWhile ensuring compliance to the corporate safety standards and safe practices conduct preliminary investigations into any incidents / accidents / discrepancies and provide the operational management with reports of any / all irregularities faced during the shift.\nConduct follow-up on-job mentoring to all new', 994, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=83f234a1e47ab18c&from=serp&vjs=3', '2018-07-17 14:40:06', '2018-07-17 14:40:06'),
(9109, 985, 1248, 'Jobs in Oman', 'Operational\n Oversee all RAMP activities in civil section under the RAMP services covering the following sections;\nRAMP Loading; and\nGSO/ Drivers\nMonitor all staffing levels and ensure to maintain high standards of Safety of staff and equipment’s at all times in line with DGSAS standards and guidelines set by the company.\nMonitor to ensure that all airlines grounded in Muscat airport are getting the customer service that they are paying for as per their agreement.\nConstantly monitor and prepare Equipment’s requisition report and forward it to Senior Officer – RAMP/Ramp Manager for equipment’s procurement approval and processing.\nMonitor On Time Performance (OTP) of aircraft with regards to equipment, manpower stationed, catering and transportation to achieve timeliness and smooth departure process of all flights from Muscat Airport.\nMonitor, maintain and ensure that management policies are enforced and strictly followed by all staff personnel working under RAMP section.\nInvestigate and resolve RAMP discrepancies near aircraft with regards to equipments or liaise with respective user department within Ground Operations/ GSEW department to assist in repairing the equipment and follow up to completion. Upon failure to resolve, escalate the issue to Senior Officer - RAMP to take necessary action steps.\nCarry out special assignments as per senior management requests which involve Teachers Charters, Haj Flights, (Khareef festivals and VIP movements.)\nEnsure compliance to safety and security regulations. Staff shall be responsible and accountable to follow safety policies.\n Update knowledge of current company policy and procedures by reading, memo, circulars and manual updates.\nLine Manager holds the authority to change assigned duties.', 994, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=39bb24417eba76e4&from=serp&vjs=3', '2018-07