(9110, 986, 1248, 'Jobs in Oman', 'Operational\n\nPre-flight Preparations\nPrepare and update staff allocation plan to ensure that all flights is being handled by adequate Turnaround Coordinators and adequate availability of supporting manpower (Equipment Operators, Drivers, Porters, Cleaners, etc.)\nCheck to ensure that all staff adhere to safety measures and dress code such as PPE and other related measures\nCoordinate with Apron Services, Transport and Cabin Appearance sections to ensure that all ground equipment are operationally safe to use and liaise with GSEW to take necessary action steps for repair.\nCoordinate with other departments involve in the turnaround handling of a flight.\nCoordinate with the following sections for providing special services to VIP and VVIP\nTransport and Cabin cleaning section: for carrying out cleaning services and proving special transportation.\nApron Services: for providing adequate manpower.\nBaggage Handling Unit: for carrying out timely baggage handling services.\nFlight on Ground\nMonitor all flights and ensure that ramp turnaround activities are carried out as per the various airline requirements, the Service Level agreements and that the on-time-performance (OTP) of flights are maintained.\nMonitor and ensure all passengers disembarked with adequate facilities to special need passengers such as wheelchair and unaccompanied minors\nMonitor and ensure the baggage loading/offloading is carried out based on flight and passenger priority\nMonitor and ensure that all cargo loading/offloading is carried out within the stipulated time\nMonitor, coordinate and ensure that catering department sends right amount of food as per the passenger requirements\nCoordinate with Baggage Handling Unit to ensure timely baggage handling services is carried out to/ from the aircraft and check if all baggage checked in at the counter is loaded into the aircraft\nMonitor and ensure safe operation of all equipment in the RAMP area.\nPost Flight Activities\nPrepare Shift Report giving complete informat', 994, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=29634a49548f198d&from=serp&vjs=3', '2018-07-17 14:40:06', '2018-07-17 14:40:06'),
