(9112, 987, 322, 'Jobs in KSA', 'As a humble family business that started on the banks of the Dubai Creek in the 1930s, Al-Futtaim has expanded to a presence in 31 countries, a portfolio of over 200 companies, and 42,000 employees. You’ll find us in industries ranging from automotive and retail, to finance and real estate, and connecting people with international names like Lexus, Ikea, Robinsons, and Adidas. Our team is proudly multicultural and multinational because that kind of diverse representation gives us the global mindset to grow and impact the people, markets, and trends around us.\nCome join us to live well, work better, and be the best.\n\nAbout the Position:\nWe are looking to recruit a Forklift operator to join the team within Al Futtaim Logistics, located in Riyadh, KSA.\nJob Purpose :\nThe main purpose of the role is to ensure on a day to day basis all customer requirements are managed and planned for operations and other internal departments within agreed service levels and adhering to all KSA rules and regulations.\nReporting to the Warehouse Supervisor you will be responsible for the adherence to all group policies for self and team members. HR policies, EHS policies, Al-Futtaim way behavioral standards.\nAbout You:\nThe ideal candidate will have the following qualifications, experience and skills:\nKEY Qualities:\nPhysical fitness\nExperience of working within a target driven industry\nPrevious experience of driving Forklift in the KSA, preferably with license\nMinimum basic level of education\nAble to work under pressure\nBe a team player\nManual handling experience\nFlexibility and punctualityMinimum Qualifications and Knowledge: School completion certificate\nMinimum Experience: 2 years in similar role\nJob-Specific Skills: Good Knowledge of Basic English & numbers\nBehavioural Competencies: Effective communication and strong interpersonal skills, with excellent planning capacity. Ability to solve problems and work under pressure\n\nWe’re here to provide excellent service but a little help from you', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=debef2729f601d81&from=serp&vjs=3', '2018-07-17 14:40:06', '2018-07-17 14:40:06'),
(9113, 988, 1099, 'Jobs in UAE', 'Do you see yourself as a Driver – Front Office?\nWhat\'s your passion? Whether you\'re into scuba diving, golf or dancing the tango, at IHG we\'re interested in you. We love people who apply the same amount of passion and precision to their jobs as they do to their hobbies - people who put our guests at the heart of everything they do. And we\'re looking for more people like you to join our friendly and professional team - people that help us create great hotels guests love.\nThe Crowne Plaza Dubai, with over 568 rooms, 13 international restaurants and bars, and one of the largest meeting, conference and banqueting facilities in the UAE, is looking to recruit a Driver – Front Office.\nYou\'ll be an integral member of the hotel\'s Front Office team. This role reports to the Front Office Manager, and within the limits of established InterContinental Policies and Procedures.\nIdeally, you\'ll have some or all of the following qualifications and experience we\'re looking for:\n1. Valid UAE LMV license no. 3 for at least one year\n2. Well groomed and Presentable\n3. Excellent communication skills\n4. Good knowledge of buildings and landmarks.\n5. Keep track of all addresses figures for future reference\n6. Responsible for running errand tasks for the Front Office as ordered by the Front Office Manager.\nIn return we\'ll give you a competitive tax-free financial and benefits package, hotel discounts worldwide and the chance to work with a great team of people.\nSo what\'s your passion? Please apply on-line and tell us how you can bring your individual skills to IHG.\nWe are an equal opportunity employer.', 894, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=2fbeb4d7bdf04d6d&from=serp&vjs=3', '2018-07-17 14:40:08', '2018-07-17 14:40:08'),
