(9117, 990, 1265, 'Jobs in Qatar', 'Job Purpose\nThe Light Driver will deliver cargo to customer locations and vice versa, and be responsible for the security and handling of the products.\nRoles and Responsibilities\nTransport the cargo Safely and on time to the respective sites\nEnsure documentation is followed as per company rules\nTaking care of the Vehicle allotted to him and ensure the daily check list is followed properly\nOn time reporting for duty, neat and proper driving, accident free and wearing PPE\nShould be capable of operating smart phones as company will be providing similar hand held devices.Minimum Qualifications\nHigh school or should possess Basic English speaking skills or equivalent preferred.\nMinimum Qualifications\nMinimum 3 years of experience in a similar role with valid Qatar light vehicle license.', 1011, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=4ec0322062b9b1c3&from=serp&vjs=3', '2018-07-17 14:40:08', '2018-07-17 14:40:08'),
(9118, 991, 1267, 'Jobs in Qatar', 'QR17940 - Driver / Messenger (Line Maintenance) | Qatar Airways | Doha\nOrganisation: Qatar Airways\nJob Function: Technical Engineering\nDivision: Technical (Engineering) (Division)\nEmployment Type: Full Time - Permanent\nCity: Middle East | Qatar | Doha\nLast date of application: 18-Jul-2018\nQatar Airways\nWelcome to a world where ambitions fly high\nFrom experienced pilots to dynamic professionals embarking on new careers, Qatar Airways is searching for talented individuals to join our award-winning team.\nWe take pride in our people—a dynamic and culturally diverse workforce is essential to why we are one of the finest and fastest growing airlines in the world.\nWe offer competitive compensation and benefit packages.\nAbout Your Job:\nYou will be responsible for collection and distribution of documentations from assigned sections/departments and vice versa is delivered, without error and within set timeframes. You will handle the transport service for internal customers in a safe and timely manner and ensuring that vehicle is maintained to acceptable safety standards. You will ensure that the line maintenance supplies arriving at Technical Gate 1 & 2 to be collected on time.\n\nOperational\nSafely transport colleagues or internal customers to various locations in a timely, safe and courteous manner.\nAccompanying visitors for line management from Technical building to airside areas as advised\nArrange and follow up visitor passes during AOG situations.\nMaintain driver logs, daily-running charts accurately and complete pre-trip inspections to ensure company vehicle records are maintained as per company standard.\nRegular washing/cleaning of management and line maintenance vehicles which is to be done through QAS\nWorkshop.\nHandle the distribution, collection and delivery of documents/mail delivered to various locations in a timely and efficient manner.\nCollection and maintain inventory of materials, pantry supplies, stationeries from Technical gates &\ncollection of reflective jack', 1013, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=4f9270749e5dbd9c&from=serp&vjs=3', '2018-07-17 14:40:08', '2018-07-17 14:40:08'),
(9119, 992, 1267, 'Jobs in Qatar', 'QR15473 - Driver / Porter (Heavy Vehicle) | Qatar Duty Free | Doha\nOrganisation: Qatar Duty Free\nJob Function: Logistics & Warehouse\nDivision: QDFC (Division)\nEmployment Type: Full Time - Permanent\nCity: Middle East | Qatar | Doha\nLast date of application: 31-Jul-2018\nQatar Duty Free\nQatar Duty Free (QDF) is an award winning subsidiary of Qatar Airways, the national airline of the state of Qatar and currently operates at the Departure, Arrivals, VIP and Premium Terminal of Hamad International Airport. As one of the fastest growing Duty Free operations in the world, Qatar Duty Free operates from the new Hamad International Airport (HIA). HIA is also home to the newly created QDF Food & Beverage Division which will set new benchmarks in airport hospitality.\nAbout Your Job:\nAs a Driver/Porter you will transport and deliver stocks and staff to and from various Qatar Duty Free locations. When required you will need to assist storekeepers in unloading goods from containers, arranging the stock picking locations and in doing timely stock delivery to various shop locations. It involves continuous physical movements. Work load also shall include any other jobs as required for the warehouse operations as indicated by warehouse officer and supervisors on a time to time basis.\nAbout You ::\nTo be eligible for this position you should have minimum high school level education with at least 1 year driving experience in related field. Applicants must possess a valid Heavey vehicle driving license and an airport driving license will be an advantage. You will have good oral and written communication skills in English language and you will have good knowledge of good hygiene practice and food safety.\nNote: you will be required to attach the following:\n1. Resume / CV\n2. Copy of Passport\n3. Copy of Highest Educational Certificate\n4. Copy of Driving License', 1013, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=c211594247c2dfe3&from=serp&vjs=3', '2018-07-17 14:40:08', '2018-07-17 14:40:08'),
