(9121, 994, 1270, 'Jobs in Qatar', 'Shuttle Bus Driver-(OCN) (QBO000195)\nDescription\nFUNCTIONAL TITLE:Bus Driver-(OCN)\nJOB LOCATION/DEPARTMENT:Qatar - LSB\nPOSITION SUMMARY:\nThis position is designed for a foreign national that would deploy to work in Doha, Qatar on a DOD (Department of Defense) contract.\nThe position will require the candidate to successfully complete the work permit and residency process for Qatar.\nBus Driver is responsible to ensure that he maintains and follow the designated routes and ensure that all Shuttle Bus’s are well maintained.\nMAJOR JOB ACTIVITIES:\nDrives the shuttle bus inside CAS.\nInspect and monitor bus operation and report any abnormalities.\nPerforms other duties and assignments as required.\nMATERIAL & EQUIPMENT DIRECTLY USED: Shuttle Bus.\nWORKING ENVIRONMENT/PHYSICAL ACTIVITIES:\nIn this position there is exposure to physical and working conditions where serious accidents or injuries may occur, exposure to disagreeable noise elements and prolonged high ambient temperatures.\nMust be able to understand the customers needs, and be able to solve problems dealing with whatever nationality.\n1.Must be able to lift/push/pull 35-45 lbs.\n\nQualifications\n\nMINIMUM QUALIFICATIONS:\nQatar Driving License\nEducation/Experience:\nHigh School diploma or equivalent is required.\nRequires as a minimum knowledge driving safety and other hazards associated with driving. Previous driving experience with a School Bus is a plus.\nDemonstrated written and verbal communication skills in American English at a 9th grade level\nProgram Specific Requirements:\nMust be able to coordinate activities of a multi-national and culturally diverse work force.\nPossess knowledge of safety and environmental issues as they relate to shuttle bus driving.\nAccustomed to dealing at executive level.\nSECURITY CLEARANCE: None\nNOTICE: This position description is subject to change at any time as needed to meet the requirements of the program or company.\nFREEDOM TO ACT: Reports to the Bus Supervisor and functions under limite', 1016, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=a339c01f457d24a4&from=serp&vjs=3', '2018-07-17 14:40:08', '2018-07-17 14:40:08'),
(9122, 995, 1250, 'Jobs in Qatar', 'No two days are the same at Al-Futtaim, no matter what role you have. Our work is driven by the desire to make a difference and to have a meaningful impact with the goal of enriching everyday lives. Take our engaging and supportive work environment and couple it with a company culture that recognises and rewards quality performance, and what do you get? The chance to push the limits every single day.\nAs a humble family business that started on the banks of the Dubai Creek in the 1930s, Al-Futtaim has expanded to a presence in 31 countries, a portfolio of over 200 companies, and 42,000 employees. You’ll find us in industries ranging from automotive and retail, to finance and real estate, and connecting people with international names like Lexus, Ikea, Robinsons, and Adidas. Our team is proudly multicultural and multinational because that kind of diverse representation gives us the global mindset to grow and impact the people, markets, and trends around us.\nCome join us to live well, work better, and be the best.\nAbout the Position:\nWe are currently looking to recruit an experienced Driver | Al Futtaim Vehicle Rental | Doha, Qatar. As a Driver, you will ensure that the customer is dealt with in a pleasant, professional and efficient manner providing best in class customer service by adhering to agreed AVR standards concerning vehicle check out, delivery, collections, exchanges, transfers process, banking lodgments, collection of payments and delivery on invoice/agreements/forms to clients.\nAbout You:\nTo be successful in winning this role, you should be able to provide demonstrable experience of the following:\nPossess a valid Qatar Driver’s License\nHigh School or equivalent\nExcellent customer service skillsWe’re here to provide excellent service but a little help from you can ensure a five-star candidate experience from start to finish.', 996, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=db4231cea4b4b6df&from=serp&vjs=3', '2018-07-17 14:40:08', '2018-07-17 14:40:08'),
(9123, 225, 1279, 'Jobs in Oman', 'The Ordnance Technician receives, stores, inspects, handles, transports, accounts for, and maintains U.S. Navy (USN) Ordnance/Weapons, Armament/Weapons Support Equipment (AWSE), Material Handling Equipment (MHE), and supporting resources to support intransient Patrol Squadron aircraft. As an integral part of the Munitions Department, also performs all assigned actions in support of USAF Munitions. Supervises Asian/LN Munitions Workforce. Carries out all duties in accordance with DynCorp ISO 9000 Quality and Safety Standards.\n\nPrincipal Accountabilities\nConsistently observes and enforces all USN, USAF and host nation explosives safety, AFOSH, and security standards during all explosives and non-explosives operations.\nIn the event of an emergency, takes necessary control and timely response actions.\nConducts all ordnance work according to established quality processes, identifying potential problems and recommending solutions.\nSupervises Asian/Local National Munitions Workforce, providing clear instructions about the work.\nReconditions, repairs, and replaces defective or missing parts of ordnance and containers.\nPerforms ordnance storage actions according to stringent explosives standards.\nAchieves and maintains all ordnance qualification and certification training requirements.\nWorks closely with the Munitions Superintendent to resolve any serviceability and accountability issues noted during ordnance operations.\nTows weapons and ready service ordnance to and from flight-line.\nPrepares and configures alert ordnance loads in accordance with applicable directives.\nUploads/downloads carrier with incoming and outgoing munitions shipments.\nPerforms all applicable weapons load inspections in accordance with applicable technical orders.\nMaintains the USN technical data and publications library according to standards.\nUses designated USN accountability ordnance system to account for all ordnance.\nInspects, operates and performs maintenance on light vehicles and handling equi', 1021, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=a8442d917685f098&from=serp&vjs=3', '2018-07-17 21:37:54', '2018-07-17 21:37:54'),
