(9126, 998, 1270, 'Jobs in Qatar', 'CUSTODIAN /DRIVER (OCN) (QBO000202)\nDescription\nFUNCTIONAL TITLE:Custodian/Driver\nJOB LOCATION/DEPARTMENT: Qatar - BOSS\nPOSITION SUMMARY:\nThis position is designed for a foreign national that would deploy to work in Doha, Qatar on a DOD (Department of Defense) contract. The position will require the candidate to successfully complete the work permit and residency process for Qatar.\n1. This position performs daily cleaning and sanitizing of latrines, offices,\n common hallways, entrances and exits of housing and billeting units.\n2. Police call of areas within area of responsibility as per current contract.\n3.Bus Driver is responsible to ensure that he maintains and follow the designated\n routes and ensure that all Shuttle Bus’s are well maintained.\nMAJOR JOB ACTIVITIES:\n1. Performs basic repair on items inside respective latrines.\n2. Documents and reports discrepancies.\n3.Clean, sanitize and maintain cleanliness of assigned areas as per\n instruction.\n4.Performs other duties and assignments as required.\n5.Driver of the shuttle bus\n6.Inspect and monitor bus operations and report any abnormalities\n MATERIAL & EQUIPMENT DIRECTLY USED:\nBasic cleaning materials. Buffing machine, Vacuum machine, Shuttle Bus\nWORKING ENVIRONMENT/PHYSICAL ACTIVITIES:\nIn this position there is exposure to physical and working conditions where serious accidents or injuries may occur, exposure to disagreeable noise elements and prolonged high ambient temperatures. Must be able to understand customer needs, and be able to solve problems dealing with whatever nationality.\n1.Must be able to lift/push/pull 35-45 lbs.\nQualifications\nMINIMUM QUALIFICATIONS:\n1. Qatar Driving License\n2. Indian Light motor (LMV) license\nEducation/Experience:\nHigh school diploma is required or equivalent.\nRequires a minimum knowledge driving safety and other hazards associated with driving. Previous driving experience with a School Bus is a plus.\nRequires as a minimum completion of high school, supplemented by at least one ', 1016, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=1e52a7ff5f8f9a08&from=serp&vjs=3', '2018-07-17 21:37:56', '2018-07-17 21:37:56'),
(9127, 999, 1270, 'Jobs in Qatar', 'Laborer/Driver (OCN) (QBO000196)\nDescription\nJOB LOCATION/DEPARTMENT: Qatar - BOSS\nPOSITION SUMMARY:\nThis position is designed for a foreign national that would deploy to work in Doha, Qatar on a DOD (Department of Defense) contract. The position will require the candidate to successfully complete the work permit and residency process for Qatar.\nThis position performs a variety of task related to electrical, HVAC, plumbing preventive and corrective maintenance jobs.\nResponds to whatever job/trades that needed additional personnel to perform tasks assigned.\nBus Driver is responsible to ensure that he maintains and follow the designated routes and ensure that all Shuttle Bus’s are well maintained.MAJOR JOB ACTIVITIES:\n1. Preventive Maintenance\n2. Service Orders\n3. Non value added work (Shop clean-up, Inventory of Tools)\n4. Performs other duties and assignments as required.\n5. Drives the shuttle bus inside CAS.\n6. Inspect and monitor bus operation and report any abnormalities.\nMATERIAL & EQUIPMENT DIRECTLY USED:\nBasic tools and equipment. Shuttle Bus.\nWORKING ENVIRONMENT/PHYSICAL ACTIVITIES:\nIn this position there is exposure to physical and working conditions where serious accidents or injuries may occur, exposure to disagreeable noise elements and prolonged high ambient temperatures. Outdoor environment, lifting, carrying, pushing and pulling heavy objects. Digging, parts chasing, bending and running electrical conduit mixing and spreading concrete.\nMust be able to understand the customer’s needs, and be able to solve problems dealing with whatever nationality\n1.Must be able to lift/push/pull 35-45 lbs.\nQualifications\nMINIMUM QUALIFICATIONS:\n1. Qatar Driving License\n2. Indian Light motor (LMV) license\nEducation/Experience:\n1.Technical school diploma is required or eqivalent. Minimum of 1 year experience.\n2. Requires as a minimum knowledge driving safety and other hazards\n associated with driving.\n3.Previous driving experience with a School Bus is a plus.\n4.Demonstrat', 1016, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=01a414ca7f27c62f&from=serp&vjs=3', '2018-07-17 21:37:56', '2018-07-17 21:37:56'),
(9128, 767, 1242, 'Jobs in USA', 'Note: By applying to this position your application is automatically submitted to the following locations: Mountain View, CA, USA; Phoenix, AZ, USA; Novi, MI, USA\nAll open positions at Waymo are posted directly on Waymo\'s website.\n\nWaymo is the self-driving technology company with a mission to make it safe and easy for people and things to move around. Building on software and sensor technology developed at Google, Waymo is now launching the world’s first fully self-driving transportation service that will take members of the public from A to B at the touch of a button.At Waymo, we don’t just accept difference - we celebrate it, we support it, and we thrive on it for the benefit of our employees, our products and our community. Waymo is proud to be an equal opportunity workplace and is an affirmative action employer. We are committed to equal employment opportunity regardless of race, color, ancestry, religion, sex, national origin, sexual orientation, age, citizenship, marital status, disability, gender identity or Veteran status. We also consider qualified applicants regardless of criminal histories, consistent with legal requirements. If you have a disability or special need that requires accommodation, please let us know.\nTo all recruitment agencies: Google does not accept agency resumes. Please do not forward resumes to our jobs alias, Google employees or any other company location. Google is not responsible for any fees related to unsolicited resumes.', 271, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=7e0a9b117bbfca5b&from=serp&vjs=3', '2018-07-18 05:32:17', '2018-07-18 05:32:17'),
(9129, 1000, 1289, 'Jobs in USA', 'Repair and rebuild railroad track. Physical duties will require frequent walking over extended areas with uneven footing; flexibility sufficient for track maintenance tasks such as flexing to pick up tie plates; balance sufficient to walk on ballast; standing for more than half of each work day with periodic breaks; lift/carry and push/pull equipment and other objects weighing 25 lbs. (frequently), 50 lbs. (occasionally), and 75 lbs. (infrequently); occasional climbing on ladders; bending, stooping, and kneeling; good eye-hand coordination; and bilateral dexterity.\nRequired Certifications:\nFor this position, you will be required to become a Union Pacific certified driver during your probationary period. To become certified, you must meet the following Motor Vehicle and Medical Requirements.\nMotor Vehicle Requirements:\n1. Must be a minimum of 21 years of age\n2. Have valid driver\'s license\n3. Have an acceptable driving record per your Motor Vehicle Record (MVR). This includes commercial and personal vehicles. No more than one moving violation conviction in the past three years. No DUI/DWI/Refusal convictions in the past three years. No more than one DOT reportable accident in past three years.\n4. You may also be required to obtain your Commercial Driver\'s License (CDL) if you will be operating a vehicle(s) with a GVWR of 26,000 lbs or greater. If this is required, you will need to obtain your CDL during your probationary period.\nMedical Requirements : Must meet the medical requirements (also called physical qualifications) for commercial motor vehicle drivers as specified by the US Federal Motor Carrier Safety Administration (FMCSA). For more information about FMCSA physical qualifications for drivers click here . Health and Medical Services at Union Pacific Railroad will make the final determination on whether or not an individual meets the FMCSA medical qualifications, and may add additional medical requirements to assure the person can safety perform job tasks, wit', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Na', '2018-07-18 05:32:17', '2018-07-18 05:32:17'),
