(9145, 1016, 1305, 'Jobs in UAE', 'Manage and route phone calls appropriately\nProcess and report offfice expenses\nMaintain physical and digital employee records\nSchedule in-house and external meetings\nDistribute incoming mail\nManage and order office supplies\nMake travel arrangements\nOrganize company documents into updated filing systems\nAddress employees’ and clients’ queries (via email, phone or in-person)\nPrepare presentations, spreadsheets and reports\nUpdate office policies as needed\nCandidate Requirements\nProven work experience as an Administrative Coordinator, Administrator or similar role\nHands-on experience with MS Office Suite (particularly MS Word and MS Excel)\nFamiliarity with office equipment, like printers and fax machines\nBasic math skills\nSolid time-management abilities with the ability to prioritize tasks\nExcellent verbal and written communication skills\nHigh school diploma; additional qualification in Office Administration is a plus', 1041, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-18 06:50:31', '2018-07-18 06:50:31'),
(9146, 1017, 1110, 'Jobs in UAE', 'The main scope of the role for the CID Agent is to support the Front of House operation, assisting with various tasks where needs be, under the guidance of the Manager on Duty.\nScans identification documents and updates guest profiles on the system upon arrival and departure.\nMatches the PMS and CID in-house reports.\nProvides a best-in-class service to guests by utilizing knowledge of their customer profile on the system, handling any queries/issues in a prompt and courteous manner, and by advising on the hotel information including facilities and local amenities.\nMonitors the guest wake-up call sheet and executes requests accordingly.\nCommunicates with guests about the regulations of the property and ensures the privacy and security of their information.\nMaintains relationships with all departments to ensure a seamless delivery of services.\nEnsures the switchboard is operated in an efficient and effective manner.\nFacilitates management\'s long distance call vouchers and records them on the traffic sheet.\n', 905, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-18 06:50:31', '2018-07-18 06:50:31'),
(9147, 1018, 1306, 'Jobs in UAE', 'Air Charter Service was established in 1990 in the basement of our chairman’s home and today employs over 500 people globally, across 22 offices on six continents. Not only do we offer aircraft charters in the private, group and cargo sectors, but also further services such as onboard couriers, holiday packages and concierge services. We’ve flown everyone, and everything, from film stars to ketchup sachets, and priceless art to Premier League football teams. Whether it’s private jets, commercial aircraft or cargo that takes your fancy, every day at ACS offers up new challenges, with internal progression and planned expansion creating vacancies for new talent to join our current sales teams.\nWe are searching for a Flight Service Executive to oversee our Flight Services Team. With customers ranging from football teams to car shows this role will be ensuring the highest level of professionalism is given to every client from the moment they arrive at the airport, to boarding the plane and also arriving the designated location.\nTHE ROLE INCLUDES\nAct as the liaison between brokers, airlines, clients and suppliers\nComplete the “Flight Brief” (flight documents for confirmed charters) and ensure that the Flight Brief packs are received by all who need them\nRepresent ACS at the airports at the time of some charter flights to ensure that the passengers pre-flight experience runs smoothly\nTravelling on some charters as the ACS in-flight representative\nWhen travelling for ACS - remotely watching the process of charters including the aircraft positioning, communicating with airports, airlines, caterers and other suppliers for updates and check that everything is in order\nUpdating the customers on the progress of the flight when necessary\nResolving problems when necessary in the pre-flight arrangements, during the flight itself and during any post-flight work that needs to be completed\nBuild effective working relationships with ACS colleagues, clients and suppliers\nArranging trave', 1042, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-18 06:50:31', '2018-07-18 06:50:31'),
(9148, 1019, 1107, 'Jobs in UAE', 'Job Summary\nHandles all IT related calls by phone or in person. Installs required hardware and applications in line with Crescent IT policy. Sets up and configures laptops, desktops, printers, smartphone, POS devices and servers in conjunction with System Engineer. Reports to the Assistant Manager, IT Infrastructure.\nMajor Functional Areas\nUser Support Administration\nProvides technical support for all users on IT hardware, software and applications.\nSupports computer systems and their peripherals (Printers, Scanners, Copiers, Fax, POS, etc.). Troubleshoots as and when needed in an efficient manner.\nProvides prompt and quick service to users.\nAttends user support requests via telephone, mails and other means of formal communication.\nDeploys applications - both in-house and third party developed - to all users.\nProvides support for handling E-mail issues pertaining to individual mail-boxes and/or accounts\nConfigures desktops, laptops, printers, scanners, POS and other IT peripheral devices as per requirements.\nSupports remote locations/offices of Crescent on IT issues when needed.Reporting and Working Relationships\nReports to the Assistant Manager, IT Infrastructure.\nLiaises with external suppliers to secure IT products and services.\nExhibits and maintains an excellent relationship with all Crescent staff.Continuous Improvement of Position\nConducts regular research on contemporary IT practices particularly those related to IT administration. Recommends subsequent actions.\nEvaluates new IT products and services and provides recommendations on how they can be adopted/integrated to improve existing infrastructure.Minimum Educational, Technical Qualifications/Certifications Required\nBachelor degree in Information Technology or equivalent discipline.\nMinimum Professional Experience Required\n2 to 3 years’ experience in IT support environment with good understanding of computer systems, mobile devices and other tech products.Additional Requirements\nValid UAE driving license ', 902, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-18 06:50:31', '2018-07-18 06:50:31'),
(9149, 1020, 1112, 'Jobs in UAE', 'Ensure the smooth day-to-day running of the studio, and provide a front-of-house service to all clients/students, teachers and therapists. The Receptionist will be the first point of contact to everyone using the space and will help to create a friendly atmosphere and keep the studio clean and presentable. Able to answer phones, emails and attend to clients promptly.\nIn addition, the Receptionists are responsible for basic administrative/accounting tasks and will provide administrative support to the other members of the studio team as required.\nSkills\nStrong organizational skills, ability to prioritize\nExcellent oral and written English skills\nPresentable in appearance and manner\nBackground in Accounting\nhas knowledge with Microsoft Office applications\nReceptionist and Admin AssistantAbu Dhabi Supplies & Commercial Services\nJob Description\nEnsure the smooth day-to-day running of the studio, and provide a front-of-house service to all clients/students, teachers and therapists. The Receptionist will be the first point of contact to everyone using the space and will help to create a friendly atmosphere and keep the studio clean and presentable. Able to answer phones, emails and attend to clients promptly.\nIn addition, the Receptionists are responsible for basic administrative/accounting tasks and will provide administrative support to the other members of the studio team as required.\nSkills\nStrong organizational skills, ability to prioritize\nExcellent oral and written English skills\nPresentable in appearance and manner\nBackground in Accounting\nhas knowledge with Microsoft Office applications\n\nJob Details\nJob Location:\nAbu Dhabi, UAE\nCompany Industry:\nHospitality/Tourism/Travel; Sports and Recreation; Personal Care and Service\nRequirements :\nEmployer (Private Sector)\nJob Role:\nAdministration\nEmployment Status:\nFull time\nEmployment Type:\nEmployee\nMonthly Salary Range:\n$500 - $1,000\nNumber of Vacancies: