(9159, 1029, 1248, 'Jobs in Oman', 'Operational\n\nPreflight:\n\n1. Check and update staff allocation plan for Cargo puller driver to ensure that all flights is being handled and received the joining cargo by adequate Equipment Operators, Drivers and Porters.\n\n2. Check to ensure that all staff adheres to safety measures and dress code such as PPE and other r elated measures.\n\n3. Coordinate with G.E. Support Team to ensure that all ground equipment are operationally safe to use and take necessary action steps for repair.\n\n4. Coordinate with TRC / Loading agent / Load control section and export / import cargo for any special cargo aircraft rotations and ensure to allocate and provide adequate manpower and equipment.\n\nFlight on ground:\nMonitor and liaise with TRC and loading agent to ensure that loading and unloading for cargo activities are carried out as per the various airline requirements, the Service Level agreements with regards cargo loading/unloading are adhered to and that the on-time-performance (OTP) of flights are maintained.\nMonitor to ensure that all incoming RAMP activities request are handled so that the movement of equipment to/from the aircraft happens smooth ensuring timely provision and availability of equipment at all times.\nPost flight:\nPrepare Shift Report giving complete information of loading and unloading of the departed flight for record purposes and future reference on cargo handling.\nOther duties:\nReport any discrepancy, damage, mishandling cargo, incidents and accidents to immediate Apron in charge and Sr. Officer freighter handling.\nEnsure compliance to safety and security regulations.\nUpdate knowledge of current company policy and procedures by readying, memo, circulars and manual updates.', 994, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=254ec231630755f6&from=serp&vjs=3', '2018-07-19 04:40:15', '2018-07-19 04:40:15'),
