 improvement feedback (SIF) team members in accordance with compan', 994, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=bbf8d9499a67b3c6&from=serp&vjs=3', '2018-07-19 04:40:15', '2018-07-19 04:40:15'),
(9161, 1031, 1267, 'Jobs in Qatar', 'QR18049 - Driver/Messenger | Heavy Maintenance - Technical Division | Qatar Airways | Doha\nOrganisation: Qatar Airways\nJob Function: Technical Engineering\nDivision: Technical (Engineering) (Division)\nEmployment Type: Full Time - Permanent\nCity: Middle East | Qatar | Doha\nLast date of application: 07-Aug-2018\nQatar Airways\nWelcome to a world where ambitions fly high\nFrom experienced pilots to dynamic professionals embarking on new careers, Qatar Airways is searching for talented individuals to join our award-winning team.\nWe take pride in our people—a dynamic and culturally diverse workforce is essential to why we are one of the finest and fastest growing airlines in the world.\nWe offer competitive compensation and benefit packages.\nAbout Your Job:\nYou will be responsible for collection and distribution of documentations from assigned sections/departments and vice versa is delivered, without error and within set timeframes. You will handle the transport service for internal customers in a safe and timely manner and ensuring that vehicle is maintained to acceptable safety standards. You will ensure that Heavy maintenance supplies arriving at Technical Gate 1 & 2 to be collected on time.\n\nOperational\nSafely transport colleagues or internal customers to various locations in a timely, safe and courteous manner.\nAccompanying visitors for Heavy management from Technical building to airside areas as advised\nArrange and follow up visitor passes during AOG situations.\nMaintain driver logs, daily-running charts accurately and complete pre-trip inspections to ensure company vehicle records are maintained as per company standard.\nRegular washing/cleaning of management and Heavy maintenance vehicles which is to be done through QAS\nWorkshop.\nHandle the distribution, collection and delivery of documents/mail delivered to various locations in a timely and efficient manner.\nCollection and maintain inventory of materials, pantry supplies, stationeries from Technical gates &\ncollection', 1013, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=5e36576b7d58b665&from=serp&vjs=3', '2018-07-19 04:40:17', '2018-07-19 04:40:17'),
