(9165, 1033, 1345, 'Jobs in UAE', 'Job Summary\nSelect Group requires an honest and reliable Company Driver/Messenger to provide administrative assistance to the Head Office team. The individual will be responsible for delivery and collection of company related documentation, bank payments and deposits, pick up/drop off services for Senior Management and all other driving related administrative tasks that suppport day to day operations of the business.\n\nRequirements\nMinimum 2 years in a similar role in the UAE supporting a busy office environment\nExperience completing office related administrative tasks with local authorites, utility companies and banks\nExcellent knowledge of Dubai roads and major landmarks/buildings\nClean, valid UAE driving license\nGood spoken English\nPersonal attributes required for the role include:\nHonest, trustworthly and reliable\nPresentable appearance and friendly manner\nFlexible attitude and willing to work outside normal working hours if required\nWorks efficiently and is able to plan and prioritise tasks\nConfident liasing with all levels of seniority and able to work in a diverse team', 1055, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=4107c940bb2cf604&from=serp&vjs=3', '2018-07-19 17:49:47', '2018-07-19 17:49:47'),
