(9176, 1038, 1239, 'Jobs in USA', '$18.10 per hour\nThis position may include accounts with any or all of these responsibilities:Delivers products to assigned fountain equipment accounts across a variety of weather conditions. May perform minor repairs on vending and/or fountain equipment. Invoices customers and collects applicable payment. Responsible for daily settlement of all cash and charges. May place order for future products to be delivered at the next scheduled call to the account.\n\nDrives to vending equipment locations on an established route across a wide variety of weather conditions. Fills equipment with product. Removes cash/change from equipment and prints invoice. Responsible for daily settlement of all cash and charges. Is responsible for updating tags and Point of Sale (POS) on equipment as needed.\n\nDelivers products to customers who own or lease vending equipment. Stocks the equipment and collects the cash/change from equipment. Invoices customers and collects applicable payment. Responsible for daily settlement of all cash and charges. May place order for future products to be delivered at the next scheduled call to the account.\n\nThis position includes lifting, loading, and pushing/pulling cases ranging from 20-45 pounds repeatedly over 10-12 hour work period. It also includes pushing a hand truck, reaching, bending and squatting while delivering and merchandising product.\n\nPRIMARY ACCOUNTABILITIES:\nDeliver products and execute all promotions\nService all scheduled customers by the end of shift\nMerchandise all accounts to local standards\nSettle cash and reconcile to truck inventory\nFollow DOT Regulations\nComply with operating procedures (e.g., scan-in/scan-out, following designated route, etc.)\nRegular, reliable, predictable attendance\nBASIC QUALIFICATIONS:\n18 years or older; 21 years or older if CDL required\nPass the required drug test and physical capabilities test (if applicable)\nPass the required background checks\nValid CDL license (if required)\nPass DOT physical and DOT Road Te', 1062, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=f7f589cc14ced9c4&from=serp&vjs=3', '2018-07-22 17:12:22', '2018-07-22 17:12:22'),
(9177, 1039, 1366, 'Jobs in USA', 'Job SummaryFamily Promise is a 501c3 charity focused on providing shelter, as well as a rapid-pathway out of homelessness, for families in Metropolitan Phoenix. The candidate must have the ability to communicate effectively with a diverse group of people and be skilled with safe driving practices and procedures.Education/CertificationsHigh School Diploma or G.E.D. requiredExperienceExperienced driving 15 passenger vanWork ScheduleRegular Morning Driver: 5:00am to 6:45am: rate of $17/hour for 2 hour shiftRegular Evening Driver: 5:00pm to 6:30pm: rate of $13/hour for 2 hour shiftWeekend Driver:Mornings: 7:00am to 9:00am: rate of $17/hour for 2 hour shiftEvenings: 5:00pm to 6:30pm: rate of $13/hour for 2 hour shiftJob RolesTransport guests to hosting congregations and activities as determined by the Facilities and Transportation CoordinatorBe sure vehicle is clean and safe for driving before each scheduled runEnsure all guests are on assigned van and on time for departuresEnsure all guests are securely fastened in vehicle according to Arizona State LawTransport medical boxes and other needed items to hosting congregations as requestedOther transportation related duties as assignedTime CommitmentVaries depending on desired work scheduleRequirementsCandidate must pass drug test, criminal background check and obtain a fingerprint clearance cardCandidate must have clean driving recordReliable transportationJob Type: Part-timeEducation:High school or equivalent', 1064, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Family-Promise---Greater-Phoenix/jobs/Part-Time-Van-Driver-0e119f486b40dbba?vjs=3', '2018-07-22 17:12:22', '2018-07-22 17:12:22'),
(9178, 1040, 1367, 'Jobs in KSA', 'Working for Qabastech gives you the opportunity to be part of a successful, innovative company. The work environment is fast-paced and high-energy, and you\'ll get the chance to work with bright, highly motivated people.\nWe are seeking passionate innovators to fuel our engine of opportunity. Connect with us and learn more about our team today!\nJob Description\nThe Business Development Manager will be responsible for selling the company’s products and services The ideal candidate should be a MBA/Post graduate from reputed institutes and should have minimum 5 - 10 years of sales/large account management experience preferably with government agencies in Riyadh. The candidate should be a self-starter with excellent written and verbal communication skills including the ability to effectively present to both technical and executive audiences.\nResponsibilites\nPrimary driver for enterprise business within territory\nSolution selling to existing customer base and new prospects\nGoing deep and wide into named accounts and mining large opportunities\nBusiness Development in the assigned territory\nRequirements\nMinimum 5-10 years experience in IT Infrastructure Sales (Servers/Networking/Solutions).\nExperience in Enterprise Software Sales is an added advantage\nNeeds to be a high-energy, motivated self-starter\nExpertise in large account management – both farming and hunting\nStrong communication and presentation skills\nBackground of regularly overachieving on targets\nStrong knowledge of consultative & solutions sales\nNative Arabic Speaker', 1065, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=b3e08193dfa174f1&from=serp&vjs=3', '2018-07-22 17:12:22', '2018-07-22 17:12:22'),
(9179, 1041, 1371, 'Jobs in Qatar', 'Project Overview\nThe Siemens Tram Consortium (STC) is currently building the flagship Tram system, called People Mover System (PMS) for Qatar Education City (QEC) in Doha/Qatar. The People Mover System (PMS) is the first low floor catenary-free tram system in the world. It uses a Hybrid Energy System (HES) which incorporates a combination of super-capacitors and batteries to power the tram between charging locations along the line. It is manually operated on line of sight rules and the system is being designed in compliance with BO Strab regulations and guidance. There is 11 km of track serving both North and South Campuses of Education City and will employ 19 trams using the Avenio tram chassis by Siemens.\nSiemens is setting up the team to operate and maintain the system once completed and requires experienced Operations Personnel.\nRole Overview\nResponsible for driving the tram vehicle along QEC PMS corridor in a safe and punctual way in compliance with the company’s safety and operations rules & regulations; Provides a high standard of customer service at all times.\nWhat are my responsibilities?\nDriving Trams in accordance with the company’s rules & procedures and road traffic regulations\nEnsuring the safety of passengers, pedestrians and other road users\nProviding excellent customer service at all times\nIdentifying and reporting incidents and anomalies (rolling stock and equipment) to the Operations Controllers (OMCC)\nPerfect knowledge of QEC PMS Rolling Stock in order to conduct fault finding and rectification in compliance with operations & maintenance procedures\nReporting to Line Supervisors and Operations Controllers and complying with all operational orders and directives given\nCommunicating clearly and effectively with passengers and Operations Controllers\nAssists during T&C activities\nProvides assistance during safety & quality audits.\nWhat do I need to qualify for this job?A good physical condition (Meets requirements of Fitness Class 1)\n21 years or above', 1069, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=9dcb1bb0d5f36d2d&from=serp&vjs=3', '2018-07-22 17:12:25', '2018-07-22 17:12:25'),
(9181, 1042, 1377, 'Jobs in USA', 'Welcome! Delta is the most admired airline and we thank you for your interest in joining our team of Ready Reserve Customer Service Agents!\n\nDelta is known for its legendary, reliable service to its customers, our number one focus is the safety of our passengers while enhancing every aspect of their travel experience. Our award winning employees effectively demonstrate our core values: Honesty, Integrity, Respect, Perseverance, and Service in every aspect of their work. As a member of our above wing crew, you will be central in demonstrating that commitment to our customers by making their travel experience as smooth and pleasant as possible. At Delta, our brand is critical to our continued success. As a Ready Reserve Customer Service Agent, you play a key part in keeping our brand strong by demonstrating strict adherence to uniform compliance, maintaining professionalism, and exhibiting a positive persona inside and outside of work. Additionally, excellent internal and external customer service is another attribute that keeps our Delta brand strong.\nWorking the front lines at the airport, you will play a vital role in demonstrating that commitment and reinforcing the Delta difference! Delta understands the demands of air travel and is determined to make the experience as smooth and enjoyable as possible for our customers. Delta employees practice and advocate safety-conscious behaviors during all work activities.\nSUMMARY OF ESSENTIAL JOB RESPONSIBILITIES:\nIn this role, Ready Reserve Customer Service Agents serve our customers in both the ticketing and gate areas at airport locations.\n\nOur professionals serving as a ticket agent are the first to greet our customers and guide and assist them with the ticketing and baggage check-in process.\n\nThe ticketing process requires the use of computers and agents are responsible for all aspects of the ticketing process - selling, printing, reissue. In addition, a ticket agent is also responsible for managing the check-in proces', 411, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=6711e69c7848618d&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9182, 1043, 1378, 'Jobs in USA', 'What Do Your Friends Say About You?\nYou are friendly, outgoing, and passionate\nYou care deeply for others\nYou are easy to get along with\nYou are fun\nYou are a great person to talk to\n\nDoes that sound about right?\n\nIf so, you might be exactly who we are looking for to be part of our growing team who represent our launch team for our newest operation in PHX Sky Harbor Airport. We want to build a truly amazing team of people passionate about people. We are obsessed with making our member’s experience in our CLEAR lanes truly exceptional, and that’s where you could be the Ambassador for our entire company.\n\nYour day will be anything but boring. You will love interacting with travelers and sports fans from all walks of life as you rotate between enrollment and verification stations.\n\nIn the enrollment stations, you get to share the CLEAR story and sign up new members. We don’t hire robots, we hire people, so we really want your personality to shine as you engage with others, not read from a script. Literally, you are just talking to non-members about how cool it is to be a CLEAR member. You will know, of course, because all our CLEAR employees get a free membership.\n\nIn the verification lanes you get to cut loose and have fun catching up with existing members. You are their VIP service master, expediting them through the security process.\n\nWhat are our desired qualifications?\nAbility to stand for extended periods of time\nAbility to work non-standard hours based on Airport security checkpoint busy times\nHigh school diploma, GED, or equivalent\nAbility to follow policies and procedures set forth by CLEAR, airport, state and federal regulations.\n\nFree CLEAR membership is pretty cool, but what else can CLEAR do to enrich your day to day life?\nFull benefits package available for all full-time employees (health, dental, vision, life, and pet insurance, disability, 401k, and more)\nGood looking and comfy uniform complete with free shoes\nFree snacks available daily and celebration', 1071, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=487ee83db976d03b&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9183, 1044, 1379, 'Jobs in USA', 'Airport Operations Assistants perform a variety of safety, security, and customer service tasks in airside and landside operations at the airport. Typical types of duties include extensive face-to-face public contact, handling inquiries and complaints from airport users; performing traffic, pedestrian, and crowd control functions; responding to and providing assistance during aircraft and other emergencies; conducting airport operational, safety, and security inspections as prescribed by federal regulations and taking appropriate actions to ensure compliance with airport and federal rules and regulations, as well as Phoenix City Code. All Airport Operations Assistants are required to drive on City business. Applicants must have an acceptable driving record to be considered for employment.\nFor more information on this position, please click on the following link to hear an Airport Operations Assistant discuss the job: https://www.youtube.com/watch?v=zyepyOJAUyo\nCurrently, there are several regular full-time vacancies Landside and Airside. (Airside temporary positions may become available during this process and are full-time with benefits. Temporary positions are not covered by civil service. Employment is considered ‘at will’ and employees may be separated from the City of Phoenix at any time.)\nThis recruitment may be used for any current or future vacancies over the life of the eligible list.\nRECRUITMENT DATES\nRecruitment closes July 30, 2018 at 11:59 p.m.\nSALARY\n$17.17 (minimum) - $24.92 (maximum) hourly / $35,714 - $51,834 annually.\nComprehensive benefits package includes: 11.5 paid holidays, 12 vacation days, 15 sick days, free bus/light rail pass, traditional pension and 457/401 plans, tuition reimbursement upon hire, choice of Blue Cross/Blue Shield or Cigna HMO, PPO. For more details, visit:\nhttps://www.phoenix.gov/hrsite/Benefit%20Category/003.pdf\nJOB REQUIREMENTSTwo years of full-time experience performing customer service functions, rule enforcement and sa', 402, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=2029eae317bf304e&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51');
