(9184, 1045, 1380, 'Jobs in USA', '## PAY\n\nThe position pays per union agreement.\n\n## ALASKA AIRLINES\' STORY\n\nAlaska Airlines is one of the most respected names in aviation and flies throughout its namesake state and the Lower 48, as well as to Hawaii, Canada, Mexico and Costa Rica. Our roots date to 1932 and are symbolized by the Alaska Native painted on the tails of our aircraft. Guided by what we call the \"Alaska Spirit\", we pride ourselves on providing a lifeline to remote communities while delivering renowned service to everyone we fly. This commitment has brought us national and international recognition. We\'ve been honored with a variety of awards by readers of Travel + Leisure, Conde Nast Traveler, USA Today and others. Alaska, with Virgin America, is the premier airline for people on the West Coast, and together with its sister carrier Horizon Air, flies to more than 115 destinations. The two airlines are subsidiaries of Alaska Air Group Inc. (NYSE: ALK) with annual revenues exceeding $7 billion.\n\n## POSITION INFORMATION\n\nKEY RESPONSIBILITIES\nResponsible for assisting customers with travel requests by answering incoming calls and matching the features and benefits of Alaska Airlines to the needs of the passengers\nAnswer customer\'s inquiries regarding all aspects of their travel on Alaska Airlines or one of our travel partners\nAbility to handle customer questions, complaints, and inquiries with the highest degree of courtesy and professionalism to resolve customer issues with first call resolution\nAssist customers with technical website and mobile navigation needs\nMake new reservations and change existing reservations on scheduled domestic and international flights\nPerform both computer and inbound/outbound telephone related tasks\nOther duties as assigned\nEmbody the Alaska Spirit and conducts oneself with Professionalism, Integrity, Resourcefulness, and Caring\n\nQUALIFICATIONS\nHigh School diploma or equivalent required\nMinimum age of 18 years old\nMust be authorized to work in the United States', 919, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=ea5bb076f5ed5637&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9185, 1046, 1381, 'Jobs in USA', 'Welcome! Delta is the most admired airline and we thank you for your interest in joining our Customer Service team as a Baggage Handler/Ramp Operator!\n\nDelta is known for its legendary, reliable service to its customers, our number one focus is the safety of our passengers while enhancing every aspect of their travel experience. Our award winning employees effectively demonstrate our core values: Honesty, Integrity, Respect, Perseverance, and Service in every aspect of their work. Working at Delta, you will be central in demonstrating that commitment to our customers by making the travel experience as smooth and pleasant as possible. As a member of our ground crew, you will work with an innovative team whose common goal is to ensure that our customer\'s baggage and cargo arrives safely and on time; a task that can make a huge difference in the customer experience. At Delta, our brand is critical to our continued success. As a Baggage Handler/Ramp Operator, you play a key part in keeping our brand strong by demonstrating strict adherence to uniform compliance, maintaining professionalism, and exhibiting a positive persona inside and outside of work. Additionally, excellent internal and external customer service is another attribute that keeps our Delta brand strong.\nSUMMARY OF ESSENTIAL JOB RESPONSIBILITIES:\nAs a Baggage Handler/Ramp Operator, you are required to safely lift, load, unload, and transport baggage, mail, and cargo to and from aircraft, in addition to being responsible for on-time connections by guiding incoming and departing aircrafts from the gate positions. In addition, it is important to safeguard cargo, baggage and mail from damage, loss, and weather. Additional duties include safely driving and operating ground equipment such as tugs, belt loaders, and tow tractors in areas of congestion. Baggage Handlers/Ramp Operators are required to safely operate sophisticated machinery, work comfortably in extremely loud environment and work at height, in addit', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=bc5116b3699cefdc&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9186, 1047, 1382, 'Jobs in USA', 'Dispatchers in the Airport Command Center are responsible for receiving and dispatching emergency and non-emergency calls to Police, Fire, Operations and Maintenance airport personnel. Duties include operating and monitoring computerized alarm systems, lightning detection, advance fire warning, closed circuit TV, and other computerized access control systems. Positions may operate a paging system, multi-line telephone switchboard system, two-way radio and other communication equipment in providing accurate and timely dissemination of information and messages to field units. Additionally, positions update and track information on computerized and/or printed forms and perform general clerical duties.\nThe Aviation Department is a 24-hour per day, 7-day per week operation. Employees are required to work evenings, nights, weekends, and holidays. Vacation and shift assignments are determined by seniority which will require working 2nd or 3rd shift for an indefinite amount of time.\nThis list may also be used to fill other citywide Communications Dispatcher positions ($14.15 - $20.46 hourly) responsible for receiving calls from external and internal customers and relaying information to appropriate persons for action.\nRECRUITMENT DATES\nRecruitment closes July 30, 2018. All materials must be received by 11:59 p.m. on this date.\nSALARY\n$17.17 (minimum) - $24.92 (maximum) hourly / $35,714 - $51,834 annually. Actual salary may vary depending on the position/division/department.\nComprehensive benefits package includes: 11.5 paid holidays, 12 vacation days, 15 sick days, free bus/light rail pass, traditional pension and 457/401 plans, tuition reimbursement upon hire, choice of Blue Cross/Blue Shield or Cigna HMO, PPO. For more details, visit:\nhttps://www.phoenix.gov/hrsite/Benefit%20Category/003.pdf\nJOB REQUIREMENTSOne year of full-time experience in which the operation of a two way radio (multi-channel 800 MHz) or multi-line telephone switchboard equipment was a primary function', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=0d85fb14ec2a73e3&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9187, 1048, 1383, 'Jobs in USA', 'Airport Operations Representative II (Land Side/Terminal)\nThe salary for this position is $47,300 - $63,100\nThis position will expire on August 19, 2018\nThe Position\nThe Airport Operations Representative II (Landside) assists in managing the\nairport’s day-to-day operations in accordance with Federal, State and Local\nregulations and policies to ensure the safe and efficient movement of\npassengersExamples of Essential Duties\nResponds to emergencies and coordinates their resolution while providing\nupdates to executive staff;\nPerforms daily checks of the airport’s terminals, concourses, parking lots,\ncurbsides, airport access roadways and other airport facilities;\nManages and coordinates passenger flow daily through the airport’s security\ncheckpoints;\nWorks extensively with the traveling public on a daily basis;\nPrepares and presents various reports and documents including daily logs\nand reports for incidents, complaints, maintenance requests and regulatory\ncompliance issues;\nAssists with the management of several airport contracts;\nJob requires working shift work to include weekends and holidays.Minimum Qualifications\nGraduated from an accredited college or university in Aviation\nAdministration, Aviation Management, Business/Public Administration or a\nrelated field with a minimum of two (2) years progressively responsible\nairport operations experience. This experience should include extensive\ninteraction with the general public.\nProficient in the use of Microsoft Office.\nRequires the possession of a valid Georgia driver’s license at the time\nof employment.', 1072, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=762280ea04484f80&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9188, 1049, 1380, 'Jobs in USA', 'The salary listed on this job posting is the starting salary range; amount offered will depend upon qualifications.\nFor information related to Essential Functions, Knowledge, Skills & Abilities Required to Perform Work, and Working Conditions & Hazards of this position, click here. Locate and click on the position title to view the job classification\nspecification.For evaluation purposes, acceptable qualifying experience for all positions must have been in a paid capacity unless noted otherwise in the minimum qualifications for the posted position.Additionally, 30+ hours per week will be counted as full-time employment and will receive full credit for the amount of time employed. A minimum of 15 through 29 work hours per week will be counted as part-time employment and will receive half credit for the amount of time employed.Vacancies currently available in the following department(s): AviationMinimum Qualifications\nEDUCATION:High school diploma or GED.\nEXPERIENCE:Four (4) years of experience in aviation, airport operations, airport inspections or airport/airline security.\nEQUIVALENCY(IES):A current pilot license plus two (2) years of the required experience will meet the education and experience requirements.\nAn associate\'s degree in aviation management plus two (2) years of the required experience will meet the education and experience requirements.\nA bachelor\'s degree or higher in aviation management will meet the education and experience requirements.\nLICENSE(S) and/or CERTIFICATION(S):Valid driver\'s license with good driving record.\nOTHER REQUIREMENT(S):\nMust pass TSA background check.\nAvailability to work varying shifts (days, evenings, nights) including weekends, holidays.\nMay be subject to twenty-four/seven (24/7) emergency call outs.KNOWLEDGE, SKILLS, ABILITY(IES):Per FAA Advisory Circular 150/5210-20, selected candidate must be able to demonstrate a functional knowledge of the English language.\nKnowledge of FAA regulations pertaining to public use airport ', 919, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=deffe0906e2981c5&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9189, 1050, 1382, 'Jobs in USA', 'Airport Operations Representative II (Land Side/Terminal)\nThe salary for this position is $47,300 - $63,100\nThis position will expire on August 19, 2018\nThe Position\nThe Airport Operations Representative II (Landside) assists in managing the\nairport’s day-to-day operations in accordance with Federal, State and Local\nregulations and policies to ensure the safe and efficient movement of\npassengersExamples of Essential Duties\nResponds to emergencies and coordinates their resolution while providing\nupdates to executive staff;\nPerforms daily checks of the airport’s terminals, concourses, parking lots,\ncurbsides, airport access roadways and other airport facilities;\nManages and coordinates passenger flow daily through the airport’s security\ncheckpoints;\nWorks extensively with the traveling public on a daily basis;\nPrepares and presents various reports and documents including daily logs\nand reports for incidents, complaints, maintenance requests and regulatory\ncompliance issues;\nAssists with the management of several airport contracts;\nJob requires working shift work to include weekends and holidays.Minimum Qualifications\nGraduated from an accredited college or university in Aviation\nAdministration, Aviation Management, Business/Public Administration or a\nrelated field with a minimum of two (2) years progressively responsible\nairport operations experience. This experience should include extensive\ninteraction with the general public.\nProficient in the use of Microsoft Office.\nRequires the possession of a valid Georgia driver’s license at the time\nof employment.', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=762280ea04484f80&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9190, 1051, 1384, 'Jobs in USA', 'Minimum Qualifications\nHigh school. Three years of experience providing and planning telephone services in a telephone company, governmental agency or similar structured large organization.\nAirport Security\nApplicants qualifying for employment with the Miami-Dade Aviation Department will be subject to extensive security screening, including but not limited to, fingerprint checks, employment verification, and such other procedures as may be mandated by federal law. The security clearance required by federal law is a continuing condition of employment.', 1073, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=4de6f2102afd281b&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9191, 1052, 1248, 'Jobs in Oman', 'Duties And Responsibilities\nShall be independent of other Duty Free staff.\n\nPatrolling Guard will deter shop lifting by customers and guards must report to the Security Coordinator any area of suspicion.\n\nPatrolling the shop will also deter shop lifting by paying particular attention to Muscat Duty Free staff whom arouse suspicion.\n\nShall ensure that special attention and observation is given to all items in the shop.\n\nAll security incidents should be noted at the end of every shift and must be reported in the daily log book, day by day.\n\nResponsible for the control of cash movements and must also be alert to staff operating cash points and handling cash.\n\nShall ensure all staff moving merchandise from shop to shop carry proper documentation.\n\nShall ensure the security of stock movement within the Shop.\n\nEnsure that only authorized personnel have access to keys and security codes.\n\nEnsure all staff conforms to company security instructions.\n\nBe alert and report to the office any internal breach of company security procedures.\n\nEnsure the highest level of confidentiality with regard to company\n\n documentation and information.\n\nMaintain proper controls of security video records with at least a rotation of 2 months.\n\nArrange emergency airport passes as and when it is required by the company.\n\nReview security tapes on a regular basic’s and liaise with Finance Manager, Cash Office Supervisor, Stock Control Supervisor or other senior manager in order to catch or prevent theft.\n\nEnsure that you are adhered to the company HR, Administration and IT policies at all times\n\nKey Performance Indicators.\n\nLow or Reduced stock losses.\n\nLow or Reduced Cash losses.\n\nMaintenance of Superior Records.\n\nRequired documentation evidence for prosecution or termination.', 994, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=babf45b8a56b540a&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9192, 1053, 1248, 'Jobs in Oman', 'OPERATIONS\nIn charge with the day-to-day activities related to security in catering premises\n\nLiaise with ROP and Group Security on security issues for catering\n\nIn charge with day-to-day activities regarding safety matters in catering – related activities\n\nRepresent catering in both security and safety functions in meetings, seminars, presentations and the likes\n\nConducts trainings in both safety and security for all staff and contracted personnel\n\nPrepares annual budget for safety and security section\n\nOversee the development of the safety and security team in line with the future transfer to the new catering facility in the new airport\n\nPrepare additional staff to ensure complete security coverage of the new catering facilities\n\nRe-structure catering safety and security group to include officers and assistants / specialist in the field of safety and security\n\nOversee smooth transition from the old catering unit to the new catering unit in the field of safety and security', 994, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=de0e0c60328c4b61&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9193, 1054, 1267, 'Jobs in Oman', 'QR17566 - Senior Airport Services Agent l Qatar Airways l Sohar\nOrganisation: Qatar Airways\nJob Function: Ground Services\nDivision: Ground Services (Division)\nEmployment Type: Full Time - Permanent\nCity: Middle East | Oman | Sohar\nLast date of application: 31-Jul-2018\nQatar Airways\nWelcome to a world where ambitions fly high\nFrom experienced pilots to dynamic professionals embarking on new careers, Qatar Airways is searching for talented individuals to join our award-winning team.\nWe take pride in our people—a dynamic and culturally diverse workforce is essential to why we are one of the finest and fastest growing airlines in the world.\nWe offer competitive compensation and benefit packages.\nAbout Your Job:\nAs Senior Airport Services Agent, you will be responsible for providing quality service to passengers in respect to check-in, boarding, special services, lounges, and baggage services as per QR’s commercial. You will ensure safety standards and procedures are met while passengers and their baggage are handled in a consistent manner.\n\nYour key accountabilities include:\nConstant liaison with Check-in, transfer desk, and other related areas for the smooth acceptance of passenger\nLiaises with check-in, transfer desk, and support Airport Services Supervisor in all areas\nEscort and direct Arriving/departing passengers to the respective areas such as hotel desk, visa counter, transfer desk, premium lounges and boarding fates etc.\nAssist duty officer to handle company material and records\nLiaison with GHA for quick processing of hotel and transfer passengers\nWork with GHA and ensure smooth passenger handling\nAssist passengers in regards to entry requirements, visas, residence permits etc.\nEnsure passengers are assisted smoothly through airport facilities\nPerforms other related duties, as assigned, for the purposes of ensuring the efficient and effective function of the work unit.\nAbout You:\nYou will need to hold a Bachelor\'s Degree, trade or vocational qualification with', 1013, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=a0cbc95ebb8f732c&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9194, 1055, 1248, 'Jobs in Oman', 'Strategic\nConstantly monitor the IT infrastructure in providing a strategic direction for the development of a complex applications environment to maximize efficiency and minimize operating costs\nProvides assistance to the IT infrastructure team in preparing annual budgets and manage expenditures within the approved budget.\nPlan, prepare and manage IT infrastructure setup of the organisation and oversee the operations carried out by the reporting sections\nImplement enterprise application projects, directing requirements definition, development, validation, and ongoing maintenance activities. Planning, developing, supervising and implementing IT projects utilizing the established project management tools and techniques;\nResponsible for Application Management Services actual-to-budget expenditures, adjusting expenditure patterns/trends as needed to comply Management with budgeted amounts. Prepare, revise, finalize and submit the annual budget forecast for the Applications Services Department and related technologies;\nAssesses business automation and digitization needs and provides analysis of information systems, processes and support;\nProvide guidance, leadership and mentoring to a team of Application Services professionals. Supports and develops the technical expertise needed to meet long-term business needs. Manage staff by reviewing, approving and allocating work and work assignments among staff;Operations\nManagement of overall IT infrastructure setup of the organisation and oversee the operations carried out by the reporting sections namely,\nService Desk\nNetwork & Telecoms\nDesktop Services\nPDO, Outstations & Airport Systems\nOversee, monitor and assist Computer Centre activities with regards to timely completion of Database administration, System administration, Email administration and System operations\nOversee, monitor and assist Network & Telecoms activities with regards to timely completion of passive Network Administration (including SITA and Sabre), Telecoms', 994, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=5a0758c48858310a&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9195, 1056, 1248, 'Jobs in Oman', 'Operational\nDeputize Ground Safety Manager during his absence.\nAssist Ground Safety - Manager in fulfilling all aspects of airside safety as prescribed in safety manuals, policies and procedures.\nOver-seeing and implementation of Safety rules and regulation related to Ground Operation.\nSafety is of the highest priority to all staff for the protection of personnel and company assets in this area and we need to constantly improve safety standards.\nData gathered from regular checks will be compiled, analysed and summarized to identify trends and presented to deferent management levels.\nPrepare monthly statistics and update Manager Ground Safety.\nManage the occurrence reports in SMS system to ensure correct categorization of occurrence to enable correct analysis of all Incidents/Accidents.\nConducts investigation on incident/accident and provide recommendation to Manager Ground Safety.\nConduct audits and inspection to identify hazards, system and personnel failures to develop control measures, as well as develop an understanding of the risk and the performance of the department relative to the risk.\n10. Conduct spot check on flights and other operational area.\n\n11. Visit regional airports for Audits and spot checks.\n\n12. Monitor Human Factor Program as part of airside safety.\n\n13. Constantly monitor and promote FOD awareness to all RAMP staffs.\n\n14. Continuously adhere to and ensure all work is carried out in accordance with the obligations detailed in the Workplace and Safety Act and Ground Safety policies and procedures.\n\n15. Identify report and control any risks recognized within the workplace.\n\n16. Attend Regular team meetings to obtain information, identify safety issue related to operation and analyze for continuous improvements.\n\n17. Consistently monitor that all PPE is correctly fitted and worn by all staff as per Company policy.\n18. Represent the Ground Operations Safety Section at meeting and any other committee as required.\nCarry out special assignments as per', 994, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=8280856c2e3a6f9a&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9196, 1057, 1248, 'Jobs in Oman', 'Operations\nInstallation of new and used PCs, PC hardware components, Network Devices, Printers and other PC peripherals.\nResponds to users inquires and requests for assistance with all PC related problems.\nPreparation of gate passes for the PC and printer movements\nAssist in PC maintenance and coordinate with Oman Air IT and Oman Airport IT team for Network port enabling.\nAssist in maintaining a library of all original software, utilities and manuals.\nInstallation of new and upgrade vision of application software on new an existing PC hardware.\nInstallation up-date anti-virus software.\nLiaise with support staff for problem solving through calls.\nRaise requisitions for IC hardware requirements, peripherals and other needs.\nKeep stock of hardware spares and act as the focal point for all desktop related queries\nMaintain a register for all in-and-out PCs brought to office automation for maintenance.', 994, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=bc2cd9ce93e7f62e&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9197, 1058, 1248, 'Jobs in Oman', 'PHYSICAL STOCK COUNTS\nVerification of handover sheets (checking includes opening balance, sales registered in Navision and closing balance)\n\nVerification of variances reported by DMs relating to handover sheets\n\nVerification of high value / high risk items such as watches, electronics, communication items, jewellery, prepaid cards, raffle ticket sales, gift vouchers\n\nMonitor un-posted transfers in Navision on a daily basis and follow-up with concerned merchandiser to complete posting\n\nSpot check fast moving products which are not covered within the handover sheets across all locations\n\nCarry out shift opening and ending counts, warehouse and back store stock spot checks on as stated in stock controller task list.\n\nVerification of items lying at Replacement location\n\nRandom stock counts at Seaport / In-flight / Oman Air staff shop\n\nVerification of items returned to suppliers, removal from airport and issues to Head Office for various purposes\n\nComplete cyclical stock count of all departments\n\nPRICE AND BARCODE CHECKING\nCheck the prices and barcotes of the Items for which barcodes are created by MDF (watches, jewellery, crystalware, cigar, toys, dry food items, toiletries, etc) Any inaccuracies found in retail prices or barcodes should be immediately advised to the concerned merchandisers and timely actions should be taken to rectify them.', 994, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=4f83bd08db1dd602&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9198, 1059, 1385, 'Jobs in KSA', 'General Manager\nfor a bonded & re-Export zone Co. at King Fahd International AirportKey Accountabilities :Coordinate and provide direction for customer service efforts from all departments.Ensure ongoing customer service and maintain customer relations through focusing on the contract\'s daily operations based on customer’s needs. This is accomplished through daily communications with the customer to discuss service needs and potential problems.Responsible for attainment of profit objectives of contracts, provides financial analysis and decision making for customer.Responsible for the organic growth and development of additional business opportunities with existing customer.Ensure safety, maintain quality, establish and monitor cost control programs.Lead and foster creative problem solving, develop positive and professional relationships with customer and within contracts.Work with government departments, social groups, etc.Provide leadership in coaching, mentoring, personnel selection, professional development.Oversee operations management within the company guidelines.Oversee operations schedule and staff in anticipation of customer needs. Oversee the staffing needs of contract to assure sufficient labor to meet the customer\'s requirements and control costs.Manage the contract staff to assure continued quality service by writing procedures, testing hiring and training managerial and operational personnel.Maintain corporate productivity and quality award programs to recognize outstanding performance.Establish ongoing programs to ensure continuous improvement. This includes the use of Kaizen, LEAN, and the EQS program to maintain quality performance.Motivate the workforce through Performance Management program; encourage input from employees through Employee Involvement Groups; and reward for continuous performance using award programs.Establish and monitor cost control programs, including annual budget development, monthly P&L review, payroll, and cost analysis. Thr', 1074, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=8cceac63aec1c26f&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9199, 1060, 1386, 'Jobs in KSA', 'Rising to 44 stories and designed by award–winning architects, Bisha Hotel & Residences is Toronto\'s newest cultural hub and hotspot. At the center of it all yet unabashedly original, this property is situated in the true heart of Toronto’s Entertainment District. Creative souls, welcome home.\nJob Specific\nCoordinates the exceptionally professional and seamless welcome, registration, luggage handling, and escort to room for guests\nCoordinates pre-blocking of rooms for guests arriving with special requests\nManages the hotel’s “Ready Room” program to ensure either the immediate availability or rapid provision of clean and ready rooms for arriving guests\nManages the pre-registration, remote arrival and rooming of all group guests\nCoordinates the assembly of package collaterals and ticket media for package guests\nOversees pre-registration, amenities delivery, and airport pick-up and transfer to hotel for VIP guests\nEnsures communication of VIP arrival to Manager on Duty who welcomes VIP’s and provides escort to room\nResponsible for maximizing hotel occupancy from walk-in guests in accordance with hotel yield management policies\nResponsible for the resolution of room status discrepancies with the housekeeping department\nEnsures the prompt satisfaction of guest requests and the exceptionally professional and courteous resolution of guest complaints\nMonitors hotel credit limit reports, taking action on any accounts which require immediate settlement\nMonitors the daily pace of guest arrivals and departures\nChecks the status of all Out-of-Order rooms on a daily basis\nEnsures adherence to department and Loews Hotels guidelines, policies, and procedures\nEnsures full compliance by department with hotel security procedures\nAct as a liaison between group contacts and Conference Management department to provide group transportation arrangements\nParticipates in pre-convention meetings\nAssists with preparation of annual department budget\nManages department costs and updates budget i', 1075, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=2579318109d55934&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9200, 1061, 1387, 'Jobs in KSA', 'Objective : To ensure satisfaction of vessel Owners/Operators and Masters by providing unparalleled quality of shipping agency services.\nThe successful candidates will be Saudi Nationals with a minimum of 3 to 5 years experience in a similiar role.\nFunctions:\nConstant contact with Principals / vessels\nCommunicate with clients through usual means of communication as Outlook, mobile, etc. and also through Shipping Agency system i.e Agency Now.\nArrange for inward clearance, berthing, loading / unloading, outward clearance of vessels.\nProvide assistance to Principals / Vessels for any services that they may require such as provisions, spares, crew handling, repairs and maintenance of ships etc.\nCargo documentation\nReview and approval of Purchase orders on behalf of vessel.\nReview and approval of single appointments.\nOffice documentation in respect to POs, invoices, attendance certificates, etc.\nProvide support to the Operations Section in achieving efficient service to customers.\nLiaise with other branch for crew movement and documents handling for various operations.\nHandling of Crew and all communications related thereto.\nArrange for transportation of crew from port to airport / hospital and vice versa.\nArrange for air-tickets, hotel bookings for crew as and when required\nReview of single appointment of Marine craft crew.\nArrange for medical attention / treatment for sick crew\nMaintenance of crew handling files and related records.\nCo-ordination with Boarding Staff in crew handling matters.\nAdvise Principals on amendments to policy and procedures taking place in respect to shipping in the Kingdom from time to time.', 1076, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=a9a925a2524c686e&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9201, 1062, 1388, 'Jobs in KSA', 'Req ID: 154172 - Posted 07/18/2018 - Ocean Customer Service Import (OF-4)Job Function: Ocean FreightFull-Time/Part-Time: Full-timeContract Type: PermanentJob Level: Professional\nSub-department: BU Customer ServiceOffice Location: Jeddah / Saudi ArabiaTravel Required: NilStart Date: 1st July 2018\nThe Panalpina Group is one of the world\'s leading providers of supply chain solutions, combining its core\nproducts of Air Freight, Ocean Freight, and Logistics to deliver globally integrated, tailor-made\nend-to-end solutions. The Panalpina Group operates a global network with some 500 offices in more\nthan 70 countries, and employs around 16,000 people worldwide.\nWe are looking to hire a Customer Service Coordinator to:ResponsibilitiesUnderstands and ensures adherence to Panalpina Quality Policies, Standards and Guidelines (according to ISO 9’001, ISO 14’001 and ISO 18’001 certification) and ensures compliance to processes and procedures set in Panalpina IMS.Ensures strict adherence to Panalpina Code of Conduct.Ensures availability, actuality and adherence to specific customer SOP / KPI.Establishes internal SOP / KPI for specific customer business in line with customer SOP / KPIEnsures implementation of internal SOP with respective Operational Teams and monitors adherence to same.Ensures customer satisfaction and customer retention by providing timely, friendly and excellent Customer Service.Manages all tasks/activities within SOP and quotation from M&S and PA overseas offices.Coordinates arrival or departure information with customer and respective Operational Teams,Obtains specific documentation from customer (e.g. permits / licenses for controlled commodities etc) and provides same to Operational Teams in a timely and accurate manner.Updates relevant internal/external application(s).Acts as first escalation contact to all assigned customers (e.g. Customer Service, operational or administrative topics).Informs supervisors of any irregularities that require assistance and ca', 1077, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=ac162ce5577f8ab3&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9202, 1063, 1388, 'Jobs in KSA', 'Answering to the accountable executive, the Head of SMS is responsible for the design, development, implementation maintenance and continuous improvement of Tibah’s Safety Management System (SMS) at the PMIA. In this respect, the Head of SMS provides guidance and direction for the planning, implementation and operation of Tibah’s SMS processes. This position oversees the provision of safety intelligence, safety facilitation and safety promotion and education services.\nSkills\nBachelor\'s degree in Engineering or Aviation related.\n7 years of experience in Aviation Management, Safety Systems &amp; Quality Assurance Principles.\nSMS & QMS ManagerTibah Airports Operation\nJob Description\nAnswering to the accountable executive, the Head of SMS is responsible for the design, development, implementation maintenance and continuous improvement of Tibah’s Safety Management System (SMS) at the PMIA. In this respect, the Head of SMS provides guidance and direction for the planning, implementation and operation of Tibah’s SMS processes. This position oversees the provision of safety intelligence, safety facilitation and safety promotion and education services.\nSkills\nBachelor\'s degree in Engineering or Aviation related.\n7 years of experience in Aviation Management, Safety Systems &amp; Quality Assurance Principles.\n\nJob Details\nJob Location:\nMedina, Saudi Arabia\nCompany Industry:\nAirlines/Aviation\nRequirements :\nEmployer (Private Sector)\nJob Role:\nManagement\nEmployment Status:\nFull time\nEmployment Type:\nEmployee\nPreferred Candidate\nCareer Level:\nManagement\nYears of Experience :\nMin: 5 Max: 15\nCompany Profile\nTIBAH Airports Operation Company operates the Prince Mohammad International Airport in Madinah. Company is a consortium lead by TAV Airports with its local partners Al Rajhi and Saudi Oger. TAV Airports is Turkish company established in 1997, which is the Middle East-North Africa region’sleading airport management and operations services provider and won many international award', 1077, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=f78222a98894dc3a&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
(9203, 1064, 1388, 'Jobs in KSA', 'Consultant, Ophthalmologist Vacancy, Al Khobar, Saudi Arabia\n\nEnjoy a metropolitan lifestyle, working for a multi award-winning hospital!\n\nLucam International is assisting a very esteemed hospital group to recruit for a Consultant Gastroenterology to join their multi-disciplined facility in Al Khobar.\n\nSuccessful applicants will be joining an award-winning organisation whose team of excellent medical professionals will work with you to support and develop your medical career.\n\nThe Location\n\nAl Khobar, is Saudi Arabia’s 3rd largest city. It is served by King Fahd International Airport and is only a 25-minute drive from Manama, the capital of Bahrain.\n\nSaudi Arabian cities are modern and cosmopolitan yet yield a tranquil atmosphere. Nightlife in public areas is scarce, however there are numerous parties and events held in expat compounds or private areas for expats to make you feel more at home. Saudi Arabia is also host to various social functions, parties, dance and dramatic arts festivals as well as hundreds of literature events. In the case of Khobar, with Bahrain being 25 minutes away it’s more than possible to enjoy the nightlife offered in Manama, with a much less restrictive lifestyle and no prohibition.\n\nThe culture revolves around the religion of Islam, but unlike other cities in the kingdom there is a large proportion of expatriates. This brings a slightly more relaxed approach to the conservative lifestyle that the kingdom is synonymous with. The diversity of people is uncountable, with individuals from all corners of the globe relocating to Saudi Arabia. Everyone, no matter what their walk of life, seems to relish in the rich cultural history that Saudi Arabia has to offer.\n\nThe Company\n\nOur client has been described as the most prominent, prestigious private healthcare providers in the Middle East. They have several hospitals across Saudi Arabia, specialising in numerous medical procedures and practices. They are a JCI Certified Health Care Organization ', 1077, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=8015dda87377aabc&from=serp&vjs=3', '2018-07-22 23:35:51', '2018-07-22 23:35:51'),
