(9208, 1069, 1389, 'Jobs in UAE', 'Job no: 500712Employment type Full timeProperty / Office: Mandarin Oriental Jumeira, DubaiLocation: Dubai, United Arab EmiratesDepartment: Non-Management (Experienced), Concierge\nResponsibilities\nCo-ordinate with Concierge and Guest Relations to prepare a daily guest arrival list by flight detailsCo-ordinate with the Chief Concierge for the number of cars needed for expected arrivalsGreet guests with arrival and departure details at the airport’s arrival hallArrange transportation or room reservation for any walk out guestEnsure that the hotel cars meet cleanliness standardsEnsure that bottles of water and cold towels (LQE) are offered to guests by the driverHandle guest baggage for arrival and departure at the airportBid farewell to guests at airport and assist with airline check-in proceduresAdvise Concierge and Guest Relations on group and VIP movementsAdvise flight information to Concierge and Guest RelationsHandle guest baggage lost in transitHandle flight reconfirmation upon requestPerform any other reasonable duties are required by the department head from time to timeHandle any complaints and report to Chief Concierge of any concerns for further service recovery actions\nEducation & CertificatesSenior School qualification or equivalent\n\nExperienceMinimum 2 years’ experience working in a 5-star hotel environment.Minimum 2 years’ Door or Bell experiencePrevious experience working in the Middle East Region is an advantage\n\nSkillsExcellent interpersonal skillsAbility to understand guest needs and expectations and to deliver superior customer service with little input from othersPerform job with attention to details and the ability to organize and handle multiple tasks effectivelyClear communication; effective verbal and written communication skills in English. Arabic is an advantage.\n\nPosition Related RequirementsCapabilities to lift heavy luggage.Capabilities to stand for a long period of time.Ability to work overnight shifts\nAdvertised: 15 Jul 2018 Arabian Stan', 1078, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=3180e4d03a8977db&from=serp&vjs=3', '2018-07-22 23:35:53', '2018-07-22 23:35:53'),
(9209, 1070, 1390, 'Jobs in UAE', 'On a shift basis, manage and complete tasks set within a defined time frame within the area of Cargo Customer Service in accordance with set KPI’s, safety standards and brand values i.e. customer phone calls and email inquiries, management of landing permits and transit applications and UAE bookings and reservations. Ensure safe, secure and on time delivery of all high profile shipments on flights and key routes.\n\nSPECIFIC RESPONSIBILITIES\nAnswers customers phone and email inquiries within the set KPI’s, handles walk-in customers in an efficient and courteous manner.\nHandles inbound and outbound inquiries from external and internal customers within set operational guidelines (restrictions, dimensions, pre-flight and post-flight inquiries) and time-frames.\nExecution of Security Landing + Transit Applications. Liaison with Abu Dhabi Police and other local authorities as a result of shipment failures\nProactively highlights and prevents risks leading to shipment delays or customer dissatisfaction by timely escalation across the organization. Able to capture and report conflicting requirements from all business stakeholders.\nFollow-up communication with internal and external stakeholders to ensure uninterrupted process flow and customer satisfaction.\nTo support the Cargo Customer Service Manager to deliver departmental and corporate targets and goals.\n\nEDUCATION & EXPERIENCE\nEducated to at least high school level –undergraduate studies to be considered as a plus.Minimum of 3 years of experience in relevant field , with a proven track record of success in customer contact/customer relation awareness.\nWorking in customer service environment for minimum 2-3 years and/or Cargo logistics for 1-2 years being an advantage\n\nTRAINING & KNOWLEDGE\nAnalytical & numeric skills - Advanced\nComputer skills - High computer literacy in depth knowledge of Microsoft Office software\nWritten and verbal communication – Excellent written and verbal communication skills in English. Fluency in En', 1079, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=3fbb96159cbd3702&from=serp&vjs=3', '2018-07-22 23:35:53', '2018-07-22 23:35:53'),
(9210, 1071, 1112, 'Jobs in UAE', 'Front Office Agent\n\nEmirates Palace\nEmirates Palace is centrally located in the heart of Abu Dhabi, close to major visitor attractions and the main business areas of the city. Just 40 minutes from Abu Dhabi International Airport and 90 minutes from Dubai Airport, Emirates Palace is conveniently situated for both leisure and business travellers. Popular tourist sites close to the Emirates Palace include the Grand Mosque and the Abu Dhabi National Exhibition Centre, both located 20 minutes away. The Marina Mall and major shopping attractions are also within walking distance of the hotel\nFront Office Agent\nUnder the supervision of the Front Office Manager, the front office agent is responsible for ensuring that guests are chek in - check out according to the standards of Emirates Palace.\nKey Responsibilities\nCheck in the arriving guest and check out the departing guests in a friendly and caring manner according to the Kempinski and Leading Quality Assurance (LQA) standards.\nEnsure that LQA results are above 85%.\nUpon check in, register guest and assign rooms.\nAccommodate special requests whenever possible. If needed, assist guests in completing the registration cards.\nUse suggestive selling techniques to sell rooms and to promote other services of the hotel. Verify the guest’s method of payment and follow established credit-checking procedures or refer cash handling payment to cashiers.\nUpon departure of guests, process the guest check out procedures. Inquire for last minute charges.\nReceive payment from guests. Settle the guest account and give copy of the invoice.\nHandle all front office cashiers’ transactions such as posting charges to guests and exchanging foreign currency according to the procedures. At the end of shift, balance their cash float.\nAnswer all guest requests and questions in a friendly and caring manner, whether by telephone or in person, provide/receive information and takes appropriate actions or refer the matters to the relevant persons to handle.', 907, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=b331b76c5a9d5968&from=serp&vjs=3', '2018-07-22 23:35:53', '2018-07-22 23:35:53'),
(9211, 1072, 1392, 'Jobs in UAE', 'Job Purpose\n\nTo administer all documents pertaining to all government relations activities for ENOC, coordinating between the govt. departments/offices and ENOC ensuring statutory and other compliance as required by them. Arranging a smooth flow of documents and advising on policies for clearances, trade licenses, passport issues, police matters, and immigration related activities etc.\n\nDetailed Description\nPrincipal Accountabilities\n\n1) Coordinates between the govt. department i.e. immigration, police, RTA, consulates and embassies and ENOC company for statutory required and maintaining the bona fides of the company with them.\n\n2) Responsible for handling all ENOC group visa services (employment, stamping, renewal visa and cancellation form) and follow up for visa processing.\n\n3) Ensure the issue of online visas (Short and Long term visa) for visitors\n\n4)Issuance of all letters for ENOC Group & EPPCO group in Arabic and English ( except banks) including salary certificates addressed to municipality, immigration, public prosecution and all govt. departments.\n\n5) Conducts all visa cancellations for ENOC, administering all request, data input and coordinating with ENOC Payrolls & ENOC group on issuance of tickets, informing PRO regarding times of travel and passport release at the airport.\n\n6) Coordinating with ENOC group to arrange all medical examinations for new staff, arranging hospital appointments. Receiving all ENOC Payrolls and ENOC group new staff medical reports and receipts from hospitals and clinics\n\n7) Updating visa and passport details ensuring that all company rewards are current. Generating Discovery (oracle) reports of expired passports and visas and alerting the employees of their needs to renew.\n\n8) Designs/modifies and implements internal control measures to ensure timely renewal of visas and passports and other time bound clearances to avoid penalties.\n\n9) Generates monthly statistics and reports from oracle to ensure compliance within KPI e.g. nu', 1081, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=c0952d8359057de2&from=serp&vjs=3', '2018-07-22 23:35:53', '2018-07-22 23:35:53'),
(9212, 1073, 1121, 'Jobs in UAE', 'Job Requirements:\n\nBackend coordination of Martinizing (Laundry Services) Retail operations, which will primary include office admin tasks, logistics coordination, delivery vehicles management, HR management for MRTZ retail to be coordinated with corporate HR, handling escalation of customer complaints from retail outlets, preparing daily/weekly management reports, petty cash management, ERP integration (if required), outlet records management. 2. Any additional tasks as required by the management, within the scope of work.\n\nNationality: Indian/Srilankan/Pakistani. Preferably Indian/Srilankan\nAge: Less than 30yrs\nGender: Male/Female. Preferably Male\nSkills: Strong communication skills in English, able to communicate effectively with management & ops team. Proficiency in MS Office.\nExperience: Graduate (fresher)/ 1yr local experience\nSalary bracket: Between AED 3000 – 3500 (gross) per month based on experience\nWorking Hours: As per Labor\nLocation: MRTZ retail, Al Hathboor Group Head Office, Airport Road, Dubai\nOther Requirements: Valid UAE driver’s license\n\nOther Allowances:\nIncentive scheme will be offered based on overall business performance of MRTZ Retail\nBonus will be issued as per company policy and will be at the discretion of the management. This will purely be based on the employee’s performance, which will be assessed every quarter\nCompany vehicle will be provided\nCompany telephone will be provided\nApply', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=9fcf5569fecd80a4&from=serp&vjs=3', '2018-07-22 23:35:53', '2018-07-22 23:35:53'),
(9213, 1074, 1393, 'Jobs in UAE', 'Posting Date Jul 08, 2018Job Number 18001SR6Job Category Procurement, Purchasing, and Quality AssuranceLocation Sheraton Grand Hotel, Dubai, Dubai, United Arab Emirates VIEW ON MAPBrand Sheraton Hotels & ResortsSchedule Full-timeRelocation? NoPosition Type Non-Management/HourlyStart Your Journey With Us\nAt Sheraton, we go above and beyond in everything we do. We are inspired by our guests and one another – and are driven to make things better. We love what we do, and we give it all we’ve got – on property and off. When guests stay with us, it’s not just a room with a bed that they’re buying. It’s an experience. We’re looking for someone who is ready to go beyond in everything they do. If you are someone with a genuine drive to improve your life and the lives of those around you, we encourage you to explore careers with Sheraton.\nSheraton Grand Hotel, Dubai, United Arab Emirates.\n\nLocated at the forefront of Dubai’s most prominent thoroughfare, the Sheraton Grand Hotel seamlessly connects to the heart of the booming business district. Our hotel is just across from the Dubai World Trade Centre and within walking distance of the Dubai Convention Centre. A short drive will take you to DIFC, Dubai Mall, or downtown, and Dubai International Airport (DXB) is 10 kilometers away. Standing 53 stories tall, the hotel comprises 474 guest rooms and suites, as well as 180 one- to three-bedroom serviced apartments. All accommodations span at least 36 square meters and feature the Sheraton Sweet Sleeper® Bed. Our expansive conference center boasts meeting rooms with natural illumination and state-of-the-art audiovisual technology. The Sheraton Grand Hotel also offers a Sheraton Club Lounge that has extensive services and exciting 31st-floor views.POSITION PURPOSE\nTo provide accurate and reliable assistance to the purchasing manager. To manage the stores and cost control processes at Sheraton Grand Hotel, Dubai.\nESSENTIAL FUNCTIONS\nResponsible for the total stock held in the storero', 1082, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=57f78d6770268ab4&from=serp&vjs=3', '2018-07-22 23:35:53', '2018-07-22 23:35:53'),
(9214, 33, 1394, 'Jobs in UAE', 'This position is within the Safety Department and reports to the Safety Specialist.\nThe job holder is responsible to continuously monitor and evaluate Health and Safety operational activities and practices in order to minimize accidental losses due to hazardous conditions, under the direction of the Safety Specialist.\nKey Accountabilities\nConduct random inspections in order to identify hazards and risks at all company premises and operational activities.\nWork in conjunction with the Safety Specialist to advice the department about the hazards identified and devising proper control measures in order to prevent the accidents.\nAssist the Line Managers with incident reporting and accident investigation.\nConduct follow up inspections to ensure that recommended measures are implemented.\nMonitor the work environment by measuring conditions such as lighting, noise, ventilation etc. that may adversely affect the health and safety of staff.\nCheck all portable electrical equipment and take necessary action. Regularly monitor the condition of fire emergency equipment and advise the Safety Specialist accordingly.\nConduct inspection of all emergency and exit lights and take necessary action.\nProvide safety induction to the new contractors.\nInspects first aid box to ensure that all the necessary first aid medical items are available.\nPreparing daily shift report with details of any safety issues and reporting it to Safety Specialist for their advice on preventive measures to be taken.\nAssist in conducting periodic fire evacuation drills and ensure adequate fire emergency and first aid personnel are identified, properly trained, and readily available for responding to emergency situations.\nUpdate safety notice boards on a regular basis.\nConduct the inspection of safety posters to ensure that they are in good state and legible.\nRegularly advise the Safety Specialist of the status of health and safety at all EKFC facilities and operations and the requirements necessary to prevent los', 1083, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=a4f11a24036af023&from=serp&vjs=3', '2018-07-22 23:35:53', '2018-07-22 23:35:53'),
(9215, 1075, 322, 'Jobs in UAE', 'Responsibilities:\nReports to the Lounger Manager\nGreet, receive and bid farewell to passengers in the front reception counter\nCollect payment from passengers at the front reception counter before letting them to enter the lounge\nAssist passengers with their luggage on entry and exit at the lounge\nCarry out regular checks of all areas of the lounge, to ensure consistent cleanliness\nMust be well versed with the different currency conversion rates\nPossess a good knowledge in general information of the airport including its facilities, flight schedules and airlines information, direction to the departure gates etc.\nAssist in all departments in the lounge\nBe well versed with the computer and/or email and internet services; to assist passengers whenever required\nHelp maintain discipline\nKeep record and maintain stock of the Lounge’s promotional and marketing materials\nCooperate and work in a team towards development, implementation, maintenance and improvement of the quality management system\nTake initiative to identify areas for improvement and participate in continual improvement activities\nUndertake other jobs assigned by superior from time to timeRequirements:\nMinimum 2-5 years\' relevant experience in Hotel/lounges management in Hospitality industry\nExcellent interpersonal and presentation skills\nAble to build and maintain relationships with internal and external guests\nEager to learn, positive and energetic personality\nBe organized and motivated\nAble to remain calm under pressure\nPossess a good command of English and have excellent communication skills, both written and verbal. Other languages will be an advantage\nAble to work flexible hours\nStrong leadership, communication and interpersonal skills\nImmediate available is preferred\nBenefits', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=3ccf7ea3be3322d7&from=serp&vjs=3', '2018-07-22 23:35:53', '2018-07-22 23:35:53'),
(9216, 1076, 1267, 'Jobs in Qatar', 'QR16809 - Administration Assistant | Hamad International Airport | Doha\nOrganisation: Hamad International Airport\nJob Function: Safety & Security\nDivision: HIA (Division)\nEmployment Type: Full Time - Permanent\nCity: Middle East | Qatar | Doha\nLast date of application: 26-Jul-2018\nHamad International Airport\nHamad International Airport (HIA) is the hub for the rapidly expanding international Qatar Airways network. Open 24/7 and located just five km from Doha\'s city centre, the airport is used by more than 35 regional and international airlines. It is also home to the world’s only terminal dedicated to Qatar Airways First and Business Class passengers.\nAbout Your Job:\nRepresenting the HIA Management office, the Office Administrator is responsible for assisting the Management Office in the day-to-day functions. Responsibilities will include managing, organizing a wide range of meetings and acting as the main point of contact for the Management Office of HIA while promoting high standards of corporate values through correspondence, telephone, and personal contact. Promote high standards of corporate values through correspondence, telephone, and personal contact.\nAbout You:\nEssential:\nRelevant Vocational, Tertiary or Trade qualification.\nEnglish and Arabic speaker.\nMinimum 3 years relevant experience.\nDatabase administration experience.\nExcellent computer skills, including Microsoft Word, Excel and PowerPoint.Note: you will be required to attach the following:\n1. Resume / CV\n2. Copy of Highest Educational Certificate\n3. Copy of Passport', 1013, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=7a835fc3f1938b63&from=serp&vjs=3', '2018-07-22 23:35:53', '2018-07-22 23:35:53'),
(9217, 1077, 1267, 'Jobs in Qatar', 'QR18039 - Technology Services Lead Engineer | Hamad International Airport | Doha\nOrganisation: Hamad International Airport\nJob Function: Information Technology\nDivision: HIA (Division)\nEmployment Type: Full Time - Permanent\nCity: Middle East | Qatar | Doha\nLast date of application: 31-Jul-2018\nHamad International Airport\nHamad International Airport (HIA) is the hub for the rapidly expanding international Qatar Airways network. Open 24/7 and located just five km from Doha\'s city centre, the airport is used by more than 35 regional and international airlines. It is also home to the world’s only terminal dedicated to Qatar Airways First and Business Class passengers.\nDepartment:\nThis role supports the operational activities, maintaining the up-time of Enterprise Wired and Wireless Network and Security equipment e.g. Routers, Switches, Firewalls, IPS/IDS, Web Proxy, Wireless Controllers at the Airport. This role will carry out Network management activities and other proactive actions ensuring that the multiple services offered over the Network Infrastructure are reliable and uninterrupted.\n\nKey Responsibilities include\nSupport the 24x7 IT Network operations and provide technical support for Network and Security infrastructure by attending to the Incidents and problems as well as perform system administrative activities.\nExcellent network analysis and robust troubleshooting skills.\nConfigure Network & Security devices as per approved change request\nRepair, error correction, troubleshoot and provide resolution and root cause response to high priority and severity Incidents.\nGood Knowledge on NMS monitoring tools\nDevelop and maintain documentationExperience & Qualifications:\nEssential:\nProven hands-on Network support and operations experience of 5-7 years in managing Airport/ Large enterprise LAN/WLAN environment on MPLS.\nIn depth knowledge of Routing & Switching, Wireless LAN, IPS/IDS, Load Balancers and Firewalls.\nRelevant College or University qualification to min Bache', 1013, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=201328dcc5b21a10&from=serp&vjs=3', '2018-07-22 23:35:53', '2018-07-22 23:35:53'),
