(9220, 1080, 1267, 'Jobs in Qatar', 'QR17253 - Terminal Standard Supervisor | Hamad International Airport | Doha\nOrganisation: Hamad International Airport\nJob Function: Facilities Management\nDivision: HIA (Division)\nEmployment Type: Full Time - Permanent\nCity: Middle East | Qatar | Doha\nLast date of application: 04-Aug-2018\nHamad International Airport\nHamad International Airport (HIA) is the hub for the rapidly expanding international Qatar Airways network. Open 24/7 and located just five km from Doha\'s city centre, the airport is used by more than 35 regional and international airlines. It is also home to the world’s only terminal dedicated to Qatar Airways First and Business Class passengers.\nAbout Your Job:\nYou will be responsible for supervising the quality of cleaning services carried out by the outsourced companies for Hamad International Airport. Also high standards and safety are followed in maintaining the cleanliness, sanitation and hygienic environment while following cleaning methods in line with specific asset requirements.\n\nKey responsibilities will be:\nMonitor the cleaning schedule (daily and deep cleaning) carried out by the contractor which was has been verified by facilities management to ensure the standards set will be met.\nReport any incident on cleaning issues, facilities resulting to poor performance and poor standard of cleaning at the daily briefing and to the line manager for corrective action.\nPerform a minimum of 8 audit inspection per shift as per standard set by facilities management and update audit spreadsheet with audit scores to monitor the daily performance of the contractor.\nAbout You:\nThe qualification we need from the candidate is minimum diploma in hotel management or equivalent to management of housekeeping, hygiene and sanitation with minimum 4 years’ experience of job related and pervious employment within airport, hotel, mall, retail or industrial cleaning industry.\nNote: you will be required to attach the following:\n1. Resume / CV\n2. Copy of Passport\n3. Copy ', 1013, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=4d2e0f6ce503e282&from=serp&vjs=3', '2018-07-22 23:35:53', '2018-07-22 23:35:53'),
