ents, ensuring repaired vehicles are returned promptly ', 1013, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=8fc40548d30c884b&from=serp&vjs=3', '2018-07-22 23:35:53', '2018-07-22 23:35:53'),
(9223, 1083, 1397, 'Jobs in Qatar', 'Welcome to our World.\nOur Vision at Millennium & Copthorne Middle East and Africa is to be the preferred hotel company for our guests, colleagues, and owners while achieving exceptional growth.\nWe have an Ambition to operate 100 preferred hotels by year 2020.\nMillennium Hotel Doha is located in the heart of Doha, whether for business or leisure, This Five star hotel is within 25 minutes’ drive from Hamad International Airport, and provides easy access to Doha’s many key attractions like Aspire Zone, Villaggio Mall, National Theatre, Qatar National Convention Center, Education City, Souq Waqif, Land Mark Mall, Corniche, Museum of Islamic Arts, The Mathaf, West Bay area, Katara and the Pearl.\nMillennium Hotel, Doha offers the famous warmth of Arabian hospitality through an exclusive array of services and leisure facilities. As a guest in this hotel, you will indulge yourself with a superb range of facilities including renowned Cosmo restaurant, day light meeting rooms fully equipped with state of the art technology, an indoor swimming pool, spa and fitness center.\n\nKey Job Responsibilities\nSorts all incoming correspondence in order of priority and process the reservations to the set standard\nTakes reservations directly over the telephone while inputting / cancelling them in the computer to the required standard\nMakes sure all reservations are processed and confirmation letters/faxes/e-mails are sent our within a 24-hour period\nFiles all correspondence in alphabetical and date order on a daily basis\nMaintains and update the Reservations office Yield availability board\nChecks all reservations for the next day’s arrivals to ensure all details are correct and that all special requests are being fulfilled\nQualificationsAt least 2 years’ experience in a 4/5 star hotel\nPreferred Experience with Opera PMS (preferred)\nProficient computer skills on Microsoft Office, Excel, and Word\nPrimary Location: QA-DA-Doha\nJob: Front Office\nOrganization: Millennium Hotel Doha\nSchedule: Regu', 1086, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=fe5d3ee026eeb354&from=serp&vjs=3', '2018-07-22 23:35:53', '2018-07-22 23:35:53'),
(9224, 1084, 1267, 'Jobs in Qatar', 'QR17357 - Lead Civil Technical Officer | Hamad International Airport | Doha\nOrganisation: Hamad International Airport\nJob Function: Facilities Management\nDivision: HIA (Division)\nEmployment Type: Full Time - Permanent\nCity: Middle East | Qatar | Doha\nLast date of application: 28-Jul-2018\nHamad International Airport\nHamad International Airport (HIA) is the hub for the rapidly expanding international Qatar Airways network. Open 24/7 and located just five km from Doha\'s city centre, the airport is used by more than 35 regional and international airlines. It is also home to the world’s only terminal dedicated to Qatar Airways First and Business Class passengers.\nAbout Your Job:\nAs Lead Civil Technical Officer you will lead a team of Technical officers, Supervisors and Senior Technicians to coordinate all maintenance activities and new projects work to meet the operational requirements and quality goals set by HIA FM Management. You will support the delivery of contract management and Assurance by completing audit activities, liaising with contractors and supervising team members with operational responsibilities.\nKey accountabilities include and not limited to:-\n\nTo Manage Project gateway processes.\n\nto be able to assess and evaluate the base line program schedule for projects.\n\nto manage stakeholder and contractors\n\nTo prepare commercial and technical evaluation reports.\n\nTo assess and evaluate extension of time claims.\n\nTo broadly support in cost estimates.\n\nYou will be responsible for attending design workshops and prepare reports and MOM.\n\nTo ensure Maintenance integration and asset management process is followed and achieved.\n\nTo demonstrate skills to manage and lead a team of technical staff of minor works.\n\nTo be able to set department KPI’s in alignment with job role KPI’s.\n\nAbout You: You should have bachelor’s degree or equivalent with minimum 5 years of job related experience, awareness of