dates WFS Aviation Prices on receipt\n4. Responsi', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=443ae28bdd1df792&from=serp&vjs=3', '2018-07-22 23:35:56', '2018-07-22 23:35:56'),
(9228, 1086, 1401, 'Jobs in USA', 'BASIS.ed is seeking a Registrar to cover a maternity leave at our office in the Scottsdale area. This position will be a temp to hire role working full time with the possibility of transitioning to one of our new schools as a Registrar for the 2019-2020 school year.\nThe BASIS academic program is consistently ranked among the top 10 programs nationally and is competitive on an international scale. The mission of BASIS Schools is to provide an academically excellent and rigorous liberal arts college preparatory education to all Lower and Upper School students. It is imperative that our registrars share our vision of improving the state of education in our country.\n\nPrimary Job Responsibilities include but are not limited to:\nSummary of Essential Duties\nRunning reports and preparing Board slides/presentations.\nManaging Happy Fox tickets, emails, and answering parent phone inquiries.\nTesting 2019-2020 Applications.\nPrepare PowerPoint Registrar Training documents.\nManaging applications and offers for new schools for 2019-2020\nIndividual Tasks\nCreate reports and analyze data\nRespond to Happy Fox tickets\nAnswer Phone Calls\nRun Offers/Refreshers\nOrganize Registrar Meetings\nPoint of contact for Registrars\nEdit Enrollment Policies\nUpdate letters and content\nTest 19-20 Application to prepare for Open Enrollment\nTest links to forms and documents\nBoard Slides\nJob Qualifications:\nMinimum Qualifications: A Bachelor\'s degree or minimum of 7 years administrative experience and valid fingerprint clearance are required to work at BASIS.\n\nPreferred Qualifications: Experience with children. Skills include proficiency in Microsoft Office. Together with a high level of personal responsibility and optimism, a successful applicant will demonstrate strong communication and interpersonal skills, and will thrive in a fast-paced, achievement-oriented learning environment.\n\nAdditional Job Information:\nBenefits and Salary: Pay for this position is competitive and dependent on education and experi', 1090, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=fd929f6f61da7cd1&from=serp&vjs=3', '2018-07-23 04:42:16', '2018-07-23 04:42:16'),
(9229, 1087, 1402, 'Jobs in USA', 'BASIS Scottsdale is seeking qualified candidates for a Registrar Assistant for the 2018/2019 school year!\nIn this role, the Registrar Assistant is primarily responsible for helping the Registrar in the managing all systems related to student enrollment and records.\n\nThe BASIS academic program is consistently ranked among the top 10 programs nationally and is competitive on an international scale. The mission of BASIS Schools is to provide an academically excellent and rigorous liberal arts college preparatory education to all Lower and Upper School students. It is imperative that our registrars share our vision of improving the state of education in our country.Primary Job Responsibilities include but are not limited to assisting with:\nOrganizing and managing registration of new and returning students.\nManaging records of current students and reporting to department of Education.\nManaging student records software (PowerSchool).\nCoordinating student enrollment and withdrawal process.\nJob Qualifications:\n\nMinimum Qualifications: A Bachelor\'s degree and valid fingerprint clearance are required to work at BASIS.\nPreferred Qualifications: Experience with children. Skills include proficiency in Microsoft Office. Together with a high level of personal responsibility and optimism, a successful applicant will demonstrate strong communication and interpersonal skills, and will thrive in a fast-paced, achievement-oriented learning environment.\n\nAdditional Job Information:\n\nBenefits and Salary: Pay for this position is competitive and dependent on education and experience. BASIS offers a comprehensive benefits package.\nNOTE: All employees of BASIS Educational Group are required to obtain and maintain a valid fingerprint clearance.\nNotice of Non-Discrimination: In accordance with Title VI of the Civil Rights Act of 1964, Title IX of the Education Amendments of 1972, Section 504 of the Rehabilitation Act of 1973, the Age Discrimination Act of 1975, Title II of the Americans with ', 1090, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=a94bb6649dc2a224&from=serp&vjs=3', '2018-07-23 04:42:16', '2018-07-23 04:42:16'),
(9230, 1088, 1404, 'Jobs in USA', 'JOB GOAL:\nCoordinates all aspects of the Queen Creek Unified School District Youth Athletic Program and district facility rentals pertaining to athletic events.\n\nQUALIFICATIONS:\nBachelor’s degree from a four-year college or university\nCertified teaching experience and head varsity high school coaching experience required\nAthletic director experience preferred\nDemonstrated knowledge of athletics within an educational institution required\nExceptional communication and customer service skills\nAbility to work effectively with district staff, vendors and community members\nValid Arizona Driver’s License\nExperience using Microsoft Office Applications and GooglePERFORMANCE RESPONSIBILITIES:\nResponsibilities shall include, but not be limited to, the following:\nSupports the Strategic Plan of Queen Creek Unified School District.\nMaintains professional demeanor and a high level of ethical behavior and confidentiality.\nAdvocates for District Athletics and sports enrichment programs in the community through marketing strategies including social media outlets and participation at community events.\nDevelops and maintains partnerships with community organizations for networking and fundraising purposes.\nEnsures proper usage of school equipment and property.\nCoordinates and facilitates all meetings with vendors and coaches regarding QCUSD Youth Athletic Programs.\nCollects and maintains data regarding sports camp/clinic activities, enrollment and partnerships.\nCoordinates all operational preparation for sports camps, clinics and events.\nEnsures sports camps/clinics adhere to district and revised AIA guidelines.\nAssists in establishing annual calendar activities and facility rentals.\nWorks cooperatively with district staff and community members.\nDemonstrates proactive problem solving behavior and conflict resolution skills.\nSchedules and provides tours of rentals during business hours as requested.\nCoordinates with QCUSD staff to determine availability of requested locations, dates, an', 364, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=99444b118400975a&from=serp&vjs=3', '2018-07-23 04:42:16', '2018-07-23 04:42:16'),
(9231, 1089, 1403, 'Jobs in USA', 'Downtown Music Publishing is one of the world\'s leading rights-management firms, with offices in New York, Nashville, Los Angeles, London, Amsterdam, Tokyo, Sydney and Paris. Our catalog spans over seven decades of popular music, encompassing some of the world\'s most beloved songwriters and artists including The Beatles, John Lennon & Yoko Ono, Ryan Tedder, Benny Blanco, The Kinks, Hans Zimmer, Mötley Crüe, One Direction, Naughty Boy, Hardwell, Sturgill Simpson, Santigold, Carla Bruni, and Social Distortion. The company\'s technology platform, Songtrust, powers global royalty collection from over 100 countries and more than 20,000 unique income sources worldwide.\n\nHR/Office Coordinator\n\nOur Los Angeles office is growing and so is our People team! Downtown is in need of someone to become our Office and HR Coordinator. We are looking for someone who wants the opportunity create a fun, vibrant, and happy office culture for our LA office. In addition to the day-to-day office management, the individual we are looking for will help and assist our global HR team by expanding our internship and school outreach program.\nWhat will you be doing?:Assist in the creation of a fun and happy office culture\nGreet clients in a warm and friendly manner\nManage and nurture relationships with employees and vendors\nConference room calendar management\nManage supplies and ordering for all office, kitchen and pantry supplies\nAssist with the planning of any company outings\nAssist and work with company management and coordinate any maintenance issues.\n\nAssist with University Outreach in the Los Angeles area\n\nAssist with intern recruiting and application review process, hiring, training and development process\nYou are:Someone with a college degree\nSomeone who is extremely organized and outgoing\nSomeone who is a quick learner, self starter, problem solver\nSomeone who possesses great time management skills\nSomeone with experience using G-Suite (Google Docs, Slides, Sheets, etc)\nSomeone who has a g', 327, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=d2f510577b4bdf79&from=serp&vjs=3', '2018-07-23 04:42:16', '2018-07-23 04:42:16'),
