(9234, 1092, 1406, 'Jobs in USA', 'Ice Cream Sales Merchandisers needed. Routes cover Phoenix and surrounding areas. Office is located in Phoenix.Skills Required:  Strong customer service, Bilingual, good communication skills, fast, organized and must be comfortable using a vending or portable hand held.Duties:  Merchandise freezers, cleaning, de-Icing, maintaining assigned convenience store routes. Could be delivering freezer cabinets or picking them up to and from customer locations. Must be able to open new accounts along route to reduce drive time between stops and increase sales. Primarily job is Monday through Friday; May need to work weekends occasionally or as needed if route account route gets behind.Requirements: Must have a clean driving record, excellent driving skills and a clean background for security badge clearance. Will use a hand held device to invoice customers and perform daily inventory. If considered, applicants will be asked to take a drug test at their own expense.Extra:  Bi-Lingual is a plusIf you are interested working in a friendly atmosphere with serious intentions of commitment of staying long term please submit resume.Salary: Base Salary plus Commission per dayJob Type: Full-timeJob Type: Full-timeExperience:Merchandising: 1 yearEducation:High schoolLocation:Phoenix, AZLicense:Driver\'s License', 1094, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/La--Z--Boy/jobs/General-Office-c797592fe2cd2631?sjdu=Zzi_VW2ygsY1fzh3Ma9ZsE4zIT1NTXCwgFBhdjeTC3MupnuG8qzkAqS2Ock6AOZEdL-g_J', '2018-07-23 04:42:16', '2018-07-23 04:42:16'),
(9235, 1093, 1407, 'Jobs in USA', 'Shift:\nMonday - Friday\n12 pm - 8:30 pm\nResponsible for cleaning bathrooms, break rooms, offices and floors and stairs. This includes countertops, cabinets, tables, chairs, toilets, mirrors, walls, desktops and all surfaces and equipment in area. It includes restocking the supplies as needed and monitoring chemical usage.\nAssist Sanitation Assistants in minor equipment cleaning and sanitation.\nAssist Dish room Staff in dishwashing duties.\nMaintenance of hand sinks, floors, coolers and storage areas.\nMaintain chemical levels, garbage and recycle items throughout plant.\nMaintain all records as applicable.\nAttend team meetings and monthly company meetings and be a contributing partner to the team.\nNormal hours worked per week are 40, however it may be necessary to work extra hours on a daily and/or weekly basis.\nKnowledge of proper HACCP and GMP procedures and use lean manufacturing principles in all areas.\nRequirements\nMust be capable of independently and efficiently organizing workload.\nBending, stooping, walking, reaching, grasping, carrying are required on a constant basis. Ability to stand on feet for entire work shift, normally 8 hours, is required, however, overtime may be required during peak periods.\nMust possess good communication skills.\nWork in a team environment so must have ability to work well with others.\nAbility to think and work safety and work safely at all times and must follow all proper ergonomic and safety practices.\nMust be able to lift 52 pounds occasionally.\nAbility to read, speak and understand the English language. Must be able to perform simple math problems, including addition, subtraction and multiplication.\nA high school diploma or GED preferred, or two or more years English as a Second Language classes required.Lifting - More than 52 pounds without assistance is prohibited!', 1095, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Big-Boy-Ice-Cream/jobs/Ice-Cream-Sales-Merchandiser-55915f7962c752a3?vjs=3', '2018-07-23 04:42:16', '2018-07-23 04:42:16'),
