(9250, 1108, 1406, 'Jobs in USA', 'Posting ID# 5271\n\nJune 6, 2018\nPOSITION: Insurance Benefits Coordinator\nLOCATION: Human Resources - District Office\nOPEN TO: Employees of Carson City School District and external applicants.\nAPPLICATION PERIOD: Closes June 19, 2018, or until filled.\nSALARY & BENEFITS: Grade 26. Range begins with Step 1 = $19.52 per hour. 8.00 hours per day, 12 months per year with benefits according to the classified negotiated agreement. Employer-paid retirement, health and life insurance, sick leave benefits and personal leave. A new classified employee may receive up to a maximum of five (5) years of previous outside work experience. The prior position must be similar in nature and written verification of employment from the previous employer must be submitted to Human Resources upon employment. Per Administrative Regulation No. 311.1.\nAPPLICATION: Complete the online application by clicking \" Apply for this Position .\" The application will require:\nCover letter\nResume\nCopy of High School Diploma, or High School transcript, or GED Certificate, or degree from a higher education college/university,\nLast three (3) evaluations (if no evaluations or incomplete: submit documentation on why no or partial evaluations)\nThree (3) letters of recommendation dated within the last two years.\nEDUCATION and EXPERIENCE: Graduation from high school or the equivalent. Completion of formal or informal training in benefit administration practices, or closely related field; and responsible secretarial and office management or technical experience and/or training involving planning and scheduling work duties; experience and success in maintaining confidentiality concerning all business matters, compilation and reporting of data; reading, editing, and interpreting complex written materials and the performance of administrative details. Bilingual preferred.\n\nMust be able to pass the pre-employment drug screen test.\n\nThis is a replacement position.\nREASONABLE ACCOMMODATION: The Human Resources Department ', 1113, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=6a2a03cd75fb823e&from=serp&vjs=3', '2018-07-24 14:15:56', '2018-07-24 14:15:56'),
(9251, 1109, 1407, 'Jobs in USA', 'Position Type:\n Professional /Technical PositionsDate Posted:\n 7/9/2018Location:\n Education Service CenterDate Available:\n When FilledClosing Date:\n When Filled\nSAFETY AND SECURITY SPECIALIST - DISTRICT WIDEAbout the Position\nTo better serve our students, staff and community, School District 49 is adding two armed Safety and Security Specialist positions. The Safety and Security Specialist patrols and monitors district property or functions to ensure safety and security of students, visitors and staff and to ensure the security of buildings and property. The Safety and Security Specialist assists the Director of Safety and Security to plan for, deliver or cause to be delivered all training for Zone staff.Work Schedule: 220 work daysReports to: Director of Safety and SecurityStarting Pay Range: $44,000 - $60,000 annually, depending on experienceFull-time or Part-time: Full-timeBenefits: Benefits eligibleSpecial Note: This is an armed position. New hire will be expected to qualify for position by passing additional extensive background checks, psychologist exam, and range qualification.Position Description\nThe Safety and Security Specialist will:\nAssists the director in the supervision and coordination of all aspects of security operations and functions.\nSchedules and deploys security personnel assigned to the sections.\nResponds to calls for service or assistance to school sites as needed.\nAssists the director in developing operational procedures, emergency plans, and recommendations for implementation of new methods and procedures.\nDevelopment and/or delivery of training programs for personnel assigned to district staff, zone and building staff including, but not limited to school and criminal law and procedure, emergency response protocols and management. Crisis Prevention Institute Non-Violent Crisis Prevention Intervention,\nCoordinates special operations as assigned by the director of safety and security.\nAssists in evaluating the performance of assigned personnel', 366, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=b202e3c45de2206f&from=serp&vjs=3', '2018-07-24 14:15:56', '2018-07-24 14:15:56'),
