(9257, 1112, 1363, 'Jobs in USA', 'Description: Use company provided trucks to deliver and pick up packages in an assigned area. Position is fast paced and requires a strong commitment to safety and dependability. FedEx Ground utilizes independent contractors to service its delivery and pick-up service. You will be employed by an independent contractor.Job Type: Permanent full time employmentFull Time * Mon-Fri * 7:00am to 5:30pm** More hours may be required due to heavy package volume.Qualifications:* At least 1 year verifiable commercial driving experience within the past three years in a CMV greater than 10,000lbs. Previous employers who can verify driving experience will be called.* You must be a minimum of 21 years of age* Clean driving record for the past 3 years* No DUI\'s or Felonies* Drug Screen* Background Check* E-Verify* Customer service skills* CDL not requiredCompensation: Start at $140/ per day as a driver, $100 per day as driver\'s helper (you will be a driver\'s helper for first 2-3 weeks of training).ONLY IF YOU MEET ALL OF THESE QUALIFICATIONS, please reply to this post and attach a resume to schedule an interview.driver deliveryJob Type: Full-timeSalary: $140.00 to $160.00 /day Plus monthly safety bonusJob Type: Full-timeSalary: $140.00 to $160.00 /dayExperience:Commercial driving experience: 1 yearLicense:Driver\'s LicenseDOT Medical CardTrucking route:Local', 461, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Ground-Support-Inc/jobs/Delivery-Driver-FedEx-Ground-Contractor-15cbc640dec53033?vjs=3', '2018-07-24 16:27:02', '2018-07-24 16:27:02'),
(9258, 1113, 1435, 'Jobs in USA', 'About MassDOT\n\nThe Massachusetts Department of Transportation (MassDOT) is responsible for developing, implementing, and coordinating transportation policies and projects for the Commonwealth of Massachusetts and to efficiently plan, design, construct, and maintain a safe statewide transportation system which effectively meets the transportation needs of the Commonwealth.MassDOT’s divisions include: Highway, Aeronautics, Registry, Rail & Transit and Programs &Planning. There are approximately 3,600 employees that work in the department. In addition, the Massachusetts Bay Transportation Authority (MBTA) and Regional Transit Authorities (RTA) are subject to oversight by MassDOT.\n\nThis position requires a Tuesday through Saturday work schedule.\n1. Review and approve the required license applicant documentation to confirm identity, valid permit status, and to ensure compliance with state law and RMV policies and procedures.\n2. Verify road test sponsor accompanying applicant is at least twenty-one years of age, has at least one year of driving experience and possesses a valid driver\'s license.\n\n3. Inspect the vehicle for valid registration. Ensure that all equipment is in good working order, that the vehicle provides a seat for the Examiner next to the operator, and that the vehicle provides a seat for the sponsor. Record the make, model and registration number of the vehicle being used for the road test.\n\n4. Apply RMV policy and demonstrate good customer service skills in determining when to refuse to conduct a road test.\n\n5. Conduct competency road test exams, following criteria prescribed by the Registrar, to determine if a driver\'s license applicant has the necessary knowledge and skill that deems them eligible for a Massachusetts passenger or motorcycle license. Request the applicant perform specific driving functions, prescribed by the Registrar.\nThe skills tested include, but are not limited to:\nStarting the engine, starting and stopping the vehicle, parking paral', 1117, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=8fe0fc6eb5d69400&from=serp&vjs=3', '2018-07-24 16:27:02', '2018-07-24 16:27:02'),
(9259, 1114, 1436, 'Jobs in USA', 'FULL-TIME FLORAL DELIVERY DRIVERS NEEDED, WEEKDAYS & WEEKENDS - Downtown Phoenix. Make someone\'s day while making money by hand delivering our beautiful floral arrangements. Arizona Family Florist, the valley\'s largest retail floral company, is hiring full-time and part-time employee Delivery Drivers for all shifts. Candidates must be reliable, presentable, courteous self-starters, willing to work a flexible schedule and additional hours during holiday seasons.You will operate one of our company vehicles. Driving position pays a rate of $4.00 per successfully completed delivery. Drivers will drive multiple routes each day, all planned out by dispatch with a turn-by-turn Google map. Deliveries are valley-wide and route locations will vary day to day. Salary: $120.00/day or more (based on 30 successfully completed deliveries)Arizona Family Florist offers full-time employees medical and dental benefits, as well as paid time off after 90 days. HURRY!! Driving positions are on a first come, first served basis.MUST HAVE:Must have a Valid Arizona Driver’s LicenseMust have a Clean Driving Record (provide an MVD Driving Report) you can order this online for $3 @: https://servicearizona.com/motorVehicleRecordMust be Eligible to Work in ArizonaMust be 21 Years of Age or OverMust Pass a Drug Screening TestRegular Delivery Hours: Mon-Fri 7am-6pm Sat 7am-3pm Sun 7am-12pm Holiday hours are extended as needed.Qualified candidates send resume or apply in person at our Retail Shop & Design Center, Monday-Friday from 8AM - 6PM Arizona Family Florist 2050 South 16th Street, Suite 105 Phoenix, Arizona 85034 Located on the Northwest corner of South 16th Street and I-17 inside Arizona Flower Market.Arizona Family Florist is an Equal Opportunity Employer.For more information on Arizona Family Florist and its brands visit: www.azfamilyflorist.comJob Type: Full-time', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,