(9260, 1115, 1437, 'Jobs in USA', 'We provide the vehicle . We are looking for 1 candidate with a valid drivers license to transport parts between our 2 shops. Also to run errands and also to get paint and materials from various stores and businesses that we purchase items from to help our growing business operate more smoothly. We also transport vehicles to and from our various contracts that need to be fixed then returned to our accounts. This is a very important job to our company . This job literally keeps our company moving. This job is a demanding job. If you cannot lift at least 75 pounds then this job will not work for you.Please remember this is a lot of driving and in and out of the vehicle. Its extremely hot outside so staying hydrated is a must. If you cant take the heat ha ha. Well you know what I mean. I personally do not do well in any extreme temperature... plus or minus. Thank you for your consideration. My name is Michael .please text me at 928 632 2412 and reference the \"parts driver\" I have multiple ads for jobs. Thank youJob Type: Full-timeLicense:Driver\'s License', 461, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Hurry-Cab-of-Flagstaff/jobs/Part-Driver-345dab02100aca4d?vjs=3', '2018-07-24 16:27:03', '2018-07-24 16:27:03'),
