endors.\nSupports on Forecasting process.\nSupports in following the', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=2d37a270e980ee5d&from=serp&vjs=3', '2018-07-24 19:19:17', '2018-07-24 19:19:17'),
