(9272, 1127, 1450, 'Jobs in USA', 'DESCRIPTION\nIndustrial Color Studios, the leader in digital content production, seeks multiple talented 3D Modeling & Texture Artists to work on our eCommerce content.\nThe 3D Modeling & Texture Artist is a master in high-volume, high-quality, digital artwork generation, using Maya/Max, Zbrush/Mudbox, Substance Painter & Photoshop.\nCandidates must have the ability to successfully manage and produce multiple deadline-driven projects with high image volume while maintaining the utmost in accuracy and the highest visual quality.\nResponsibilities include:\nWorks with CGI Lead and production management staff to assess and build out hard and soft surface 3D models at both photo-real and real-time resolutions\nHelps to follow, revise, and create new quality standards for modeling and texturing of products within the company\nParticipates with creative team in asset development\nQuality control review of results\nWork with licensing partners to teach them how to process 3D models, textures and shading at their facilitiesREQUIREMENTS\nMust have a photo-real quality portfolio of 3D modeling and texturing in 3DS Max and/or Maya\nExcellent understanding of UV layout techniques\nKnowledge of topology for efficient but realistic looking meshes as both photo-real and real-time\nTechnically minded; knows how to use various computer applications, such as: Maya, 3DS Max, Photoshop, Illustrator, Nuke, AfterFX, VRay, Arnold, RedShift, Octane, Deadline, Shotgun, fTrack\n1-3 years in a CGI production environment as a modeler/texture artist\nExcellent communication skills, enjoys working on a team and teaching others\nAbility to prioritize and deal with heavy workload/multiple simultaneous projects\nAbility to record information accurately and detect/report issues before they compromise delivery\nAbility to analyze and problem solve/keen attention to detail\nAbility to learn new software quickly or on the job if necessary\nAbility to take instruction, but also work independently when neededAbout Industria', 1126, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Na', '2018-07-24 19:33:26', '2018-07-24 19:33:26'),
