(9274, 1129, 1453, 'Jobs in USA', 'Calaveras Big Trees/Save the Redwoods LeagueK-12 Education Distance Learning, Digital and Social Media Outreach ProgramCalaveras Big Trees State Park, a California State Park located in Arnold, California is looking for an enthusiastic, energetic self-starter with a passion for technology, redwoods, and science communication.Anticipated Start Date: August 1, 2018Anticipated Completion Date: June 30, 2019Work includes delivery of redwood science interpretive programs to a diverse audience of K-12 students using distance learning platforms (Skype, Zoom, etc…), creating digital content for use by educators and researchers, social media, including live streaming on several platforms (Instagram, Periscope, etc…), development of virtual and augmented reality products, in-person field trip and traditional interpretive presentations, and cross-promotion and collaboration between California State Parks and Save the Redwoods League.Applicant must have experience with varying technologies, digital content development and science communication. The ideal candidate should consider themselves a problem solver, and have the skills to employ varying technologies to assist in their organizational planning.Dorm-style housing is available August 1, 2018-June 30, 20194 days a week, approximate shifts are from 8:00 to 4:30 with occasional weekend and alternate hours.Applications accepted until filled. To apply, fill out a standard state application form Employment Application (STD 678) and send it to:Central Valley District OfficeAttn: Amber Stegner22708 Broadway StreetColumbia, CA 95310For more information, contact Amber Stegner at 209-536-2913Job Types: Part-time, InternshipSalary: $18,000.00 /yearExperience:online content management and public speaking: 2 yearsEducation:High schoolRequired work authorization:United States', 1128, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://helpwanted.indeed.com/jobs/viewjob/75009c2a131b6993?jk=949657075424a4a3&vjs=3', '2018-07-24 19:33:26', '2018-07-24 19:33:26'),
(9275, 1130, 1454, 'Jobs in USA', 'Patient Transporter-Arnold Palmer Hospital - Arnold Palmer Hospital\nOrlando Health is one of Florida’s most comprehensive private, not-for-profit healthcare systems providing access to nearly two million Central Florida residents and has provided care for more than 4,600 international visitors annually. Our physician practices, diagnostic centers, hospitals and advanced medical treatments and procedures, along with our highly qualified team of medical specialists, have distinguished Orlando Health as a healthcare leader. We are one of Central Florida’s largest employers with more than 15,000 employees and nearly 3,000 affiliated physicians supporting our philosophy of providing a continuum of care that revolves around patients’ needs. As a leading healthcare resource, providing world-class medical care as well as training our future healthcare providers, Orlando Health will continue to foster growth and development throughout the region for generations to come. We are looking for talented individuals to be part of our team.\nQUALIFICATIONS:\nPatient care or customer service role experience preferred.\nHigh Scholl Diploma preferred', 1129, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Na', '2018-07-24 19:33:26', '2018-07-24 19:33:26');
