(9276, 1131, 1457, 'Jobs in USA', 'General Purpose\nUnder general direction of the Human Resources Director, creates, implements, and manages all aspects of the pretrial services and supervision program.\nDavis County is creating and implementing a Pretrial Services and Supervision Program. The Coordinator is a new position and will be responsible for creating, implementing and supervising all aspects of the program. The Coordinator will initially be tasked with establishing procedures to implement the Public safety Assessment Tool recently adopted by the Utah Judicial Council, hiring two Case Managers, and coordinating efforts with other county and state entities.\nExample of Duties\nProvides supervision and direction to case management staff; interviews and hires employees; provides coaching, training and on-going support; schedules, assigns and monitors work; conducts performance appraisals in compliance with Davis County policies and procedures; documents performance issues in a timely manner and properly refers employees for disciplinary action when necessary.\nCreates a process for and monitors the assignment of caseloads to ensure appropriate supervision levels.\nEnsures Case Managers perform intake, risk/need assessments, pre-sentence report (PSR) investigations (if court-ordered), maintain up-to-date monitoring of court requirements, provide appropriate referrals to outside agencies, and prepare and file “order to show cause” affidavits and related documents for instances of client non-compliance in keeping with court approved procedures.\nStreamlines the work flow of the work group; monitors accuracy and timeliness of case management activities and conducts quality assurance audits.\nIntegrates county and state resources; serves as a liaison between participants in the judicial process including but not limited to courts, defense counsel and prosecutors, jail management and staff, other criminal justice agencies, treatment agencies, and the general public; coordinates efforts with the Administrativ', 1131, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=3fa687502ca2d12d&from=serp&vjs=3', '2018-07-24 19:33:26', '2018-07-24 19:33:26'),
(9277, 1132, 1458, 'Jobs in USA', 'Production Helper - Albuquerque, NM\nreq6601\nEmployment Type: Regular\nLocation: ALBUQUERQUE,NM\nHave you ever enjoyed Arnold®, Brownberry® or Oroweat® bread? A Thomas’® English muffin or bagel? Or perhaps snacked on a Sara Lee®, Entenmann’s® or Marinela® cake or donut? If the answer is yes, then you know Bimbo Bakeries USA!\nBimbo Bakeries USA is part of Grupo Bimbo, the world’s largest baking company with operations in 32 countries. Bimbo Bakeries USA (“BBUSA”) includes BBUSA and its subsidiaries and affiliated entities, including, but not limited to, Wholesome Harvest Baking, East Balt, and Acelerada. BBUSA employs 20,000 associates across the U.S. in bakeries, sales centers, corporate offices and on sales routes to ensure our consumers have the freshest products to feed their families at every meal. But our associates come to work for much more – the chance to feed their own lives through exciting work that offers the opportunity to make a real difference in their professional and personal lives every day.\n Description:\nDuties will include:Load and unload pans from production line\nStack and unstack pans\nLoad and unload oven and/or proof box.\nDump waste buckets\nAssist with other positions as assigned by supervisor.\nMay fill in for absent positions in production or packaging areas.\nTake appropriate action to ensure the integrity and sustained certification of the food safety and food quality system.\nResponsible for reporting and taking any necessary action to prevent food safety and food quality problems from occurring.\nResponsible for following and enforcing procedures outlined in the Food Safety Plan and the Food Quality Plan and any other programs that support the SQF system and other 3rd party audits.\nOther duties as assigned.\nPosition Requirements:\nHigh school diploma or GED equivalent.\nAble to communicate and work effectively with all employees\nAble to work in a fast-paced environment and must also adapt to frequent changes that occur on the production line.\nAbl', 1132, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://helpwanted.indeed.com/jobs/viewjob/b8207f076a592007?jk=4f7bb153ad77c236&vjs=3', '2018-07-24 19:33:26', '2018-07-24 19:33:26'),
