roblems from occurring. Responsible for following and enf', 263, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=c50a4ec0192711c5&from=serp&vjs=3', '2018-07-24 19:33:27', '2018-07-24 19:33:27'),
(9281, 1136, 1460, 'Jobs in USA', 'Growing our Future\nCOMTREA staff are on a mission. One that pledges to provide quality, comprehensive healthcare that is affordable and accessible for our clients. Our employees have a passion for what we do and COMTREA is committed to attracting the best talent. We possess a wide scope of skills and experiences and are recognized for a job well done.\nIf you are compassionate, energetic, resilient, talented and ready to be a part of a growing, innovative and rewarding work environment, you may be just who we’re looking for. We invite you to explore career possibilities with COMTREA. We want you to be our next best hire!\nOur Culture\nCOMTREA values diversity and embraces inclusivity. We hire staff from a variety of backgrounds and celebrate our similarities and our differences. We champion trust and work from a strength based commitment to serve. Our culture is one of caring – for the individuals we serve, for our staff, and for our community. It is one of positivity and trauma informed approaches.\nBenefits\nAt COMTREA, you are able to learn and grow in your career so that you can shine as an individual. We offer a unique opportunity to work with an amazing group of peers as well as great benefits, which may include medical, dental, vision insurance and life insurance. We offer long term and voluntary short term disability as well as a 403B Retirement plan. Another great benefit is flexibility in scheduling and a relaxed dress code. COMTREA provides our staff throughout the year with training opportunities as well as fun and rewarding activities. Employee events, such as Night at the Ball Park, employee barbecues, pet contests and dress up/down days are part of COMTREA’s culture. Great opportunities await you—apply today!\nJOB DETAILS:\nPOSITION SUMMARY\nMaintain direct contact with patients on a daily basis and perform in-person and telephone reception for Center. Serve as Cashier. This position is expected to possess excellent and empathetic service skills, maintain com', 1134, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=3fa687502ca2d12d&from=serp&vjs=3', '2018-07-24 19:33:27', '2018-07-24 19:33:27'),
(9282, 1137, 1461, 'Jobs in USA', 'Production Helper - SLO\nreq6613\nEmployment Type: Regular\nLocation: SAN LUIS OBISPO,CA\nHave you ever enjoyed Arnold®, Brownberry® or Oroweat® bread? A Thomas’® English muffin or bagel? Or perhaps snacked on a Sara Lee®, Entenmann’s® or Marinela® cake or donut? If the answer is yes, then you know Bimbo Bakeries USA!\nBimbo Bakeries USA is part of Grupo Bimbo, the world’s largest baking company with operations in 32 countries. Bimbo Bakeries USA (“BBUSA”) includes BBUSA and its subsidiaries and affiliated entities, including, but not limited to, Wholesome Harvest Baking, East Balt, and Acelerada. BBUSA employs 20,000 associates across the U.S. in bakeries, sales centers, corporate offices and on sales routes to ensure our consumers have the freshest products to feed their families at every meal. But our associates come to work for much more – the chance to feed their own lives through exciting work that offers the opportunity to make a real difference in their professional and personal lives every day.\n Description:\nOur San Luis Obispo location is currently looking for an Entry Level Production Helper. Entry level Production Helpers will be provided training in all job tasks, production and packaging. The Plant operates 24 hours a day, 7 days a week. Areas of work will include various aspects of the production operation as necessary. Assignment of job tasks will be based on experience and knowledge. No prior experience is necessary, will train. Must have open availability to work morning or afternoon shifts.\nPosition Requirements:\nPosition Requirements\nWillingness to work varied shifts, including nights, weekends, holidays and overtime as needed.\nMust have physical ability and strength to perform assigned tasks. Must be able to lift 50 lbs.\nMust be able to communicate and work in a team environment.\nMust be able to work in a fast paced environment.\nMust have ability to read and write, speak, and communicate in order to understand and follow work and safety instructions.', 1135, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=49402605135bee88&from=serp&vjs=3', '2018-07-24 19:33:27', '2018-07-24 19:33:27'),
(9283, 1138, 1461, 'Jobs in USA', 'Production General Utility- FTW\nreq6751\nEmployment Type: Regular\nLocation: FORT WORTH,TX\nHave you ever enjoyed Arnold®, Brownberry® or Oroweat® bread? A Thomas’® English muffin or bagel? Or perhaps snacked on a Sara Lee®, Entenmann’s® or Marinela® cake or donut? If the answer is yes, then you know Bimbo Bakeries USA!\nBimbo Bakeries USA is part of Grupo Bimbo, the world’s largest baking company with operations in 22 countries. Bimbo Bakeries USA employs 21,000 associates across the U.S. in bakeries, sales centers, corporate offices and on sales routes to ensure our consumers have the freshest products to feed their families at every meal. But our associates come to work for much more – the chance to feed their own lives through exciting work that offers the opportunity to make a real difference in their professional and personal lives every day.\n Description:\nBASIC PURPOSE/SCOPE\nHandle responsibilities as assigned by supervisor or floor leader, including but not limited to handling pans, assuring that product is correctly running on conveyor, packing product on baskets or trays, keeping area clean, disposing of waste in designated areas, substituting for co-workers during their scheduled breaks, and maintain high Good Manufacturing Practice standards.PRINCIPAL ACCOUNTABILITIES\nComplete duties assigned by floor leader and/or supervisor.\nFill in for co-workers during their scheduled lunch and breaks.\nMaintain area clean at all times.\nMaintain high Good Manufacturing Practices. All Good Manufacturing Practices and safety procedures must be followed at all times.\nWorking environment will include extreme heat and dust.\nPosition Requirements:\nMust have a high school diploma or GED.\nMust be able to read, write, and speak English.\nMust be able to work any hours and holidays.\nMust be able to work varied shifts.\nMust be able to push, pull, lift, carry, squat, twist, kneel, and reach.\nFollow Personal Protective Equipment (P