(9284, 1139, 1465, 'Jobs in USA', 'Family living in Cow Hollow of San Francisco with one and a half year old daughter is seeking a professional, experienced and educated Full-Time Nanny. Schedule will be spilt between two full-time live in nannies to ensure the family has seven day per week coverage. Nanny will live in during days they are working and live out on days they are off work. Nannies should be comfortable working many days consecutively (e.g., if traveling for one to two weeks at a time, only one nanny will travel with family and the other nanny is off work). The position requires flexibility as family’s schedule changes at various times in the year (e.g., summer, travel, etc.). Approximately 15 to 20 weeks of domestic and international travel per year is required (approximately 1-2 trips of international travel per year). Family has various residences across the country. Applicants need to be honest, trustworthy, understand the importance of maintaining discretion (confidentiality agreement is required), collaborative and experienced working with other domestic staff (full-time housekeeper, full-time nanny, etc.) and experienced working with Principals that are at residence often (discreet and staying out of the way is important). Start date is ASAP.RESPONSIBILITIES: Newborn experience and knowledgeable about routines, sleep training, reading and communicating to baby as often as possible, etc.Experienced with play-based learning and creating educational activities (e.g., planned engaging activities at home, developmentally appropriate games and activities, engaging projects and crafts, themed weeks, scheduled outings, etc.)Knowledgeable about child development (e.g., firm when necessary and capable of teaching child manners and etiquette, but also capable of being laid back and fun)Support teaching and reinforcement of manners and other social skillsProvide developmentally appropriate games and activities, engaging projects and crafts at home and schedule/plan fun outings and eventsWilli', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Strollers-and-Stilettos/jobs/Full-Time-Nanny-Heavy-Travel-Cow-Hollow-07be3ee171eb36ee?vjs=3', '2018-07-24 19:43:29', '2018-07-24 19:43:29'),
