(9288, 1142, 1196, 'Jobs in KSA', 'VIP Family in Riyadh, Saudi Arabia Require a 6/12 Nanny | June Start | Top Salary Offered\nJob ref: Riyadh/2L\nVIP Family based in Riyadh require a nanny to work 6 days per week, 12 hours per day, with flexibility when travelling with the family.\n\nThe duties of this role would consist of all the usual nursery duties such as changing, feeding and maintaining daughters routines as well as overseeing all her daily activities, plan fun and educational activities and outings in various locations worldwide, oversee child’s menus and nutrition, focus on education and stimulating the child’s development etc.\n\nThis is a fully-staffed household so no cooking, laundry or cleaning would be expected. The nanny would be expected to travel with the family; destinations include the UK, the US and France.\n\nThe ideal nanny would need to be qualified in childcare, speak a second language is a plus (French preferably) and have experience with working in a similar environment.\n\nPersonality wise, the family would like a nanny who is a team player and can work well with other staff, flexible, active, organized, honest and discreet, as well as someone who is warm and loving.\n\nThe nanny would be provided with her own en-suite bedroom and bathroom, when travelling the nanny would need to be flexible with the accommodation arrangement.\n\nStart date is June 2018. Salary is negotiable, but depending on education and qualification, languages spoken and individual level of experience.\nRequirements\nLocation\nRiyadh\nStart date\n03/06/2018\nDuration\nPermanent\nSalary\nnegotiable\nHours\n12/6\nLanguages\nEnglish, French\nPermanence\nPermanent\nChildren\nFemale/17 months old,\nExperience\nEssential\nDriving licence\nNot Essential\nNon smoker\nEssential\nShared care\nYes\nSole charge\nYes\nAccommodation Details\nBasis\nLive-in\nAccommodation\nThe nanny would be provided with her own en-suite bedroom and bathroom, when travelling the nanny would need to be flexible with the accommodation arrangement.\nFamily residence\nHouse\nOther Deta', 962, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=d2655938871fa15e&from=serp&vjs=3', '2018-07-24 19:43:29', '2018-07-24 19:43:29'),
