(9292, 1146, 1185, 'Jobs in Qatar', 'Job Summary:\n\nA high profile Family based in Qatar is looking for an experienced and knowledgeable fashion orientated individual to manage the wardrobe and luxury fashion for a HNW female.\n\nDuties:\n\nYou will take care of all of the client’s luxury clothes and shoes, and will be responsible for storage and inventory of fine clothing, jewellery and personal accessories. You will also need to keep good order for the dressing table, stock and supply of cosmetics and toiletries. You will be a tech savvy individual to ensure her extensive clothing collection across multiple properties in logged within the inventory for both organisational and insurance purposes. You will be responsible to packing and unpacking the principal’s possessions when the client travels.\n\nIt would be beneficial but NOT essential if you have butler experience\nIf the individual is confident with butler duties you will assist in front of House service, meeting and greeting guests. You will also be serving food and drinks, ensuring proper service at all times, providing table service (both formal and informal), and undertaking butler duties and personal food service to the client.\n\nTravel\n\nYou will travel with the lady of the house when requested; this will most likely during the summer and Christmas holidays when the children are off school.\n\nCandidate requirements:\nThe successful candidate should be able to demonstrate a strong knowledge of fashion particularly with the handling, storage and care of luxury fabrics. Experience in a well-established hotel or high-profile household is preferred. You must have discretion and the ability to give excellent service, but not intrude on the principal’s private space or boundaries. The client will consider those with a fashion background who want to move into private households. You must be tech savvy, with a good knowledge of using iPhones, iPads, and MacBooks. DBS check will be required\n\nAccommodation:\n\nOne bedroom with ensuite at the villa.', 951, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Na', '2018-07-24 19:43:32', '2018-07-24 19:43:32'),
