(9320, 4, 1499, 'family', 'Hello..I am a looking for Live in nanny/maid to immediately start with my family. We are an Indian family of 5- one 4 year old girl & 1 year old twins ( boy & girl) looking for a housemaid/ nanny to join our family. Please find below the criteria:\r\n\r\n-experienced Filipino nationality\r\n- 20-40 years old\r\n- Experience with young children or todller should know how to feed, change diapers, sterilize bottles, bathe and do playtime. Follow the feeding schedule.\r\n- should have a happy pleasant personality; cleanliness is very important, honest and trustworthy\r\n- When the baby is sleeping, do the house work such as basic cooking,mopping, laundry, ironing, cleaning bathrooms etc\r\nSalary & Benefits include the following:\r\n- Salary starting is 1,500 AED and above depending on experience \r\n- 8 pm to 5 am rest time\r\n- If chores is finished early you could rest early\r\n- one ticket back home\r\n- yearly bonus (based on performance)\r\n-yearly increment (based on performance)\r\n\r\nChildren is the #1 priority so those interested should message me or what’s app me at 0552007457 for more details.\r\n\r\nWe will be providing help for you to handle the household.\r\n\r\nPlease Attach CV and/or work experience and message or what’s app me on 0552007457.\r\nLocation: Al Reem Island , Abu Dhabi Near Abu Dhabi Mall', 224, 'Experience with young children or todller should know how to feed, change diapers, sterilize bottles, bathe and do playtime. Follow the feeding schedule. - should have a happy pleasant personality; cleanliness is very important, honest and trustworthy - W', NULL, NULL, NULL, '1500.000', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2018-07-25', 1, NULL, '2018-07-25 21:39:38', '2018-07-25 21:39:38'),
