(9325, 1151, 1503, 'Jobs in USA', 'WE MAKE PEOPLE SMILE\nDo you have a strong recruitment background in a retail atmosphere?\nMagic Memories is a company that delights and amazes guests on the simple but universal concept of making people smile, and has driven that concept into its product, service, and innovation philosophy.\nPicture yourself working at LEGOland California in an exciting and dynamic atmosphere!\nIf you’re outgoing, friendly and motivated to be a part of a high energy team, we’re looking for you as an Operations/Recruiting Supervisor!! The Operations/Recruiting Supervisor is responsible for assisting the Site Manager by providing direct administrative support of store operations and recruiting efforts as well as supervising the sales team as needed.\nWe offer a fun job with flexible hours and great opportunity to expand your leadership experience with a company that encourages growth and advancement!\nAs an Operations Supervisor, you will:\nAssist in attracting, recruiting, and onboarding of new team members.\nAssist in sales and performance reporting.\nPerform store opening and closing as per company procedures and guidelines.\nAssist in the management of store supplies and expense control.\nRequirements:\nHigh school diploma or general education degree (GED).\nHave a minimum of two (2) years of administrative experience, preferably in a retail operations environment.\nProficient in windows-based software such as excel, word and G-Suite. POS system proficiency a plus.\nAbility to demonstrate excellent written and verbal communication skills with customers, management and cross-functional team members.\nProfessional communication skills and appearance.\nAbility to support operations 7-days a week, including weekends, evenings and holidays – it’s tourism after all!\nAbout Magic Memories :\nSince its inception in 1995, the company has grown to more than 2,200 employees in 185 attractions in 10 countries across the United States, Canada, United Kingdom, Europe, China, United Arab Emirates, Australia and N', 1146, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=50d76855bcc72207&from=serp&vjs=3', '2018-07-26 01:53:29', '2018-07-26 01:53:29'),
