(9327, 1153, 1504, 'Jobs in USA', 'NOW HIRING FOR CREW MEMBERS!Interviews held Tuesday to Friday from 2 to 4 pm at: Jollibee Maryland Parkway3890 S. Maryland Parkway Ste 137Las Vegas NV 89119Look for Mr. Robert Denolo (Area Mgr). **********************************************************************************************************************************Why Join Us?We are a stable and fast-growing food service company operating in North America (US & Canada), and we offer our employees the following:Great work culture, a compelling mission- vision- values, and a work environment of family spirit & funExcellent training & career growth opportunitiesMeal privilege & product discount, 401k plan, potential for annual pay increase, company events. (Medical & dental insurance, paid vacation & sick leaves, and life insurance offered to eligible full-time Crew Members)Jollibee Foods Corporation (JFC), together with its subsidiaries, develops, operates, and franchises quick service restaurants in the Philippines and internationally. It offers a range of dishes and food products. The company operates quick service restaurants under the Jollibee, Chowking, Greenwich, Red Ribbon, Mang Inasal, Burger King, Yonghe King, Hong Zhuang Yuan, Superfoods, Smashburger, Dunkin’ Donuts, and 12 Hotpot names. As of March 17, 2017, the company operated approximately 3,000 stores in the Philippines, the United States, Canada, China, Brunei, Vietnam, Hong Kong, Singapore, Kingdom of Saudi Arabia, the United Arab Emirates, Qatar, Oman, Kuwait, and Bahrain. To date, Jollibee has acquired an 80-percent stake in Smashburger, an American fast-casual burger chain.The brands of Jollibee, Red Ribbon Bakeshop, and Chowking are all company-owned business units operating in JFC - North America.JOLLIBEE:  The Philippines\' number one fast food and one of Asia\'s largest restaurant chains. It is an American-style fast food restaurant with Filipino-influenced dishes specializing in burgers, spaghetti, chicken and some local Filipino dishes', 1147, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Honeybee-Foods-Corporation-dba-JOLLIBEE/jobs/Restaurant-Crew-Member-509d3fa06b209aa8?vjs=3', '2018-07-26 01:53:29', '2018-07-26 01:53:29'),
(9328, 1154, 1503, 'Jobs in USA', 'JOIN OUR FAST-GROWTH COMPANY TODAY!\nILLUME is a leading designer, manufacturer and marketer of high-quality branded and private-label home fragrance and personal care products. While currently located in Bloomington, Minnesota, we are building a state-of-the-art Corporate Office, Distribution and Manufacturing facility in Maple Grove, Minnesota. We are a fast-growing company experiencing year-over-year growth and we\'re adding to our high-talent workforce to keep pace with our current growth and proactively scouting talent in anticipation of future needs.\nOur trend-forward products can be found through the Company\'s online retail store and in over 7,000 retailers nationwide, including key retail partners Anthropologie, West Elm, Nordstrom, and Target. ILLUME candles and personal care products are consistently featured as \"must have\" items in O Magazine, InStyle, and other influential publications. Internationally, ILLUME can be found in 44 countries, including England, Japan and the United Arab Emirates.\nPOSITION SUMMARY\nThe Packer will perform various duties throughout the warehouse such as packing orders, loading carrier trucks, assisting with product cycle counting product, and other duties as assigned.\nFIVE KEY ACCOUNTABILITIES\nPack Orders\nLabeling\nShipping\nCommunication\nSafety\nDUTIES AND RESPONSIBILITIES\nEnsure that proper packing materials are used for each product being packed.\nResponsible for the completeness and correctness of all orders filled.\nApply shipping labels to shipper cartons per established guidelines.\nPrepare bill of ladings, packing slips, receiving reports, parts/ materials list for shipment, and routing following company procedures or customer instruction.\nAccept work direction from and supervisors and managers.\nReport all accidents, incidents, and near misses to supervisor.\nEnsure that all work procedures are followed and observed.\nSKILL AND QUALIFICATION REQUIREMENTS\nHigh school diploma or GED required, one-year related experience or trainin', 1148, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=d4166c7b064a3ec5&from=serp&vjs=3', '2018-07-26 01:53:29', '2018-07-26 01:53:29');
