(9329, 1155, 1504, 'Jobs in USA', 'Linguists wanted!\n\nLinguist support services are required to transcribe, translate, and interpret information gathered from a variety of sources in order meet ongoing, new and/or changing mission or operational requirements.\n\nLinguists will support U.S. CENTCOM, whose mission is to promote cooperation among nations, respond to crises, deter or defeat state and non-state aggression, support development and, when necessary, reconstruction in order to establish the conditions for regional security, stability, and prosperity. CENTCOM’s AOR covers 20 countries -- Afghanistan, Bahrain, Egypt, Iran, Iraq, Jordan, Kazakhstan, Kuwait, Kyrgyzstan, Lebanon, Oman, Pakistan, Qatar, Saudi Arabia, Syria, Tajikistan, Turkmenistan, United Arab Emirates, Uzbekistan, and Yemen.\n\nSupport personnel may be required to live and work in harsh and hostile environments (to include combat operations), and may be required to remain in the area of military operations for the duration of that mission.\n\nLinguists employed on this task order shall be physically and mentally prepared to endure extended periods outdoors in all weather conditions while accompanying U.S. Forces on various\n\nmissions in full protective gear (body armor and helmet). Travel may include transport via small aircraft, rotary craft, ground vehicles (MRAP, HUMVEE, commercial vehicle, etc.), or water craft in a wide variety of environments including high winds, rough terrain, and high altitude.\nQualifications:\nCAT I, CAT II, and CAT III level linguists desired.\nRequired Languages:\nArabic-Iraqi (DG)\n\nKurdish (KU)\n\nArabic-Modern Standard (AD)\n\nArabic-Eastern (Levatine Dialect) (QE)\n\nOthers, including Malayalam (MN), Pashtu (PU), Urdu (UR), Hindi (HJ), Kurdish-Kurmanji (XK), Persian Farsi (PF)\n\nLinguists with capabilities in multiple languages highly desired - examples:\n\nArabic Iraqi / Kurdish (DG/KU)\n\nArabic - Eastern (Levantine Dialect) / Kurdish-Kurmanji (QE/XK)\nPlace of performance:\nWhile the primary places of performance are ', 1149, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=de7f5cf123d082ea&from=serp&vjs=3', '2018-07-26 01:53:29', '2018-07-26 01:53:29'),
(9330, 1156, 1505, 'Jobs in USA', 'WE MAKE PEOPLE SMILE!\nHourly plus Commission! Earn up to $20 per hour!!\nAt Magic Memories, we’re a company that delights and amazes guests on the simple but universal concept of making people smile, and has driven that concept into its product, service, and innovation philosophy.\nPicture yourself working at our iconic location in Williams, AZ at the Grand Canyon Train!!!\nWe are seeking exceptional photography hosts and sales people with a drive to achieve targets, who are motivated, outgoing, friendly and possess outstanding customer service skills to join the Magic Memories team. No photography experience is necessary! We’ll train you to become a skilled, successful photographer!\nWe offer a fun job with flexible hours and a great opportunity to gain experience with a company that encourages growth and advancement!\nAre you interested in:\nLearning photography and taking pictures.\nApplying your creativity, customer service and sales skills.\nMeeting and interacting with people from around the world.\nWorking with fun team members.\nMaking money!\nDuties and Requirements for the Best Job you have ever had:\nLearning and adapting to photography styles, with a motivation to excel in sales performance.\nDemonstrating ability to meet sales targets in a busy environment.\nExercising initiative and problem solving skills.\nProfessional communication skills and appearance.\nWorking a variety of shifts, including weekends, evenings and holidays – it’s tourism after all!\nA fearless approach to capturing memories and creating exceptional experiences for our guests.\nAbility to work while standing or walking (with reasonable accommodation) and in an outdoor environment that could include inclement or sunny weather.\nPrevious guest experience preferred, but not required\nExperience in digital photography is a plus, but not required.\nAbout Magic Memories :\nSince its inception in 1995, the company has grown to more than 2,200 employees in 185 attractions in 10 countries across the United States', 1150, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=196217bf6d128603&from=serp&vjs=3', '2018-07-26 01:53:29', '2018-07-26 01:53:29'),
(9331, 1157, 1506, 'Jobs in USA', 'WE MAKE PEOPLE SMILEDo you have a strong recruitment background in a retail atmosphere?Magic Memories is a company that delights and amazes guests on the simple but universal concept of making people smile, and has driven that concept into its product, service, and innovation philosophy.Picture yourself working at LEGOland Californiain an exciting and dynamic atmosphere!If you’re outgoing, friendly and motivated to be a part of a high energy team, we’re looking for you as an Recruiting Manager!! The Recruiting Manager is responsible for assisting the Site Manager by providing direct administrative support of store operations and recruiting efforts as well as supervising the sales team as needed.We offer a fun job with flexible hours and great opportunity to expand your leadership experience with a company that encourages growth and advancement!As an Recruiting Manager, you will: Assist in attracting, recruiting, and onboarding of new team members.Assist in sales and performance reporting.Perform store opening and closing as per company procedures and guidelines.Assist in the management of store supplies and expense control.Requirements: High school diploma or general education degree (GED).Have a minimum of two (2) years of administrative experience, preferably in a retail operations environment.Proficient in windows-based software such as excel, word and G-Suite. POS system proficiency a plus.Ability to demonstrate excellent written and verbal communication skills with customers, management and cross-functional team members.Professional communication skills and appearance.Ability to support operations 7-days a week, including weekends, evenings and holidays – it’s tourism after all!About Magic Memories : Since its inception in 1995, the company has grown to more than 2,200 employees in 185 attractions in 10 countries across the United States, Canada, United Kingdom, Europe, China, United Arab Emirates, Australia and New Zealand.EQUAL EMPLOYMENT OPPORTUNITY– Magic M', 1151, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Magic-Memories/jobs/Recruiting-Manager-Legoland-9408aa1b234b8b87?vjs=3', '2018-07-26 01:53:29', '2018-07-26 01:53:29'),
(9332, 1158, 1507, 'Jobs in USA', 'Retail Sales – Photographer – LEGOLAND California\nWE MAKE PEOPLE SMILE\nDo you have a Positive, Can-Do Attitude and an Outstanding set of Customer Service Skills?\nAt Magic Memories, we’re a company that delights and amazes guests on the simple but universal concept of making people smile, and has driven that concept into its product, service, and innovation philosophy.\nPicture yourself working at our iconic location in Carlsbad, CA – the LEGOLAND California as a Retail Sales Photographer!\nRetail Sales Photographer Duties and Requirements for the Best Job you have ever had:\nAs a retail Sales Photographer, you will:\nYou will be learning and adapting to photography styles, with a motivation to excel in sales performance.\nYou will be demonstrating ability to meet sales targets in a busy environment.\nYou will display a professional communication skills and appearance.\nYou will be working a variety of shifts, including weekends, evenings and holidays – it’s tourism after all!\nYou will need a fearless approach to capturing memories and creating exceptional experiences for our guests.\nYou will need the ability to work while standing or walking (with reasonable accommodation).\nYou should have computer proficiency and cash register experience preferred.\nAt Magic Memories, as a Retail Sales Photographer, you can earn a great income, develop amazing new skills and friends, and best of all bring smiles to everyone you meet.\nAbout Magic Memories:\nSince its inception in 1995, the company has grown to more than 2,200 employees in 185 attractions in 10 countries across the United States, Canada, United Kingdom, Europe, China, United Arab Emirates, Australia and New Zealand.\nEQUAL EMPLOYMENT OPPORTUNITY – Magic Memories is dedicated to providing equal opportunities to all individuals regardless of race, color, religion, ethnic or national origin, gender, age, disability, sexual orientation, gender identity, gender expression, veteran’s status, or any other factor that is a prohibited ', 1146, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=8191f8ba9a8e1327&from=serp&vjs=3', '2018-07-26 01:53:29', '2018-07-26 01:53:29'),
(9333, 1159, 1508, 'Jobs in Oman', 'Overview\nMultilingual: native speaker in local country language. Excellent command / business-level proficiency in spoken and written English is required\nCoverage: GCC-Oman, Bahrain, Kuwait, Qatar and United Arab Emirates\nHemophilia Nurse Educator (International)\nServing as a country specific independent contractor and field-based extension of our Client\'s Global Medical Affairs, the Clinical Nurse Educator (CNE) will represent the Company and launch of its personalized care Hemophilia A medical device. The CNE will educate and support caregivers, patients and healthcare practitioners on how to utilize the medical device, and associated free web-based and mobile application in the worldwide market in support of the Company Hemophilia A strategy. The educational sessions, clinical in-services and product training provided by the CNE will support the effective utilization of the device. The CNE will collaborate with the Company local medical teams to identify and prioritize activities in these countries to educate and advance the outcomes of patients.\nAccountabilities\nProvide clinical in-services and scientific education to patients (upon HCP request), and related Health Care Practitioners (HCPs).\nRespond to requests from HCPs and patients related to the medical device, patient application and PK guided prophylaxis.\nDevelop and maintain authentic relationships based on value of experience, expertise and delivery of service to community based Hemophilia A experts, patients and related HCPs.\nDemonstrate clinical, scientific and technical expertise in PK guided prophylaxis in Hemophilia A\nAlign with local medical teams to effectively implement corporate, scientific and clinical strategies within the specific Hemophilia A community\nRespond to requests from local medical teams to interact with community-based HCPs to provide described educational sessions\nDiscover and communicate relevant customer information and insights on the medical device to support medical strategies', 1152, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=a17fa707c2ccdd5b&from=serp&vjs=3', '2018-07-26 01:53:29', '2018-07-26 01:53:29'),
