(9343, 1169, 322, 'Jobs in KSA', 'Manager - Project Management - Yanbu, Saudi Arabia\nParsons\' engineering and construction management staff members create innovative, safe, and sustainable infrastructure in the Kingdom of Saudi Arabia, the United Arab Emirates, Qatar, Oman,Bahrain, and Kuwait. We deliver rail, transit, road, and highway transportation; water conveyance and wastewater treatment; oil and gas; land development; public; and aviation infrastructure to our customers and communities. Parsons creates interconnected communities and world-class infrastructure.Job Purpose:\nThis position, as described, is intended to be filled by a senior manager of SAPL. It is closely aligned with the duties of the Department Director and is established by the CEO to align and unify the activities of the MSA contractor with the department objectives and the Annual Work Plan. This position retains performance responsibility of SAPL personnel working in support of the department activities, ensuring that work of MSA support staff conforms with department needs. Supports, as Deputy of Department, the development of the schedule, scope of work and cost estimation for construction, engineering and consultative projects. Also performs contractor evaluation and proposal analyses.Main Responsibilities:\nStrategy Formulation:Support Director in establishing and then implement department policies, goals, objectives, and procedures as approved by the Director of Project Management.Ensure new operations plans, policies, procedures, and transition/migration plans for the department are consistent with the overall goals and objectives of RC, respective business unit and division.Develop departmental business plans that are in line with Division/Business Unit/RC objectives as directed by the Director.Budgeting and Control:\nMonitor costs and resources in day to day activities.Assist the Director in establishing and implementing the business plan, priorities and working objectives of the department and section in alignment with', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=62ed856c82564a7b&from=serp&vjs=3', '2018-07-26 01:53:29', '2018-07-26 01:53:29'),
