(9345, 1171, 322, 'Jobs in KSA', 'هدف و الغرض من الوظيفة:\nالقيام بإستقبال الزوار والترحيب بهم وخدمتهم .\nالمهام و المسئوليات:إستقبال الزوار والترحيب بهم بما يليق بالمظهر العام للمؤسسة.تنظيم المكالمات الصادرة والواردة من وإلى المؤسسة.\nاالدورات التدريبية:\nلا يشترط\nاللـغــات:اللغة العربية\nبطلاقة تحدثاً و كتابةاللغة الإنجليزية\nجيد على الأقل تحدثاً و كتابة\nSkills\nخبرة ممتازة في التعامل مع أجهزة الكمبيوتر وبرامج الاوفيسالخبرة في التعامل مع شبكات التواصل الاجتماعيالسمات الشخصية:\nيجب أن يتحلى بالسمات التالية:\n1- الإنضباط فى المواعيد\n2- التركيز و المنطقية فى التفكير\n3- معدل ذكاء طبيعى\n4- هادىء الطباع و غير إنفعالى\n5- يفضل ألا يكون مريضاً بالسكر أو الضغط أو القلب أو القولون العصبى\n6- اللباقة فى الحديث و بشاشة الوجه\n7- حسن الإستماع و الفهم و إدراك المواقف بوعى و تركيز\n8- حسن المظهر.\n9-القدرة على مواجهة المواقف الحرجة بحكمة\nيفضل أن يكون المتقدم من الجنسية السعودية أو اليمنية.قابل لنقل الكفالةبيئة العمل مريحة وغير روتينيةيوجد مكافآت شهرية ودورات تطويريةيشترط توفر سيارة\nموظف عاممجموعة روديان\nJob Description\nهدف و الغرض من الوظيفة:\nالقيام بإستقبال الزوار والترحيب بهم وخدمتهم .\nالمهام و المسئوليات:إستقبال الزوار والترحيب بهم بما يليق بالمظهر العام للمؤسسة.تنظيم المكالمات الصادرة والواردة من وإلى المؤسسة.\nاالدورات التدريبية:\nلا يشترط\nاللـغــات:اللغة العربية\nبطلاقة تحدثاً و كتابةاللغة الإنجليزية\nجيد على الأقل تحدثاً و كتابة\nSkills\nخبرة ممتازة في التعامل مع أجهزة الكمبيوتر وبرامج الاوفيسالخبرة في التعامل مع شبكات التواصل الاجتماعيالسمات الشخصية:\nيجب أن يتحلى بالسمات التالية:\n1- الإنضباط فى المواعيد\n2- التركيز و المنطقية فى التفكير\n3- معدل ذكاء طبيعى\n4- هادىء الطباع و غير إنفعالى\n5- يفضل ألا يكون مريضاً بالسكر أو الضغط أو القلب أو القولون العصبى\n6- اللباقة فى الحديث و بشاشة الوجه\n7- حسن الإستماع و الفهم و إدراك المواقف بوعى و تركيز\n8- حسن المظهر.\n9-القدرة على مواجهة المواقف الحرجة بحكمة\nيفضل أن يكون المتقدم من الجنسية السعودية أو اليمنية.قابل لنقل الكفالةبيئة العمل مريحة وغير روتينيةيوجد مكافآت شهرية ودورات تطويريةيشترط توفر سيارةJob Details\nJob Location:\nRiyadh, Saudi Arabia\nCompany Industry:\nArts/Entertainment/and Med', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=5f279570c10904da&from=serp&vjs=3', '2018-07-26 01:53:29', '2018-07-26 01:53:29'),
(9346, 1172, 1512, 'Jobs in UAE', 'Posting Date Jul 17, 2018Job Number 18001ZZ3Job Category Rooms and Guest Services OperationsLocation Four Points by Sheraton Sharjah, Sharjah, United Arab Emirates VIEW ON MAPBrand Sheraton Hotels & ResortsSchedule Full-timeRelocation? NoPosition Type Non-Management/HourlyStart Your Journey With Us\nWhere timeless classics are woven with modern details. Where business meets pleasure. Where even when you’re global, you can experience the local. Designed for the independent traveler seeking balance, there’s Four Points.Job Summary\n Process all guest check-ins by confirming reservations, assigning room, and issuing and activating room key. Process all payment types such as room charges, cash, checks, debit, or credit. Process all check-outs including resolving any late and disputed charges. Answer, record, and process all guest calls, messages, requests, questions, or concerns. Coordinate with Housekeeping to track readiness of rooms for check-in. Communicate parking procedures to guests/visitors and dispatch bell staff or valet staff as needed. Supply guests with directions and information regarding property and local areas of interest. Run daily reports (number of arrivals, departures), identify any special requests, and check reports for accuracy. Complete designated cashier and closing reports in the computer system. Cash guests\' personal checks and traveler\'s checks. Count bank at the beginning and end of shift. Balance and drop receipts according to Accounting specifications.\n Follow all company safety and security policies and procedures; report accidents, injuries, and unsafe work conditions to manager. Follow all company policies and procedures; ensure uniform and personal appearance are clean and professional; maintain confidentiality of proprietary information; protect company assets. Welcome and acknowledge all guests according to company standards; anticipate and address guests\' service needs; assist individuals with disabilities; thank guests with genuine ', 1156, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=c83dfc00db26f094&from=serp&vjs=3', '2018-07-26 01:53:32', '2018-07-26 01:53:32'),
(9347, 1173, 1513, 'Jobs in UAE', 'Department Description:\nBUB was set up as a separate vertical under CWM to manage all nonindividual relationships Various products and services have already been set up to this effect and a constant effort is placed to ensure that a complete suite of products is offered in order for the customer to use Emirates NBD as aone stop bank for all the banking requirements\nBrief Description:\nThe position holder supports the line manager in all aspects of client experience customer service and complaint management The position holder will implement projects and initiatives pertaining to client experience and customer service The position holder will liaise with Senior Managers Business Unit Heads\nKey responsibilities will include\nSupport the line manager to develop long term service strategy for the segment and ensure the Customer Experience strategy for the unit is aligned with the Organization strategy\nImplementation of new strategic initiatives identified on an ongoing basis based on the overall service excellence strategy of the organization Lead the problem solving hypothesis development and recommendations that would enhance overall Service framework\nAssist the Customer Journeys creation and maintenance in coordination with support units to developwow experience across various touchpoints\nSupport the segment in achieving the set Service Standards and ensure the standards are reviewed on an ongoing basis\nLiaise with other Customer Experience Managers and support teams in other segments for best practice sharing and resolving issues across segments\nDetailed Description:\nEnhance the overall BUB client experience\nImplementation of key process improvements enhancing customer service\nImplement changes in the BUB client journey at everytouch pointie personal digital and documental interaction\nLiaise with Group Marketing Team Market Leaders to develop plan and execute client events promotions and gift campaigns\nConduct and analyze customer satisfaction surveys\nGather clientmar', 1157, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=7acf1d1eb2200efd&from=serp&vjs=3', '2018-07-26 01:53:32', '2018-07-26 01:53:32'),
(9348, 1174, 1514, 'Jobs in UAE', 'United Arab Emirates\nANNOUNCEMENT NUMBER: DXB-18-024\nANNOUNCEMENT NUMBER: DXB-18-024\nOPEN TO: U.S. Citizen Eligible Family Members (USEFMs) - All agenciesThe “Open To” category listed above refers to candidates who are eligible to apply for this position. The “Open To” category should not be confused with a “hiring preference” which is explained later in this vacancy announcement.\nPOSITION: Administrative ClerkOPENING DATE: July 16, 2018\nCLOSING DATE: July 30, 2018\nWORK HOURS: 80hours/per pay period\nSALARY: FP Scale: FP-09 - $34,390Final Grade/Step will be determined by Washington, D.C.ALL APPLICANTS MUST HAVE THE REQUIRED WORK AND/OR RESIDENCY PERMITS TO BE ELIGIBLE FOR CONSIDERATION. FOR NON-UAE NATIONAL, THE MISSION ASSISTS IN OBTAINING REQUIRED RESIDENCY/WORK PERMIT TO LAWFULLY WORK IN THE UAE.\nServes as Office Administrator to the Political/Economic (Pol/Econ) office by acting as the first point of contact (POC) for the office and managing a wide array of administrative duties and special projects to ensure a smooth and efficient flow of work. The Pol/Econ office has six officers and two LES. The office supports political and economic reporting in Dubai and the northern emirates for Consulate General Dubai.QUALIFICATIONS REQUIRED\nApplicants must address each required qualification listed below with specific and comprehensive information supporting each item. Failure to do so may result in a determination that the applicant is not qualified.\nEducation High School Diploma is required.\nWork Experience At least 1 year prior experience as Administrative or Executive Assistant, preferably in a USG Foreign Affairs Agency.\nLanguage Level 4 (fluent) reading/writing/speaking English is required.\nKnowledge General knowledge of a professional working environment. Good knowledge of the how an Embassy or Consulate works.\nAbilities and Skills Strong interpersonal skills and discretion. Demonstrated skills in MS Office suite, Sharepoint and general computer skills including in', 1158, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=0a331dfb828bd355&from=serp&vjs=3', '2018-07-26 01:53:32', '2018-07-26 01:53:32'),
(9349, 1175, 1512, 'Jobs in UAE', 'Posting Date Jul 23, 2018Job Number 18001WRYJob Category Finance and AccountingLocation Four Points by Sheraton Bur Dubai, Dubai, United Arab Emirates VIEW ON MAPBrand Four PointsSchedule Full-timeRelocation? NoPosition Type Non-Management/HourlyStart Your Journey With Us\nWhere timeless classics are woven with modern details. Where business meets pleasure. Where even when you’re global, you can experience the local. Designed for the independent traveler seeking balance, there’s Four Points.Job Summary\nCheck figures, postings, and documents for correct entry, mathematical accuracy, and proper codes. Organize, secure, and maintain all files, records, cash and cash equivalents in accordance with policies and procedures. Record, store, access, and/or analyze computerized financial information. Maintain accurate electronic spreadsheets for financial and accounting data. Classify, code, and summarize numerical and financial data to compile and keep financial records, using journals, ledgers, and/or computers. Prepare, maintain, and distribute statistical, financial, accounting, auditing, or payroll reports and tables. Complete period-end closing procedures and reports as specified. Prepare, review, reconcile, and issue bills, invoices, and account statements according to company procedures.\n Follow all company policies and procedures; ensure uniform and personal appearance are clean and professional; maintain confidentiality of proprietary information; protect company assets; protect the privacy and security of guests and coworkers. Address guests\' service needs in a professional, positive, and timely manner. Speak with others using clear and professional language; prepare and review written documents accurately and completely; answer telephones and emails using appropriate etiquette. Move, lift, carry, push, pull, and place objects weighing less than or equal to 10 pounds without assistance. Develop and maintain positive working relationships with others; support team to', 1156, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=57ce23e6d20e88d6&from=serp&vjs=3', '2018-07-26 01:53:32', '2018-07-26 01:53:32'),
(9350, 1176, 1512, 'Jobs in UAE', 'Posting Date Jul 19, 2018Job Number 18001VZZJob Category Rooms and Guest Services OperationsLocation Sheraton Mall of the Emirates Hotel, Dubai, Dubai, United Arab Emirates VIEW ON MAPBrand Sheraton Hotels & ResortsSchedule Full-timeRelocation? NoPosition Type Non-Management/HourlyStart Your Journey With Us\nAt Sheraton, we go above and beyond in everything we do. We are inspired by our guests and one another – and are driven to make things better. We love what we do, and we give it all we’ve got – on property and off. When guests stay with us, it’s not just a room with a bed that they’re buying. It’s an experience. We’re looking for someone who is ready to go beyond in everything they do. If you are someone with a genuine drive to improve your life and the lives of those around you, we encourage you to explore careers with Sheraton.Job Summary\nAnswer, record, log, and process all guest calls, requests, questions, or concerns. Operate telephone switchboard station. Process guest requests for wake up calls, screening calls, do not disturb, call forwarding, conference calls, TDD relay calls, and non-registered guest calls. Advise guest of any messages received. Monitor busy or unanswered lines, check back with callers on hold to update status, and offer to take a message. Receive, record, and relay messages accurately, completely, and legibly. Activate/deactivate guest room message lights as appropriate. Instruct guests on how to access the internet; transfer guests with problems to provider\'s customer support line. Test communications equipment to ensure it works properly. Respond to special requests from guests with unique needs. Contact appropriate individual or department as necessary to resolve guest call, request, or problem. Follow up with guests to ensure their requests or problems have been met to their satisfaction. Dispatch bell staff or valet staff as needed.\n Follow all company policies and procedures; report accidents, injuries, and unsafe work conditions', 1156, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=8bfcef12e281f9c4&from=serp&vjs=3', '2018-07-26 01:53:32', '2018-07-26 01:53:32');
