(9359, 1184, 322, 'Jobs in Qatar', 'Job Description\n\nThe Service Advisor endeavors to provide the best possible quality\nof service, which ultimately will serve to bring in new customer,\nensures responsibility of the Service Reception are carried out\naccording to the official service guidelines of each franchise.\n\nResponsibilities\n\n&bull; The Service Advisor is fully responsible for any commercial\ntransaction for each and every vehicle under him. I.e. He is responsible for the down payment on pro-forma invoice or quotation, parking charges, storage of the vehicle, and cannibalization of the vehicle. Should the customer decide to\ndecline to sign, the Service Advisor has to return the vehicle to the customer assuming all diagnostic and evaluation are charged and amounts received by Alfardan Premier Motors. Should the vehicle remain in custody of Aftersales Department for a period of more than ten (10) days after completion of repair or repair have been carried out without the down payment, the full amount incurred will be debited to the Service Advisor.\n&bull; He greets and attends to the customer as they enter the service reception, he will seek then details of the vehicle concerned.\n&bull; He will note down the complaints and if necessary inspect the car on the vehicle hoist\n&bull; He will also perform if required a test drive to determine the nature of the problem in order to issue a clear diagnosis, having diagnosed the problem he discusses the potential cost with the customer and seeks his approval. He informs the customer to acknowledge the agreed completion time and will then pass the order on to the workshop supervisor.\n&bull; He performs a final end control in relation to the work ordered and reports other defects\n&bull; During delivery he discusses the invoice with the customer and at the same time agrees a new date for works not completed, if the completion date cannot be kept, he informs the customer in good time\n&bull; He informs the Workshop Manager about customer attitude where extra atten', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=7e47685e78222623&from=serp&vjs=3', '2018-07-26 01:53:32', '2018-07-26 01:53:32'),
