(9362, 1187, 1521, 'Jobs in USA', 'The United Nations Ethics Office was established by the Secretary-General as an independent Secretariat unit subsequent to the approval of the General Assembly at the 2005 World Summit (see Assembly resolution 60/1, para. 161 (d)). Having commenced operations on 3 January 2006, and in accordance with Secretary-General’s bulletins ST/SGB/2005/22 and ST/SGB/2007/11, the United Nations Ethics Office’s functions include:\n\n(a) Providing confidential advice and guidance to staff on ethical issues, including administering an ethics helpline;\n(b) Administering the Organization’s financial disclosure programme;\n(c) Administering the Organization’s protection against retaliation policy;\n(d) Developing standards, training and education on ethics issues, in coordination with the Office of Human Resources Management and other offices, and conducting ethics outreach;\n(e) Supporting ethics standard-setting and promoting policy coherence within the Secretariat and among the Organization’s funds and programmes.\nThe position is located in the United Nations Ethics Office and the Ethics Officer will report to the Director through the Senior Ethics Officer.\nResponsibilities\nUnder the overall guidance of the Director and direct supervision of the Senior Ethics Officer, the incumbent will be responsible for the following duties:\n1. Provision of ethics advice\nProvide timely and confidential ethics advice and guidance to staff members; Conduct review of pre-appointment declarations of interest of senior officials; Prepare advisory memos on issues relating to ethics and integrity; Draft ad-hoc reports, position notes and presentations on issues relating to ethics and integrity, including conflict of interest management; Ensure provision of consistent ethics advice through interactions with other Ethics Office staff; Conduct relevant research, including policy research, and provide policy advice; and Conduct review of staff regulations and rules, and other administrative issuances as require', 263, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=7549c8abb1db55bc&from=serp&vjs=3', '2018-07-26 01:59:34', '2018-07-26 01:59:34'),
(9363, 1188, 1522, 'Jobs in USA', 'This position is located in the Environment Statistics Section, Environment Statistics and Geospatial Information Branch, Statistics Division, Department of Economic and Social Affairs (DESA). The Statistician reports to the Chief of the Environment Statistics Section. The Statistics Division is committed to the advancement of the global statistical system. The Division compiles and disseminates global statistical information, develop standards and norms for statistical activities, and support countries\' efforts to strengthen their national statistical systems. Further information is available on the following website: https://unstats.un.org.\nResponsibilities\nUnder the direct supervision of the Chief of the Section, the Statistician will be responsible for the following duties:\nInitiates and co-ordinates the development of appropriate methods for obtaining relevant data on environment statistics.Ensures the quality of collected environmental data for accuracy, consistency and comparability.Plans and conducts analytical programmes of work in environment statistics. This may include: identifying projects, conducting analysis and participating in technical advisory activities for national capacity building.Supervises and contributes to the development and maintenance of databases, web publishing tools, and other software for collection, storage and distribution of environment statistics.Undertakes methodological research with regard to standards on concepts, definitions and classifications in environment statistics (including climate change statistics) to assist countries and other constituents in strengthening their statistical development.Develops new or improved statistical methods and quantitative models for analyses related to environment statistics.Provides guidance and advice to other departments, field experts, etc., in the planning, operation and evaluation of environment statistics programmes and projects.Plans and co-ordinates seminars, workshops, expert mee', 372, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=04a54a518a2b6f69&from=serp&vjs=3', '2018-07-26 01:59:34', '2018-07-26 01:59:34'),
(9364, 1189, 1504, 'Jobs in USA', 'This position is located in the United Nations (UN) Ethics Office, an independent office, which assists the Secretary-General in ensuring that all staff members observe and perform their functions consistent with the highest standards of integrity, required by the Charter of the United Nations, through fostering a culture of ethics, transparency and accountability. The Legal Officer will report to the Senior Ethics Officer, who leads the Team on Protection-against-Retaliation and other matters, and to the Director.\nResponsibilities\nWithin delegated authority, the Legal Officer will be responsible for the following:\n1. Protection against Retaliation (PaR)Serves as a lead officer in conducting procedural reviews of appeal cases, preliminary reviews of PaR requests and drafts prima facie case findings; advises clients of the UN PaR policy and internal grievance mechanisms; independently handles a wide range of multi-discipline and complex PaR legal matters, involving issues of public, private, and administrative law, to include interpretation and application of instruments in that area of concentration (both substantive and procedural).Advises and engages with UN internal justice system bodies including the tribunals, on retaliation cases, participates in negotiations and settlement of claims, to include establishing strategy and approach; deciding on the recommendations on the merit of claims and in connection with the reviewability of administrative decisions taken upon a recommendation of the Ethics Office.Reviews retaliation investigations to determine if retaliation occurred as alleged, applying the legal standard of “clear and convincing evidence” required by the PaR policy; advises on and drafts complex agreements and other legal documents; develops new modalities to meet unique needs/circumstances.Performs extensive legal research and analysis and prepares determinations, briefs, and correspondence, in particular to remediate situations where retaliation has oc', 327, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=1f3f2d384f9eff84&from=serp&vjs=3', '2018-07-26 01:59:34', '2018-07-26 01:59:34'),
(9365, 1190, 1523, 'Jobs in USA', 'Who We Are\nVisaHQ is a leading online US passport and travel visa services company assisting retail and corporate clients in the United States, United Kingdom, Canada, Germany, United Arab Emirates, India, and Indonesia. Headquartered on Embassy Row in Washington DC, VisaHQ uses cutting-edge online technologies to offer unmatched electronic travel management solutions as well as access to the most comprehensive in the world visa requirements database and the largest Embassy and Consulate online directory for its customers.\nOur Staff\nVisaHQ hires a diverse and internationally minded staff of professional and reliable employees who are dedicated to breaking through the many bureaucratic barriers imposed on international travelers. They know their way past these hurdles not only from professional training programs and effective management, but through a wealth of personal and shared experience. In short, the company and its dependents hold themselves to the highest standards of professionalism, dedication, and respect.\nOpen Vacancy\nVisaHQ is looking for a full-time Visa and Passport Specialist to join our growing team in Washington DC. There is a good potential for growth with and within the company.\nThe Visa and Passport Specialist will provide a wide range of support to our clients that includes answering telephone calls, emailing, responding to inquiries, using a variety of online and paper applications, and other administrative tasks. The Visa Specialist will also work directly with all the Consulates in the Washington DC area, submitting visa applications on the behalf of our clients.\nThe person in this position must be highly organized, detail oriented, and punctual.\nRequirementsMinimum education of an Associate\'s Degree\nExperience in the field of travel and visa preparation is highly desired\nExperience in legalization (authentications, apostiles) is highly desired\nExcellent English verbal and written communication skills\nForeign languages (Arabic, Russian, Chine', 1150, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=060af287ac39e691&from=serp&vjs=3', '2018-07-26 01:59:34', '2018-07-26 01:59:34'),
(9366, 1191, 1522, 'Jobs in USA', 'This position is in the Office of the High Commissioner for Human Rights (OHCHR), Field Operations and Technical Cooperation Division (FOTCD), Peace Missions Support Section (PMSS). The incumbent will be based in New York and reports through the team leader to the Chief of the Peace Missions Support Section (PMSS).\nResponsibilities\nUnder the overall supervision of the Chief of the Peace Missions Support Section and the direct supervision of the unit team leader, the incumbent will be responsible for the following duties:Supports the integration of human rights in UN peace operations;Assists and advises human rights components of UN peace operations and Geographic Branches on staffing matters, including recruitment/selection, mobility, deployment and related administrative measures and procedures; Reviews United Nations Volunteer (UNV) candidate profiles for suitability for human rights deployment to peace operations;Supports the Department of Field Support (DFS) management of rosters through coordinating and providing technical expertise on human rights staffing requirements for UN peace operations; Plans and coordinates activities related to the organisation of human rights expert panels and analyses the results of rostering exercises, including from a gender perspective;Collects data and analyses the budgeted human rights workforce, structures and reporting lines approved for human rights components and maintains statistics, including gender-specific data and indicators;Conducts substantive research and analysis of human rights issues/events and assesses their impact on the human rights situation in assigned region or countrypeace operations;Provides input to policy and guidance relevant to human rights component in peace missions, including on protection of civilians, human rights due diligence on UN support to non-UN forces, sexual violence in conflict and peace building and assists in documenting best practices and lessons learned;Collects and analyses human ri', 372, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=d4ce2729fbcc2917&from=serp&vjs=3', '2018-07-26 01:59:34', '2018-07-26 01:59:34'),
