(9401, 1206, 1572, 'Jobs in USA', 'Silverado. Passion. Possibilities. Purpose.\nSilverado Associates know that there is no substitute for a meaningful career. We take pride in knowing the world is a better place because of what we do, and we feel fortunate to be part of a family that is unified in this commitment. We get the chance to learn every day, the opportunity to grow, and the ability to help others. At Silverado, it is about ENRICHING LIVES!\n\nSilverado is presently seeking a Part Time Receptionist to join our Memory Care team.\n\nPlease apply directly to our website at silverado.com/careers\n\nMeet our associates and learn why they love working with Silverado: http://www.silverado.com/recruiting/meet-our-team/\n\nQualifications:\nHigh school diploma\nAt least one year experience dealing with the public via telephone and in person.\nStrong computer skills– especially with Word and Excel.\nExcellent customer service skills and outstanding verbal and written communication skills. Strong ability to multi-task.\nSummary of Major Functions:\nAnswer telephone calls in a professional manner and direct appropriately.\nReceive, separate and distribute incoming mail and prepare outgoing mail.\nGreet visitors and direct accordingly.\nMaintains files on the computer and updates information as necessary pertaining to associates and clients.\nAssist with clerical duties and office functions as assigned.\n- Saturday and Sunday 2:00 pm - 8:00 pm\n\nAt Silverado, we sincerely appreciate our Associates! Silverado Senior Living offers competitive pay and great benefits for our full-time associates including medical, dental, vision, life insurance, 401(k) with an employer match, vacation, and sick time as well as great opportunities for growth. Learn more about our Silverado Benefits: http://www.silveradobenefits.com\nEOE/M/F/D/V\nTo maintain our world class standard, all offers of employment with Silverado are contingent upon a satisfactory background check as well as drug screening, a physical and TB testing (if required for the pos', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=b5781fa82c1e7cff&from=serp&vjs=3', '2018-07-28 20:36:09', '2018-07-28 20:36:09'),
(9402, 1207, 1573, 'Jobs in USA', 'Looking for applicants to work part time Thursdays through Sundays.\nShifts available 4:00 PM to 12:00 AM (midnight).Job Summary\nThis is a part-time, entry level position. The ideal candidate will demonstrate an ability and desire to learn and grow their skills and responsibilities over time. The Data Center Technician is responsible for deploying and maintaining servers and the supporting infrastructure in a fast-paced environment with rapidly shifting priorities, while maintaining high availability. A strong attention to detail and effective documentation skills are critical components to success in this position.\nDuties and ResponsibilitiesPrioritize requests and deploy servers to meet deadlines.\nInstall and validate servers and supporting hardware.\nServer assembly and disassembly.\nServer maintenance and repair.\nRacking and un-racking of servers and devices.\nPerform hardware troubleshooting.\nServer console reboot.\nInstall, test, and label cables and fiber using standard data center protocols and using cable management systems.\nReview power requirements and rack layouts to ensure that equipment is installed properly.\nReplace failed drives and devices.\nCoordinate all repairs with customers and support team.\nTakes routine inventory count and maintains stock of hardware.\nDemonstrates excellent written communications skills including the ability to follow detailed written instructions.\nRequirements\nPhysical requirementsAbility to sit or stand for long periods of time.\nAbility to lift up to 50 lbs.\nQualificationsMinimum of 1 or more years experience installing and troubleshooting server hardware or equivalent experience.\nAbility to work with minimal supervision and manage multiple projects and priorities.\nMaintain high degree of self-motivation and independent decision-making.\nHigh School Diploma or equivalent.\nDrivers License and reliable transportation.\nType at 50wpm or faster.\nOUR CORE VALUES\nIOFLOOD can be summed up in three sentences:IOFLOOD exists to help entrepre', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=13f1e6e3d80230f7&from=serp&vjs=3', '2018-07-28 20:36:09', '2018-07-28 20:36:09');
