(9403, 1208, 1573, 'Jobs in USA', 'As one of “The World’s Most Admired Food Companies” in Fortune magazine, Nestlé provides quality brands that bring flavor to life every day. The Nestlé Dreyer’s Ice Cream division serves to provide world class service to frozen grocery accounts across the country. Products include industry leading brands such as DIGIORNO pizza, DRUMSTICK ice cream snacks, and HӒAGEN-DAZS premium ice cream.\nPOSITION OVERVIEW:\nThe Merchandiser’s primary function is to support the display and stocking of Nestlé products at various customer sites in accordance to plan-o-gram specifications through executing world class service. This includes demonstrating sound safety practices while merchandising product, replenishing store freezers from back-room inventory, improving shelf positioning, increasing product display space, ensuring retail price tags are properly displayed, maintaining all Point-of-Sales materials, utilizing current flavor schematics for all products, establishing rapport/credibility with store personnel, and fostering strong communication with co-workers. The position requires driving to grocery store customers in a personal vehicle, for which mileage reimbursement will be provided per company policy.\nPRIMARY RESPONSIBILITIES:Merchandise frozen ice cream and pizza products to drive sales in various grocery accounts.Build and maintain relationships with appropriate customers in all accounts, communicate with customers during service calls and respond to customer requests.Follow operational standard procedures that outline route schedules (Deliver, Merchandise and Order, also known as “DMO”), merchandising principles, filling frozen shelves with product, rotating product regularly, and front facing product.\nMaintain company-owned equipment and properly handle paperwork.Ensure stores set to correct flavor and tag schematics, promotional displays are properly executing, and store back stock is maintained and organized.Identify and communicate all selling opportunities and pot', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=409f97ee35dca07e&from=serp&vjs=3', '2018-07-28 20:36:09', '2018-07-28 20:36:09'),
(9404, 1209, 1574, 'Jobs in USA', 'Job Summary\nTo exceed guest expectations by being enthusiastic and helpful and to create a welcome home atmosphere for members and guests. Incorporate the Village Standards: People, Places and Programs everyone/every time/everywhere\nSummary Of Essential Functions\nAttract and Retain members by consistently providing excellent customer service Responsible for interacting with employees, members and guests in a manner aligned with the People, Places and Programs components of the Village Standards Present a professional, positive image that reflects well on the organization. Greet and check in members with sincere hospitality and effective communication skills Responsible for having general knowledge of the club, amenities, programs, and useful information about the area Responsible for handling and recording cash and non-cash transactions Providing exceptional customer/ guest service and acting in a friendly/ helpful manner at all times. Handle guest complaints in a timely manner, and direct guest questions or concerns to the correct individuals Assist members in signing up for programs and activities. Answer all phones and direct calls to appropriate staff Maintain clean and safe front desk area and any other related areas Assist membership where possible to help ensure their successful operation. Handle credit card/cash transactions Take member reservations for tennis, squash and racquet courts Other duties as assigned.\nKnowledge/Skills Required\nAbility to operate multi-line telephone systems Outstanding customer/guest service/ skills with a friendly, enthusiastic, and helpful demeanor. Understanding of court reservation systems Must be 18 years or older and have high diploma or GED Must possess basic computer/data entry skills. Obtain CPR certification within 30 days of hire through company training Ability to multi-task May be required to work evenings and weekends as needed Required to maintain a physical presence within the Village to perform assigned duties\nKno', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=f9e7877edbd6adf0&from=serp&vjs=3', '2018-07-28 20:36:10', '2018-07-28 20:36:10'),
(9405, 1210, 1575, 'Jobs in USA', 'For those who want to invent the future of health care, here\'s your opportunity. We\'re going beyond basic care to health programs integrated across the entire continuum of care. Join us and help people live healthier lives while doing your life\'s best work.(sm)\n The Clinical Document Improvement Specialist - (CDS) is responsible for providing CDI program oversight and day to day CDI implementation of processes related to the concurrent review of the clinical documentation in the inpatient medical record of Optum 360 clients’ patients. The goal of the CDS oversight and practice is to assess the technical accuracy, specificity, and completeness of provider clinical documentation, and to ensure that the documentation explicitly identifies all clinical findings and conditions present at the time of service.\n\nThis position collaborates with providers and other healthcare team members to make improvements that result in accurate, comprehensive documentation that reflects completely, the clinical treatment, decisions, and diagnoses for the patient. The CDS utilizes clinical expertise and clinical documentation improvement practices as well as facility specific tools for best practice and compliance with the mission/philosophy, standards, goals and core values of Optum 360.\nIn this position the CDS will utilizing the Optum™ CDI 3D technology that is assisting hospitals to improve data quality to accurately reflect the quality of care provided and ensure revenue integrity.\nOur three-dimensional approach to CDI technology, paired with best-practice adoption methodology and change management support, is helping hospitals make a real impact on CDI efficiency and effectiveness.\nIncrease in identification of cases with CDI opportunities, with automated review of 100% of records\nImproved tracking, transparency and reporting related to CDI impact, revenue capture, trending and compliance\nEasing the transition to ICD-10 by improving the specificity and completeness of clinical docum', 1180, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=f473b19c6901b0b0&from=serp&vjs=3', '2018-07-28 20:36:10', '2018-07-28 20:36:10'),
