(9408, 1213, 1578, 'Jobs in USA', 'Chapman Automotive Group is one of the largest & best selling automotive retailers across Arizona and Nevada. Every employee with the Chapman Automotive Group is absolutely critical to its success. We have been family owned & operated since 1966, and we take great pride in our reputation. Our rapid growth and fast-paced environment make this an awesome place to work. Happy employees make happy customers, and we reward individuals who are ready to work hard and stay motivated.\nWHAT WE OFFER:\n*\nEmployee/Family Vehicle Purchase Plan\n\n*\nClear Promotion Tracks & Flexibility to Growth Within Chapman\n\n*\nLong Term Job Security\n\n*\nFriendly Working Environment\nRESPONSIBILITIES:\n*\nAnswer phones and direct consumer to the proper department and follow up in a timely manner\n\n*\nHandle customer complaints diplomatically and refer complaining customers to the appropriate individual for resolution\n\n*\nOperate switchboard telephone system\n\n*\nCommunicate with callers in a professional, friendly and efficient manner, striving to minimize the amount of time customers spend on hold\n\n*\nAssist the managers with various clerical duties as needed\n\n*\nBe friendly, professional, courteous and efficient when working with all customers and employees\n\n*\nFamiliarize yourself with department structures & internal procedures for assisting customers efficiently\nQualifications:\n*\nExperience with Microsoft Office suite is a plus\n\n*\nAvailable to work flexible hours on weeknights & weekends\n\n*\nAbility to communicate customers\' interests needs and requests to management and sales personnel\n\n*\nProfessional personal appearance\n\n*\nClean driving record', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=47ce4383f28afcc2&from=serp&vjs=3', '2018-07-28 20:36:10', '2018-07-28 20:36:10'),
(9409, 1214, 1579, 'Jobs in USA', 'It would benefit you if you also emailed us your facebook or instagram link to the email above and/or send us a video introducing yourself--this way you\'ll stand apart and not just be some letters on a white piece of paper. Text video to (480) 646-0777. The video sets you apart and shows your level of motivation and creativity! In the video just introduce yourself and why you would like to work for Always Unleashed. You can tell us a little about some of your present/past positions; whatever you\'d like --we just want to meet you.We are located at 7230 E Adobe Drive (Corner of Scottsdale Rd & Adobe Dr., 2 miles north of the 101)Dog Pet Resort Night Shift Boarding Attendant - $100-$126 per night dependent upon how many dogs. Must be able to work holidays and some weekends. Ideal for students, or mommies who want to go home and be with child in the morning when dad goes to work.Qualifications:Clean work history: If this is NOT your first job, it is necessary that you have had a job with a reputable company for 6 months, with a good recommendation. We needdependable and punctual employees with a nice orderly appearance.Experience:We will teach you everything you need to know: you just need have the confident bold personality- that\'s a must.RESPONSIBILITIES INCLUDE (not limited to): - Care and comfort of overnight boarded dogs; Approximately 4-5 hours of chores (Cleaning, Feeding, etc.)Job Types: Full-time, Part-timeSalary: $100.00 to $126.00 /day', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Always-Unleashed-Pet-Resort/jobs/Dog-Pet-Resort-Boarding-Attendant-e06cad0d4373e65a?vjs=3', '2018-07-28 20:36:10', '2018-07-28 20:36:10'),
(9410, 1215, 1580, 'Jobs in USA', 'We are currently looking for OUTGOING and EXCITING Performers to present MAD SCIENCE SHOWS and PARTIES!\n\nAre you looking for a job that\'s FUN and gives you loads of EXPERIENCE on stage and in the spotlight? Look no further than MAD SCIENCE! For SHOWS you\'ll visit schools, libraries, camps and more to deliver AMAZING science presentations that will WOW your audiences of 15-250 kids! We provide the training and equipment, and handle all the booking and scheduling from our office. All you do is go have fun with the kids!\n\nThe Event Perform position is part-time, and is perfect for someone with a flexible schedule who can take on many gigs when given plenty of notice and can earn up to $150-$300 a weekend.\n\nRequirements:\nAn OUTGOING and DYNAMIC personality\n\nEnjoys performing in front of an audience (birthday parties typically 15-25 children)\n\nExperience with groups of children ages 4-12\n\nReliable transportation\n\nA cell phone\n\nExcellent verbal communication skills\n\nAbility to lift up to 35 lbs\n\nAvailable most weekends\n\nKnowledge of basic 3rd grade science (don\'t worry - we\'ll provide training!)\n\nLots of ENERGY\n\nAll employees will be fingerprinted for criminal background check\n\nSuccessful candidates are also:\nResponsible - able to conduct programs safely and efficiently\n\nReliable - always on time, always prepared\n\nAdaptable - able to adjust to every environment and group type\n\nProfessional - comfortable dealing with everyone from parents to principals\n\nFlexible - able to function in a business where schedules and workloads are at the mercy of the customer\n\nFUN!!!Mad Science of the Bay Area is an equal opportunity employer and encourages diversity in its workforce; it does not discriminate on the basis of race, color, gender, religion, age, sexual orientation, national or ethnic origin, disability, marital status, veteran status, or any other occupationally irrelevant criteria.', 1182, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=37e50081f29b771b&from=serp&vjs=3', '2018-07-28 20:36:10', '2018-07-28 20:36:10'),
(9411, 1216, 1581, 'Jobs in Oman', 'If you are a committed, creative professional and are passionate about making a lasting difference for children, the world\'s leading children\'s rights organization would like to hear from you. For 70 years, UNICEF has been working on the ground in 190 countries and territories to promote children\'s survival, protection and development. The world\'s largest provider of vaccines for developing countries, UNICEF supports child health and nutrition, good water and sanitation, quality basic education for all boys and girls, and the protection of children from violence, exploitation, and AIDS. UNICEF is funded entirely by the voluntary contributions of individuals, businesses, foundations and governments.\n\nAnd we never give up.\n\nFor every child, Hope\n\nBackground and Justification\n\nThe Sultanate of Oman is a high income country of 4.2 million people. Over the past 40 years, economic stability and income growth have gone hand-in-hand with rapid reductions in child and maternal mortality, universal child immunization, universal primary education, and strong political will to address the rights of women and girls.\n\nThese developments have included the child protection sector as well. Oman has many components in place to protect children from violence, as reflected in the Oman Child Law, the National Childhood Strategy and National Strategy on Child Maltreatment. However, there is inadequate data to define the scale and scope of child maltreatment. The full extent is hidden for reasons including a very young case notification system that still requires bolstering across sectors, as well as stigmatization, and culturally accepted practices not recognized as maltreatment. Between 2007 and 2013, there were 484 cases of child maltreatment reported to health services, and the child protection hotline launched in January 2017 had received calls regarding 330 cases of child abuse by the end of the year. Trends in the region also suggest that the problem is large. Girls experience a hi', 1183, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=6e16447daaae792f&from=serp&vjs=3', '2018-07-28 20:36:10', '2018-07-28 20:36:10'),
(9412, 1217, 1581, 'Jobs in Oman', 'If you are a committed, creative professional and are passionate about making a lasting difference for children, the world\'s leading children\'s rights organization would like to hear from you. For 70 years, UNICEF has been working on the ground in 190 countries and territories to promote children\'s survival, protection and development. The world\'s largest provider of vaccines for developing countries, UNICEF supports child health and nutrition, good water and sanitation, quality basic education for all boys and girls, and the protection of children from violence, exploitation, and AIDS. UNICEF is funded entirely by the voluntary contributions of individuals, businesses, foundations and governments.\n\nAnd we never give up.\n\nFor every child, Hope\n\nBackground and Justification\n\nThe Sultanate of Oman is a high-income country of 4.2 million people that has earned recognition for its rapid human development over the past 40 years. Oman’s Human Development Index (HDI) ranked Oman at 52 amongst 188 countries in 2015, placing the Sultanate amongst the high human development countries. Since 1990, the country has achieved one of the world’s fastest rates of reduction in under-five mortality rate. The United Nations 2016 estimates for the infant mortality rate and under-five mortality rate for Oman are respectively 9 and 11 per 1,000 live births[1], a fraction of the MENA regional averages (36 and 28 per 1,000 live births respectively, 2011), and of the same order as estimates for the United States and some other OECD countries. Oman has also made remarkable progress in adult literacy, from 33 percent in 1970 to 87 percent in 2011 (MOE, 2006 data), ten percentage points higher than the regional average for the MENA region. Oman offers a unique policy model in the MENA region. The country has taken bold measures that promote greater openness and dialogue, a pro-employment policy, greater access to land ownership, affordable consumer goods, and universal health and education serv', 1183, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=73b925b055d55402&from=serp&vjs=3', '2018-07-28 20:36:10', '2018-07-28 20:36:10'),
