(9416, 1221, 1584, 'Jobs in KSA', 'This position reports directly to the Sales Manager, and dotted line to the Executive Manager.\nStrategic Job Functions\nCommunication and Interaction with Management\nDue to the nature of this front line sales position it is critical to be a good communicator. As a District Sales Executive you are in a very independent job that requires you keep many people updated on your progress. The following are expectations in this area:\nUpdate all calls and opportunities in CRM.\nAttend local branch sales meetings and contribute strategic information to the team including key results from your past weeks calls, updates on current target accounts and a review of this weeks key upcoming calls.\nUse the Executive Manager and Sales Manager as your source for operational support and account strategy.\n\nService Knowledge\nYou are responsible to stay updated on the company\'s various service offerings and new service development. You can use your internal sources to support this on-going education. It is also important for you to know you who our top customers are and what types of specific solutions we provide to them.\nMarket Intelligence Feedback\n\nAs a field sales person, you are required to keep us updated on market intelligence such as:\nCompetitive Information\nCustomer Requirements\nPotential New Product Developments\nFeedback to management\n\nYou should be involved in local trade groups and have a strong local network to ensure you keep us updated:\nJoin local traffic clubs\nCouncil of Logistics Management\nTrade Department\n\nTerritory Management\n\nAs you will be assigned a territory, it is part of your job requirement that you manage that Territory and know every potential account that resides in it. This includes:\nSegmenting your territory into sub-areas\nDriving around your area on weekend and with free time to prospect\nJoin the local chamber of commerce or equivalent\n\nYou own this territory so practice the âBig Dogâ concept.\n\nTactical Job Functions\n\nCalls Per Week\n\nThe guideline for the', 1186, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=a9e873a04c2c9a94&from=serp&vjs=3', '2018-07-28 20:36:10', '2018-07-28 20:36:10'),
(9417, 1222, 1585, 'Jobs in UAE', 'Reporting to the Management Consular Officer at the Consulate General of Canada in Dubai. Accountable for the provision of mission specific common services to mission clientele in addition to the coordination of regionalized common services requests from the mission to the Client Service Delivery Point located in the High Commission of Canada in New Delhi, India. Responsible for the delivery of the following common services: property and facilities management, material management and procurement; limited responsibilities for the delivery of the following common services: financial, human resources; and the management of information and documentation of the service(s) in accordance with established policies, guidelines and procedures.\nEssential qualifications:\nEducation:Successful completion of a university degree from a recognized university\nLanguage:Fluency in English (both oral and written)\nExperience:Experience working in an office environment for a minimum of five (5) years.\nKnowledge:Knowledge of property and facilities management, material management and procurement\nAbilities/Competencies:Ability to communicate effectively, both orally and in writingAdaptability and flexibilityAttention to detailClient focusInitiativeIntegrityJudgmentTeamwork and co-operation\nAsset Qualifications:\nPreference may be given to candidates who have the following asset qualifications:Fluency in Arabic (both oral and written)Master’s degree in a related field e.g. business administrationExperience working for a diplomatic mission or an international organizationExperience working in property and facilities management, material management and procurement\nIf candidates meet the factors listed in the asset qualifications they must also clearly demonstrate how they meet these factors in their covering letter.Organizational Needs:\nOperational Requirements:\nAbility to work regular overtime (evenings and weekends)Annual leave during the summer period may be restricted due to operational nee', 1187, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=40acc3685e6dfefe&from=serp&vjs=3', '2018-07-28 20:36:12', '2018-07-28 20:36:12'),
(9418, 1223, 1397, 'Jobs in UAE', 'Flight Attendant Job Opening. Currently we are looking for Flight Attendant for one of our Client Based company. Location Dubai. Interested Candidates Can submit their Application.\n\nJob Duties and Responsibilities:• Performing all regulation cabin duties prior to flight• Ensuring all standards are met and passengers comply with FAA policies• Greeting passengers and assisting them on the plane• Checking passenger tickets and passports• Assisting pilots in flight when needed• Instructing passengers on all emergency procedures, emergency equipment; operating all emergency exits• Serving food and beverages to passengers• Assisting passengers in stowing baggage• Presenting in flight sales and airline promotions• Explaining custom forms and passing out required paperwork to passengers• Maintaining a clean cabin\n\nJob Requirements and Qualifications:• High school degree or equivalent• Friendly people-person polite and empathetic to all passengers• Patient and helpful when assisting passengers• Able to multitask, prioritize, and manage time efficiently• Self-motivated and self-directed• Works well as part of a team and on individual tasks• Excellent at verbal communication• Works well and efficiently under pressure• Possesses strong interpersonal and communication skills• Excellent personal presentation, image, and style• Willing to work holidays, nights, and weekends• Physically able to stand and move during the length of shift; able to bend and kneel through shift.', 1086, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=a2a0c1b89eb73599&from=serp&vjs=3', '2018-07-28 20:36:12', '2018-07-28 20:36:12'),
(9419, 1224, 1587, 'Jobs in UAE', 'Welcome to our World\nOur Vision at Millennium & Copthorne Middle East and Africa is to be the preferred hotel company for our guests, colleagues, and owners while achieving exceptional growth.\n\nWe have an Ambition to operate 100 preferred hotels by the year 2020.\nJob Location\nStudio M is a chic urban hotel brand that is part of the Millennium Hotels and Resorts.\nStudio M provides thoughtful, well designed spaces with the “cool” factor combined with stylish, high quality rooms and integrated fuss- free technology. The stylish and contemporary Studio M offers 215 rooms, 8 suites and 100 apartments designed with integrated technology for both business and leisure travellers.\nStudio M is located near Dubai International Terminal 2, Dubai Police Headquarters and Dubai Free Zone Authority at walking distance to Al Qiyadah metro station.\nKey Job Responsibilities\nThe Telephone Operator is responsible for speedy and courteous answering incoming calls while speaking clearly, distinctly and with a friendly tone. They deal with the requirements and questions of guests in the way that is up to the hotel standards.\nAnswering all incoming calls timely and according to the company’s telephone etiquette.Direct calls to guests, staff or other departments through the switch board always ensuring the guest’s privacy and confidentiality is kept.Place outgoing calls.Operate communication platform “What’s App” and answer to guest messages in a professional manner.Possess monitoring and coordination abilities with various departments in order successfully tend to guest needs.Keep records of calls placed and received, and of related toll charges.If electronic system is down, to record all-chargeable calls and post them on the guest’s invoiceReport all telephone defects to the technical department.Perform administrative work relating to technical faults and problems.Calculate and quote charges for services such as long-distance connections.Takes messages for guests and delivers the same to g', 1189, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=d46cf4a3884170de&from=serp&vjs=3', '2018-07-28 20:36:12', '2018-07-28 20:36:12'),
