s, employee relocation disbursements, expense dictionar', 1190, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=e9262974ec16161c&from=serp&vjs=3', '2018-07-28 20:36:12', '2018-07-28 20:36:12'),
(9422, 1227, 1586, 'Jobs in UAE', 'Job DescriptionWhen you’re part of Thermo Fisher Scientific, you’ll do challenging work, and be part of a team that values performance, quality and innovation. As part of a successful, growing global organization you will be encouraged to perform at your best. With revenues of $20 billion and the largest investment in R&D in the industry, we give our people the resources and opportunities to make significant contributions to the world.Essential functions:\nThis individual is a partner to the customer through adoption and use of next-generation high throughput sequencing systems after installation.\nResponsible for the provision of scientific application support and training on Next Generation Sequencing (NGS) systems, thereby contributing substantially to customer satisfaction.\nResponsible for providing support on Bioinformatics related queries from customers.\nSupport sales in the achievement of the order plan by strategic planning and delivery of product line specific post-sales related customer support activities in a timely and professional manner.\nImpacts service by joint escalation solving and technical coaching. Responsible for keeping up to date with product and state of the art scientific know how.\nThe position is field based, with incentive compensation on customer success and satisfaction metrics as well as efficiency.\nKey Responsibilities Include:\nAssist customers in designing and conducting experiments to initiate and validate the use of NGS system in their laboratories.\nProvide initial training to customers at their own laboratories and at Life Technologies training locations.\nProvide Bioinformatics support to customers.\nProvide information to customers regarding applications and related products for the NGS systems, including kits, reagents, Bioinformatics and ancillary devices.\nProvide technical and applications assistance in response to customer inquiries.\nPlays major role when introducing and supporting new products and applications. Train support or ', 1188, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=bc6af424da37a765&from=serp&vjs=3', '2018-07-28 20:36:12', '2018-07-28 20:36:12'),
