(9430, 1235, 1591, 'Jobs in Qatar', 'Department Profile\nThe department of Pathology is a professional service that provides a full range of diagnostic testing and interpretations and serves additional functions including academic training and teaching. The hospital-based laboratory will provide diagnostic testing in Anatomical Pathology including cytopathology, histology and surgical pathology. Blood Sciences that include Chemistry, Hematology, Coagulation and Blood Transfusion. Microbiology and Immunology that also includes molecular pathology. HLA and Pathology Genetics, Point of care testing (POCT) and a 24/7 Phlebotomy services. The department of clinical laboratory will be CAP and ISO 15189 accredited as well as JCI. The department is supported by the Cerner PathNET LIS as part of an enterprise wide CIS and will incorporate ward-based electronic testing, wireless and RFID technologies in Phlebotomy, as well as digital pathology.Job Summary\nThe Technologist I - Pathology Genetics performs DNA/RNA diagnostic experiments that involve among others: Sanger Sequencing; Fragment analyses on capillary electrophoresis [i.e. for Fragile X syndrome, MLPA etc]; Real-time PCR; Microarray analyses [Affymetrix, Illumina platforms or both]. Willingness to become involved in interpreting sequencing, fragment analyses, real-time PCR, microarray and NGS data after receiving proper training is highly desirable;\nThe Technologist I - Pathology Genetics assists in the validation of all equipment and processes within the laboratory, preparation of policies and procedures in accordance with CAP/ISO15189 and JCI, and training of staff in specific techniques as appropriate to the expertise and experience of the post-holder. The Technologist I - Pathology Genetics performs a broad range of technical and analytical work with a high level of individual skill and judgment, under minimal supervision. The incumbent is required to observe and maintain a high standard of laboratory health, safety and risk procedures; and works to d', 1193, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=895b59498954c887&from=serp&vjs=3', '2018-07-28 20:36:12', '2018-07-28 20:36:12'),
