(9468, 1254, 1678, 'Jobs in USA', 'Make a difference every day by joining CCRES as a school-based Board Certified Behavior Analyst (BCBA) !\n\nWe are accepting applications for the 2018 - 2019 school year for Board Certified Behavior Analysts (BCBA) to provide comprehensive behavior analytic services to students in Haverford Area School District.\n\nThis is a 10 month contract position.\n\nPrimary Responsibilities:\nConduct functional behavioral assessments and write reports summarizing results.\nDevelop positive behavioral supports utilizing evidence-based interventions.\nAssess a student’s instructional needs and develop appropriate programming.\nProvide ongoing monitoring of student data and make programming adjustments as needed.\nDevelop tools and work with staff to collect progress-monitoring data on behavioral goals.\nTrain staff on positive behavior support plans and instructional programs and monitor fidelity.Skills:\nEffective written and verbal communication skills.\nExtensive skills in behavioral assessment and positive behavior support plan development.\nExtensive knowledge of data analysis.\nAbility to work collaboratively within a team atmosphere.\nExperience working with students with autism, emotional/behavioral disorders, and/or intellectual disabilities.Qualifications:\nMaster’s Degree in applied behavior analysis (ABA) or a related program\nBCBA certification\nMinimum three years working after BCBA certificationWhy is CCRES the BEST for YOU:\n\nCCRES is a non-profit industry leader providing educational and behavioral health HR/staffing services within Southeastern PA. We work in partnership with the Advanced Clinical Services (ACS) program of the CCIU to provide the highest quality behavioral health school district services to individuals with special needs.\nReceive clinical support from BCBA-D, ACS Program Supervisor.\nCaring & dedicated CCRES HR team!Credentialing Requirements:\nBoard Certified Behavior Analyst (BCBA) - Certificate\nPA Child Abuse (Act 151) Clearance (Current within 1 year)\nPA Criminal', 1210, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=933091fab6b54c9c&from=serp&vjs=3', '2018-07-29 19:07:58', '2018-07-29 19:07:58'),
(9469, 1255, 1683, 'Jobs in USA', 'Make a difference every day by joining our team as a contract school-based BCBA Specialist!\n\nWe are accepting BCBA Specialist applications to consider for the 2018 - 2019 school year.\n\nCCRES is the industry leader working in partnership with the Advanced Clinical Service program of the Chester County Intermediate Unit (CCIU) to provide the highest quality behavioral health services to children and families with special needs.\n\nWe are seeking Board Certified Behavior Analysts (BCBA) to provide comprehensive behavior analysis services to students in schools within Chester County, PA. This is an Independent Contractor position.\n\nMake a difference every day by joining our team as a contract School-based BCBA Specialist!\n\nWe are accepting BCBA Specialist applications to consider for the 2018 - 2019 school year.\n\nCCRES is the industry leader working in partnership with the Advanced Clinical Service program of the Chester County Intermediate Unit (CCIU) to provide the highest quality behavioral health services to children and families with special needs.\n\nWe are seeking Board Certified Behavior Analysts (BCBA) to provide comprehensive behavior analysis services to students in schools within Chester and Montgomery County. This is an Independent Contractor position.\n\nPrimary Responsibilities:\nConduct functional behavioral assessments and write reports summarizing results.\nDevelop positive behavioral supports utilizing evidence-based interventions.\nAssess a student’s instructional needs and develop appropriate programming.\nProvide ongoing monitoring of student data and make programming adjustments as needed.\nDevelop tools and work with staff to collect progress-monitoring data on behavioral goals.\nTrain staff on positive behavior support plans and instructional programs and monitor fidelity.Skills:\nEffective written and verbal communication skills.\nExtensive skills in behavioral assessment and positive behavior support plan development.\nExtensive knowledge of data analysis.\nA', 1215, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Cassie\'s-Cardinals/jobs/Nanny-November-e28e98f5a7df01fe?vjs=3', '2018-07-29 19:07:58', '2018-07-29 19:07:58'),
(9470, 1256, 1680, 'Jobs in USA', 'Full Time Permanent Nanny Needed 5/6 Days a Week\nRef: NPUN12OA\nSalary : £450 npw\nLocation: Woodside\nStart Date : ASAP\nDays/ Hours Required : 5 days a week, occasionally Saturday’s 12:00pm – 20:00pm\nExperience : 1 years plus\nJob Description: Predominantly looking after toddlers after return from school and nursery. General Nanny duties include cooking toddler meals, keeping toddler bedroom and toys clean and tidying, supervising meal times and to create and supervise fun activities for toddlers and to prepare toddlers for bed.\n\nIf you think you have the right experience to support the family then please apply with your cv today quote job reference NPUN12OA', 1214, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=d79fec1864b7d06f&from=serp&vjs=3', '2018-07-29 19:07:58', '2018-07-29 19:07:58'),
(9471, 1257, 1684, 'Jobs in UAE', 'A qualified and experienced ‘first class’ nanny is required to care for three children aged 6 1/2 and twins aged 4 years of age.\n\nThis position requires a confident, high energy nanny who can multitask who enjoys travelling. The client would also prefer a nanny that has worked in the UAE or Middle East previously who has experience of International travel with the families (the travel will include the USA). This client ideally wants a minimum of 10 years experience.\n\nThe position is 24/6 and based in Dubai with the majority of school holidays spent in different International locations.\n\nThe role will include all nursery duties and the supervision of the children and their belongings and they require a candidate who will be confident to help with the homework.\n\nThe present and previous New Zealand nannies highly recommend the position.\n\nExcellent salary offered.', 1217, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-29 19:07:59', '2018-07-29 19:07:59'),
(9472, 1258, 1685, 'Jobs in UAE', 'Governess in Qatar to work for a VIP family. They are looking for someone who will speak perfect English and will be in place to teach all manners and etiquette to the children. The Governess will have charge of B1 and B8, there is a little girl aged 1 years old but she will not be looking after by the Governess.\nThe family are looking for a very professional, switched on and flexible person who can show initiative with the day to day busy lifestyle of the family. They will have other nannies who are there to help you, and will take care of all Nursery duties. The duties for the Governess will be to teach the children all the appropriate manners and guide them. You will hopefully also step in to overlook the other nannies and make sure everything is running smoothly with all the children.\nYou will be expected to travel with the family which will be in all the school holidays mainly to Europe and the US. You will have a driver to take you to where you need to go.\nAccommodation will be on the grounds of the house but will be in a separate building with your own bedroom and bathroom and shared use of kitchen facilities. The family are looking for someone who will be very calm, sweet, and gentle and have a motherly character.\nASAP start but are looking for the right candidate so will wait.\nWorking a 6 day week, 8-10 hours a day.\nSalary: Excellent and open to amazing candidat\n\nPlease get in touch with Dominique Taylor for more information.', 1218, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-29 19:07:59', '2018-07-29 19:07:59'),
(9473, 1259, 1196, 'Jobs in UAE', 'English or French native Speaking Governess Required in Dubai | ASAP Start Date\nJob ref: Dubai/4/B\nA native French and/or English speaking governess is being sought after in Dubai. The position is to care for four boys aged 1, 5, 8 and 10 years old.\n\nThe successful candidate will come from a teaching or higher education background. She should have at least 3 years’ experience working as a governess for private families.\n\nThe governess will be working from 2-10pm daily, she will be working 6 days a week one week and 5 days a week the following week.\n\nHer primary duties will be to care for the educational and social needs of the boys. She will be in charge of their education and liaise with schools and tutors. She should devise age-appropriate, educational activities for the children during the holidays and at home.\n\nThe successful candidate will preferably be a driver, active and enjoys sports and outdoor activities.\n\nThe family are willing to pay a salary of 20,000 AED a month in addition to visa, medical insurance and accommodation. This is roughly £4000 pm and is negotiable for the right candidate.\n\nThe nanny will also be given 30 holiday days a year and her flights home will be paid for by the family.\n\nThis position would suit a positive, energetic, hard working person with a flexible attitude and kind personality.\nRequirements\nLocation\nDubai\nStart date\nASAP\nDuration\nPermanent\nSalary\napproximately £4000 pm negotiable\nHours\n2pm - 10pm, 6 days a week one week, 5 days a week next week\nLanguages\nEnglish, French\nPermanence\nPermanent\nChildren\nMale/10 years old, Male/8 years old, Male/5 years old, Male/1 year old,\nExperience\nEssential\nDriving licence\nPreferred\nNon smoker\nEssential\nShared care\nYes\nSole charge\nYes\nAccommodation Details\nBasis\nLive-in\nAccommodationFamily residence\nHouse\nOther Details\nNursery duties only\nYes\nExpecting a baby\nNo', 962, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-07-29 19:07:59', '2018-07-29 19:07:59'),
