(9489, 1260, 1713, 'Jobs in USA', 'As a House Cleaner/Maid, you are a key member of the team providing quality cleaning for our customers. Exemplifying our code of values, you show respect and courtesy to all customers and employees.\n\nYou are self-motivated, dependable, and have a great attitude. This is hard work, but can be very rewarding for people who have pride in a job well done, like to help people, and like to stay moving.\n\n Specific Responsibilities:\nPerform professional residential cleaning services including mopping, vacuuming, dusting, sanitizing, wipe downs and other final touches\nCommunicate with customers and staff in a professional and courteous manner\nJob Requirements:\nValid Driver’s License\nPositive Attitude\nTeam player who can work independently\nBenefits:\nNo nights, no weekends\nFamily friendly hours\nPaid time off and holidays after 1 year\nCompany car provided\nWe are actively interviewing for this position - Apply today and our hiring manager will follow-up!', 1219, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=8242567638e7b7ba&from=serp&vjs=3', '2018-07-30 20:35:06', '2018-07-30 20:35:06'),
