(9492, 1263, 1715, 'Jobs in USA', 'Two Maids & A Mop is proud to announce that it has an immediate opening for an Office Manager.\nOur company serves more than 20 cities in eight states throughout the nation. In addition, our company was recently recognized as the National Maid Service of the Year by the Cleaning For A Reason Foundation!!\n\n$Now, we\'re ready to grow even more with the addition of one awesome, hard-working Office Manager for our “insert city name here” office location. The ideal applicant will have the following attributes:\nYou must be a natural born salesperson. Selling our service will be one of your most important responsibilities so expect to sell us on why you should become our next Office Manager!!\n\nYou must have prior management experience.\n\nYou must be very organized.\n\nYou must be a self-starter.\nPaid training - Mileage reimbursement - Profit Sharing Plan - Unlimited Income Potential!!\n\nThe position also has a few basic requirements:\nYou must be available Monday-Friday 7:00-4:30 PM.\nYou must provide your own dependable transportation, with valid insurance.\nYou must be able to pass a nationwide criminal background check and drug screen.\nThe position is perfect for anyone that has a drive to grow, because your hard work will directly determine your paycheck. Our unique compensation structure allows each of our managers to literally have unlimited income potential!!\n\nThe position starts at $32,000 annually but with profit sharing projected to increase to more than $50,000 the first year!!\n\nWe\'re scheduling interviews right now so bring your best smile and best customer service story to the interview!!!\n\nCheck us out online at www.twomaidsmandeville.com.', 1221, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=dd970c49fca2e1e1&from=serp&vjs=3', '2018-07-30 20:35:06', '2018-07-30 20:35:06'),
