(9507, 1277, 1731, 'Jobs in USA', 'Vuria is in search of Creative Copywriter to add to our SEO team! If you are a passionate, hard-working individual that thrives in a fast-paced environment and wants to join a dynamic, fun, and enterprising company, this is the perfect opportunity for you!LOCAL CANDIDATES ONLYOther awesome perks include: Full benefits, paid holidays, paid time off, casual work attire and environment!Responsibilities:- Develop timely, relevant content to meet diverse needs- Conceptualize and develop blogs and informative articles- Write and edit website and product copy- Initiate and develop brand awareness on key social sites such as Facebook, Twitter, Linked In, YouTube and blogs.- Create content calendars and outline content creation plans for a multitude of websites- Perform keyword research and relevancy research- Refine a large volume of content daily with quality edits (and rewrites as needed)- Manage website content, including image and video optimization- Assist design, sales and marketing teams as neededQualifications:- 1 to 2 years post-education writing experience (copywriting, public relations, agency experience), experience with writing copy for brands, and experience with B2B brand messaging, advertising copy, web content creation and email marketing; or an equivalent mixture of experience and education.- Phenomenal written and oral communication skills- Excellent writing, editing and proofreading skills- Working knowledge of Google Analytics- Creativity, teamwork and strong attention to detail- Self-motivated and positive attitudeJob Type: Full-timeLocation:Scottsdale, AZ', 1228, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Vuria-Creative-Technology/jobs/Digital-Media-Content-Writer-Creator-2bbf4aa39ecc34bb?vjs=3', '2018-07-31 15:50:31', '2018-07-31 15:50:31'),
