(9509, 1279, 1733, 'Jobs in USA', 'Established Phoenix Agency is currently seeking a full time Digital Marketing/Social Media Content Creator. $35K+ DOE. Other awesome perks include: Full benefits, paid holidays, paid time off, casual work attire and environment!The right candidate will have experience working with - and be extremely fluent with - a variety of web/software applications, possess superior analytical ability, and have a passion for the latest innovations and trends in digital and mobile capabilities/solutions.THIS IS AN IN OFFICE POSITION ONLY OPEN TO LOCAL CANDIDATES.Responsibilities:SOCIAL MEDIA:- Execution of social media activities (i.e. tweeting, sharing, engaging, liking, increasing social reach, etc) for various clients- Oversees social media content with the goal to authentically connect and engage with the customer and community, grow the member base, and support brand initiatives- Maintains the social media editorial calendar, plan social media activities to drive engagement and collaborate with a wide variety of stakeholdersSEO:- Prepares and delivers all reports to clients, assembles all data and compiles all materials for monthly review- Facilitates process and schedule for copywriting team, editing, review, and publication. Tracks and reports at each stageSkills Required:- 1+ years of experience creating content for different social media outlets- Demonstrated first-hand experience using social media platforms such as Facebook, YouTube, Twitter, Instagram and Pinterest for business use representing an organization or brand- Strong project management including scheduling and setting deadlines- Experience with social media management and analytics tools- Self-learner, very adept and natural at acclimating to all software and web/mobile apps- Excellent time management skills and ability to multi-task- Excellent communication skills (written and oral)- Impeccable attention to detail- Proficiency in Microsoft Office and ability to quickly learn new software- Team player and cre', 1230, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Vuria-Creative-Technology/jobs/Social-Media-Content-Creator-Digital-Marketing-5c24f4c8a7171377?vjs=3', '2018-07-31 15:50:31', '2018-07-31 15:50:31'),
(9510, 1280, 1734, 'Jobs in USA', 'This is your opportunity to join a team of thought leaders working at the mission level to make a difference in people’s lives. Through our research and program development, we create leading-edge solutions to overcoming major obstacles in learning and wellness.Our company culture is highly collaborative. You will have the opportunity to engage at the highest level of creative problem solving. We live by our founding theory that everyone has strengths and we cultivate a team with diverse ways of taking action. Success requires everyone on the team committing a high level of effort.You will have the benefit of working with the world’s leading expert on predicting human behaviors to elevate your communication, efficiency and problem solving. In return you are expected to bring passion, purpose and persuasive ideas. You must be open to direct feedback about how you can improve your work.In our small team environment, everyone contributes in various ways. You will need to be able to switch tasks quickly, often without advanced notice.At any given time, you may be writing, editing or publishing articles, blogs or social media content which will have a profound impact on humankind. At other times, you may be assisting with preparation for retreats and seminars or quality checking our online applications.If you are a tech savvy, skilled writer who is looking to be a part of groundbreaking research on human nature, this is the job for you.Key ResponsibilitiesClearly and effectively communicate highly complex information to a wide range of internal and external audiencesEdit and post research articles and other content to our websiteWrite content for customer support, marketing, branding and researchCreate and distribute a monthly newsletter than engages our clients and subscribersSupport customers on the phone and via emailDevelop and sustain systems for office technologyRecord, edit and post podcastsPerform other duties as assignedRequirementsBachelor’s degree in related f', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Dynamynd,-Inc./jobs/Social-Media-Digital-Content-Writer-0c5fc51529be5327?vjs=3', '2018-07-31 15:50:31', '2018-07-31 15:50:31'),
(9511, 1281, 1735, 'Jobs in USA', 'DEPARTMENT OF REVENUE\nThe Department of Revenue’s mission is serving taxpayers.\nOur vision is funding Arizona’s future through excellence in innovation, customer service and continuous improvement.\nVisit our website at www.azdor.gov\nDIGITAL MEDIA COORDINATOR\nSupport\n WE ENCOURAGE YOU TO APPLY TODAY!!\nAll Arizona state employees operate within the Arizona Management System (AMS), an intentional, results-driven approach for doing the work of state government whereby every employee reflects on performance, reduces waste, and commits to continuous improvement with sustainable progress. Through AMS, every state employee seeks to understand customer needs, identify problems, improve processes, and measure results. State employees are highly engaged, collaborative and embrace a culture of public service.\nIf you have a passion for continuous improvement and making a difference in the State of Arizona, we encourage you to apply today!\nApply By: Position Will Remain Open Until Business Needs are Met.\nJOB SUMMARY\nWe are seeking a Digital Media Coordinator who will be responsible for the development and maintenance of ADOR’s website content, blogs, social media campaigns, electronic newsletters, and other digitally produced material. In collaboration with other ADOR Communications staff, program personnel and technology support staff, the Digital Media Coordinator will help develop strategies for communicating information in memorable, visually compelling ways. The Digital Media Coordinator will identify target audiences and figure out the best ways to present information to these audiences to maintain online presence and to implement innovative medial campaigns.\nExample of the duties and requirements include:\nDevelop, write and edit Web pages using computer script languages such as Hypertext markup.\nRedesign ADOR’s internal website, which includes coding, editing and maintaining new and existing web pages.\nCoordinate and manage overall visual look and improvements of website, ', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=dc16723e59b49c2e&from=serp&vjs=3', '2018-07-31 15:50:31', '2018-07-31 15:50:31'),
(9512, 1282, 1736, 'Jobs in USA', 'DigitalWire360 is looking for a digital specialist. Successful candidates will have experience with Adwords, Facebook advertising, Social media experience, on-page and off-page SEO skills, experience with Google Analytics and Search Console.JOB SUMMARYThis role will oversee and perform activities such as content strategy, link building and keyword strategy to increase rankings on all major search networks. You will also manage all SEM campaigns on Google, Yahoo, Bing, and Facebook Ad Platform in order to maximize ROI. Automotive experience is a plus.Managing the execution of on-page and off-page SEO, PPC campaigns, Email Marketing, digital and social media campaigns.Set up, manage and optimize PPC campaigns on Google AdWords/Bing/YahooSet up, manage and optimize Facebook PPC tacticsUse Google Analytics, Search Console and other tools to evaluate the effectiveness of search campaignsManages the budgets of multiple PPC accounts to maintain consistent spend and web trafficPerforming ongoing analysis and reporting followed by optimization of all online marketing campaigns.Assists in keyword research for SEO of new websites and landing pagesWork alongside the web developers to improve conversions and reduce bounce rates of PPC campaignsWeekly/Monthly reportingTrack, analyze, and prepares reports on performance initiative for PPC client campaignsProvide recommendations for budget and display ad changes based on analysisJob Type: Full-timeSalary: $40,000.00 to $50,000.00 /yearExperience:Digital Marketing: 2 years', 443, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/DigitalWire360/jobs/Digital-Strategist-d5afe07c469262e3?vjs=3', '2018-07-31 15:50:31', '2018-07-31 15:50:31'),
(9513, 1283, 1735, 'Jobs in USA', 'THIS JOB IS LOCATED IN LAS VEGAS, NV. RELOCATION IS REQUIRED.VapeNW is looking for a marketing professional to lead our marketing efforts. This role will consult and provide cross functional departments to achieve project goals. We are looking for someone who understands Brand Integrity and marketing best practices.Responsibilities and Duties:Maintain strategic level knowledge of best practices and strategies in social media and paid social media.Maintain strategic level knowledge of the digital ecosystem (search, social, native, display) and how channels work together.Assist in development of social media strategy and building social media plans (including audience targeting, segmentation, message, budgeting, etc.)Execute strategy with cross-functional teams.Command a thorough understanding of business goals and marketing KPIs.Develop and manage execution of campaign plans.Actively manage social media campaigns and goals (engagement, acquisitions, and direct response).Analyze performance data and provide interpretation and conclusions.Monitor activity on the company’s branded social media platforms (brand integrity, response, re-direction, escalation, etc.)Actively contribute to social media risk management, proactively identifying and implementing strategies to avoid and/or mitigate crisis.Supervise brand content.Incorporate SEO best practices across the company’s branded social media platforms.Manage external marketing partners such as advertising agencies, digital marketing firms, and any other relevant 3rd party vendors.Desired Qualifications:Bachelor’s degree in Marketing or related field.5 or more years of experience in progressive roles in the field of marketing.Minimum 2 years of experience in paid social, display advertising, online marketing, and/or mobile marketing.A proven track record in retention marketing in a direct-to-consumer business.Customer-centric mindset.SEM/SEM experience.All applicants applying for VapeNW openings must be authorized to work', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/VapeNW/jobs/Digital-Acquisition-Social-Media-Manager-25d995ab11fe42ea?vjs=3', '2018-07-31 15:50:31', '2018-07-31 15:50:31'),
(9514, 1284, 1737, 'Jobs in USA', 'CLi Digital Mediais a creative digital studio with services including website design and development, reputation management, corporate branding, marketing and advertising.The CLi Account Management team is looking for a self-motivated, proactive, detail oriented and “kick ass” Social Media Coordinator! You will manage different projects and tasks for our Account Management team. The ultimate goal of this role is to maximize our teams effectiveness and productivity and assist with whatever required to keep them moving forward.Are you are an innovative “out of the box thinker”, who has a “whatever it takes attitude”, and likes to get stuff done? Here’s what you’ll need to know.Responsibilities: Manage assigned projects and tasks. A few examples are listed below:Social Media set up and maintenancePull and assemble a quarterly reportPublish press releases and blogsSocial media updatesComplete tasks by the due dates assignedSkills and Experience: Knowledge and experience with MS Office SuiteFamiliarity with Google docs, Google calendar and DropboxPrevious experience working in sync with multiple administrators is preferredAbility to work through repetitionA creative eye is a bonusAbout You: You demonstrate expert ability to proactively prioritize, plan, schedule and organize multiple projects simultaneously according to the importance of project or tasks assigned, all with meticulous attention to detailYou demonstrate an expert level understanding of correct grammar and communicationYou have a high level of integrity, authenticity and a genuine desire to help peopleYou are humble, have a high level of interpersonal skills and have a professional demeanorJob Type: Full-timeExperience:Creative Writing: 1 yearOrganizational Skills: 1 yearCommunications: 1 yearTeamwork: 1 yearWritten Communication: 1 yearDigital Media: 1 year', 806, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '