(9515, 1285, 1738, 'Jobs in USA', 'CLi Digital Mediais a creative digital studio with services including website design and development, reputation management, corporate branding, marketing and advertising.CLi Account manager to oversee the online presence and customer experience for an assigned set of clients. Day-to-day involvement with these clients requires developing and maintaining long-term relationships, developing and executing content strategies to meet client audience goals, and monitoring and maintain a positive online reputation. The Account Manager works closely with the client as well as the internal fulfillment teams to ensure that the clients requests and account needs are addressed in a timely manner.Responsibilities of an Account Manager include: #1 point of contact for the client and internal fulfillment teamBuild and maintain solid, trusting relationships for long-term successful client relationshipsMonthly progression/strategy calls with clientManage client content strategy and editorial calendarFacilitate or delegate incoming client requests and escalationsAbility to diffuse issues with solutions in a quick mannerSkills of an Account Manager include: Excellent written and verbal communication skills with internal and external teamsPrioritization and organization skillsCreativityAccountabilityQuality ControlSense of urgencyJob Type: Full-timeExperience:Organizational Skills: 1 yearCreative Writing: 1 yearSocial Media Marketing: 1 yearCommunications: 1 yearWritten Communication: 1 yearEducation:High schoolLocation:Scottsdale, AZ 85251', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Cli-Digital/jobs/Social-Media-Account-Manager-5c8bc2d8521b8bb6?vjs=3', '2018-07-31 15:50:31', '2018-07-31 15:50:31'),
(9516, 1286, 1739, 'Jobs in USA', 'Job Posting Title: Sr. Digital Media SpecialistJob Description:\n\nThe Sr. Digital Media Specialist will own and execute display marketing and retargeting across programmatic and social channels for Clearlink\'s web sites and brand partners. In this role you will manage direct response digital media campaigns and tactics. Your goals will include lead generation, retargeting, tactical optimization, new channel and platform development, and strategic media planning for multiple branded sites. Tasks will include managing advertising budgets, requesting creative, generating tags, executing campaign tactics, tracking performance, and reporting on key program metrics. Your efforts will drive incremental growth for our business and align with our cross-channel customer efforts.\n\nThe Sr. Digital Media Specialist reports into the Director of Digital Media Channels. This role works closely with web marketing teams and partner strategists over each of our brand partner relationships. We\'re looking for a natural problem-solver that is data-driven with strong analytical skills. You have that rare combination of technical ability and exceptional communication and would be just as comfortable manipulating data in Excel as you would be establishing a new relationship with a marketing partner, client or vendor.\nCore KPI\'s include:Traffic to sites or mobile click to call ads resulting in calls and orders\nLead generation that results in orders\nROAS and profit margin\nEngagement (shares, likes, comments, favorites, etc.)\nQualifications:BS in Business or a related field\n2-5 years display and paid social experience in a B2C environment\nExperience managing marketing programs that are held to a specific profit margin, KPI\'s and ROAS goals\nKnowledge of digital media management methods and best practices\nExperience working with a DSP (e.g. Amobee, The Trade Desk)\nResults-driven mindset with ability to test, measure, optimize and drive net success\nAbility to handle multiple projects simultaneousl', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=e39765938b53c8c8&tk=1cjnofrs218654kf&from=serp&alid=3&advn=5184795356218513', '2018-07-31 15:50:31', '2018-07-31 15:50:31'),
