(9519, 1289, 1742, 'Jobs in Oman', 'The Marketing Manager role will involve:\nDevelopment and implementation of the Brand strategy\nDeveloping the marketing strategy for new and existing products\nImplementation of the Marketing strategy - including campaigns, events, digital marketing, and PR.\nWorking closely with the company’s Sales team; enabling them to meet their commercial objectives by providing them with appropriate tools, materials and presentations\nGuiding the day to day activities of the marketing team.\nEnsuring that the marketing objectives are implemented by the marketing team.\nWork closely with product management team to define marketing materials and programs.\nDevelop and Manage Website and social media presence and direct programs to improve social media reputation and recognition.\nDeveloping and delivering marketing and communications strategies for the organisation.\nUndertake continuous analysis of competitive environment and consumer trends\nPlan marketing and branding objectives.\nExpand product solutions and offerings.\nPrepare marketing strategies alongside other company executives and staff.\nAnalyze market trends and recommend changes to marketing and business development strategies based on analysis and feedback.\nPrepare and adhere to budgets.\nOversee creation and delivery of press releases, advertisements, and other marketing materials.\nDesign print ads and publications.\nEnsure brand messages are consistent.\nGather and analyze customer insight.\nNurture and enrich all external perceptions of the company and growth of market share.\nEngage consumers on social media.\nDeepen relationships with all media to ensure the most effective messaging and positioning of the organization.\nLead all areas of content generation and production across all media platforms.\nTake calculated risks based on data-driven analytics.\nDrive overall CRM and direct marketing.\nEngage other organizations within the community.\nCollaborate with sales and sourcing to develop strategic partnership activities and implemen', 1233, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=db466f4c6bd79faf&from=serp&vjs=3', '2018-07-31 15:50:31', '2018-07-31 15:50:31'),
(9520, 1290, 1149, 'Jobs in Oman', 'We are looking for a Manager of Performance Management to join a well established Service Provider in Oman. The successful candidate will have a minimum of 10 years experience with a reputed Company with exposure in Sustainability Reporting, Brand Communications and Digital Marketing, IT Policy, Procurement and Project Management. The Role Holder must have Post Graduate degree with excellent communication skills, preferably with a degree/diploma in Finance.\nThe salary on offer is 1,500 Omani Rial per month plus accommodation, food, laundry, company vehicle, annual return flight, medical cover and life cover.\nThe RoleCompany focal point for Sustainability Reporting; liaise with EY for creation of yearly sustainability reports as per GRI guidelines.Collate data from multiple sources within the Company; review and rationalise data charts; provide inputs for infographics, data diagrams, case studies, etc.Scrutinise and review the final copy content of the report in line with Corporate brand messaging.Coordinate with Advertising agencies in tandem with EY to conceptualise, develop and finalise all artwork for the report, including the final print layout.Work with the Advertising Agency to conceptualise, develop and finalise the e-version of the report in a microsite and upload with same within given timeline.Interact on behalf of the Company with GRI team to get the draft report GRI approved and procure the stamp of authentication from GRI.In-house Focal point for all mass media campaigns, advertisement artworks, brand communications; interact regularly with Advertising agencies to develop, co-create and manage brand based campaigns.Develop, conceptualise, manage and monitor Company`s digital marketing strategy across all social media forums.Company focal point for monitoring Ad agency KPIs.Interact with various advertising agencies and publication houses to create related artworks for Company advertisement campaigns.Web asset Management: Liaise with IT Team & Advertisin', 921, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=8fc64fc94eb67647&from=serp&vjs=3', '2018-07-31 15:50:31', '2018-07-31 15:50:31'),
