(9522, 1292, 1745, 'Jobs in Oman', 'SENIOR EXECUTIVE / EXECUTIVE (MARKETING)\nJob: To support the Divisional heads in all areas of Product / Brand management, planning & implementation of marketing strategies in a highly competitive and dynamic business environment. The incumbent should also involve in organizing customer meets and events, implement aggressive promotional strategies to achieve business objectives. Exploring business opportunities with wide market coverage / innovative marketing initiatives and building customer rapport will also form part of the responsibility.\n\nThe job will also involve ATL / BTL activities – Advertising & Sales promotion, Media planning, Market Research, Digital Marketing, Planning & Execution of Campaigns, Product launches, Event Management, Road Shows, Analysis of market trends, MIS etc.\nQualification: Engineers / Graduates in any discipline preferably with Management qualification.\nAge: Around 28 - 30 years\nExperience: 4 - 8 years of relevant experience in marketing functions in reputed organizations from the automobile industry. Proven track record and strong analytical & communication skills are essential. Candidates working with reputed Automobile manufacturers will be preferred.', 1236, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=5ceb4d4798653a29&from=serp&vjs=3', '2018-07-31 15:50:31', '2018-07-31 15:50:31'),
