(9526, 1296, 1748, 'Jobs in KSA', 'Looking for enthusiastic and experienced professionals who can ensure the following outcomes from every client deployment. 3-5 years of experience in digital and social account management at a brand or agency, or client management experience. Bilingual speaker with excellent written and verbal communication skills. Demonstrated experience and a passion for the social media universe (i.e., Facebook, Twitter, YouTube, Instagram, G+, LinkedIn, Snapchat, etc.). Experience in managing social media accounts, content creation, community management, reporting, campaigns, SEO & SEM is a plus\nLooking for enthusiastic and experienced professionals who can ensure the following outcomes from every client deployment:\nMaximum usage of the platform mapped to business needs.\nEnsure client renewals and continued adoption of new products and services.\nEstablishes a relationship built on trust with every new partner, client champion, and stakeholder.\nWhat Are Your Responsibilities\nEnsure that every client derives the most value possible from the platform.\nAct as day-to-day contact for stakeholders and system administrators.\nProvide subject matter expertise on social business practices.\nWork alongside our internal Sprinklr business development teams and development teams to foster new opportunities within existing business.\nWho You Are & What Makes You Qualified\n3-5 years of experience in digital and social account management at a brand or agency, or client management experience\nBilingual speaker with excellent written and verbal communication skills\nAbility to work independently and as a member of a team\nDemonstrated experience and a passion for the social media universe (i.e., Facebook, Twitter, YouTube, Instagram, G+, LinkedIn, Snapchat, etc.)\nExperience in managing social media accounts, content creation, community management, reporting, campaigns, SEO & SEM is a plus', 1239, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL