(9527, 1297, 1749, 'Jobs in KSA', 'Develop and oversee the digital marketing strategy for the company\nPlan and execute all digital marketing activities, including SEO/SEM, marketing database, email, social media and display advertising campaigns\nManaging online brand and product campaigns to raise brand awareness\nManage the company’s website and ensure optimum user experience\nDesign, build and maintain our social media presence utilizing all available tools, including Social Media content, Always-on marketing, Fan acquisition ads, engagement tactics and others\nMeasure and report performance of all digital marketing KPIs such as website visits, Social Media followers, lead generation metrics, marketing campaigns ROI and others\nManage and optimize lead generation plan and ensure delivering on KPIs while providing periodic reports\nDevelop and launch marketing campaigns created specifically for the digital channels Responsibility for planning and budgetary control of the digital marketing functionIdentify trends and insights, and optimize spend and performance based on the insights\nBrainstorm new and creative growth strategies\nPlan, execute, and measure experiments and conversion tests\nCollaborate with internal teams to create landing pages for specific campaigns and initiatives\nUtilize strong analytical ability to evaluate end-to-end customer experience across multiple channels and customer touch points\nManage the Digital Marketing agency and collaborate with other agencies and other vendor partners once required\nEvaluate emerging technologies. Provide thought leadership and perspective for adoption where appropriateQualifications\nBachelor degree in Marketing\n2 years of experience in Digital Marketing\n\n#External\nJob Sales & Marketing\nPrimary LocationSA-Saudi Arabia-Jeddah\nOrganization Bldg Technologies & Solutions\nOvertime Status-Non-exempt', 1240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,