(9528, 1298, 1304, 'Jobs in KSA', 'The role requires a basic understanding of digital principles, how marketing campaigns work cross market, plus an analytical aptitude. It requires the ability to be highly motivated, numerate and articulate, both when speaking to clients, writing documents and analysing results.\nThe Digital Executive is responsible for producing media schedules based on the communications brief, ensuring that the process is accurate and efficient. Working with the Planner/Manager, the Executive will help to develop the media plan, maximise value for clients and ensure activity is optimized.\nEnsuring the delivery of all campaigns with timely optimisations to deliver against the client objectives.\nFull post analysis of campaigns to report performance, optimisation and value delivery.\nWith the Planner/Manager compiles and regularly presents buys, reports and post analysis to client.\nEnsures all relevant campaign/market updates are communicated.\nBe an expert in digital channels and share expertise with the broader department and agency.\n100% proficiency and accuracy with the financials; budget control, contract management, account queries, etc\nThoroughly checks all pro-formas and provides to the Digital Manager for sign-off prior to invoicing.\nSkills & Experience:\nExcellent project management skills\nStrong attention to detail\nEffective and efficient working style\nAcademically minded, analytical and can translate analysis into everyday consumable language\nAbility to analyse campaign reports to identify required optimisations\nExcellent understanding of all implementation and buying systems\nOrganised and structured.\nCritical analysis of all Survey/market data ensuring informed buying decisions.\nDemonstrates financial and numerical astuteness.\nExcellent presentation skills beginning to sell buying performance to clients.\nAttention to detail with high levels of accuracy.\nCompetent in all Microsoft office software.\nBasic understanding all key mediums and how the marketplace impacts media buys', 1040, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=aeac71d8a46a8334&from=serp&vjs=3', '2018-07-31 15:50:31', '2018-07-31 15:50:31');
