s proprietary media to clients.\nTo support the Mana', 1244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=2d6717e93c441c17&from=serp&vjs=3', '2018-07-31 15:50:34', '2018-07-31 15:50:34'),
(9535, 1305, 1754, 'Jobs in UAE', 'Would you like to work for a leading global media organisation? Do you have experience in digital production? If so, we’d love to hear from you. We are currently recruiting a Digital Producer to join the Digital/Marketing team in Dubai.\nIn Europe, Middle East and Africa, Turner currently broadcasts 69 channels in 20 languages to 125 countries. It is headquartered in London and operates local offices across the region. The brand portfolio includes EMEA’s number one international news brand CNN International as well as Turner’s leading kids brands, Cartoon Network – home of global hit animation series such as The Amazing World of Gumball and Boomerang, featuring timeless classics such as Scooby-Doo, Tom & Jerry and Looney Tunes.\nThe digital producer will handle daily tasks for maintaining the brand’s digital presence across website(s), social accounts and digital products (games/apps, microsites, etc.).Key duties and responsibilities include:\nEditing/producing digital content such as text, graphics, video and, as relevant to each platform and corresponding brand\nProviding daily support and maintenance for social media accounts and websites\nCurating content from relevant sources (i.e. creative team, programming team, central team, etc.)\nWorking with the team on monthly plans and on developing digital content ideas\nPerforming quality check for games and apps produced in Arabic\nProofreading and copywriting Arabic scripts, SEOs, and social posts\nKnowledge and experience requiredEssential:\nProficiency in Adobe Suite,\nProficiency in Microsoft Office, particularly PowerPoint & Excel\nKnowledge of digital platforms\nFluency in Arabic\nVideo Editing experience\nDesirable:\nWorking knowledge of digital measurement/analytics tools\nExperience working with CMS\n Working from our office in Dubai, you will have the opportunity to work for a truly global media company. With global scope and local focus, we’ll find and share stories that matter to our diverse audiences and clients.Less Fear', 1245, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=615bbe5207b30cf5&from=serp&vjs=3', '2018-07-31 15:50:34', '2018-07-31 15:50:34'),
(9536, 1306, 1107, 'Jobs in UAE', 'POSITION DESCRIPTION\n\nTitle: Digital Media Specialist (Online Marketing)\n\nDuration: 6 Months\n\nLocation: Dubai, UAE\n\nStart Date: ASAP\n\nSalaryRange: Up-to AED 7000/Month\n\nMust-Haves: English / Family Visa Or NOC\n\nNote:\nPrefer candidates on father’s/spouse’s dependent visa OR candidates with work permit and NOC from the employer or anyone who doesn’t require visa sponsorship.Qualifications:\n2+years experience in marketing\nAbility to communicate technical information to non-technical personnelTypical Duties and Responsibilities:\nDirect marketing\nWork with the IT department/agency in support of their digital media\nDevelop and grant proposals that support digital media endeavors\nPerform outreach with active community involvement of social media projects\nWork with local business groups to help develop our digital media objectives\nPerform related duties as assigned.\nEstablish an Internet presence for public relations campaigns\nDevelop and maintain relationships with reporters, community members, consumers, and government officials, as well as anyone else who will spread the word about the company’s product/service\na lot of their work online, using technology like websites, webcasts, blogs, and podcasts, social media to spread the message of their clients/Event organizers.\nAdvertisements', 902, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=931c6bb96bd8cd99&from=serp&vjs=3', '2018-07-31 15:50:34', '2018-07-31 15:50:34'),
(9537, 1307, 1754, 'Jobs in UAE', 'As a Product Manager you will be a member of the world class CNN Digital Product Team which is responsible for creating industry-leading digital products enjoyed by millions of consumers across the globe. The Product Manager, CNN Arabic will manage the development of new and existing local products that exceeds and anticipates the needs of consumers while contributing to the achievement of CNN Worldwide business goals. This is a multi-disciplined, cross-functional role, where you will collaborate with key stakeholders to lead the product vision, strategy, roadmap, and delivery of products and experiences across web, mobile, video and social.\nThe ideal candidate will have some prior experience in building consumer-facing, multi-platform, multi-media digital products. They should also be able to articulate product ideas through story-boarding and have excellent communication skills.What you’ll be doing:\nHolding responsibility for delivering products in a successful manner on time and on budget.\nActing as the main technical strategy person between editorial, commercial and other stakeholders\nDeveloping strategies for effective data analysis and reporting and helping all the stakeholders track their KPIs and success metrics.\nProviding business insights and data trends to help all stakeholders identify areas of growth or weakness for each team (Editorial and Advertisement).\nServing as a key link between Sales, Ads, Editorial and business operations.\nDeveloping partner relationships with 3rd party content platforms, content providers and advertisement networks.\nTracking the Digital Media landscape and identifying new opportunities, risks and areas of growth.\nHelping to develop content strategy with the editorial team and other stakeholders such as the sales team.\nPerforming data-driven prioritization of features and identifying improvements to the product user experience.\nUnderstanding the software development lifecycle, development methodologies and release management.\nW', 1245, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/rc/clk?jk=a88e3e52535ec6a1&fccid=92b6ad9b1bd886b6&vjs=3', '2018-07-31 15:50:34', '2018-07-31 15:50:34'),
(9538, 1308, 1755, 'Jobs in UAE', 'The Digital Platform Co-ordinator needs to be a focal point in handling a vital mobile application platform for one of our clients.Key responsibilities:\nThe person should be responsible for presenting a business engagement platform (mobile app) + web based to stakeholders, take feedback from them for constant improvement. Should be able to administer and moderate user posted contents. The person should be the connecting link between client\'s office and our office team to ensure services are up to satisfaction of all.\nRequirements (Qualifications/Experience/Competencies)\nBachelor\'s degree in Computer Science, Information Technology, Math, or relevant field. Should be a techno-commercial, Internet friendly person with active social media presence and good communication skills. The person should be an Arabic speaker with very good command over the English language.\nSpeaking skills, pleasant approach, html and mobile app friendliness, general awareness and inquisitiveness to changes in business ecosystem of Dubai are needed.', 1246, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=7140ac45c5df37c8&from=serp&vjs=3', '2018-07-31 15:50:34', '2018-07-31 15:50:34'),
(9539, 1309, 1756, 'Jobs in UAE', 'Ericsson truly believes that a successful business can only be built on successful people and enables us to transform our business within a rapidly changing technological arena, through vision and diversity.\nEricsson attracts and develops high performing, competent and motivated individuals, by building on everyone\'s competence and ambition to succeed. We offer an exciting, diverse and challenging environment for this.\nOur upcoming graduate program for minimum 6 months based out in Dubai will begin in August 2018 and we are looking for smart and innovative graduate to join.\nIs this you?\nGraduate of the year 2017 or 2018 with one of the following degrees:\nYou are still studying or have just completed your University degree in Business, Marketing, Communications or equivalent training/experience\nResponsibilities & Tasks\nSupport in designing creatives\nProduce and ensure brand consistency in MA videos, infographics and alike digital tools…\nCreate content for digital (i.e. dotcom, blogs, email marketing…) and social media channels\nSupport in managing MA digital and social media channels\nEnsure news flow adaptation to SM and digital channels and accordingly adapt and activate the content\nSupport in the development of concept and content creation of digital experiences and events\nAssist in collecting and reporting digital performance metrics for stable evaluation methods, possibilities for analytics and automation marketing\nCoordinate with the digital and social media agencies\nWrite, test, and optimize landing pages for search engine marketing -both paid and organic.\nManage PPC (pay per click) and other digital advertising initiatives\nCore Competences\nCommunication knowledge & skills for professionals\nMarketing knowledge & skills\nDigital Communications skills\nAnalytical Skills\nProject Management skills\nCampaign Management\nConceptualization\nContent Marketing\nInnovative Spirit\nDigital Lifestyle\nPresentation & English skills (spoken and written)\nBehavioral Competences:\nAlways', 1247, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=dc255f8ae189f73c&from=serp&vjs=3', '2018-07-31 15:50:34', '2018-07-31 15:50:34'),
