y questions the status quo and analyses data to create ', 1250, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=78fec06f07e59d5c&from=serp&vjs=3', '2018-07-31 15:50:34', '2018-07-31 15:50:34'),
(9542, 1312, 1760, 'Jobs in Qatar', 'Carnegie Mellon University is a private, global research university that stands among the world’s most renowned education institutions. With ground-breaking brain science, path-breaking performances, creative start-ups, big data, big dreams, hands-on learning, and a whole lot of robots, we don\'t just imagine the future, we invent it. If you’re passionate about joining a dynamic community that challenges the curious to deliver work that matters, your journey starts here.\nThe Student Affairs group at our Doha campus is seeking an International Student Services Coordinator. In this role, you will deliver services addressing the needs of international students. This involves the coordination of the immigration and visa process for incoming/returning international students, and the administration of student campus exchange and study abroad programs. You will be responsible for delivering administrative and support services to international students as well as to those passionate about the global study options.\nThis includes but is not limited to tasks such as:\nMaintaining accurate electronic and paper/file records\nBuilding reports on campus exchange enrollment\nManaging budget for campus exchange and delivering accurate and timely information about the application process\nPresenting at pre-departure and informational programs workshops about the campus exchange process and deadlines\nLiaising with the enrollment services and financial aid manager, and the administrator for academic programs to support global study initiatives\nCoordinating marketing and outreach efforts of the office as it relates to campus exchange and study abroad options\nYour primary responsibilities will include:\nAdvising students on global study opportunities and building awareness of campus exchange and global study options\nFostering an intentional, positive, student centered experience and providing timely communication to students through email and phone\nAdvising students on issues related to housin', 1251, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=0d6aecc2a5701ba3&from=serp&vjs=3', '2018-07-31 15:50:34', '2018-07-31 15:50:34'),
