under pressure and to efficiently deal with multi', 1252, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=4ff4e37855f8555b&from=serp&vjs=3', '2018-07-31 15:50:34', '2018-07-31 15:50:34'),
(9544, 1314, 1762, 'Jobs in Qatar', 'Mandatory Skills:\nBSS Billing\nDesirable Skills:\nBanking - Mobile and Digital Channels, eTOM - Enhanced Telecom Operations Map\nJob Description:\nResponsible for IT Architecture work as End-to-End Digital Full Stack Solution Architect as a EA Team member and as member of Program/Project Organization to address Technology demands as they relate to IT systems related to Digital Transformation. Main focus area shall be to work in BSS Digital Domain i.e. Omni-Channel Front-End and Back-End.\nAct as End-to-End IT Solution Architect and member of Design Authority for Digitalization and Digital Transformation Initiatives in regards to Omni-Channel Front-End and Back-End Solution Architecture and Design.\nMinimum Experience and Essential Knowledge\nMin 10 years experience in IT with majority of the work in Digital Transformation & Digitalization area as Solution Architect with significant skills in IT Applications / Digital BSS Applications. Should have good expereince in Digital Billing, Convergence, rating, Market Place, BOT based integration, Social Media platform integration. Also having OSS/BSS knowledge in depth is must. In depth knowledge in eTOM Framework is expected.\nResults and Delivery oriented mind set with proven track record on providing technical leadership and delivering complex technology digital transformation initiatives as an End-to-End Solution Architect\nProficiency in English Language is DesirableRoles & Responsibilities:\nMinimum Experience Required:\nMandatory Skills: BSS Billing Big DataDesirable Skills: Banking - Mobile and Digital Channels, eTOM - Enhanced Telecom Operations MapLanguage Skills: English Language', 1253, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=1441cbc9e4c16fe6&from=serp&vjs=3', '2018-07-31 15:50:34', '2018-07-31 15:50:34'),
