(9547, 1317, 1766, 'Jobs in Qatar', 'Digital Content Executive\nAttractive salary and Benefits\nMondrian Doha, opening in late 2016, brings the up-all-night intensity, energy and Sunset Strip vibe of the original Hollywood Mondrian to the West Bay Lagoon neighborhood of Doha, capital city of Qatar.\nMondrian Doha will buzz with the instant gratification, the perfect provocative moment, perpetual possibility and confident cool that Mondrian is known for worldwide. Mondrian’s famous lobby scene, the soul of the hotel, will recreate the see-and-be-seen vibe of the original and will be the place to meet for a cocktail and intense mingling.This is an Exciting opportunity to join our pre opening Team at Doha. Mondrian Doha will be Morgans Hotel first Hotel in the Middle East, with more in the pipeline. We are a luxury lifestyle brand, and we are looking for a dynamic, experienced, enthusiastic and energetic professional.\nJob Purpose:\nUnder the general guidance of the Marketing & PR Manager, the Digital Content Executive will be responsible for supporting the digital marketing initiatives and online presence of Mondrian Doha. Core responsibilities will include media placement and trafficking, website updates, analytics, social sites and external site updates and content.\nDuties & Functions:\nSupport content management/updates/submissions across MHG websites including Mondrian Doha\' webpage, intranet, corporate micro-sites etc. Includes monitoring and reporting\nOwns the Digital request process by creating one off landing pages, updating and testing special offers on mhg.com and making brand updates as requested\nTraffic and place all digital display media including ad buys and retargeting. Conduct testing, analysis and reporting\nManage the traffic, reporting and update of email marketing campaigns and programs\nWork with the Revenue team to create, post, and monitor the performance of promotional rates and packages. These need to be optimized and monitored for social media, review sites, email, display, and search e', 1257, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=de948ea5e42048bf&from=serp&vjs=3', '2018-07-31 15:50:34', '2018-07-31 15:50:34'),
(9548, 1318, 1767, 'Jobs in Qatar', 'Natural Resources are urgently seeking on behalf of their client a COMMUNICATIONS OFFICER who will be based in Qatar on a long term residential position and will be responsible for ensuring that privatized companies are able to fully discharge their external communications disclosure obligations to shareholders investors and government regulatory authorities and maintain an adequate public presence in printed and digital media discharge their legal obligations with regards events and publications and fulfil the corporate social responsibility mandates given by their respective Boards of Directors. Handle all media related activities for privatized companies and ensure that the websites are updated in a timely manner. Note Experience with an International Oil Company or reputable National Oil Companymajor Auditing Firms is preferredDutiesPerform the PR function to the Privatized Companies and act as the primary contact between the privatized companies and the press newspapers and Group companies PR departments.Conducts the entire events management preparations for general assembly meetings exhibitions conferences sponsorship activities corporate social responsibility branding media newspaper advertisements interviews and other adhoc events of privatized companies.Prepares corporate social responsibility initiatives and media communications plan for privatized companies to ensure that the companies maintain the desired level of public profile and fulfill their social mandates.Ensures the privatized companies corporate brands and public profiles are consistent with the social mandate as envisaged by the Boards of Directors by preparing reviewing andor endorsing all public material external communications website updates and events including that of group companies and third parties.Preparing all public material external communications annual reports website updates and events including that of group companies and third parties.Conduct entire events management preparati', 1258, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=4629b9db1a694f79&from=serp&vjs=3', '2018-07-31 15:50:34', '2018-07-31 15:50:34'),
