th coverage.Displaying comprehensive knowl', 995, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=ea6b16504d900a5f&from=serp&vjs=3', '2018-07-31 15:50:34', '2018-07-31 15:50:34'),
