(9551, 1320, 1240, 'Jobs in USA', 'The driver will be responsible for picking up students at their homes and bringing them to school in the mornings by 7:45 A.M. In the afternoons, the driver will be responsible for picking students up at school at 2:00 and transporting them to their homes. The applicant must have a current Fingerprint Clearance Card and appropriate driver\'s license, as well as a clean driving record. A NOVA Behavior Coach will ride the bus also to monitor students\' behaviors.Job Type: Part-timeSalary: $75.00 /dayExperience:driving a passenger van: 1 yearLocation:Phoenix, AZLicense:appropriate drivers license, valid fingerprint clearance car', 461, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Nova-Individualized-Learning-Center/jobs/Private-School-Van-Driver-4d4b56103fab474f?vjs=3', '2018-07-31 21:03:08', '2018-07-31 21:03:08'),
(9552, 1321, 1337, 'Jobs in USA', 'Paramount Recovery Service is Arizona\'s fastest growing Repossession Company. Due to rapid growth, we are looking to expand our team and invite a Camera Car/Scout Car Driver to join our field staff. In this position, you would drive a company owned vehicle equipped with the latest License Plate Recognition Technology. This position would be centrally located in Phoenix, AZ.Qualifications: Clean MVRCurrent Drivers licenseMust be at least 23 years oldAble to pass background check to pass state licensing requirementsIntermediate computer skillsAbility to stay calm under pressure and de-escalate situationsBe self-motivated and have a strong eagerness to work.Must be able to work all shifts including weekends.Training: New hires will receive training with our team of highly experienced staff. Training will consist of camera car operations, computer software, general paperwork, and all applicable laws and regulations.Job Type: Full-timeSalary: $400.00 to $700.00 /weekLicense:Driver\'s License', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Paramount-Recovery-Service/jobs/Driver-fb1f3e44cb7190f1?vjs=3', '2018-07-31 21:03:08', '2018-07-31 21:03:08'),
(9553, 1322, 1239, 'Jobs in USA', 'We are a mobile dental office looking to fill a full-time opening for a Mobile Office Driver/Patient Liaison. Our company operates our 3 mobile offices in Phoenix and surrounding cities. We offer great pay and benefits for the candidate with the right experience and skills.Responsibilities and requirements, including but not limited to:- Ability to physically assist patients when transferring from wheelchair to exam chair.- Interacting with patients, community members, doctors and co-workers in a professional manner.- Timeliness and the ability to be flexible when schedule changes occur.- Willingness to take instruction and be proactive in the care of the mobile office.- Completion of end-of-day duties including; returning mobile office to parking facility, refueling both diesel and gasoline, packaging all instruments to be sterilized, general cleaning inside and outside of the mobile office and inventory of supplies.- Cleaning and maintaining work area to ensure safety- Ability to maintain and repair engines and RVs a plus.Job Specifications:- Self-starter who is able to work with minimal supervision, but not afraid to ask questions- Valid Driver\'s license with a clean MVD driving record required- 3+ years of experience driving large vehicles.- Above average verbal communication, social and interpersonal skills.Please reply with your name, phone number, and email. Also include your resume and any qualifying experience.Job Type: Part-timeExperience:Driving Large Vehicles: 3 yearsLicense:Drivers License', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Mobile-Dentistry-of-Arizona/jobs/Mobile-Office-Driver-Patient-Liaison-80878756a2f932cb?vjs=3', '2018-07-31 21:03:08', '2018-07-31 21:03:08');
