(9554, 1323, 1239, 'Jobs in USA', 'OnTrac Regional Service Provider seeking an experienced delivery driver for package delivery in personal vehicles. Warehouse is based in Phoenix and the delivery regions are Chandler and Gilbert areas. Work days commence at 7am, duration of the day varies based on package count that must be delivered each day. However, we anticipate each day will be roughly 8-10 hours long. The ideal candidate will be flexible when longer days are required. We deliver Monday through Friday and seeking applicants should also be available to work a Saturday shift on occasion.Drivers will be hired as independent contractors, weekdays will be paid $1.85 per stop delivered. Routes will have an estimate of 60-150 stops per day.We are seeking someone who is highly dependable. Individuals should be willing to work hard as this is a physically demanding job, be dependable and posses communicate skills.Job Type: ContractSalary: $150.00 to $250.00 /dayExperience:Driving: 5 yearsEducation:High schoolLocation:Phoenix, AZLicense:D ClassRequired work authorization:United States', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Eragon-Express/jobs/Trac-Courier-Driver-7922aca1dfd86bfa?vjs=3', '2018-07-31 21:03:08', '2018-07-31 21:03:08'),
(9555, 1324, 1245, 'Jobs in Oman', 'The Junior IT Field Support Specialist is responsible for installing , maintaining and providing technicalsupport to corporate users .\nKey Accountabilities\nInspect personal computer equipment, install hardware and peripheral components such as monitors,keyboards, printers and disk drivers on user’s premisesInstall and configure specified software packages such as operating systems, business applications and other office toolsInitiate systems and network troubleshooting and monitoring, and replace defective components as neededAttend unit meetings as required by the hierarchy in order to get informed of new policies and other services related issuesPlace support calls to network solution providers and other IT support companies as requested by the hierarchyCommunicate with suppliers as requested in order to get the necessary support regarding Brand Communication interface and filesAssist the IT team in the pre-opening phase of new storesQualifications, Experience, Knowledge\nBachelor\'s Degree or Technical Degree in computer science\n1-2 years of experience in a similar role\nFluency in English\nCompetencies\nCustomer Focus\nAnalytical Thinking\nAttention to details\nCultural Awareness\nCommunication Skills\nDriving and Achieving results\nTeamwork', 991, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=872c7c682e8a14f0&from=serp&vjs=3', '2018-07-31 21:03:08', '2018-07-31 21:03:08'),
(9556, 1325, 1121, 'Jobs in Qatar', 'Posting Date Jun 19, 2018Job Number 18001AUDJob Category Rooms and Guest Services OperationsLocation W Doha, Doha, Qatar VIEW ON MAPBrand W HotelsSchedule Full-timeRelocation? NoPosition Type Non-Management/HourlyStart Your Journey With Us\nBoldly coloring outside the lines of luxury, W turns the traditional notion of the extravagant hotel on its head. Our irreverent attitude and taste for excess redefine revelry for the modern jet set. Our guests have a lust for a life less ordinary that drives them to demand more, experience it all, and hit repeat.\nWe share our guests’ passions, providing insider access to what’s new and what’s next. Moderation is not in our vocabulary and we know that lust for life demands more, not less. W guests soak it in and live each day with a mantra: Detox.Retox.Repeat. If you’re ready to create the energetic W scene that is magnetic to everyday disruptors around the world, then we invite you to explore a career with W Hotels.As a Guest Relations Executive / W Insider it is your main responsibility to bring to life the W core value of ‘Insider’ and activate this key brand differentiator in a way that creates both valuable and memorable experiences for our guests, while ultimately driving loyalty to the brand. It is your further task: to provide a visible and accessible Living Room presence in order to anticipate, understand and act upon the needs and desires of our guests; to create a link between newly discovered guest wishes and the according hotel teams who make the wishes come true; to actively interact with guests to ensure they feel welcome and special; to proactively approach guests to enquire about their experience and discover special preferences; to be the key driver regarding personalizing the guest experiences through WOW moments; to handle any problems and unusual situations brought up by the guests and follow through until resolved; to arrange personalized amenities for our guests based on our Whatever/Whenever philosophy.Foll', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=aa1730201a368748&from=serp&vjs=3', '2018-07-31 21:03:11', '2018-07-31 21:03:11'),
