t. You must enhance your expertise and take oppor', 1013, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=8c6ce2c1106a0669&from=serp&vjs=3', '2018-07-31 21:03:11', '2018-07-31 21:03:11'),
