(9700, 308, 561, 'maidcv.com', '\r\n                            We are looking for a live in Filipina Housemaid/Nanny to join our family.  You will be sharing work and duties with our other Filipino lady.  We have five school aged children and live in Al Barsha. We require someone with good cleaning skills and experience with working with children.  We are looking for someone friendly, happy, trustworthy, energetic and hard working and with a good sense of humour.  Duties will include all household chores and helping to look after children after school and during school holidays.  Job will include accompanying children on family vacations and day trips, to play dates and parties, etc.  Ability to cook would be an advantage.  You should be aged between 25-45 and be fluent in English.  You must have references from previous employers that we can contact.  We provide your own private room/bathroom, shared staff kitchen, 30 days paid leave and ticket home yearly, visa, health insurance, Fridays off.  If you meet the above criteria and are interested please send me a Whatsapp with your details and CV on 0505515358 (no phone calls please) or email rachj@hotmail.com.  Salary will be dependant on skills and experience\r\n                        ', 589, NULL, NULL, NULL, NULL, '3.000', 6, '2.8000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-08-15 19:34:30', '2018-08-15 19:34:30'),
