(9711, 320, 573, 'maidcv.com', '\r\n                            An open minded female (single only) maid and a personal assistant (from Philippines only) needed, \r\n\r\nHer age between (18y to 28y) not older please, \r\n\r\nHas nice good looking, full of energy and positive, clean with a calm and a happy face and personality, \r\n\r\nShe should be tall, thin and fit, height from 155 - 175 only (no short and fat), athletes type are preferred and most welcomed, \r\n\r\nHas a very good English skill speaking, writing and typing, \r\n\r\nWell educated and and good Microsoft office user, \r\n\r\nHas a knowledge on Booking flights and hotel reservations, \r\n\r\nFlexible to travel and to stay with sponsor any time, any place needed, \r\n\r\nFlexible and open minded to attend events, celebrations and parties, \r\n\r\nHas energy to workout with sponsor six days a week (not lazy or a fast food lover), \r\n\r\nknow house cleaning , washing clothes, house hold managing and buying groceries, \r\n\r\nHas a little knowledge or wiling to learn preparing diet healthy food and ready to share a healthy life style food with sponsor, \r\n\r\nFor a very good monthly salary (2500 DH), a cosy room, and 1 day off a week will be provided, to work in a small new 2 bedroom apartment in MBZ (Abu Dhabi) United Arab Emirates, \r\n\r\n2 way Flight ticket will be on sponsor, ( 1 ticket every 2 years to Philippine), with 1 month leave and 1 month salary, \r\n\r\nCandidate Required to start work on 1 july 2018, also candidate need to know their are no early leaving to country, only after completing 2 years on sponsor visa, \r\n\r\n\r\nThe candidate will be tested for a month with a 1 month salary, before transferring her visa to the sponsor sponsorship, to make sure that she fits the job, \r\n\r\nIf interested please send your updted photos and other details with contact info ...by replying to this post: \r\n\r\nPlease don’t contact me for other matters\r\n                        ', 594, NULL, NULL, NULL, NULL, '2.700', 6, '2.5000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-08-15 19:34:30', '2018-08-15 19:34:30'),
