(9737, 1427, 1914, 'Jobs in USA', 'ResponsibilitySchedule appointments for new and recurring patients based on Physician\'s availability.Answering and addressing high volume multi-line telephone calls from hospitals, doctor\'s offices and patients.Preparing patient charts by obtaining referrals and authorization, verifying insurance eligibility, obtaining previous medical records, etc.Collect payments for co-payments, uninsured vivits and oustanding balances.Maintain hard copy patient records as well as the files stored in our EHR.Call patients to remind them of upcoming appointments and to help them schedule testing for off-site services.SkillsBilingual English/ Spanish is a must.High school diploma/GED required (Associate degree preferred).1+ years’ experience preferred.Familiarity with ECW a plus.Ability to handle a fast-paced environment and prioritize tasks based on importance.Excellent communication and problem solving skills.Familiarity with Microsoft Office and desktop publishing software.Job Type: Full-timeExperience:Medical Reception: 1 yearEducation:High school or equivalentLanguage:Spanish', 1312, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Mazhar-Majid-MD/jobs/Front-Desk-a04f88660460d902?vjs=3', '2018-08-15 21:16:06', '2018-08-15 21:16:06'),
(9738, 1428, 1915, 'Jobs in USA', 'Job DescriptionThis busy medical testing laboratory is currently seeking an experienced Lab Assistant for its Boston Lab.The person in this position will perform various tasks to support the laboratory technical staff including: human specimen processing and distributing for clinical laboratory testing, sending out specimens, and the maintenance of quality assurance records.The position is collaborative in nature and requires special care of physical samples, compliance protocols, and safety procedures.Candidates with strong biology backgrounds and new graduates are encouraged to applyPlease submit a resume with cover letter for consideration.Job Type: Full-time, Monday to Friday 8:30 to 5.00 PMApplicant can also call 781-397-7800, and ask for MajidJob Type: Full-timeSalary: $16.00 to $20.00 /hourEducation:High school or equivalent (Required)Work authorization:United States (Required)', 1313, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Medical-Professional-Staffing/jobs/Clinical-Laboratory-Assistant-45c3c73eeb1e3669?vjs=3', '2018-08-15 21:16:06', '2018-08-15 21:16:06'),
(9739, 1429, 1916, 'Jobs in USA', 'Location: Des Plaines and Skokie, IL Category: Adjunct Faculty Posted On: Thu Jul 26 2018 Job Description:Oakton has an opening beginning with the Fall 2018 semester for dual credit Electronics faculty to teach Introduction to Electronics.\nIntroduction to Electronics introduces the electronics curriculum with hands on labs and simulations. Topics range from Ohm\'s Law to semiconductor circuits, and include series and parallel circuits, capacitors, inductors, and magnetics, with a focus on analog and digital circuits.\nPart-time faculty are paid on a lecture hour equivalents (LHE) basis. For most courses, the LHE is the same as a credit hour. For others, the LHE represents additional work for teaching the class, such as grading papers for Composition classes or teaching a class with a laboratory section (computers, languages, and the sciences); in those cases, the LHE represents a figure higher than the credit hour. All part-time faculty start at the beginning pay rates, regardless of the level and type of experience obtained elsewhere. For the 2018-19 academic year rates are $1110/LHE for faculty without doctorates and $1188/LHE for faculty with doctorates. The College has not completed negotiations with the adjunct faculty for a 2018-19 academic year salary schedule.\nPart-time faculty advance one step within the salary schedule with the successful completion of 2 fall & spring semesters where 3+ credit hours are taught in each semester.\nJob Requirements:A Bachelor\'s degree in Electrical Engineering, Electronics Engineering Technology, or a related science or computer technology, and a minimum of one year of electronics work experience are required.\nPrior post-secondary teaching or training experience in a hands on laboratory environment. a Master\'s degree in Electrical Engineering, Electrical Engineering Technology or Computer Technology, and a minimum of 5 years of industrial or technical experience, strong communication and presentation skills are preferred.\nAdditi', 1314, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=7e0e8094a3d01007&from=serp&vjs=3', '2018-08-15 21:16:06', '2018-08-15 21:16:06'),
