(9745, 1435, 322, 'Jobs in KSA', 'أخصائي الجودة مسئول عن تطبيق سياسات واجراءات الجودة المعمول بها في المجموعة، وهو مسؤول أيضا عن تدريب الأفراد على تطبيقها وتحفيزهم على العمل بها، كذلك هو مسؤول عن تطبيق أي إجراءات جديدة للحصول على إحدى شهادات الجودة اللازمة.\nSkills\nمعرفة عالية بمتطلبات إدارة الجودة الشاملة.\n2. معرفة عالية بمتطلبات الحصول على شهادات الجودة المحلية والعالمية مثل ISO, HACCP.\n3. قدرات عالية في إعداد إجراءات متطلبات الجودة والنماذج الخاصة بها.\n4. قدرات عالية في الرقابة على تطبيق إجراءات الجودة.\n5. مهارات جيدة في استخدام الحاسوب.\n6. إتقان اللغة الانجليزية.\n7. يفضل ان يكون لديه تخصص صحي\nكذلك يفضل ان يمتلك:-\n1. مهارات شخصية عالية.\n2. تحمل ضغط العمل.\n3. مهارات إدارية وتنظيمية عالية.\nأخصائي الجودةAl Majed For Oud\nJob Description\nأخصائي الجودة مسئول عن تطبيق سياسات واجراءات الجودة المعمول بها في المجموعة، وهو مسؤول أيضا عن تدريب الأفراد على تطبيقها وتحفيزهم على العمل بها، كذلك هو مسؤول عن تطبيق أي إجراءات جديدة للحصول على إحدى شهادات الجودة اللازمة.\nSkills\nمعرفة عالية بمتطلبات إدارة الجودة الشاملة.\n2. معرفة عالية بمتطلبات الحصول على شهادات الجودة المحلية والعالمية مثل ISO, HACCP.\n3. قدرات عالية في إعداد إجراءات متطلبات الجودة والنماذج الخاصة بها.\n4. قدرات عالية في الرقابة على تطبيق إجراءات الجودة.\n5. مهارات جيدة في استخدام الحاسوب.\n6. إتقان اللغة الانجليزية.\n7. يفضل ان يكون لديه تخصص صحي\nكذلك يفضل ان يمتلك:-\n1. مهارات شخصية عالية.\n2. تحمل ضغط العمل.\n3. مهارات إدارية وتنظيمية عالية.\nJob Details\nJob Location:\nRiyadh, Saudi Arabia\nCompany Industry:\nRetail/Wholesale\nRequirements :\nEmployer (Private Sector)\nJob Role:\nQuality Control\nEmployment Status:\nFull time\nEmployment Type:\nEmployee\nPreferred Candidate\nCareer Level:\nEntry Level\nYears of Experience :\nMin: 1\nResidence Location:\nRiyadh, Saudi Arabia\nGender:\nMale\nNationality:\nUnited Arab Emirates; Bahrain; Djibouti; Algeria; Egypt; Iraq; Jordan; Comoros; Kuwait; Lebanon; Libya; Morocco; Mauritania; Oman; Palestine; Qatar; Saudi Arabia; Sudan; Somalia; Syria; Tunisia