(9746, 1436, 322, 'Jobs in KSA', 'الاشراف علي العمليات التالية :\nالقيام بكافة المعاملات التي تخص التكاليف\nالتحويلات الخاصة بالمواد الخام .\nمطابقة كافة التكاليف المخزنية من طلب تحويل / سند تحويل .\nاستعلامات البضائع من منتج تام ومواد خام ومتابعة تسجيلها وادخالها علي البرامج المحاسبية .\nتوجيه ومراقبة كافة الأنشطة المحاسبية والمالية وأنشطة رفع التقارير الخاصة بالتكاليف.\nتحديد الحد الادنى والاعلي للتكلفة حسب الطلب .\nالتحليلات الخاصة بالتكاليف وانحرافاتها\nالمتابعة والتنسيق والاشتراك في عمليات جرد المخزن واعداد قوائم الفروق الناتجة عن ذلك .\nتنسيق وتسهيل عمل المدققين الداخليين والخارجين وإعطاءهم المعلومات والتفاصيل اللازمة عن الحسابات والأنظمة المستخدمة.\nعمل سجل خاص للمعوقات المهمة التي تطرأ من خلال العمل وطرق حلها.\nمراجعة التقارير المستخرجة من النظام والتأكد من صحتها ودقتها.\nبناء وتطوير نظام التكاليف بالشركة\nالاشراف علي عدد من المحاسبين في وحدة تكاليف المصنع والقيام بضبط الاتي :\nSkills\n\nقدرات عالية في استخدام البرامج المحاسبية والتقنية وبرامج ERP\n2. مهارة عالية في استخدام MS Office وخاصة الاكسل في المحاسبة.\n3. معرفة جيدة باللغة الانجليزية .\n4. إلمام كامل بالعمليات الحسابية.\nخبرة 7 سنوات + 3 سنوات اشرافية في وحدة تكاليف المصنع\nEducation\nAccounting\nمشرف وحدة التكاليفAl Majed For Oud\nJob Description\n\nالاشراف علي العمليات التالية :\nالقيام بكافة المعاملات التي تخص التكاليف\nالتحويلات الخاصة بالمواد الخام .\nمطابقة كافة التكاليف المخزنية من طلب تحويل / سند تحويل .\nاستعلامات البضائع من منتج تام ومواد خام ومتابعة تسجيلها وادخالها علي البرامج المحاسبية .\nتوجيه ومراقبة كافة الأنشطة المحاسبية والمالية وأنشطة رفع التقارير الخاصة بالتكاليف.\nتحديد الحد الادنى والاعلي للتكلفة حسب الطلب .\nالتحليلات الخاصة بالتكاليف وانحرافاتها\nالمتابعة والتنسيق والاشتراك في عمليات جرد المخزن واعداد قوائم الفروق الناتجة عن ذلك .\nتنسيق وتسهيل عمل المدققين الداخليين والخارجين وإعطاءهم المعلومات والتفاصيل اللازمة عن الحسابات والأنظمة المستخدمة.\nعمل سجل خاص للمعوقات المهمة التي تطرأ من خلال العمل وطرق حلها.\nمراجعة التقارير المستخرجة من النظام والتأكد من صحتها ودقتها.\nبناء وت