r Business installation, configuration & Mainten', 1315, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=843c2bb505c99002&from=serp&vjs=3', '2018-08-15 21:16:09', '2018-08-15 21:16:09'),
(9752, 1442, 1917, 'Jobs in UAE', 'Job Title : Sr. Contract Administrator ( Cont-02-06-18 )\nJob Location : DubaiJob Industry : ContractingJob Function : Contracting & ServicesPreferred Nationalities : Any\nGender : Male\nMinimum Educational Qualification : Bachelor\'s Degree in Mechanical/ Electronics/ ElectromechanicalRelevant Years of Experience: : 10 Years Experience in Construction including reasonable exposure to MEP sectorAge : 40Posted Date : 13-06-2018Description\nPrincipal Accountabilities\n1\nReview and draft contract agreements. This includes full contractual review of agreements provided by the Contractors/Employers, draft adequate responses, negotiate and settlement. Drafting of new agreements, amendments to agreements are also considered part of this accountability.\n2\nSet-up and implement contractual and procedural steps in accordance with contract documents. This includes implementation of mandatory contractual practices such as, but not limited to, issuance of adequate notices, interim particulars and providing claim details set out under the terms of contract of each construction project.\n3\nDrafting and responding construction claims\n4\nReview, draft and response contractual communications\n5\nIdentify and analyses and potential claim events and take necessary contractual measures to secure entitlements.\n6\nOverlook variations, payments, claims and subcontract settlements of accounts in all aspects. This includes review, response, providing advises to Project Quantity Surveyors on best practices, negotiate and interim/final settlements\n7\nProvide advisory support to cater planning requirements to establish time related claims\n8\nOversee the duties and responsibilities of Quantities Surveyors and Planning Engineers and provide advisory support with respect of meeting desired performance\n9\nSet up and monitor correct contractual practices to minimize the contractual risks and potential disputes\n10\nMentoring project commercial teams for continuous success\nMinimum Requirements\n\nQualifications and Exp', 1315, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=6769a95f4367364f&from=serp&vjs=3', '2018-08-15 21:16:09', '2018-08-15 21:16:09'),
(9753, 1443, 1917, 'Jobs in UAE', 'Job Title : Logistics & Warehouse Manager ( IOM-HYD-HR-025-2018 )Job Location : DubaiJob Industry : AutomobileJob Function : Logistic & WarehousingPreferred Nationalities : Any\nGender : Male\nMinimum Educational Qualification : Bachelor DegreeRelevant Years of Experience: : 10-15 Years experience in Automotive Logistics OperationsAge : 35-45Posted Date : 30-07-2018Description\nPrincipal Accountabilities\n\n§ Provide inputs for developing logistics & warehousing strategy for optimum utilisation of resources (financial, human & infrastructure)\n§ Facilitate the conduct of internal/external quality audits, group internal audits\n§ Initiate prompt actions on the Non Conformance Reports (NCRs) of the audits & close all NCRs in the shortest possible time\n§ Ensure adherence to the applicable SOPs\n§ Monitor all warehousing processes, identify opportunities to improve the same\n§ Update Standard Operating Procedures (SOPs) according to the changes implemented in the processes.\n§ Monitor process cost and initiate actions to reduce/control the same.\n§ Monitor daily performance and initiate appropriate actions to meet the performance targets.\n§ Motivate the Warehouse & Logistics team and maintain high moral to achieve highest level of service to the customers.\n§ Conduct annual performance assessment of the team\n§ Develop & maintain excellent relationships with internal (showroom managers) & external customers (fleet customers) on Logistics services\n§ Ensure that the company vehicles are always kept well maintained by following preventive maintenance programme.\n§ Prepare port clearance plan based on vessel arrival intimation.\n§ Coordinate with other department for faster processing of customs documents required for clearance.\n§ Port and Customs clearance, inbound quality checks.\n§ Scheduling vehicles and drivers for optimum utilization.\n§ Ensure proper documentation and entry of inbound vehicles.\n§ Oversee all activities pertaining to inspection of vehicles for damage during transit an', 1315, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=0e09894ed1cb2685&from=serp&vjs=3', '2018-08-15 21:16:09', '2018-08-15 21:16:09');
