(9754, 1444, 1917, 'Jobs in UAE', 'Job Title : Marketing Manager (Automotive) ( IOM-HYD-HR-030-2018 )Job Location : DubaiJob Industry : AutomobileJob Function : MarketingPreferred Nationalities : Any\nGender : Male\nMinimum Educational Qualification : Bachelor Degree in MarketingRelevant Years of Experience: : 8-10 Year Experience in Automotive IndustryAge : 30-40Posted Date : 08-08-2018Description\nPrincipal Accountabilities\n\n1) Develop annual marketing plan, strategy and allocate resources on various ATL & BTL marketing activities including digital to achieve Sales & Marketing objectives.\n2) Manage day-to-day marketing operations.\n3) Effectively manage marketing spending and budget.\n4) Planning and implementing promotional campaigns.\n5) Manage the creation and publication of all marketing materials in line with marketing plans.\n6) Manage activities such as events, product launches and maintain a check and balance on its successful implementation to achieve marketing objectives.\n7) Manage and execute effective digital marketing campaigns.\n8) Effective planning of PR activities and CSR (Corporate Social Responsibility) events for enhancing company and product image and gaining a competitive advantage.\n9) Manage media interviews and point of contact to protect and enhance the company and brand image.\n10) Overall responsibility for brand management and corporate identity.\n11) Monitor the effectiveness and measure ROI of marketing campaigns and promotions.\n12) Work closely with agencies and assist with new product launches.\n13) Maintain excellent relationship with the Principal and ensure the effective communication and engagement.\n14) Maintain excellent relationships and networks with all stakeholders including customers, suppliers, business partners, Govt. and media for mutual collaboration and further business growth to achieve performance excellence.\n15) Monitor market trends and performance by segment and proactively share corrective measures to enhance sales and market share.\n16) Introduce effective ', 1315, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=7e90ebb3a0549123&from=serp&vjs=3', '2018-08-15 21:16:09', '2018-08-15 21:16:09'),
(9755, 1445, 1917, 'Jobs in UAE', 'Job Title : Maintenance Foreman ( IOM/A5/GM/0412018 )Job Location : DubaiJob Industry : Leader L.L.CJob Function : OthersPreferred Nationalities : Any\nGender : Male\nMinimum Educational Qualification : 2 Years Diploma in ElectricalRelevant Years of Experience: : 2-3 YearsAge : 25-35Posted Date : 01-07-2018Description\n Principal Accountabilities\n\nRoutine inspection of each and every production machine and utility equipment like compressors, CNC machines, etc. every day morning to ascertain safe work conditions.\nRepairing and installing electrical & mechanical systems, and electronic components of machineries and equipment to guarantee lowest down time.\nCoordinate with the maintenance crew to constantly check the machines and carry out regular lubrication.\nFollowing electrical code, manuals, schematic diagrams, and other specifications, using hand tools, power tools, and electrical and electronic test equipment to troubleshoot and resolve faults.\nInstalling power supply wiring and conduit for newly installed machines and equipment to guarantee safe and ideal running conditions.\nCoordinating with mechanics and plumbers for special multi jobs to provide support especially in electromechanical systems.\nActivating the preventive maintenance program for each machine to reduce down time.\nPerforming all technical duties assigned by the maintenance engineer and maintenance manager.\nMinimum RequirementsDiploma of minimum 2 years in applied electrical science.\n\nPrevious training or experience in Industrial electrical electronic systems.\n\nAbility to work in production areas at times where noise levels are moderate to high.\n\nAbility to understand and adhere to all safety guidelines.\n\nAbility to work in a team environment.\n\nKnowledge of Windows and Office software a plus.\n\nExcellent communications skills needed for interaction with other technicians and employees.\n\nAbility to rotate shifts and work weekends.', 1315, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=849b91797898dc36&from=serp&vjs=3', '2018-08-15 21:16:09', '2018-08-15 21:16:09'),
(9756, 1446, 1917, 'Jobs in UAE', 'Job Title : Sales Supervisor (OOH) ( G/1707/18-02 )Job Location : DubaiJob Industry : FMCGJob Function : Sales/ Business DevelopmentPreferred Nationalities : Any\nGender : Male\nMinimum Educational Qualification : Bachelor’s Degree (Hotel Management would be an added advantage)Relevant Years of Experience: : 7 Years experience in HorecaAge : 28-35Posted Date : 22-07-2018Description\nPrincipal Accountabilities\n\n1) Liaise with the Line Manager, develop and implement a market/consumer driven business - marketing plan in line with the department objectives. Assist with end to end account management on aspects pertaining to contracts, collections, inventory management and forecast on stock as required\n2) Participate proactively and in consultation with the Line manager develop marketing strategies to secure maximum revenue production from key accounts assigned on a long term basis. Challenge traditional marketing strategies and develop new unconventional methods to position the assigned brands as a preferred product\n3) Monitor all competitor activities and thereafter translate its impact on the division’s sales revenue plan. Further to the evaluation, develop and present counter campaigns to negate competitor objectives thus sustain market share for the assigned brands\n4) Engineer marketing activities to promote the brands and all other services with all key accounts, to enhance continued customer loyalty in U.A.E based on seasonal demands (High Vs Low) whilst maintaining / increasing market share thereby generating sales revenue\n5) Manage the brands assigned, and monitor, counsel, review daily activities to facilitate smooth service delivery to all customers. Motivate and invigorate energy in the team to exploit their potential to its fullest thus exceeding all expected service standards\n6) Formulate means and methods of increasing customer database for effective use in all sales, marketing related activities. Data capture to encompass all current / potential consumers, bu', 1315, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=1b00db797d56099a&from=serp&vjs=3', '2018-08-15 21:16:09', '2018-08-15 21:16:09'),
