(9763, 1453, 1926, 'Jobs in USA', 'Family with main residence in Lakeview of Chicago with 4 and 10 year old boys is seeking an educated, experienced, professional, organized, meticulous and detail oriented Full-Time Nanny/House Manager to manage a busy family and household. The schedule is approximately 50+ hours per week on Monday - Friday at 10:00/11:00am - 8:00pm. If ideal candidate has desire to work more hours, Sundays at 4:00pm-8:00pm is desirable to family. Hours have the potential to shift in future years when children are both enrolled in full day school, during summer months, etc. (position will transition into much more house management and family assistant responsibilities when children are both enrolled in full day school). Nanny is required to spend summer months (Late June through August) in Nantucket, Massachusetts and February and/or March in Scottsdale, Arizona annually with family. Nanny is required to travel internationally and domestically approximately 2-4+ weeks per year (in addition to travel mentioned above) and work overnights when parents are traveling without children approximately 1-2+ weeks annually. Extreme flexibility is required for the position. Children are enrolled in private schools (Youngest child attends on Monday - Friday at 9:00am-12:00pm and oldest child attends on Monday - Friday at 7:40am-4:00pm), which are driving distance from the family\'s residence. Family has staff vehicle, so safe vehicle for transportation is not required. Nanny must be comfortable with small dog. Nanny/House Manager must be collaborative to work with domestic staff (Executive Assistants and Part-Time Housekeeper) and directly with Principals on a daily basis, warm, nurturing, calm confidence and demeanor, discreet, assertive, proactive, resourceful, self starter, organized, detail oriented, hard working, service focused, kind, professional, ability to multi-task and wear many hats, respectful and capable of maintaining discretion. Candidates must have previous experience in similar p', 384, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Strollers-and-Stilettos/jobs/Full-Time-Nanny-House-Manager-Heavy-Travel-Lakeview-eb77eaf3df4476c7?vjs=3', '2018-08-15 22:47:34', '2018-08-15 22:47:34'),
(9764, 1422, 1909, 'Jobs in KSA', 'We are currently looking for proactive and self-motivated workers who want to move their careers forward to work and live in AND WORK in our company , Ritz Carlton Hotel is a currently in need of New Hotel workers required .\n\nOur policy is to provide equal employment opportunity to all qualified persons without regard to race, creed, color, religious belief, sex, age, national origin, ancestry, physical or mental disability, or veteran status.\n\nWe offer you to be part of a multi-cultural environment, pursue your passion and take the journey of your career within the experience in luxury home .\n\nThe positions available are, Nanny, cook, Driver, Teacher, nurse, Security Officer , Chef Cook , Cleaners , bar man , bar woman , Cooks Room Service needed\n\nWe are looking for workers in our Company since we have an increase in customers this may , We need men and women, so employment opportunities are available now. we urgently need hard working and serious people , Apply with your Cv resume and you most have a valid passports ,Hope you can contact us for more information if you are interested in the job.\n\nThanks and wish you the best in your Application . God Bless you .', 1311, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=d06525357395a08e&from=serp&vjs=3', '2018-08-15 22:47:34', '2018-08-15 22:47:34'),
(9765, 1424, 1188, 'Jobs in KSA', '2947E TEMPORARY NANNY - Live out **August 17th- 28th** - London, UKAge/Number of children: 2.5 year old boyDuties:\nAll nursery duties, doing activities with the family and the childWorking hours: 12 hours a day - from the 17th to the 28th of AugustSalary offered: £150 per day\nResponsible consultant: valentina.arena@nannybutler.com', 954, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=bc71519a2277549b&from=serp&vjs=3', '2018-08-15 22:47:34', '2018-08-15 22:47:34'),
(9766, 1425, 1190, 'Jobs in KSA', 'A High Profile family in Riyadh, Saudi Arabia is seeking a Live In Full Time Nanny to help take care of their two toddlers and primary school-aged child. The family already have two Western nannies so you will be working in a team. You will only be looking after one child at one time. The Nanny would be needed 12 hours a day, 6 days a week, flexibility is required. The family would ideally like to hire at the end of August.\n\nThe candidate would be provided with a separate villa within the family\'s quarters that is shared with the other nannies. You will have your own bedroom and bathroom.\nThe duties for this position would include:ensuring the children are safe at all times\nplaying both fun and educational games together\nteaching them the correct manners and etiquette\norganizing the children’s daily schedule\npreparing healthy meals\nmaintaining a clean and tidy environment for the child\nensuring they are washed, in their pyjamas and in bed at the correct time\n\nThe family travels frequently to places such as the United Kingdom, France, and the United States. The family would like you to travel with them on these holidays so you must be able to travel. If you are interested in this position please fill out the form below and a consultant will be in contact with further information. Position ID: 2023815', 956, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=3eb2c52c5bcef668&from=serp&vjs=3', '2018-08-15 22:47:34', '2018-08-15 22:47:34'),
(9767, 1454, 1190, 'Jobs in KSA', 'Experienced and professional, calm, patient and warm Nanny is required to join full staffed household with two young children, providing care for either just the eldest with some downtime during the day whilst the child is at school or both, focusing on the toddler during the day and both children in the afternoons, the salary will be reflected in either options.\n\nThis is a long term role within a fully staffed household with childcare focus & nursery duties, where time permits, based in Riyadh, Saudi Arabia.\n\nThe family travel approximately 3 months a year, usually 2 months over the summer and few weeks during winter and spring. They are looking for someone to start early September, the family will be in London first week of September and ideally would like to meet the nanny before confirming a contract.\n\nTypical hours will be 6 days per week, 12 hours per day, but flexibility is required. When travelling, you will need to work full time around the clock, depending on location. The salary is negotiable, depending on level of experience and qualifications and whether you look after just one child or both, ranging between £800 and £1200 per week.\nThe duties will include:typical nursery duties (with assistance from other staff)\ntaking the children to school & picking up with the driver\ntaking the children to various activities and playdates\ncreating weekly activity plan\nresearching local activities when travelling\nstaying on top of the children\'s belongings when travelling (packing & unpacking)\nsupervising the weekly menu to ensure healthy and balanced diet\nassisting with the children\'s emotional and educational needs\n\nThe family is open for Arabic or French speaking candidates but this is not a requirement. To learn more about this role, please complete the form below and a consultant will contact you with more information.\nPosition ID: 2023982', 956, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=ffc9cb8e8914c93c&from=serp&vjs=3', '2018-08-15 22:47:34', '2018-08-15 22:47:34'),
