(9770, 74, 1933, 'Jobs in USA', 'Furniture Store is looking for a Janitor.Daily job responsibilities:Vacuuming, sweeping, and mopping of flooring. Clean and sanitize bathrooms. Clean break rooms. Restock supplies in bathrooms, break rooms and common areas. Empty all trash cans and replace liners, clean receptacles as necessary. Dusting and cleaning furniture. Cleaning windowsills and windows. Maintain janitor closets in a clean, organized and safe manner.Must be dependable, responsible, reliable and have some janitorial experience.Full Time 40 hours a week, Saturday & Sunday required work days.Pay is $10.50 per hour.Muebleria en busca de una persona para limpiar.Las responsabilidades del trabajo diario:Aspirar, barrer y trapear el piso. Limpiar y desinfectar los baños. Limpiar las salas de descanso. Reponer suministros en los baños, salas de descanso y áreas comunes. Vacíe todos los botes de basura y reemplacar los revestimientos, limpie los receptáculos según sea necesario. Quitar polvo y limpiar muebles. Limpieza de alféizares y ventanas. Mantenga los armarios de conserjería de una manera limpia, organizada y segura. Debe ser confiable, responsable y tener cierta experiencia de limpieza.Full time 40 horas por semana, se trabaja Sabado y DomingoPago es $10.50 por hora.Schedule:Monday - 7-3:30pmTuesday - OffWednesday - 10-6:30pmThursday - OffFriday - 7-3:30pmSaturday - 12:30-9pmSunday - 12:30-9pmJob Type: Full-timeSalary: $10.50 /hour', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/TWS-Facility-Services/jobs/Janitorial-Worker-087e6bce60918cd6?vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9771, 1455, 1934, 'Jobs in USA', 'Our business is going strong! We have the freight to keep you running and making money! Our regional fleet runs within a 400 mile radius of Detroit Michigan. Drivers are home on weekends. Ask about dedicated runs as well.\n\nNEW Driver App\n67% of linehaul paid to truck\n100% fsc paid to truck\nAverage trailer fleet of less than 3 years of age\nFuel saving skirts on most trailers\nNo trailer rental fees\nFuel card and discount program\nIn cab scanning\nIn cab navigation\nWeekly settlements\nInsurance Programs available\nFree rider program\nBestpass\nDrivewyse\n\nand much more------', 226, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=25bce42abf52fd68&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9772, 1456, 1935, 'Jobs in USA', '¡Estamos contratando a gente rápidamente en Phoenix! ¡Hasta $500 bonificación disponible para la experiencia profesional!Debe pasar E-verify y las comprobaciones de fondoLicencia de conducir y bilingüe inglés/español preferido (no requerido)La experiencia de la limpieza no requerida, estamos felices de pagarle para entrenarNO SE NECESITA COCHE:  Conducir nuestros vehículos de la empresa, dejar de pagar por el gas y poner millas en su cocheTambién proporcionamos: uniformes, clientes, y todas las fuentes de la limpiezaPague un promedio de $80-$130/día por tiempo completo. Los mejores productores pueden ganar más de $600/semana.Conserve el 100% de sus propinasVacaciones pagas y tiempo libre después de 90 díasLO HACEMOS SIMPLE - SOLO DEMOSTRARSE PARA TRABAJAR, SER AMISTOSO Y TRABAJAR DURO - TE PAGAMOSPor favor, solicite con su currículum O visítenos en: 15810 N Cave Creek Rd, Phoenix AZ 85032 (justo al sur de Rainbow Donuts)Tipo de puesto: Tiempo completoSalario: $80.00 a $130.00 /díaExperiencia:Limpieza Profesional: 2 años (Requisito deseable)Licencias o certificaciones:Licencia de conducir válida (Requisito deseable)Idioma:inglés (Requisito deseable)', 482, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Maid-Brigade-of-Arizona/jobs/Limpiadore-De-Casa-b08b6e9cde37527a?vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
