(9775, 1459, 1938, 'Jobs in USA', 'POSITION SUMMARY\nThe position performs sanitation labor by performing the seven steps of sanitation while understanding and complying with all safety policies and procedures. The sanitation team member must understand how to work with necessary chemicals, work at a pace and delivers a clean plant to the customer on time and abide by company policies, including satisfactory attendance.\nESSENTIAL FUNCTIONS\nTo be qualified to perform a Sanitation team member job, an individual must be able to perform each essential duty satisfactorily, with or without reasonable accommodation:Work cooperatively with leads and PSSI management to ensure sanitation procedures are followed.\nFrequently lift hoses, equipment and chemical containers, etc.\nWear employer-specified PPE (gloves, face shield, eye goggles, aprons, boots, safety glasses, etc.).\nExposer to chemicals (with PPE required for the task).\nAll night standing, lifting, crouching for periods at a time).\nPerform all tasks safely.\nUse Lock-out/Tag-out.\nOther duties as assigned.\nJOB PERFORMANCE MEASURES\nTeam members are considered to be qualified (fully trained) when they achieve satisfactorily the following five categories:\nSeven steps of sanitation- Capable of following all the steps with detailed supervision.\nSafety- Understanding and compliance all of the safety policies covered during training.\nChemicals- Understanding of chemical types, labeling, PPE and warnings regarding to mixing chemicals.\nPace-Work at a acceptable speed to deliver the plant on time.\nAttendance- Dependability in both: arriving and completing the work shift and compliance with attendance policy.\nMINUMUM QUALIFICATIONS\nAccountable for his/her own actions, ability to take direction and instruction from managers, prompt and timely, safety awareness, attention to detail, ability to focus on tasks at hand, adaptability, communication with peers, strong work ethic, ability to wear personal protective equipment, ability to work in environments with extreme tem', 244, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=54c786359b51c191&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9776, 1460, 1939, 'Jobs in USA', 'ERS-Environmental Record Search (www.reccheck.com) is looking for two or three part time sub-contractors. Candidates that tend to be successful in this position are student researchers, house persons, or retire persons that live within close proximity to the Library of Congress. All research is performed at the following location:The Library of Congress101 Independence Ave, SEWashington, DC 20540 Library ResearchWe will provide details on research projects via e-mail. Each project will take about 1 to 2 hours of actual work time once trained and efficient. From assignment (e-mail), you will have 1 or 2 workdays (some can be completed on weekends and early evening) to start and complete the research by e-mailing it back to us. In most cases you will work with our other staff at the Library. You will be asked if you want to accept usually 2 to 10 projects per week. You need to have a decent digital camera or phone to take pictures of pages from books and in some cases maps at the library (Many cell phone cameras work great). Your camera has backup from our hand held scanner and/or the Libraries equipment. We will be switching to hand held scanners completely in the near future. You need to have high speed internet at home to download scans and/or cell phone connection to send us the pictures and/or scans and/or unlimited data on your phone. There is an availability for work on Saturdays and total flexibility because your the BOSS (you are an independent subcontractor).We will train you on how to conduct the research on your own time (you will be learning a job to be an independent subcontractor) that ususally takes 3-4 hours of training. It is not complicated but, the work is very interesting and perfect for a STUDENT or Homemaker and/or someone whom only wants to work part time! This subcontractor position is not a full time position nor meant to be. It is perfect to make extra spending money and is very flexible.We are looking to fill this position immediately. If i', 1323, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Environmental-Record-Search/jobs/Library-Congress-Researcher-7b011f3b1c4d30eb?vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9777, 1461, 1940, 'Jobs in USA', '4003: Special Events Assistant\nPOSITION SNAPSHOT:\nA Special Events Assistant provides pressure point relief in the Special Events office so our Sales Teams can focus on introducing Dave & Buster’s to new guests every day. The SEA provides administrative support to the Special Events Manager (SEM) and Special Events Consultant (SEC) and ensures each Guest knows their business is important to Dave & Buster’s. During high‐volume periods, this position may also provide some sales and marketing support, under the direction of the GM, SEM, and/or SEC.\nNITTY GRITTY DETAILS:\nYou provide critical administrative support to the SE office, including faxing, filing, making copies, mailings, and other general administrative work.\nYou receive and finalize contracts within the sales system and assist with collection of event deposits and payments.\nYou assist in maintaining event archives.\nYou take incoming Guest calls as a backup when the SEM and/or SEC are busy, taking down important information and referring the Guest’s needs to the SEM or SEC.\nYou generate PowerCards, drink tickets, and the other items we need to make our events one‐of‐a‐kind.\nLike to party? We like to party… You get to show Guests around Dave & Buster’s and introduce them to all of the ways we can make their event one to remember!\nDuring high volume periods, you follow up on leads identified by the SEM and SEC. This will include checking availability, responding to online event inquiries (OERs/RFPs), and giving our Guests an overview of the FUN Dave & Buster’s has to offer!\nYou assist in executing local marketing plans, under the direction of the GM, SEM, and SEC.\nYou go above & beyond to ensure the needs of each Special Events Guest are met, processing paperwork in a timely manner, following up on questions, and working behind‐the‐scenes to make sure the SE team and Operations are set up for success.\nAnd, because we expect you to “Act like you own it” your job includes everything listed above PLUS the ever‐pop', 399, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=86bd1e5b59de4886&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9778, 1462, 1941, 'Jobs in USA', 'Vice President of Operations at Firetrace\nCompany\nFiretrace is focused on fire suppression. We aim to operate in niches where we can be the market leader, delivering outstanding products, service and support to our customers.\nFiretrace (www.firetrace.com) is in a period of significant change, having moved from private ownership to ownership by Halma plc (www.halma.com) in late 2015. We have developed a new growth strategy, and a key part of that is working in market niches where we can be the market leader. In order to do that, we need to deliver levels of service better than our customers expect. Operations also has to set the example in our drive for excellence across everything we do as a business.\nWe are currently a $40M revenue company, with sales in diverse geographical areas. Marketing, R&D, finance, manufacturing operations and administration functions are based at our HQ in Scottsdale, and we have a sales team based across North America and worldwide (Europe, Middle East, China, India, SE Asia, and Africa).\nRole Summary\nThe VP Operations has the following fundamental core objectives:\nManage all operational, supply chain and quality aspects of our business, and build and develop a team accordingly\nSupport the growth strategy of the business by designing and implementing a supply chain and customer service level that exceeds expectations, and provides a real differentiator in our market place\nDrive rigor into all our operational processes more akin to a business an order of magnitude larger than Firetrace, and instill a culture of continuous improvement in operations and beyond\nBe an engaging, pro-active, challenging, and fully participating member of the board. Demand excellence across your team and the whole business\nThe VP Operations is a member of the board of the company, and reports directly to the President.\nSpecific Responsibilities\nDirectly manage the Firetrace operations team, including purchasing and supply chain, manufacturing, manufacturing engin', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=b1a697c4e77209f5&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9779, 1463, 1942, 'Jobs in USA', 'I need a tractor owner operator or two in the Cleveland area. Our business is going strong! I have a round trip run out of the Avon, Ohio area to Mich on Sunday night to get your week started. We have the freight to keep you running and making money! Our regional fleet runs within a 400 mile radius of Detroit Michigan. Drivers are home on weekends. Ask about dedicated runs as well.\n\n67% of linehaul paid to truck\n100% fsc paid to truck\nAverage trailer fleet of less than 3 years of age\nFuel saving skirts on most trailers\nNo trailer rental fees\nFuel card and discount program\nIn cab scanning\nIn cab navigation\nWeekly settlements\nInsurance Programs available\nFree rider program\nPaid Tolls\nand much more------', 226, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=f9a55d1259b30e2d&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9780, 1464, 1121, 'Jobs in Oman', 'Data de divulgação da vaga Jul 26, 2018Nº do Cargo 180023C9Categoria de emprego Engenharia e instalaçõesLocal W Muscat, Muscat, Omã VER NO MAPAMarca W HotelsHorário Período integralRemanejamento? NoTipo de cargo Não gerencial/HoristaComece sua jornada conosco\nOusadamente ultrapassando as barreiras do luxo, o W vira de cabeça para baixo a noção tradicional de hotel extravagante. Nossa atitude irreverente e atração pelo excesso redefinem a diversão da alta sociedade moderna. Nossos hóspedes desejam uma vida menos ordinária que os leve a exigir mais, experimentar tudo e repetir.\nNós compartilhamos das mesmas paixões dos hóspedes, fornecendo acesso privilegiado a tudo que é novo e ao que virá no futuro. Moderação não existe no nosso dicionário, e nós sabemos que o desejo de viver exige mais, não menos. Os hóspedes do W mergulham fundo e vivem cada dia com o mantra: Detox.Retox.Repeat. Se você estiver pronto para criar o ambiente agitado dos hotéis W que atrai os disruptores comuns no mundo todo, então nós o convidamos para explorar uma carreira no W Hotels.A Marriott International oferece igualdade de oportunidades de emprego e está comprometida em contratar uma força de trabalho diversa e manter uma cultura inclusiva.', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=4db0be814a9259a5&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9781, 1465, 1121, 'Jobs in Oman', 'Date de publication Aug 16, 2018Numéro de l\'Emploi 18002B8SCatégorie d\'Emploi Ingénierie et InstallationsLieu Sheraton Oman Hotel, Oman, Oman AFFICHER SUR LA CARTEEnseigne Sheraton Hotels & ResortsHoraire Temps pleinMutation? NonType de Poste Non-cadreCommencez votre parcours chez nous\nAu Sheraton, nous nous surpassons dans tout ce que nous entreprenons. Nos clients et nos collègues nous stimulent : ils nous encouragent à toujours faire mieux. Nous aimons ce que nous faisons et nous y mettons tout notre cœur, au travail comme ailleurs. Quand nos clients séjournent chez nous, ce n’est pas juste une chambre avec un lit qu’ils recherchent. Ils veulent vivre une expérience. Nous recherchons des personnes prêtes à se dépasser dans tout ce qu’elles entreprennent. Vous cherchez sincèrement à améliorer votre vie et celle de votre entourage ? Nous vous invitons à consulter les offres d’emploi proposées par l’enseigne Sheraton.Résumé des fonctions\n Répondre et traiter les demandes de réparation des clients. Communiquer avec les clients afin de résoudre les problèmes de maintenance. Effectuer l’entretien préventif des outils et de l’équipement de la cuisine et de la chambre des appareils mécaniques, y compris le nettoyage et la lubrification. Inspecter visuellement les outils, l’équipement ou les machines. Transporter de l’équipement (p. ex., outils, radio). Identifier, localiser et actionner toutes les vannes d’arrêt de l’équipement et toutes les manettes de fermeture des services publics pour les bâtiments. Maintenir les stocks requis pour l’entretien et commander les pièces et les fournitures nécessaires. Communiquer les activités et les problèmes qui se produisent chaque jour aux autres équipes à l’aide des normes et des programmes de communication approuvés. Avoir des connaissances de base ou la capacité d’acquérir ces connaissances dans les catégories suivantes : climatisation et réfrigération, électricité, mécanique, plomberie, systèmes et contrôles pneumatiques et élec', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=50430585ab4b2627&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9782, 1466, 1121, 'Jobs in Oman', 'Fecha de publicación Aug 16, 2018Número de Empleo 18002B8SCategoría de Empleo Ingeniería e InstalacionesUbicación Sheraton Oman Hotel, Omán, Omán VER EN MAPAMarca Sheraton Hotels & ResortsHorario Tiempo completo¿Reubicación? NoTipo de Posición Non-GestionComience su aventura con nosotros\nEn Sheraton, vamos más allá en todo lo que hacemos. Nuestra inspiración son nuestros huéspedes y las personas que tenemos a nuestro alrededor, y nos esforzamos constantemente por mejorar. Disfrutamos mucho de lo que hacemos, y ponemos todo nuestro esfuerzo en ello, dentro y fuera de la propiedad. Cuando los huéspedes se hospedan en nuestros hoteles, no es simplemente una habitación con una cama lo que obtienen, sino una experiencia. Estamos buscando a alguien capaz de esforzarse más allá de sus propios límites en todo lo que haga. Si tiene un impulso genuino por mejorar su vida y la de los que lo rodean, lo invitamos a explorar carreras en Sheraton.Descripción del Trabajo\n Responder y atender las solicitudes de reparaciones de los huéspedes. Comunicarse con los huéspedes/clientes para resolver problemas de mantenimiento. Realizar mantenimiento preventivo en herramientas y equipo de cocina y sala de máquinas, incluyendo limpieza y lubricación. Inspeccionar visualmente las herramientas, el equipo o las máquinas. Transportar equipos (por ej., herramientas, radio). Identificar, localizar y operar todas las válvulas de cierre para el equipo y todas las llaves de desconexión de servicios generales para los edificios. Llevar un inventario de mantenimiento y solicitar piezas y suministros según sea necesario. Comunicar las actividades y problemas diarios a los empleados de los otros turnos usando programas y normas de comunicación apropiados. Demostrar conocimientos o aptitud básica para adquirir conocimientos en las siguientes categorías: acondicionamiento de aire y refrigeración, electricidad, mecánica, plomería, sistemas y controles neumáticos/electrónicos, carpintería y acabado, equipo ', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=0fb62c03d17ec3d0&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9783, 1467, 1121, 'Jobs in Oman', 'Data di presentazione Jul 18, 2018N. Posizione 180020ENCategoria la Posizione Finanza e ContabilitàSede Sheraton Oman Hotel, Oman, Oman VISUALIZZA SULLA MAPPABrand Sheraton Hotels & ResortsTipologia Tempo pienoTrasferimento? NoTipo posizione Non direttiva/a oreInizi il suo viaggio con noi\nAllo Sheraton diamo il massimo in tutto quello che facciamo. Ci lasciamo ispirare dai nostri ospiti e da chi ci circonda e ci impegniamo per migliorare. Amiamo quello che facciamo e ci prodighiamo per dimostrarlo. I clienti che soggiornano da noi non comprano solo una stanza con un letto. Comprano un\'esperienza. Cerchiamo personale che sia disposto a dare il massimo in tutto quello che fa. Se vi anima una sincera inclinazione a migliorare la vita di chi vi circonda e la vostra, vi esortiamo ad esplorare le opportunità di lavoro di Sheraton.Marriott International attua una politica di pari opportunità, si impegna ad assumere una forza lavoro diversificata e a favorire una cultura di inclusione.', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=9f39f6a5692077c8&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
