(9785, 1469, 1121, 'Jobs in Oman', 'Datum umístění Aug 12, 2018Číslo Pracovní Pozice 180029O8Kategorie Práce Řízení událostíPracoviště Sheraton Oman Hotel, Omán, Omán ZOBRAZIT NA MAPĚZnačka Sheraton Hotels & ResortsPlný úvazek Plný úvazekOchota k přestěhování NeTyp pozice Manažerská poziceZačněte svou cestu u nás\nV Sheratonu se snažíme překonat běžné standardy při všem, co děláme. Inspirují nás naši hosté a také se inspirujeme navzájem, to nám pomáhá se zlepšovat. Milujeme to, co děláme, dáváme tomu všechno - v hotelu i mimo něj. Když se u nás host ubytuje, nedostane za své peníze pouze pokoj s postelí. Dostane zážitek. Hledáme někoho, kdo se snaží překonávat běžné standardy při všem, co dělá. Pokud jste někdo, kdo se doopravdy pořád snaží změnit svůj život a životy těch okolo sebe k lepšímu, doporučujeme Vám prozkoumat pracovní příležitosti v Sheratonu.Marriott International je zaměstnavatel, který poskytuje rovné příležitosti, zaměstnává rozmanité pracovníky a vytváří firemní kulturu otevřenou všem. Společnost Marriott International nediskriminuje žádné skupiny osob, které federální, státní nebo místní zákony klasifikují jako postižené, veterány nebo jinak ohrožené.', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=32e64a1ae67bac55&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9786, 1470, 1121, 'Jobs in Oman', 'Data publicării Aug 07, 2018Număr post 180027MFCategoria postului Operațiuni legate de camere și servicii pentru oaspețiLocaţie Mirbat Marriott Resort, Salalah, Oman VIEW ON MAPBrand Marriott Hotels Resorts /JW MarriottOrar Normă întreagăTipul postului În afara posturilor de conducere/cu oraÎncepeți călătoria alături de noi\nPortofoliul de mărci Marriott International include atât JW Marriott cât și Marriott Hotels.\nMarriott Hotels, marca principală a Marriott International, cu peste 500 de unități globale, duce mai departe arta găzduirii, astfel încât oaspeții noștri să poată călători superb. În calitate de gazdă la Hotelurile Marriott, veți ține această promisiune, oferind opțiuni de calitate superioară, stil sofisticat și detalii elaborate cu grijă. Cu aptitudinile și imaginația dumneavoastră, împreună vom inova și reinventa viitorul călătoriilor.\nJW Marriott face parte din portofoliul de lux al Marriott International și constă din peste 80 de unități frumoase, operate în orașe-gateway și stațiuni distincte din întreaga lume. La JW Marriott considerăm că angajații noștri se află pe primul loc. Dacă sunteți fericit și oaspeții noștri vor fi fericiți. E chiar atât de simplu. Hotelurile noastre vă oferă o experiență de muncă unică, unde veți face parte dintr-o comunitate deosebită și vă veți bucura de un spirit de camaraderie într-un un grup divers de colegi. La JW Marriott creăm numeroase oportunități pentru instruire, dezvoltare, recunoaștere și, cel mai important, un loc unde să vă puteți urma pasiunile într-un mediu de lux. Tratarea oaspeților într-un mod excepțional începe prin felul în care ne îngrijim de angajații noștri. Acesta este JW Treatment™.Marriott International este un angajator care pune în aplicare o politică de egalitate de șanse, este hotărât să angajeze o forță de muncă diversă și susține o cultură incluzivă.', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=6cb4f950cceec223&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9787, 1471, 1121, 'Jobs in Oman', 'Date de publication Aug 12, 2018Numéro de l\'Emploi 180029NXCatégorie d\'Emploi Ventes et MarketingLieu Sheraton Oman Hotel, Oman, Oman AFFICHER SUR LA CARTEEnseigne Sheraton Hotels & ResortsHoraire Temps pleinMutation? NonType de Poste Non-cadreCommencez votre parcours chez nous\nAu Sheraton, nous nous surpassons dans tout ce que nous entreprenons. Nos clients et nos collègues nous stimulent : ils nous encouragent à toujours faire mieux. Nous aimons ce que nous faisons et nous y mettons tout notre cœur, au travail comme ailleurs. Quand nos clients séjournent chez nous, ce n’est pas juste une chambre avec un lit qu’ils recherchent. Ils veulent vivre une expérience. Nous recherchons des personnes prêtes à se dépasser dans tout ce qu’elles entreprennent. Vous cherchez sincèrement à améliorer votre vie et celle de votre entourage ? Nous vous invitons à consulter les offres d’emploi proposées par l’enseigne Sheraton.Résumé des fonctions\nMarriott International est une entreprise qui s\'engage en faveur de l\'égalité professionnelle, qui veut donner à chacun sa chance et qui favorise une culture « inclusive ».', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=7523828f7b88e5c8&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9788, 1472, 1121, 'Jobs in Oman', 'Data publicării Aug 12, 2018Număr post 180029O3Categoria postului Vânzări și marketingLocaţie Sheraton Oman Hotel, Oman, Oman VIEW ON MAPBrand Sheraton Hotels & ResortsOrar Normă întreagăRelocare? NuTipul postului În afara posturilor de conducere/cu oraÎncepeți călătoria alături de noi\nLa Sheraton, ne depășim în tot ceea ce facem. Suntem inspirați de oaspeți și ne inspirăm unii pe ceilalți – ne dorim să facem lucrurile mai bine. Iubim ceea ce facem și oferim tot ce putem – în hotel și în afara acestuia. Când oaspeții se cazează la noi, ei nu cumpără numai o cameră cu un pat. Este o experiență. Căutăm persoane gata să se autodepășească în tot ceea ce fac. Dacă sunteți o persoană cu o dorință adevărată de a îmbunătăți viața dumneavoastră și a celor din jur, vă încurajăm să explorați oportunitățile de carieră de la Sheraton.Marriott International este un angajator care pune în aplicare o politică de egalitate de șanse, este hotărât să angajeze o forță de muncă diversă și susține o cultură incluzivă.', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=0686e68468777230&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9789, 1473, 1943, 'Jobs in Oman', 'Dans le cadre d\'un important projet de compteurs d\'eau, de réseau (infrastructure radio et serveurs) et télé-relève associés remporté à Oman (300 000 compteurs), nous sommes à la recherche d\'un Chef de projet afin de piloter les différentes étapes du projet et d\'être l\'interlocuteur privilégié de notre client et partenaires sur place.\nVos missions principales consisteront à réaliser le déploiement du projet :\n\" Assurer la relation avec notre client et partenaires en veillant à la bonne exécution du contrat commercial et en se posant comme interlocuteur privilégié sur place et vis-à-vis du siège de Sagemcom.\n\" Etre garant(e) de la réalisation technique, commerciale, financière du projet.\n\" Piloter, suivre et coordonner le planning de déploiement des compteurs et faire des points d\'avancement réguliers à la BU (reporting).\nJob requirements\nTitulaire d\'une formation d\'Ingénieur généraliste, vous avez idéalement des connaissances en radio, télécom ou IT.\nDes capacités évidentes d\'organisation, de communication et de leadership seront indispensables pour mener à bien la mission.\nUne expérience antérieure dans le suivi de projets ou sous-parties complexes faisant intervenir plusieurs parties prenantes sera fortement appréciée.\nEnfin, vous maîtrisez l\'anglais pour intervenir dans un environnement international pouvant nécessiter des déplacements en Arabie-Saoudite, Emirats arabes unis et Koweit.\nSagemcom est une entreprise handi-accueillante.\nPeut candidater, toute personne âgée de plus de 18 ans et de moins de 28 ans. Vous devez être de nationalité française ou européenne (ressortissant des Etats membres de l\'Espace Economique Européen qui regroupe les 28 Etats membres de l\'Union européenne, la Norvège, l\'Islande, le Lichtenstein) ou monégasque.', 1324, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=040234aaaccc766f&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24');
INSERT INTO `post_jobs` (`id`, `job_id`, `created_by`, `job_for`, `job_descripton`, `country_id`, `job_requirements`, `num_of_candidates`, `phone`, `prefered_gender`, `max_salary`, `currency_id`, `min_salary`, `visa_statues`, `living_arrangments`, `educational_level`, `religion`, `experience`, `martial_status`, `request_status`, `nationality`, `seen`, `availability`, `industry_id`, `link`, `created_at`, `updated_at`) VALUES
(9790, 1474, 1512, 'Jobs in KSA', 'Fecha de publicación Aug 09, 2018Número de Empleo 180028OFCategoría de Empleo Finanzas y ContabilidadUbicación Sheraton Makkah Jabal Al Kaaba Hotel, Makkah, Arabia Saudita VER EN MAPAMarca Sheraton Hotels & ResortsHorario Tiempo completo¿Reubicación? NoTipo de Posición Non-GestionComience su aventura con nosotros\nEn Sheraton, vamos más allá en todo lo que hacemos. Nuestra inspiración son nuestros huéspedes y las personas que tenemos a nuestro alrededor, y nos esforzamos constantemente por mejorar. Disfrutamos mucho de lo que hacemos, y ponemos todo nuestro esfuerzo en ello, dentro y fuera de la propiedad. Cuando los huéspedes se hospedan en nuestros hoteles, no es simplemente una habitación con una cama lo que obtienen, sino una experiencia. Estamos buscando a alguien capaz de esforzarse más allá de sus propios límites en todo lo que haga. Si tiene un impulso genuino por mejorar su vida y la de los que lo rodean, lo invitamos a explorar carreras en Sheraton.Descripción del Trabajo\n Comprobar las cifras, los asientos y los documentos para obtener un ingreso correcto de la información, exactitud matemática y códigos adecuados. Organizar, asegurar y mantener todos los archivos, registros, efectivo y los equivalentes de efectivo según las políticas y procedimientos. Registrar, guardar, tener acceso y/o analizar información financiera computarizada. Clasificar, codificar y resumir la información numérica y financiera a fin de recopilar y mantener registros financieros mediante la utilización de libros diarios, libros de contabilidad y/o computadoras. Completar los procedimientos e informes de cierre al término del período según lo especificado. Auditar las cajas periódicamente según los procedimientos operativos estándares (Standard Operating Procedures, SOP). Mantener, distribuir y registrar la caja chica, las cajas y los contratos. Documentar, mantener, comunicar y actuar ante cualquier diferencia de efectivo según los SOP. Actuar como enlace entre el hotel y el servic', 1156, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=6d655de54b34ab70&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9791, 1475, 1944, 'Jobs in KSA', '1. Grow and maintain the customer base in the Expat and Visitors segment, mainly by developing and owning the strategy to grow the segment, suggesting strategic and tactical actions using all available levers.\n\n2. Deliver a Segmented Lifecycle Management model as a tool to keep the customer base segments under control and to define segmented opportunities.\n\n3. Ensure a holistic understanding of the Expat and visitors segment for different nationality segments from end to end to come up with new growth levers\n4. Thoroughly understand the key commercial expat and visitors segment opportunities that exist for Pre-Paid & Post-paid customers based on the insights and ensure propositions/ promotions are designed.\n5. Complete proposition design covering end-to-end proposition (complete CLM). & work with the insights as well as critical stakeholders in the business to develop the proposition for Pre-paid & Post-paid customers.\n6. Drive and work on the implementation of the expat segment strategy through understanding the key customer Segment needs, developing clear insights for these customers and creating customer propositions based on these insights which span our full range of products, services and customer experience.\n7. Drive value based segmentation across the expat segment for implementing proposition structures and pricing plans to deliver better-targeted and complete propositions\n\n8. Provide active support to the development and execution of the propositions to deliver customized launches that will enhance the commercial performance. Support the Expat and Roaming head in the required way to maximize commercial performance through proposition development and enhancing the revenues for the existing base.\n9. Drive future revenue streams for the expat segment by developing future proposition models/ concepts that encompassing new applications, mobile data advanced digital services for voice.\n\n10. Establish best practices for the expat & Visitors segment in the area of', 1325, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=0bf147b91aed5a53&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9792, 1476, 1945, 'Jobs in KSA', 'Works independently and ensures a safe and proper environment for testing in the Laboratory, on the wards, in the operating room, Cardiac Cath Lab, Emergency Room or any other area as required. Prepares the patient for the study, explains the procedure to the patient, puts the patient at ease and obtains any relevant medical information as required. Performs non-invasive cardiac testing such as but not limited to ECG, Holter monitoring, stress testing, pacemaker and ICD analysis, blood pressure monitoring and echocardiography. Recognizes and eliminates artefacts to produce meaningful diagnositc information which is presented to the physician for interpretation. Performs other duties as assigned.\nEssential Responsibilities and Duties1.Independently performs non-invasive cardiac investigations such as but not limited to ECG, Holter monitoring, stress testing, pacemaker and ICD analysis, blood pressure monitoring, echocardiography procedures including Transesophageal Echocardiography (TEE) and Stress Echocardiography (SE).\n2.Calibrates and operates equipment as required.\n3.Performs urgent procedures on critically ill patients portably on the wards, in the Operating Room (O.R.), Cardiac Cath Lab, ICUs, Emergency Room and any other location as requested and as required.\n4.Assists physicians with procedures in the Operating Room, Cardiac Cath Lab or any other setting as required.\n5.Observes and monitors patients during procedures, notes signs of distress and/or medical emergencies, takes remedial action and notifies the nurse or/and physician as necessary.\n6.Produces meaningful diagnostic information, obtains measured and calculated data and makes preliminary reports for review by the reporting physician.\n7.Documents and logs all patient events and procedures.\n8.Ensures a safe environment and safe operation of equipment. Monitors equipment and reports any hazards or needs for repair and maintenance to Senior Cardiovascular Technologist or Manager.\n9.Cleans and disinfects ', 1326, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=bfd1cda60f97c700&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9793, 1477, 1512, 'Jobs in KSA', 'Datum umístění Aug 09, 2018Číslo Pracovní Pozice 180028OFKategorie Práce Finance a účetnictvíPracoviště Sheraton Makkah Jabal Al Kaaba Hotel, Mekka, Saúdská Arábie ZOBRAZIT NA MAPĚZnačka Sheraton Hotels & ResortsPlný úvazek Plný úvazekOchota k přestěhování NeTyp pozice Nemanažerská pozice / hodinová mzdaZačněte svou cestu u nás\nV Sheratonu se snažíme překonat běžné standardy při všem, co děláme. Inspirují nás naši hosté a také se inspirujeme navzájem, to nám pomáhá se zlepšovat. Milujeme to, co děláme, dáváme tomu všechno - v hotelu i mimo něj. Když se u nás host ubytuje, nedostane za své peníze pouze pokoj s postelí. Dostane zážitek. Hledáme někoho, kdo se snaží překonávat běžné standardy při všem, co dělá. Pokud jste někdo, kdo se doopravdy pořád snaží změnit svůj život a životy těch okolo sebe k lepšímu, doporučujeme Vám prozkoumat pracovní příležitosti v Sheratonu.Marriott International je zaměstnavatel, který poskytuje rovné příležitosti, zaměstnává rozmanité pracovníky a vytváří firemní kulturu otevřenou všem. Společnost Marriott International nediskriminuje žádné skupiny osob, které federální, státní nebo místní zákony klasifikují jako postižené, veterány nebo jinak ohrožené.', 1156, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=627c26e5d5688c60&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9794, 1478, 1946, 'Jobs in KSA', 'Mechanical Engineer\nProvide technical recommendations, proposals or responses as requested from outside TSD, relevant to day to day facility engineering issue.\nDuties and Responsibilities\n Provide technical recommendations, proposals or responses as requested from outside TSD, relevant to day to day facility engineering issue. Provide technical assistance based on SSE/SE direction to urgent plant situations in the area of Mechanical as required. Provide technical review and consultation to design document provided by others in the area of Mechanical as required. Participate in Task Force / Facility incident investigations. Provide technical review and advice on MOC, Trip report and Hazard studies. Participate in regular meeting, OJT and training courses. Provide technical review for excavation permit.\n\nQualifications\nQualifications & Education\n Bachelor degree in Mechanical Engineering or equivalent from reputable university. More than 7 years of experience in Oil Refining and Petrochemical Plants possibly combined with EPC contractor experience. Combined experience with design, material selection, analysis/calculation, field construction, troubleshooting in mechanical & piping. Good knowledge of Mechanical engineering practices and calculation methods in basic. Good knowledge of Piping engineering practices, design details and calculation methods including CAD practice. Good understanding of industrial standards, international code requirement and Company work procedures.', 1327, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=d7db6eb019910bf0&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9795, 1479, 1947, 'Jobs in KSA', 'Estudios Mínimos: Ingeniería Técnica/Superior\n\nIdiomas: Nivel Alto de idioma Inglés.\n\nExperiencia de 5 años mínimo en esta función en empresas de ingeniería de sectores de Energía (Ciclo Combinado+Campo Solar). Desarrollará su función en el site. Asimismo, se requiere experiencia en:\nOperación de Turbinas de Gas\nOperación de turbinas de Vapor\nExperiencia obligatoria como Jefe de Operación en Plantas de Energia\nOtros Requisitos\nUsuario de paquete ofimático\nDisponibilidad para viajar tanto a nivel nacional como internacional\nFunciones:\n\nJefe de operación en Plantas de Energía.', 1328, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=6e66d9459b91f91e&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
