(9799, 1483, 322, 'Jobs in KSA', 'Date de publication Jun 25, 2018Numéro de l\'Emploi 18001RWGCatégorie d\'Emploi Ingénierie et InstallationsLieu Four Points by Sheraton Riyadh Khaldia, Riyad, Arabie Saoudite AFFICHER SUR LA CARTEEnseigne Four PointsHoraire Temps pleinMutation? NonType de Poste Non-cadreCommencez votre parcours chez nous\nLà où le classique intemporel se mêle aux détails modernes. Là où le travail s’allie au plaisir. Même si vous êtes un citoyen du monde, vous pouvez profiter de ce qui se fait localement. L’enseigne Four Points est conçue pour le voyageur indépendant en quête d’équilibre.Résumé des fonctions\n Répondre et traiter les demandes de réparation des clients. Communiquer avec les clients afin de résoudre les problèmes de maintenance. Effectuer l’entretien préventif des outils et de l’équipement de la cuisine et de la chambre des appareils mécaniques, y compris le nettoyage et la lubrification. Inspecter visuellement les outils, l’équipement ou les machines. Transporter de l’équipement (p. ex., outils, radio). Identifier, localiser et actionner toutes les vannes d’arrêt de l’équipement et toutes les manettes de fermeture des services publics pour les bâtiments. Maintenir les stocks requis pour l’entretien et commander les pièces et les fournitures nécessaires. Communiquer les activités et les problèmes qui se produisent chaque jour aux autres équipes à l’aide des normes et des programmes de communication approuvés. Avoir des connaissances de base ou la capacité d’acquérir ces connaissances dans les catégories suivantes : climatisation et réfrigération, électricité, mécanique, plomberie, systèmes et contrôles pneumatiques et électroniques, menuiserie et finition, matériel de cuisine, véhicules, conservation de l’énergie et en bâtiment. Effectuer toute la préparation de surfaces, la peinture, les réparations mineures aux plaques de plâtre et aux boiseries, le remplacement des ampoules et des filtres de climatiseur, et le nettoyage complet et minutieux des zones de peinture ou de ', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=2e8ef393da9d6003&from=serp&vjs=3', '2018-08-17 18:17:24', '2018-08-17 18:17:24'),
(9800, 1484, 1121, 'Jobs in Oman', 'Date de publication Jul 18, 2018Numéro de l\'Emploi 180020ENCatégorie d\'Emploi Finance et ComptabilitéLieu Sheraton Oman Hotel, Oman, Oman AFFICHER SUR LA CARTEEnseigne Sheraton Hotels & ResortsHoraire Temps pleinMutation? NonType de Poste Non-cadreCommencez votre parcours chez nous\nAu Sheraton, nous nous surpassons dans tout ce que nous entreprenons. Nos clients et nos collègues nous stimulent : ils nous encouragent à toujours faire mieux. Nous aimons ce que nous faisons et nous y mettons tout notre cœur, au travail comme ailleurs. Quand nos clients séjournent chez nous, ce n’est pas juste une chambre avec un lit qu’ils recherchent. Ils veulent vivre une expérience. Nous recherchons des personnes prêtes à se dépasser dans tout ce qu’elles entreprennent. Vous cherchez sincèrement à améliorer votre vie et celle de votre entourage ? Nous vous invitons à consulter les offres d’emploi proposées par l’enseigne Sheraton.Résumé des fonctions\n Contrôler l\'exactitude des chiffres, reports et documents. Organiser, assurer la sécurité et gérer l\'ensemble des livres de comptes, des dossiers, de la trésorerie et équivalents de trésorerie dans le respect des politiques et procédures. Enregistrer, stocker, avoir accès à et/ou analyser des informations financières informatisées. Classer, coder et synthétiser des données chiffrées et financières afin de compiler et de conserver des données financières dans des journaux, grands livres et/ou sur ordinateur. Préparer, tenir à jour, analyser et diffuser des tableaux et rapports statistiques, financiers, comptables, d\'audit ou de paie. Mener à bien les procédures et préparer les rapports de fin d\'exercice selon les instructions. Préparer, vérifier, rapprocher et éditer les notes, factures et extraits de compte en fonction des procédures de la compagnie. Encaisser les sommes dues et régler les factures fournisseurs, et suivre les paiements jusqu\'à leur terme. Préparer les dépôts quotidiens de l\'argent liquide reçu de l\'ensemble des employé', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=9b50735cbdc40a31&from=serp&vjs=3', '2018-08-17 18:17:25', '2018-08-17 18:17:25'),
(9801, 1485, 1121, 'Jobs in Oman', 'Fecha de publicación Jul 18, 2018Número de Empleo 180020ENCategoría de Empleo Finanzas y ContabilidadUbicación Sheraton Oman Hotel, Omán, Omán VER EN MAPAMarca Sheraton Hotels & ResortsHorario Tiempo completo¿Reubicación? NoTipo de Posición Non-GestionComience su aventura con nosotros\nEn Sheraton, vamos más allá en todo lo que hacemos. Nuestra inspiración son nuestros huéspedes y las personas que tenemos a nuestro alrededor, y nos esforzamos constantemente por mejorar. Disfrutamos mucho de lo que hacemos, y ponemos todo nuestro esfuerzo en ello, dentro y fuera de la propiedad. Cuando los huéspedes se hospedan en nuestros hoteles, no es simplemente una habitación con una cama lo que obtienen, sino una experiencia. Estamos buscando a alguien capaz de esforzarse más allá de sus propios límites en todo lo que haga. Si tiene un impulso genuino por mejorar su vida y la de los que lo rodean, lo invitamos a explorar carreras en Sheraton.Descripción del Trabajo\n Comprobar las cifras, los asientos y los documentos para obtener exactitud. Organizar, asegurar y mantener todos los archivos, registros, efectivo y los equivalentes de efectivo según las políticas y procedimientos. Registrar, guardar, tener acceso y/o analizar información financiera computarizada. Clasificar, codificar y resumir la información numérica y financiera a fin de recopilar y mantener registros financieros mediante la utilización de libros diarios, libros de contabilidad y/o computadoras. Preparar, mantener, auditar y distribuir las tablas y los informes estadísticos, financieros, contables, de auditoría o de nómina. Completar los procedimientos e informes de cierre al término del período según lo especificado. Preparar, examinar, conciliar y emitir las cuentas, las facturas y los estados de cuenta según los procedimientos de la compañía. Hacer un seguimiento y resolver las cuentas atrasadas y las facturas de los proveedores hasta que se reciba o se resuelva el pago total. Preparar depósitos consolidados d', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=551052b44f0f0ad7&from=serp&vjs=3', '2018-08-17 18:17:25', '2018-08-17 18:17:25'),
(9802, 1486, 1121, 'Jobs in Oman', 'Data publicării Jun 21, 2018Număr post 18000UWHCategoria postului Alimentație, băuturi și servicii culinareLocaţie Sheraton Oman Hotel, Oman, Oman VIEW ON MAPBrand Sheraton Hotels & ResortsOrar Normă întreagăRelocare? NuTipul postului În afara posturilor de conducere/cu oraÎncepeți călătoria alături de noi\nLa Sheraton, ne depășim în tot ceea ce facem. Suntem inspirați de oaspeți și ne inspirăm unii pe ceilalți – ne dorim să facem lucrurile mai bine. Iubim ceea ce facem și oferim tot ce putem – în hotel și în afara acestuia. Când oaspeții se cazează la noi, ei nu cumpără numai o cameră cu un pat. Este o experiență. Căutăm persoane gata să se autodepășească în tot ceea ce fac. Dacă sunteți o persoană cu o dorință adevărată de a îmbunătăți viața dumneavoastră și a celor din jur, vă încurajăm să explorați oportunitățile de carieră de la Sheraton.Marriott International este un angajator care pune în aplicare o politică de egalitate de șanse, este hotărât să angajeze o forță de muncă diversă și susține o cultură incluzivă.', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=12bd17897fe1d339&from=serp&vjs=3', '2018-08-17 18:17:25', '2018-08-17 18:17:25'),
