todas las llamadas, las solicitudes, l', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://om.indeed.com/viewjob?jk=d3d432ddaa6fad20&from=serp&vjs=3', '2018-08-17 18:17:25', '2018-08-17 18:17:25'),
(9804, 1488, 1950, 'Jobs in KSA', '-Sous l\'autorité de la conseillère/du conseiller de coopération et d\'action culturelle (COCAC), concevoir et piloter la\npolitique de coopération (éducation, culture, universitaire, scientifique, langue française, audiovisuel, institutionnel)\npour promouvoir les intérêts et l\'influence de la France dans la région ouest du RoyaumeRelais du SCAC de l\'Ambassade au Consulat général de Djeddah ; représentant du SCAC de l\'ambassade et du\nConsulat Général dans les instances de gestion de l\'école française de Djeddah\n\nACTIVITES PRINCIPALES\n-Conseil au Consul Général sur les questions de coopération culturelle, scientifique, universitairesDans le cadre du plan stratégique pays, pilotage et cadrage de la coopération bilatérale pour la région ouestProposition et élaboration de projets de partenariats entre des partenaires saoudiens et des opérateurs /établissements\nfrançais (IF, Campus France, Musées, festivals, Universités)Levée de fonds, mise en oeuvre et suivi des projets ainsi que de l\'assistance technique relevant du MEAE ou\nd\'opérateurs extérieurs ; évaluation des projetsPromotion des études en France et accompagnement des étudiants saoudiens et tiers dans leur projet d\'études en France\nvia l\'animation de l\'Espace Campus France de DjeddahExplorer l\'association de la coopération française aux processus communautairesSoutien à l\'accès à la culture pour la jeunesse saoudienne et à la création pour les jeunes talents locaux (accompagner\nl\'ouverture du pays en mettant en valeur l\'expertise culturelle française)Promotion de la création contemporaine françaisePromotion de la langue française, coopération éducative francophoneDéfinition et mise en oeuvre d\'un programme de coopération éducative pour les 7 écoles francophones de Djeddah et\nles deux Départements d\'universités saoudiennes de Djeddah ; recherche de nouveaux partenairesReprésentation de l\'Etat au conseil de gestion de l\'Ecole française internationale de Djeddah (conventionnée MLF).\nDans ce cadre, coordination du projet', 1329, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=4d072dec0e5dc38f&from=serp&vjs=3', '2018-08-17 18:17:25', '2018-08-17 18:17:25'),
(9805, 1489, 1951, 'Jobs in KSA', 'Solutions Integration Architect | Advanced ServicesWhat You’ll Do\nThe Advanced Services (AS) Solution Integration Architect (SIA) will be responsible for identifying Customer challenges and craft operational business proposals and solutions.\nTranslate: The SIA will be able to bridge between IT and the board room. You will be able to explain technical challenges in a business context and vice versa. They can articulate how business requirements translate into design decisions and how design decisions enable/impact the businessIntegrate: The SIA will understand the technical environment end-to-end. You will be expected to know how changes in one architecture could impact another architecture. If there are multiple architectures and partners involved, you will be responsible for the coordination of everything in the technical solution - they don’t need to know everything, but they need to synchronize the people who doBridge: The SIA is the bridge between pre-sales and post-sales. You will need to partner with the CSA/SE to ensure we have a smooth transition from what we’ve sold (and the associated customer expectations) and what we ultimately deliverExpand: The SIA will have a unique relationship with the operations and architecture teams. Your role will be to feed intelligence back into the account team to enable them to sell more. You will instinctively know that a competitor is having challenges and make recommendations to the CSA/Client Exec that it is a good day to talk about a relevant Cisco solution. The SIA should help expand our relevance and enable the product sales team.\nWho You’ll Work With\nAs the Solutions Integration Architect, your role will sit within the Advanced Services team reporting into the Senior Manager of Service Delivery in the Kingdom of Saudi Arabia. Similar to the Service Delivery Manager, you will have an integral partnership with the counterpart in the Services Sales team.\nWho You Are\nYou’ll have a deep understanding of Customer Business ', 1330, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=9e71cc9caa9c671a&from=serp&vjs=3', '2018-08-17 18:17:25', '2018-08-17 18:17:25'),
(9806, 1490, 1512, 'Jobs in KSA', 'Data publicării Jul 12, 2018Număr post 18001XGFCategoria postului Tehnologia informațieiLocaţie Le Méridien Medina, Madinah, Arabia Saudită VIEW ON MAPBrand Le MeridienOrar Normă întreagăRelocare? NuTipul postului În afara posturilor de conducere/cu oraÎncepeți călătoria alături de noi\nPortofoliul de mărci Marriott International include atât JW Marriott cât și Marriott Hotels.\nMarriott Hotels, marca principală a Marriott International, cu peste 500 de unități globale, duce mai departe arta găzduirii, astfel încât oaspeții noștri să poată călători superb. În calitate de gazdă la Hotelurile Marriott, veți ține această promisiune, oferind opțiuni de calitate superioară, stil sofisticat și detalii elaborate cu grijă. Cu aptitudinile și imaginația dumneavoastră, împreună vom inova și reinventa viitorul călătoriilor.\nJW Marriott face parte din portofoliul de lux al Marriott International și constă din peste 80 de unități frumoase, operate în orașe-gateway și stațiuni distincte din întreaga lume. La JW Marriott considerăm că angajații noștri se află pe primul loc. Dacă sunteți fericit și oaspeții noștri vor fi fericiți. E chiar atât de simplu. Hotelurile noastre vă oferă o experiență de muncă unică, unde veți face parte dintr-o comunitate deosebită și vă veți bucura de un spirit de camaraderie într-un un grup divers de colegi. La JW Marriott creăm numeroase oportunități pentru instruire, dezvoltare, recunoaștere și, cel mai important, un loc unde să vă puteți urma pasiunile într-un mediu de lux. Tratarea oaspeților într-un mod excepțional începe prin felul în care ne îngrijim de angajații noștri. Acesta este JW Treatment™.Marriott International este un angajator care pune în aplicare o politică de egalitate de șanse, este hotărât să angajeze o forță de muncă diversă și susține o cultură incluzivă.', 1156, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=5bb37df37fcf065c&from=serp&vjs=3', '2018-08-17 18:17:25', '2018-08-17 18:17:25'),
