(9808, 1492, 1121, 'Jobs in UAE', 'Data publicării Aug 02, 2018Număr post 180025VOCategoria postului Menaj și spălătorieLocaţie Marriott Hotel Downtown, Abu Dhabi, Abu Dhabi, Emiratele Arabe Unite VIEW ON MAPBrand Marriott Hotels Resorts /JW MarriottOrar Normă întreagăTipul postului În afara posturilor de conducere/cu oraÎncepeți călătoria alături de noi\nPortofoliul de mărci Marriott International include atât JW Marriott cât și Marriott Hotels.\nMarriott Hotels, marca principală a Marriott International, cu peste 500 de unități globale, duce mai departe arta găzduirii, astfel încât oaspeții noștri să poată călători superb. În calitate de gazdă la Hotelurile Marriott, veți ține această promisiune, oferind opțiuni de calitate superioară, stil sofisticat și detalii elaborate cu grijă. Cu aptitudinile și imaginația dumneavoastră, împreună vom inova și reinventa viitorul călătoriilor.\nJW Marriott face parte din portofoliul de lux al Marriott International și constă din peste 80 de unități frumoase, operate în orașe-gateway și stațiuni distincte din întreaga lume. La JW Marriott considerăm că angajații noștri se află pe primul loc. Dacă sunteți fericit și oaspeții noștri vor fi fericiți. E chiar atât de simplu. Hotelurile noastre vă oferă o experiență de muncă unică, unde veți face parte dintr-o comunitate deosebită și vă veți bucura de un spirit de camaraderie într-un un grup divers de colegi. La JW Marriott creăm numeroase oportunități pentru instruire, dezvoltare, recunoaștere și, cel mai important, un loc unde să vă puteți urma pasiunile într-un mediu de lux. Tratarea oaspeților într-un mod excepțional începe prin felul în care ne îngrijim de angajații noștri. Acesta este JW Treatment™.Marriott International este un angajator care pune în aplicare o politică de egalitate de șanse, este hotărât să angajeze o forță de muncă diversă și susține o cultură incluzivă.', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NU