(9809, 1493, 1121, 'Jobs in UAE', 'Data publicării Aug 09, 2018Număr post 180023DMCategoria postului Alimentație, băuturi și servicii culinareLocaţie Marriott Executive Apartments Dubai Creek, Dubai, Emiratele Arabe Unite VIEW ON MAPBrand Marriott Executive ApartmentsOrar Normă întreagăTipul postului În afara posturilor de conducere/cu oraÎncepeți călătoria alături de noi\nLumea este un loc uriaș, iar Marriott Executive Apartments oferă apartamente corporative în cele mai mari și mai bune orașe pentru călătoriile de afaceri din Europa, Asia, America Latină și Orientul mijlociu. Alăturați-vă echipei Marriott Executive Apartments și ajutați-i pe oaspeții noștri să se adapteze la noul spațiu local și să se simtă confortabil și înconjurați de grijă, trăind la distanță de căminul lor.Marriott International este un angajator care pune în aplicare o politică de egalitate de șanse, este hotărât să angajeze o forță de muncă diversă și susține o cultură incluzivă.', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=e1236a9e9207c0fe&from=serp&vjs=3', '2018-08-17 18:17:27', '2018-08-17 18:17:27'),
(9810, 1494, 1953, 'Jobs in UAE', 'La Dirección de Transformación Digital de ACCIONA Infraestructuras busca incorporar una persona que se encargue de la operación de una instalación de impresora 3D a gran escala en Dubái.\nFuncionesAsegurar la óptima implantación y funcionamiento de los equipos de 3D a gran escala y periféricos.Planificación de producción de los equipos y gestión de personal.Relación con subcontratistas y proveedores.Apoyo a la unidad de desarrollo de negocio en gestión con clientes.Elaboración de ofertas.Coordinar actividades de mejora continua en procesos y materiales con equipo de Innovación Corporativa.Control de costes en coordinación con personal administrativo.Coordinar labores de control de calidad, prevención de riesgos laborales, gestión de residuos.\nRequisitosFormación en ingeniería industrial, eléctrica o mecánica.Experiencia en proyectos de innovación con la implantación de prototipos de equipos industriales.Nivel alto de inglés.Al menos diez años de experiencia en proyectos industriales o en construcción.Disponibilidad para viajar.\nACCIONA es una multinacional española líder en la promoción y gestión de energías renovables e infraestructuras (construcción, agua, industrial y servicios). Con más de un siglo de trayectoria, está formada por más de 30.000 empleados, tiene presencia en más de 30 países de los cinco continentes y forma parte del IBEX-35.', 1332, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=1fb53b9fe1216a7a&from=serp&vjs=3', '2018-08-17 18:17:27', '2018-08-17 18:17:27'),
(9811, 1495, 1121, 'Jobs in UAE', 'Data publicării Apr 22, 2018Număr post 180015JECategoria postului Utilaje și instalațiiLocaţie Aloft Al Ain, Al Ain, Emiratele Arabe Unite VIEW ON MAPBrand Aloft HotelsOrar Normă întreagăRelocare? NuTipul postului În afara posturilor de conducere/cu oraÎncepeți călătoria alături de noi\nLa Aloft Hotels suntem conectați la călătorii din generația următoare care iubesc spațiile deschise, gândirea deschisă și exprimarea deschisă. Aloft oferă un spațiu în care stilul este necesar, scenele sociale vibrează și unde singura direcție este spre înainte. Oaspeții noștri sunt entuziaști ai tehnologiei și eminamente sociali, cu un stil eclectic pe care nu se tem să-l afișeze. Înțelegem necesitățile oaspeților noștri, astfel că oferim o opțiune accesibilă gurului de design expert în tehnologie. Căutăm persoane inovatoare, expresive care nu se tem să tragă linii în afara șablonului. Dacă sunteți o persoană care apreciază caracteristicile futuriste ale tehnologiei și scenele sociale vibrante, vă invităm să explorați oportunitățile de carieră de la Aloft Hotels.Marriott International este un angajator care pune în aplicare o politică de egalitate de șanse, este hotărât să angajeze o forță de muncă diversă și susține o cultură incluzivă.', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=c11e5bdbd0090758&from=serp&vjs=3', '2018-08-17 18:17:27', '2018-08-17 18:17:27'),
(9812, 1496, 1121, 'Jobs in UAE', 'Data publicării Jul 17, 2018Număr post 18001ZYPCategoria postului AdministrativLocaţie Four Points by Sheraton Sharjah, Sharjah, Emiratele Arabe Unite VIEW ON MAPBrand Sheraton Hotels & ResortsOrar Normă întreagăRelocare? NuTipul postului În afara posturilor de conducere/cu oraÎncepeți călătoria alături de noi\nLocul unde piesele clasice eterne sunt întrețesute cu detalii moderne. Unde afacerile se îmbină cu plăcerea. Locul în care, chiar dacă sunteți o persoană globală, puteți avea parte de lucruri locale. Conceput pentru călătorul independent care caută echilibru: vă prezentăm Four Points.Marriott International este un angajator care pune în aplicare o politică de egalitate de șanse, este hotărât să angajeze o forță de muncă diversă și susține o cultură incluzivă.', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=7329db69ac9173d2&from=serp&vjs=3', '2018-08-17 18:17:27', '2018-08-17 18:17:27'),
(9813, 1497, 1524, 'Jobs in UAE', 'Grade: K\nCandidate with good MIS skills are preferred.\nJob Purpose:\nThe purpose of the job is to carry out processing of the credit card personal loan and auto loan and mortgage application generated by DSA teams The role holder would be the point\nof contact from Emirates NBD for sourcing the complete applications in lieu with Emirates NBD policy process and documentation\nJob Requirements:\nPrescreening Applications Documents\nIncome proof profiling\nChecklist applicable stamps ops control\nAECB check GRC comments\nCase History on CAS company customer\nSalary Credit Status Fiancle\nData Entry Fresh Resub\nScheme and update as per policy\nGenerate tracker number\nArrange documents as per BPM guidelines\nScanning and moved into RCC queue\nEnsure maintenance of the credit card file record in RMC\nCancel Cases Reason wise SEBDE Channel Wise SR to be generated\nApproved Rejected cases SEBDE Channel Wise\nEVCVOV Cases to be follow up Approved PDOC cases to be follow up\nRejected cases Follow up and generate SE number\nPrepare MIS on daily basis channel wise\nAction Plan MIS for Next day\nCoordinate with the processing teams for timely disbursal of credit card personal loan and Auto Loan\nEnsure rejection and discrepancies are minimum\nCoordinate with branches for CIF related cases and raise SR for the resolution of the suspensionQualifications\nCollege Graduate\nExperience in Sales Business Development Customer Service MIS\nUnderstanding of regional market and customers\nKnowledge of common banking products esp. liability products\nRetail Products Services along with processes\nMIS Analytics\nRelationship Management skills\nAbility to articulate problems analyze issues and recommend solutions\nStrong communication and collaboration skills2 to 4 years of age\nPrimary Location: United Arab Emirates-Dubai-Dubai - Deira, Baniyas Road, Enbd Head Office\nJob: Processing\nOrganization: Distribution\nSchedule: Regular\nShift: Standard\nJob Type: Full-time\n Day Job\nJob Posting: Jul 18, 2018, 10:06:02 AM', 1166, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=d57c1dddaaf5ffa2&from=serp&vjs=3', '2018-08-17 18:17:27', '2018-08-17 18:17:27'),
(9814, 1498, 1121, 'Jobs in UAE', 'Data publicării Aug 09, 2018Număr post 180028RCCategoria postului AdministrativLocaţie Le Méridien Mina Seyahi Beach Resort & Marina, Dubai, Emiratele Arabe Unite VIEW ON MAPBrand Le MeridienOrar Normă întreagăRelocare? NuTipul postului În afara posturilor de conducere/cu oraÎncepeți călătoria alături de noi\nAici, la Le Méridien, suntem convinși că ajutând oaspeții, deblocăm experiențele neașteptate și antrenante pe care fiecare destinație le poate oferi. Oaspeții noștri sunt persoane avide de cultură, curioase și creative, cosmopolitane, care apreciază serviciile sofisticate, atemporale. Oferim servicii și experiențe originale, șic și memorabile care îi inspiră pe oaspeți să deslușească destinația. Căutăm persoane curioase, creative și bine informate care să se alăture echipei noastre. Dacă vă face plăcere să intrați în legătură cu oaspeți care gândesc la fel ca dumneavoastră și doriți din suflet să creați experiențe neașteptate, vă invităm să explorați oportunitățile de carieră de la Le Méridien.Marriott International este un angajator care pune în aplicare o politică de egalitate de șanse, este hotărât să angajeze o forță de muncă diversă și susține o cultură incluzivă.', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=9d725495a1561df6&from=serp&vjs=3', '2018-08-17 18:17:27', '2018-08-17 18:17:27'),
