(9816, 1500, 1954, 'Jobs in Qatar', 'Since 1939, COWI has pushed the boundaries of tunnelling, bridge, marine and foundation design through our involvement in more some of the world\'s largest, most iconic and complex projects.\n\nWith a full set of world-class competencies within tunnelling, bridge, marine and foundation engineering, combined with local presence and experience, our dedicated professionals are ready to take on the most complex projects anywhere in the world – no matter how large or small. We manage our projects from offices located in India, Scandinavia, UK, Germany, Middle East, SE Asia and North America.\n\nWe want to be the best place to work. We promote a collaborative mind-set, work internationally and engage with our colleagues, clients and stakeholders.\n\nWe are recognised as a centre of excellence for quality, innovation and client’s first choice. Our philosophy of getting it ‘right first time’ in tandem with producing alternative designs to ensure safe, economic and sustainable solutions has firmly established COWI as a leader in its field.\nOverview:\nFollowing further contract awards, we are experiencing an increased demand for our services and our strengthened position in the market brings a continuous flow of new extensive and challenging projects. Consequently, we are actively seeking to recruit a professional and an enthusiastic Accountants Assistant based in Dubai, ideally with previous accounting experience preferably in an engineering firm, to join our established team\nRole Summary:\nReporting to the Finance Manager, you will be accountable for preparing necessary spreadsheets and statutory accounts.\nDuties and Responsibilities include but are not limited to:Working with spreadsheets, ledgers and journals.\nPreparing statutory accounts\nManage Fixed Assets\nManage Payroll\nCalculating and checking to make sure payments, amounts and records are correct.\nManaging petty cash transactions.\nControlling credit and chasing debt.\nReconciling finance accounts and maintaining accruals\nTAX F', 1333, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=b71cff598354af0f&from=serp&vjs=3', '2018-08-17 18:17:27', '2018-08-17 18:17:27');
