(9817, 1501, 1121, 'Jobs in Qatar', 'Data publicării Aug 02, 2018Număr post 180025IPCategoria postului Operațiuni legate de camere și servicii pentru oaspețiLocaţie The Westin Doha Hotel & Spa, Doha, Qatar VIEW ON MAPBrand Westin Hotels & ResortsOrar Normă întreagăRelocare? NuTipul postului În afara posturilor de conducere/cu oraÎncepeți călătoria alături de noi\nLa Westin ne-am angajat să promovăm bunăstarea oaspeților noștri, oferindu-le un mediu reconfortant, înlesniri bine gândite și programări revitalizante pentru a se asigura că aceștia pleacă simțindu-se mai bine decât la sosire. Recunoaștem că deplasările pot fi deranjante pentru bunăstarea oaspeților noștri, iar noi suntem plini de energie în a-i asista ca parteneri să mențină controlul și să se ridice peste toate problemele în timpul deplasărilor. Tot ceea ce facem este conceput să-i ajute pe oaspeți să se mențină în cea mai bună formă, iar ei apreciază atitudinea noastră orientată spre sprijin, serviciile anticipative și cunoștințele cuprinzătoare despre cel mai bun mod de a-i asista pe parcursul șederii lor. Căutăm persoane dinamice, încântate să se alăture echipei și care sunt pregătite să sară în orice situație pentru a oferi ajutor. Dacă sunteți o persoană pozitivă, adaptabilă și intuitivă care este cu adevărat interesată de bunăstarea celorlalți, vă invităm să descoperiți cum putem să ne dezvoltăm împreună la Westin.Marriott International este un angajator care pune în aplicare o politică de egalitate de șanse, este hotărât să angajeze o forță de muncă diversă și susține o cultură incluzivă.', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=e33fdcc91d6f5fc4&from=serp&vjs=3', '2018-08-17 18:17:27', '2018-08-17 18:17:27'),
(9818, 1502, 1955, 'Jobs in Qatar', 'The Systems Engineers at Cisco are customer-focused technical sales professionals who provide high level technical support and guidance to customers. He/she collaborates with the Account Team to recommend and develop appropriate customer solution offerings.\n\nWe enable our top enterprise customers to transform their business to next generation architectures including new technologies, cloud models and new services. We leverage our assets to solve our enterprise customer’s critical challenges. Do you want to help with this change? You can have the ability to manage market transitions in new architectures like Enterprise Networking including Digital Network Architecture, next generation Data Center, Security and Collaboration with innovative Service concepts included.\n\nThe ideal candidate is an experienced systems engineer looking to build out their career to the next level and help drive key deals in selected Financial account as well as being an advocate for the customer within Cisco and contribute to a Global Cisco team.\nWhat You\'ll Do\nThe Systems Engineer provides an architectural perspective across the Cisco product portfolio and can leverage his / her technical specialization for specific opportunities.\nParticipate in the creation of an overall account plan\nParticipate in the creation of a technical account plan\nProactively generate leads through customer meetings, seminars, and education Qualify Opportunities\nDefine customer business problem in a technical context\nHelp plan for and move deals through the sales process by knowing how and when to engage the appropriate Cisco and partner tools and resources (such as CSE, SE, PSS, AS Engineers, etc.)\nDefine solution options and articulate the benefits of a Cisco solution\nResearch and demonstrate solution ROI\nCoordinate solution development, including leveraging replicable architectures and researching customized solutions\nDevelop proof of concept, including presentation and documentation of test results\nDevelop or o', 1334, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=02229de4ded9e957&from=serp&vjs=3', '2018-08-17 18:17:27', '2018-08-17 18:17:27'),
(9819, 1503, 1121, 'Jobs in Qatar', 'Datum umístění Jun 24, 2018Číslo Pracovní Pozice 18001RO4Kategorie Práce Gastronomie a kuchařstvíPracoviště The St. Regis Doha, Doha, Katar ZOBRAZIT NA MAPĚZnačka St. Regis Hotels & ResortsPlný úvazek Plný úvazekOchota k přestěhování NeTyp pozice Nemanažerská pozice / hodinová mzdaZačněte svou cestu u nás\nZnačka ST. Regis se věnuje luxusnímu ubytování již více než 110 let, vše začalo otevřením podniku St. Regis New York. Ve chvíli, kdy John Jacob Astor IV otevřel dveře svého mistrovského díla ve stylu Beaux-Arts nacházejícího se na Páté Avenue v New Yorku, St. Regis se okamžitě stal symbolem nekompromisní elegance a služeb ušitých na míru. Dnes s více než 40 podniky na těch nejlepších umístěních po celém světě je St. Regis místem, kde vznikají trendy, boří se hranice a hosté si zde znamenitě užívají svého pobytu. Vítáme Vás a dovolujeme si Vám představit pracovní příležitosti v St. Regis.Marriott International je zaměstnavatel, který poskytuje rovné příležitosti, zaměstnává rozmanité pracovníky a vytváří firemní kulturu otevřenou všem. Společnost Marriott International nediskriminuje žádné skupiny osob, které federální, státní nebo místní zákony klasifikují jako postižené, veterány nebo jinak ohrožené.', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=97069dd91ca511cc&from=serp&vjs=3', '2018-08-17 18:17:27', '2018-08-17 18:17:27'),
(9820, 1504, 1121, 'Jobs in Qatar', 'Datum umístění Jul 26, 2018Číslo Pracovní Pozice 18000UT2Kategorie Práce Pokojská a prádelnaPracoviště The St. Regis Doha, Doha, Katar ZOBRAZIT NA MAPĚZnačka St. Regis Hotels & ResortsPlný úvazek Plný úvazekOchota k přestěhování NeTyp pozice Nemanažerská pozice / hodinová mzdaZačněte svou cestu u nás\nZnačka ST. Regis se věnuje luxusnímu ubytování již více než 110 let, vše začalo otevřením podniku St. Regis New York. Ve chvíli, kdy John Jacob Astor IV otevřel dveře svého mistrovského díla ve stylu Beaux-Arts nacházejícího se na Páté Avenue v New Yorku, St. Regis se okamžitě stal symbolem nekompromisní elegance a služeb ušitých na míru. Dnes s více než 40 podniky na těch nejlepších umístěních po celém světě je St. Regis místem, kde vznikají trendy, boří se hranice a hosté si zde znamenitě užívají svého pobytu. Vítáme Vás a dovolujeme si Vám představit pracovní příležitosti v St. Regis.Marriott International je zaměstnavatel, který poskytuje rovné příležitosti, zaměstnává rozmanité pracovníky a vytváří firemní kulturu otevřenou všem. Společnost Marriott International nediskriminuje žádné skupiny osob, které federální, státní nebo místní zákony klasifikují jako postižené, veterány nebo jinak ohrožené.', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=5978ef771ffa40fb&from=serp&vjs=3', '2018-08-17 18:17:27', '2018-08-17 18:17:27'),
(9821, 1505, 1121, 'Jobs in Qatar', 'Fecha de publicación Jul 03, 2018Número de Empleo 18001V3SCategoría de Empleo Ventas y MárketingUbicación The Ritz-Carlton, Doha, Doha, Qatar VER EN MAPAMarca The Ritz-CarltonHorario Tiempo completo¿Reubicación? NoTipo de Posición Non-GestionComience su aventura con nosotros\nCon más de 80 propiedades galardonadas por todo el mundo, las damas y caballeros de The Ritz-Carlton crean experiencias tan excepcionales que, mucho después de que nuestros huéspedes hayan estado con nosotros, la experiencia continúa acompañándolos. Como principal proveedor mundial de experiencias de lujo, establecemos el nivel para servicios especiales y excepcionales en todo el mundo. Te invitamos a explorar The Ritz-Carlton.Descripción del Trabajo\n Diseñar y producir materiales de marketing incluyendo, entre otros, anuncios publicitarios, material adicional, señalización/señalética, piezas de sucesión de imágenes, folletos y presentaciones electrónicas que reflejen la imagen y estilo de la marca para aumentar los ingresos del hotel. Trabajar en conjunto con los gerentes de marketing y departamentos operativos relacionados como parte de un proyecto en equipo proporcionando soluciones de diseño y conceptualización concernientes a materiales que se entregan. Mantener familiaridad con la demografía de los clientes y desarrollar una apariencia y sensación apropiadas para todas las promociones y material adicional relacionado con el evento. Controlar el avance de todos los proyectos, incluyendo el mantenimiento de ficheros de proyectos y archivos, y facilitar la comunicación continua al equipo de marketing y/o proyectos con respecto al proyecto en curso y actualizaciones de estado. Ejecutar varios aspectos de producción incluyendo impresión, escaneado, retoque digital, edición de imágenes, efectos especiales y manipulación y diagramación de archivos.\n Obedecer todas las políticas y procedimientos de la compañía, asegurarse de que tanto su uniforme como su aspecto personal sean pulcros y profesional', 916, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=ebce7a17643ee037&from=serp&vjs=3', '2018-08-17 18:17:28', '2018-08-17 18:17:28'),
(9822, 1506, 1956, 'Jobs in Qatar', 'Senior Systems EngineerThe Role\nThe Senior Systems Engineer (SSE) is a customer-focused technical sales professional that provides pre-sales consulting, technical guidance, and hands-on assistance to customers and Nutanix channel partners. The SSE teams and collaborates with Nutanix sales teams to recommend and design effective and appropriate customer solutions based on Nutanix offerings.\nThe SSE acts in a consultative fashion and is looked to as an expert in his/her field by the Nutanix sales teams, business partners and customers.\nKey responsibilities of the SSE include:Articulate the features and benefits of Nutanix solutions and products.\nUnderstand the customer’s business drivers and how to map these to a Nutanix solution.\nProvide technical leadership in the Requirements Discovery, Solution Development, and Solution Proposal stages of the opportunity sales cycle.\nProvide channel partner enablement for selected channel partners in defined territory to include: regular product and solution updates, customized workshops, SE shadow program, and any other required tasks to enable partner to perform independent pre-sales support for small-to-medium size opportunities.\nPerform product demonstrations and presentations in support of company road show’s and events.\nManage, monitor, and/or perform solution evaluations and Proofs-of-Concept in support of sales opportunities either directly or through channel partners.\nPerform technical account management and act as an interface between the sales/pre-sales account teams and technical staff by monitoring and managing technical issues to conclusion, including any required management escalations required to resolve technical issues.\nAct as interface to Product Management to monitoring and manage feature requests and product roadmap issues to conclusion, including any required management escalations required to resolve related issues.\nProvide reporting and feedback on customer accounts and field activities to Sales, Product Ma', 1335, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://qa.indeed.com/viewjob?jk=7ffbd8fe1b6bd436&from=serp&vjs=3', '2018-08-17 18:17:28', '2018-08-17 18:17:28'),
(9823, 1507, 581, 'maidcv.com', '\r\n                            Dear Beloved,\r\n\r\nPlease however strange or surprising this contact may seem to you as we have not met personally or had any dealings in the past, I humbly ask that you take due consideration of it\'s importance and immense benefit, However, this is not mandatory nor will it in any manner compel you to honor against your will, I don\'t want you to feel sorry for me because I believe everyone will die someday, My name is Mrs. Lana Henriquez and I have been diagnosed with cancer & congested heart failure of which the doctors have confirmed that I don\'t have much time left after several tests carried out on me, I am about to undergo a surgery which I don’t stand a chance to survive it, I want God to be merciful to me and accept my soul so I have decided to give alms to charity organizations, as I want this to be one of the Last good deeds I do on earth, So far I have distributed money to some charity organizations here and nearby countries. Now that my health has deteriorated so badly I cannot do this myself anymore, I once asked members of my family to close my personal accounts and distribute the money which I have there to charity organizations in  some other places of their choice but they refused and kept the money to themselves, Hence I do not trust them anymore, as they seem not to be contended with what I have left for them, The last of my money which no one knows of it  a huge cash of ($3.500.000.00 USD) that my late husband deposited in a Finance Security Company in Ivory Coast before he died, I want to donate this money to someone who can use it and help me dispatch it to charity organizations and help the less privileges in his/her country, if only the person will be sincere to me then I will trust him/her and give the person more details on how to receive the money so Kindly contact me back with my private Email address below if you are interested to help me carry out this task.\r\n\r\nMy Email Address is:   lanaluck37171@yahoo.gr\r\n ', 1336, NULL, NULL, NULL, NULL, '5000.000', 6, '0.0000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-08-18 09:02:29', '2018-08-18 09:02:29'),
