(9834, 1518, 1176, 'Jobs in USA', 'Flexible nanny with open availability needed! Professional working couple that travels often for work is needing a nanny. The two kids 5 and under have consistent weekday childcare. The 40-45hr/wk guarantee will include weekend and evening work with some weekday needs. Looking for a hands on nanny who will play, play, play! Must have a degree and previous nanny experience. Position pays $50,000 with full benefits.Job Type: Full-timeSalary: $50,000.00 /yearExperience:nanny: 3 years (Preferred)', 1341, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/TLC-Family-Care/jobs/Full-Benefit-Nanny-a774119271d81791?vjs=3', '2018-08-20 03:07:39', '2018-08-20 03:07:39'),
(9835, 1519, 1905, 'Jobs in USA', 'FUN LOVING NANNY NEEDED! MUST enjoy the outdoors, sports and connects well with pre- teens to toddlers in Greenwich, CT! Must have a valid DL!START DATE: August 27, 2018COMMITMENT LENGTH: At least 1 year. Family prefers a long term commitment.LIVE IN/OUT ACCOMMODATIONS: Live In (overnight Friday and Saturday) Accommodations are own bedroom (with TV) and bathroom on the second floor of the home near the children.DAYS/HOURS: Friday 6:00pm to Sunday 6:00pm (48 hour shift). Family can be flexible on Friday start. Mornings would typically start around 8 AM.CHILDREN: 4 children 11, 9, 6 and 2.5 years oldMUSTS: Have experience with multiple children at a time (toddlers to teens.) Must be very organized and responsible. Always have safety as top priority. Proactive – always step in where needed. Must be comfortable driving children (in family’s car.) Be kind and a role model, but disciplined. Have own reliable transportation to get to / from family home. If nanny does not have a car, nanny can take train/uber. Family will help cover travel as needed. Have a valid drivers license and clear record.PREFERENCES: Someone who likes sports is a huge plus! (hockey and lacrosse.) Flexibility to travel is a plus! The job will be playing with kids and driving them to/from frequent weekend activities (sports and playdate)TRAVEL: Family travels to Canada and Wyoming in the summer. *Job is most weekends Sept 1 – June 30. Family is generally away school holidays – option for nanny to travel with some of them or not work. Family is away July/August and can discuss that on a one-off basis.JOB REQUIREMENTS/DUTIES: Care of all children; not always at once. Be able to help all around. Take children to sports / activities / etc. with family’s car. Prepare snacks and simple dinners for the children. Nanny may need to cook full meals for children and family, but can be pretty simple and not every weekend.PETS: Not currently but may in 2019 get a dog.GROSS SALARY/BENEFITS: $500-$600 a weekend.Job ', 1342, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/NY-Nanny/jobs/Weekend-Live-Nanny-02befa728e1d4143?vjs=3', '2018-08-20 03:07:39', '2018-08-20 03:07:39'),
(9836, 1520, 1961, 'Jobs in USA', 'Are you looking for a way to help students reach their potential at school? Make a difference today !\n\nTutoring is a perfect way to work around your busy class schedule while keeping your mind sharp! A tutor should be encouraging and help the student gain confidence in their abilities. You must have a passion for helping students learn and the ability to teach difficult concepts with new ideas.\n\nYou will be helping with homework assignments and projects. Picking up the student from school will also be needed occasionally. Tutoring will take place within the family home.\n\nPlease have the following qualifications:\nHave access to safe, reliable transportation and a good driving record.\nHave at least 2 non-related references (including babysitter work) related to working with children, paid or unpaid.\nHave the ability to pass extensive background check.\nExperience working as a tutor or performing homework help.About Us: College Nannies + Sitters + Tutors North Scottsdale aims for professional development and personal growth in you, the family and within our company. The people we hire have a broad set of personal skills (you don\'t have to be a college student!) who are ready to tackle the most common childcare and academic problems and make an impact on everyone we meet. We enable nannies and tutors to focus on their work with one student or family and bring a personalized solution to each case, making lives easier and better, one child at a time.', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=b850c549d6269534&from=serp&vjs=3', '2018-08-20 03:07:39', '2018-08-20 03:07:39'),
(9837, 1521, 1967, 'Jobs in USA', '***THIS POSTING IS FOR RNs, LPNs, CNAs, EXPERIENCED NANNIES (WITH REFERENCES), AND RN STUDENTS.***Let Mommy Sleep, Las Vegas overnight newborn care agency is currently hiring Registered Nurses, LPN\'s, CNA\'s, MA\'s and Newborn Caregivers for the best job in the world!Shifts are typically from 10pm-7am and caregivers feed, diaper, swaddle and provide all care of single babies and twins through the night.Nurses & Caregivers also provide evidence based postpartum care and education of parents, lactation assistance and answering all the questions that brand new parents have.We offer flexible schedules, a rewarding work environment supporting new families and a wonderful team to support you. Continuing education is also available. PRN\'s and Nursing students welcome!Learn more at:www.letmommysleep.com/lasvegaswww.letmommysleep.com/careers***MUST LIST ALL NEWBORN CARE EXPERIENCE ON RESUME IF NOT IN A CLINICAL SETTING.******NO PHONE CALLS PLEASE. THOSE SELECTED FOR AN INTERVIEW WILL BE NOTIFIED BY PHONE. THANK YOU!***Job Types: Part-time, ContractExperience:Newborn Care: 3 years (Required)Education:High school (Required)Location:Las Vegas, NV (Required)License:RN, LPN, CNA, Student RN (Preferred)Language:English (Required)Work authorization:United States (Required)Shifts:Graveyard (Required)Nursing Degree:Associates Degree in Nursing (Preferred)', 1147, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/job/night-nursenanny-rn-lpn-cna-student-rn-c0cba314f43ab4c6?vjs=3', '2018-08-20 03:07:39', '2018-08-20 03:07:39'),
(9838, 1522, 1196, 'Jobs in KSA', 'Proactive and Creative Nanny Sought in Riyadh | Flexible Start Date\nJob ref: N/Riyadh/2S\nA friendly client in Riyadh are searching for a creative and reliable Nanny primarily for their sons the eldest is almost 3 years old and the youngest 11 months old. They are searching for a nanny to oversee their youngest son’s maternity nurse as well as care for and educate their children.\n\nThese parents are very hands on and require a nanny who knows when to step back. The candidate would be scheduled to work for 12 hours a day 6 days a week, but the family on most days provide their nanny with free time whilst they spend quality time with their children.\n\nThe family are happy to provide their nanny with an en-suite bedroom and dressing room within the family house and are providing the nanny with a driver for use at work and on her day off. The nanny has the opportunity to visit the mall with the driver and can use the gym within the family house.\n\nThe nanny would not be required to perform any nursery duties; she would be required to pay close attention to the boys’ development and learning. The candidate should love children and be very creative and happy to engage the children in educational activities and games.\n\nThe family travels for approximately 3 months of the year and would require the nanny to travel with them. They ski every year and regularly travel to London and Europe. Whilst travelling the nanny is required be flexible with her working hours.\n\nThe salary for this position is approximately £1000 per week.\nRequirements\nLocation\nRiyadh\nStart date\nASAP\nDuration\nPermanent\nSalary\n£1000 pw\nHours\n12 hours 6 days a week\nLanguages\nEnglish, French\nPermanence\nPermanent\nChildren\nMale/3 years old, Male/7 months old,\nExperience\nEssential\nDriving licence\nNot Essential\nNon smoker\nEssential\nShared care\nYes\nSole charge\nYes\nAccommodation Details\nBasis\nLive-in\nAccommodation\nSeparate bedroom with en-suite bathroom and dressing room.\nFamily residence\nHouse\nOther Details\nNursery dut', 962, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=64569495fc821f99&from=serp&vjs=3', '2018-08-20 03:07:39', '2018-08-20 03:07:39'),
(9839, 1523, 1196, 'Jobs in KSA', 'Professional Nanny Sought in Saudi Arabia | 3.5 year old Twin Girls | ASAP Start Date\nJob ref: Pro/Nan/2\nFriendly family in Saudi Arabia are searching for a responsible and organised nanny for their twin girls aged 3.5 years old.\n\nThe family employ other members of staff, whom the nanny will work alongside, so nursery duties will be taken care of. The nanny will however be responsible for the twins education, daily routines, nuitrition and general development.\n\nThe ideal candidate will be flexible and comfortable with worldwide travel. The nanny will be experienced in planning fun and educational activities and outings to keep the children engaged and stimulated when travelling.\n\nThe family are seeking a nanny who is experienced in caring for children of a similar age, ideally childcare qualified, will be able to maintain a routine for the children and provide the best possible childcare whilst respecting the family’s culture.\n\nA separate en-suite bedroom will be provided for the nanny.\n\nFrench or Spanish speaking candidates would be a bonus however this is not neccessary.\n\nSalary: around £1000 per week this salary is dependent on the calibre of the candidate. The family would like their new nanny to start ASAP although for the right person, they are happy to wait.\n\nThis would be an ideal position for a warm and caring nanny who is comfortable working with other staff.\nRequirements\nLocation\nSaudi Arabia\nStart date\nASAP\nDuration\nPermanent\nSalary\n£1000 pw\nHours\n12/6\nLanguages\nEnglish, French, Spanish\nPermanence\nPermanent\nChildren\nFemale/3.5 years old, Female/3.5 years old,\nExperience\nEssential\nDriving licence\nNot Essential\nNon smoker\nEssential\nShared care\nYes\nSole charge\nYes\nAccommodation Details\nBasis\nLive-in\nAccommodation\nSeparate en-suite bedroom provided\nFamily residence\nHouse\nOther Details\nNursery duties only\nYes\nExpecting a baby\nNo', 962, NULL, NULL, NULL, NULL, NULL, NULL,