effectively before groups of customers or associat', 1092, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/viewjob?jk=711f966b6b413c34&from=serp&vjs=3', '2018-08-20 03:12:28', '2018-08-20 03:12:28'),
