(9853, 1537, 1962, 'Jobs in USA', 'Do you love to cook? Are you passionate about fresh and healthy meals? And do you love to make children smile? Do you want to make a difference in other\'s life? If you answered yes, then come JOIN OUR TEAM!We are looking for a Preschool Cook, who can cook nutritious meals food five days a week (no holidays, weekends and no nights required).THE POSITIONAble to prepare nutritious meals appropriate for preschool children for only approx. 60+ kids.Knowledge of ALL NATURAL approach to menu planning and cooking.Make any necessary menu changes or substitutionsPrepare and serve meals that are timely, tasteful and appetizing in appearanceAssure that kitchen and food storage areas are clean and properly arranged at all timesKnowledge of Food Handling Rules & Regulations, Food Managers LicenseHandle food in accordance with sanitary procedures and standardInventory kitchen supplies weekly, place grocery order to be delivered and stock delivery when arrives.If needed have the ability to go to the store to buy supplies as and when needed.Work cooperatively with Center Director and other staff membersAssist with children when needed (Give lunch breaks to teachers)**Preschool experience required. At least 6 months experience preferred.Job Type: Full-timeRequired education:High school or equivalentRequired experience:Cook: 1 yearRequired licenses or certifications:Kitchen Manager\'s CertificateorFood Handler\'s cardDPS Fingerprint Clearance CardNegative TB TestJob Type: Full-timeSalary: $11.00 /hourExperience:Food Handling: 1 year (Preferred)Cooking: 1 year (Preferred)Education:High school (Required)', 482, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Whiz-Kidz-Preschools/jobs/Childcare-Cook-5e06fe5e1858d2f5?vjs=3', '2018-08-20 03:12:28', '2018-08-20 03:12:28'),
(9854, 1538, 1982, 'Jobs in USA', 'Freedom Academy Homework Club is a fun-loving after school program where we supervise children while they wait for their parents to pick them up and take them home. During this time we work on homework with them, play with them, create bonds with them, and grow with them. We teach them leadership skills by having them do good deeds and help others, while also showing them to respect their parents, teachers, and other classmates.The hours for Homework Club are from 2:30pm to 6:00pm, Monday through Friday. Hours fluctuate, depending on the number of students still in the Homework Club on any given day. At least once a month we have half days for the students, giving employees a few more hours for their week starting from 11:00am and going until 6:00pm.We are a great job for college and university students who are looking to get a few hours of work in while going to school full time.Previous childcare experience would be appreciated, however, is not required. Paid employees in our Homework Club are required to get a Fingerprint Clearance Card before they begin employment.We are located at 3916 E Paradise Ln, Phoenix, AZ 85032Job Type: Part-timeExperience:childcare: 1 year (Preferred)Education:High school (Preferred)Location:Phoenix, AZ 85032 (Preferred)License:Fingerprint Clearance Card (Required)Work authorization:United States (Preferred)', 482, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Freedom-Academy-Homework-Club/jobs/After-School-Childcare-Provider-22fabc07e13fe6e9?vjs=3', '2018-08-20 03:12:28', '2018-08-20 03:12:28'),
