(9856, 1540, 1984, 'Jobs in USA', 'Join our talented team where we inspire children to be lifelong learners. We are seeking an assistant teacher who is compassionate, energetic, and knowledgeable. Work hours include 3pm-6pm. We are looking for candidates who are:Passionate about working with childrenMeticulous in ensuring the daily care of every child by following all licensing guidelines and implementing all company standards.Effective in communication with parents, children, and co-workers.Dedicated to attendance, punctual, and detail oriented to maintain an effective, clean, and organized classroom.Skills (required): Experience working in a licensed childcare facilityA high school diploma or equivalentImpeccable references and a proven track record of caring and nurturing childrenThe ability to meet state requirements for education and experienceFlexibility as to the hours and schedule of workMust be at least 18 years of ageJob Types: Part-timeJob Type: Part-timeSalary: $11.00 to $12.00 /hourExperience:childcare: 1 year (Preferred)Education:High school (Required)', 240, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Resurrection-Lutheran-Preschool/jobs/Preschool-Teacher-Assistant-71631d1adfb10e15?vjs=3', '2018-08-20 03:12:28', '2018-08-20 03:12:28'),
(9857, 1541, 1985, 'Jobs in USA', 'Assistant Childcare Director this position is responsible for the daily planning, management and supervision of 5 staff, and 30+ children.The Child Care Asst. Director is also responsible for communicating with parents as needed.The position requires excellent leadership, organizational, and communication skills, as well as the ability to provide exceptional customer service.An understanding and experience with Arizona childcare licensing requirements is a must.Experience with DHS,DES ,CACFP and Procare System Preferred.A combination of infant, toddler or preschool teaching experience.Strong leadership, supervisory and customer service skills and ability to create/maintain partnerships with families and staff.Ability to lead staff in implementing a developmentally appropriate curriculum.Strong organizational and communication skills and the ability to handle multiple tasks or crisis situations effectively.Capacity to understand and manage center financial duties.Computer literacy.Experience working in an inclusive work environment and managing across differences.Excellent organizational & communication skillsWillingness to work in a team environment.We are always looking for the best educators in the field early child hood education. If you fit any of the following categories send us your resume.Center Director / Assistant Preschool Director / Child Care Director / Assistant Director / Daycare Director / Assistant Daycare DirectorJob Type: Full-timeSalary: $26,000.00 to $32,000.00 /yearLocation:Mesa, AZ (Preferred)License:Level One Fingerprint Clearance Card (Required)valid negative TB Test (Preferred)', 279, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.com/cmp/Nana\'s-Place-childcare-and-preschool/jobs/Assistant-Childcare-Director-8c87176c27009063?vjs=3', '2018-08-20 03:12:28', '2018-08-20 03:12:28'),
(9858, 1542, 1188, 'Jobs in KSA', '2958E Nanny EMT - Saudi ArabiaChildren: g4 years oldDetails/Duties:\nOnly child related duties.\nTravelling worldwide.Requirements:\nChildcare Qualifications.\nAble to work in a team with other staff.\nEnglish Mother Tongue.Hours of Work 6 days pw, 12 hours per day.Accommodation: Own bed/bathroom in independent accommodation.Stipend Offered: £1000-1200pwk\nResponsible Consultant: cristina@nannybutler.co.uk', 954, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=df58cdb1909e46d6&from=serp&vjs=3', '2018-08-20 03:12:28', '2018-08-20 03:12:28'),
(9859, 1543, 1190, 'Jobs in KSA', 'A family in Riyadh, Saudi Arabia is seeking a highly experienced Live in Nanny to care for their lovely toddler. It is a necessity that you have experience with childcare and you have evidence of having a proactive nature.\n\nThe family are keen to have some one who wants to be involved in all aspects in family life, including some travel with the family in and out of the country. This position will be 6 days per week, full time.\n\nThe role includes both sole and shared care of the child which includes\nchanging nappies and helping with potty/toilet training,\nteaching general life skills, such as basic hygiene and manners,\ncreating activities and playdates,\npreparing and administering healthy food for the little child,\npreparing and assisting with bath time and bedtime,\ncleaning and washing up after child\'s meals,\nand reporting every activities and issues to the parents.\n\nThe Nanny will also be responsible in doing some light childcare housekeeping such as\norganising the child’s clothes,\ndoing laundry and ironing the child’s clothes,\nmaking sure the child’s room is always clean,\nand doing occasional grocery shopping of the child’s supplies.\n\nThe family would like a nanny who is a team player and can work well with other staff, flexible, active, organised, honest and discreet, as well as someone who is warm and loving. Someone who speaks a second language is ideal, preferably French.\n\nThey would like someone to start as soon as possible but they are willing to wait for the right candidate. To learn more about this role, please complete the form below and a consultant will contact you with more information.\nPosition ID: 2023565', 956, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=27c9a18cba199878&from=serp&vjs=3', '2018-08-20 03:12:28', '2018-08-20 03:12:28'),
(9860, 1544, 1986, 'Jobs in KSA', 'Fachärztin/Facharzt für Pathologie/Hämatopathologie in Medina Saudi-Arabien gesucht\nOur client is currently recruiting for a high calibre Consultant Hematopathology to join the team at their prestigious hospital facility in Saudi Arabia. The client\'s operation is split over numerous medical cities throughout the most interesting regions of the country, including Riyadh, Dammam, Al Hofuf, Jeddah, and Al Madinah Al Monawarh.\nThis is an organisation of considerable reputation that oversees the Saudi Arabian government\'s Healthcare sector. They are esteemed throughout the country for the exceptional calibre of their medical team and the superior level of care they deliver to the hospitals\' patients.Location\nThe Kingdom of Saudi Arabia covers almost 80% of the entire Arabian Peninsula. With a population of 27 million, including 8.4 million foreign residents, it is a country of considerable size Saudi Arabia\'s population is 27 million, including approximately 8.4 million foreign residents.\nSaudi Arabia\'s geography is varied, with forests, grasslands, mountain ranges and the world\'s largest continuous sand desert. The climate varies from region to region. In the desert temperatures can reach over 110 degrees Fahrenheit at the height of the summer summer, while in the winter temperatures can drop below freezing in the north and central parts of the country. Saudi Arabia gets very little rain, only about four inches a year on average.Key InformationOur client has over 70 Primary Health Care Centres and numerous tertiary facilities\nSpecialising in Pre-Hospital Trauma and Life Support\nBed capacities range from 70 to over 500\nThere is opportunity for continuing education and training within the medical complex\nKey BenefitsTax Free Salary dependent on experience\n30 Days Annual Leave per annum\nFree Uniform\nAnnual return air ticket\nFree Housing Accommodation or Housing Allowance\n24 Hour Free Transport\nAirline Tickets\nFree Medical/Dental Services\nFree Medical Insurance\nChildcare an', 1355, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://sa.indeed.com/viewjob?jk=4111b3c83550c9ec&from=serp&vjs=3', '2018-08-20 03:12:28', '2018-08-20 03:12:28'),
