(9869, 1553, 1118, 'Jobs in Qatar', 'Work Locations\n:\nHotel AlRayyan - Curio \'A Collection by Hilton\'\nMall of Qatar\n Doha 201184\nA Kids Animator is responsible for providing a caring and safe environment for children to deliver an excellent Guest and Member experience while building and maintaining good parent/guardian relationships.\nWhat will I be doing?\nEssential Function\n75% Ensuring the culture of health and safety awareness in the kids club\n10% Follow the code of ethics, rules and regulation of kids club\n05% Greet the parents and children in friendly, welcoming, calm and be helpful at all times\n05% Maintain the cleanliness of the area and sanitize all the equipment (E.g. toys, etc.)\n05% Report in case of incident or accident happen during club sessions\nOther Duties\nAssimilate to The Hilton Family PRIDE/CARE culture through understanding, supporting and participating in all elements of PRIDE/CARE. Demonstrate working knowledge of the service standards.\nRegular Attendance in conformance with the standards, which may be established by Hilton from time to time, is essential to the successful performance of this position. Employees with irregular attendance will be subject to disciplinary action, up to and including termination of employment.\nSafety requirements\nPersonal Protective Equipment (PPE) may be required when performing work duties that may have the potential or risk to your health or safety. The hotel will provide the required PPE. Team members will be trained in the proper use and care of any assigned PPE. It is your responsibility to report defective, damaged or lost PPE, or equipment that does not fit properly, to your Manager.\nSpecific job knowledge, Skill and ability\nThe individual must possess the following knowledge, skills and abilities and be able to explain and demonstrate that he or she can perform the essential functions of the job, with or without reasonable accommodation.\nFulfilling the role of a Kids Club Counselor, you will enthusiastically interact with our younger guests bet', 913, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=bf532bbe29e0aedc&from=serp&vjs=3', '2018-08-20 03:12:31', '2018-08-20 03:12:31'),
(9870, 1554, 1990, 'Jobs in Qatar', 'Good day, we are Youffy Health and Nursing Care Center and we are looking for babysitters for our patients.\n\nThis is for infants, toddlers to, grown children.\nThe candidates must have the following qualifications:\n1. Must be a High School Graduate.\n\n2. Must be friendly, accommodating, and must like children.\n\n3. Must have previous experience taking care of children\n\n4. Knows the basics of childcare\n\n5. Must be female', 1359, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Na', '2018-08-20 03:12:31', '2018-08-20 03:12:31'),
(9871, 1555, 1991, 'Jobs in Qatar', 'Job Summery: Nursery Manager of Kids Nursery is responsible for planning and delivering effective daily management of the nursery, in accordance with Company policy, all relevant legislation, plus local authority. Also, to ensure the provision is of the highest quality, providing a safe, stimulating and caring child-centred environment catering for the children’s educational and developmental needs. Ensuring that all agreed quality and safety standards are maintained in the nursery at all times. Being responsible for the recruitment and overall staff of all childcare and liaise closely with parents/carers to ensure high levels of involvement and customer satisfaction at all times.Roles and responsibilities: 1) Leads and manages a team, motivating them with a shared sense of direction.2) Responsible for the recruitment and overall management of all childcare and other staff. Liaises with the Admin and HR related issues with the management.3) Monitors all nursery staff and student placements, to ensure the effectiveness of service delivery in line with the nursery’s policies, procedures and core values.4) Identifies staff training and developmental needs, planning with the management to ensure these needs are met.5) Develops and manages the operational framework and standards to ensure the smooth running of the nursery at all times. Ensures the required standards and conditions of registration are maintained at all times.6) Ensures that the nursery’s procedures on child protection are adhered to liaising with the management and local ministry as required.7) Ensures the highest standard of safety and security within the nursery, in particular that security systems are always fully operational and used properly by all staff. Establishes all appropriate emergency procedures.8) Responsible for all health and safety issues within the nursery, ensuring compliance with the ministry’s Health and Safety Policy and procedures at all times.9) Operates the highest level of cleanl', 1360, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.indeed.ae/viewjob?jk=c7d2a0aefcb6652c&from=serp&vjs=3', '2018-08-20 03:12:31', '2018-08-20 03:12:31'),
