(9898, 1582, 2013, 'Jobs in UAE', 'A financial technology company is seeking a skilled fullstack web developer with experience in frontend software development.\n\nResponsibilities\nWrite secure, clean code for web applicationsSupports and troubleshoots existing applicationsEvaluates and analyzes business requirements for new systems and system changesMaintenance and enhancement of existing software\nQualifications\nExperience with PHP (greater than 5.2)Experience with HTML/CSSExperience with JavaScript emca 6Experience with NodeJSUnderstanding of MVC design patternsProficient understanding of code versioning tools, such as GitFamiliarity with web frameworksFamiliarity with relational databases and Structured Query Language (SQL)', 1374, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-08-20 19:09:16', '2018-08-20 19:09:16'),
(9899, 1583, 2015, 'Jobs in UAE', 'TenTwenty is looking for a reliable, passionate and talented back-end developer to join our enthusiastic team. The position is full-time and you will be located at our Dubai office in the UAE. Do you like sunny days, spending your winter weekends at the beach, getting loads of experience and putting your coding skills to practice? Make sure to apply to this vacancy!\nYou can offer us & we can offer you\nExcellent LAMP / PHP / MySQL / jQuery development knowledge.\nA sound understanding of front end web technologies as well.\nEager to learn, discuss and share knowledge with our development team\nExperience in building sites using Open Sources / PHP frameworks.\nBeing a Magento Specialist\nImplementing PHP elements into HTML templates\nKnowledge of the Concrete5 CMS and Laravel\nSmart working developer with an eye for detail and following the coding standards.\nAbility to speak English fluently\nWilling to have an awesome life in Dubai!\nWorking in a dynamic working environment\nEnthousiastic teammembers\nInternal training and education when required\nLots of room for your own creativity and input\nA fine salary\nFinancial growth opportunities within the organisation\nA great international working experience', 1376, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-08-20 19:09:16', '2018-08-20 19:09:16'),
(9900, 1584, 2016, 'Jobs in UAE', 'We are looking for a front end developer1 Ability to work with latest UI framework such as Boostrap to create compelling user experiences2 Knowledge of latest front end development technologies3 Able to convert a visual design to a user experience4 Able to create front end interfaces in variety of frameworks HTML5 PHP Knowledge of full stack development platforms is a big plus6 Able to work with applications developers and to perform technical tasks to move the project forward faster7 Self starter motivated continuously improving hisher skill set8 Full Stack developers will be given preference. Webology is a software house with a mission focused on building online products and integrated solutions.We are working on launching new products and services and are looking for fresh talent to join.We offer an excellent learning environment with potential for rapid growth', 1377, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-08-20 19:09:16', '2018-08-20 19:09:16'),
(9901, 1585, 2017, 'Jobs in UAE', 'If you are a graduate with a degree in Computer Science or Information Technology, and are looking for a challenging position in software development, then you might be interested in working with us!\n\nYou will be a key member of the IT department working on maintenance and enhancement of current projects as well as heading new projects right from project initiation, requirements gathering to final deployment and training.\n\nKey Responsibilities:\nThe Application and Web and Developer and Designer (Front & Back End) will be responsible for developing, designing, layout and\ncoding mobile and website.\nDesign and build advanced applications on all platforms\nWrite code, either from scratch or by adapting existing website software and graphics packages to meet business requirements.\nBe involved in all technical and graphical aspects of building an application and website – how the system works and how it looks.\nWork on bug fixing and improving application performance\nAble to work on his own and in a team.\nRequirements to Apply:\nSoftware Development Skills\nAbility to use and/or learn multiple development languages such as HTML, CSS, JavaScript, JQuery, PHP, Java and Objective-C\nUnderstanding of RESTful APIs\nAbility to use and/or learn Angular 4 (JavaScript Framework) and Laravel 5 (PHP Framework)\nMySQL database management skills\nCapable of designing and developing robust and well-built software architectures\nDocumenting requirements and software design through models and diagrams (eg. UML)\nHands on experience in writing well-designed, testable and efficient code\nKnowledge of SDLC methodologies such as Waterfall and Agile methods\nStrong business analysis, requirements gathering and communication skills/li>\nKnowledge of revision control technologies such as Git\nBeneficial Skills:\nFull Stack Web Development\nUse of Angular 4 and Laravel\nAndroid Mobile application development\nWordPress development\nEducation qualification:\n\nBachelor’s degree in Computer Science, Software Developme', 1378, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-08-20 19:09:16', '2018-08-20 19:09:16'),
(9902, 1586, 2019, 'Jobs in UAE', 'Senior Software Engineer Vacancy in Dubai\n\nWe require a senior software engineer to develop information systems by studying operations; designing, developing and installing software solutions; support and develop software team. The Senior Software Engineer will lead a team of developers responsible for developing mobility and IT solutions.\n\nResponsibility\n\nDevelop software solutions by studying information needs; conferring with users; studying systems flow, data usage, and work processes; investigating problem areas; following the software development life cycle.\n\nDetermine operational feasibility by evaluating analysis, problem definition, requirements, solution development and proposed solutions.\n\nDocument and demonstrate solutions by developing documentation, flowcharts, layouts, diagrams, charts, code comments and clear code.\n\nPrepare and install solutions by determining and designing system specifications, standards, and programming.\n\nImprove operations by conducting systems analysis; recommending changes in policies and procedures.\n\nQualifications\n\nDegree or Honours (5 + or equivalent)\n\nBachelors or Master degree in IT Software Engineering, Mobile Application Development, Mobile Computing, Computer Science or a similar programming-centric field of study.\n\nMinimum 5 years of experience as a senior software engineer or Team Leader.\n\nSkills\n\nEducation in various programming languages, data modeling, database design, developing tools is vital.\n\nIT experience (software development )Should have worked as a Team member at least 3 years on a project size of over 5 man years.\n\nMust have experience in developing Apps, cloud solutions, mobile solutions and digital transformation.\n\nHave excellent skills in the following Programming.\nLanguages:\nO HTML5 and Java\n\nO Objective-C\n\nO Swift\n\nO c ++\n\nO Ruby and Rails\n\nO PHP\n\nO ASP.Net\nHave excellent skills in the following Database Software:\nO Oracle SQL\n\nO Microsoft SQL\n\nO MySQL\n\nWe are offering an attractive salary with benefi', 1380, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-08-20 19:09:16', '2018-08-20 19:09:16'),
(9903, 1587, 322, 'Jobs in UAE', 'Job Description\n\nRequired a strong middleweight developer who wants to extend his/her skill set, or a senior developer in a small team who has loads of great ideas that you want to unleash, this is a hands-on role requiring a true all rounder. Proven experience in E-commerce platforms is mandatory requirement for this position.\n\nSkills\nMagento skinning and module development (Expert)\nObject Oriented programming/MVC fundamentals\nPHP (Expert)\nMySQL (Expert)\nCSS, Style sheets\nJavaScript\nJQuery, AJAX\nXML and Apache knowledge\nExperience using development frameworks such as Zend, etc.,\nPayment Gateway Integration\nHTML\nWord Press\nAbout Company\nGrafdom is one of the leading digital media agencies in the Middle East with expertise in Web Design, Social Media & Mobile Apps.', 441, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-08-20 19:09:17', '2018-08-20 19:09:17'),
