(9922, 1606, 2034, 'Jobs in UAE', 'Community Managers (Female ONLY)\nRecruitment and Placement in the handling of all 19 category of domestic and household workers including some of the following Maid-Nanny-Housekeepers-Childminder-Babysitter-Cook-Driver-Governess etc\nWe need high achievers, who are goal-orientated.\nIf you have studied hospitality, or have been involved in sports, real estate or worked in hotels in housekeeping management, trained or mentored domestic and household workers previously, or run your own business and consider yourself a multi-tasker, then we would be interested to hear from you.\nTadbeer Service Centers are the official handling of all domestic and household workers, and will handle all (1) visa entry permits and government related typing, (2) recruitment ( 3) Full time living in (4) on-demand cleaning services,..\nAll domestic workers will be offered Ministry of Human Resources and Emiratization ( MoHRE) labour contracts, and Tadbeer will be the only and official place to recruit, place and handle all 19 category of domestic and household workers.\nTadbeer Housekeeping Co is responsible government-government for the welfare of all domestic workers, offering high levels of accountability to both the employment parties. Tadbeer Centers will also offer conflict resolution, as well as on-going training and up-skilling programs.\nWe are looking for passionate career focused ladies to join our team as Community Managers, specializing in the recruitment of families who wish to engage a domestic worker under Tadbeer Center ( Full time Live In Package) and placing in one of our Candidates suitable for the family requirements.\nTadbeer Service Centers are regulated by the MoHRE, and Federal Law. This is a sweeping change to the way all families and housemaids can engage with each other contractually. Ultimately the way forward will be that families will only be able to engage a domestic workers via Tadbeer Service Centers, which creates huge demand on Tadbeer.\nTadbeer Service Centers o', 1396, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-08-22 04:16:22', '2018-08-22 04:16:22'),
(9923, 1607, 2036, 'Jobs in UAE', 'Female House Maid Vacancy in Dubai\n\nWe are an Indian family looking for a Female Housemaid (Indian or Nepali) who can help us with the housework and veg.\n\nCooking.\n\nShould be able to speak and understand good Hindi and little bit English.\n\nThe candidate should be mild, gentle and soft spoken.\n\nExperience in taking care of small kids would be an added advantage.\nSalary: AED 3,000\n\nInterested candidates can send their CV', 1398, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-08-22 04:16:22', '2018-08-22 04:16:22'),
