(10015, 1694, 2096, 'maidcv.com', '\r\n                            Hello, \r\n\r\nWe are French family of 4 (with approx. 2y/o baby girl and approx. 5 y/o little Boy) \r\nWe are looking for a reliable and skilled nanny/housemaid to take care of our kids during our absence and manage their after-school activities. \r\nWhen the kids are in school we would appreciate her support to handle basics house chores, cooking, ironing as necessary. \r\nRequirements: \r\n- Good-natured, Responsible, Reliable and Skilled.\r\n- Experience with Toddlers is a must (Minimum 5 years’ experience with toddlers)\r\n- Fluent in English \r\n- Capable to handle basic house chores, cooking, ironing, etc. \r\n- Previous references are a must\r\n- Driving license would be a Plus.\r\nConditions: \r\nGood salary provided (according to experience), medical insurance, maid room, 1 day off, annual leave,  flight tickets and visa. \r\n\r\nThank you very much, \r\n\r\nLook forward to hearing from you!\r\n                        ', 650, NULL, NULL, NULL, NULL, '2.700', 6, '2.5000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-08-27 14:35:44', '2018-08-27 14:35:44'),
