(10025, 1704, 2103, 'Jobs in UAE', 'A family is looking for a Full Time Live in Nanny Housekeeper in Dubai to help with their household and assist them in looking after their two school aged children. The hours for this position would be 6 days per week, very flexible hours but full time.\n\nThe Nanny Housekeeper will be responsible with all Nanny duties such as\nschool drop offs and pick ups,\nhelping arrange playdates,\ntaking the children to playgrounds and extra curricular activities,\nkeeping the children active,\nengaging and stimulating the children,\nhelping with bath and bedtime routines.\n\nThis position also involves general housekeeping which includes\ndusting,\ncleaning toilet and bathrooms,\ncleaning kitchen,\nhoovering the floor and carpet,\nchanging bedsheets,\nmopping,\nand making sure towels and linens are always clean.\n\nThe Nanny Housekeeper must be confident with both aspects of the position. The family would like the Nanny Housekeeper to start as soon as possible. Great accommodation will be provided, own private room.\n\nSomeone who speaks Italian would be a big bonus for this role. They are looking for someone who can travel with them over the summer in Europe before going back to Dubai. To learn more about this role, please complete the form below and a consultant will contact you with more information.\nPosition ID: 2023693', 1457, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-08-28 17:45:23', '2018-08-28 17:45:23'),
