(10253, 1916, 2273, 'maidcv.com', '\r\n                            We are a looking for a live-out Filipina Housemaid/Nanny to join our family of 4 (with approx. 2.5y/o baby boy and approx. 5.5 y/o little Boy). We live in an apartment in down town Dubai. We require someone with good cleaning skills and a lot of experience with working with children. We are looking for a happy, energetic, positive, skilled and reliable person with a good sense of humor. Duties will include all household chores and helping to look after children. Experience with Toddlers is a must (Minimum 5 years’ experience with toddlers). You should be fluent in English. You must have references from previous employers that we can contact. \r\n\r\nGood salary provided (according to experience),1 day off, annual leave, flight tickets and visa. If you meet the above criteria and are interested please send me a Whatsapp with your details and CV on 0505082424 (no phone calls please). Thank you very much, Look forward to hearing from you!\r\n                        ', 1568, NULL, NULL, NULL, NULL, '3.300', 6, '3.1000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://maidcv.com/ViewJobs', '2018-09-09 14:46:36', '2018-09-09 14:46:36'),
